Mampu menempatkan persatuan,\r\nkesatuan, serta kepentingan dan keselamatan bangsa dan negara sebgai kepentingan\r\nbersama di atas kepentingan pribadi dan golongan. Dan ke-6 yang berbunyi (6)\r\nmengembangkan persatuan Indonesia atas dasar Bhinneka Tunggal Ika. Kedua\r\npemuda yang bertikai tidak melihat bahwa apa yang mereka lakukan dapat berimplikasi\r\npada keselamatan dan keutuhan bangsa dan masyarakat yang berbeda golongan.\r\nBerawal dari pertikaian individu, bisa berdampak menjadi pertikaian antar golongan\r\n(Muslim dan Kristen).', NULL, '2024-05-18 16:04:15', '2024-05-18 16:04:15'),
(1030, 'POLTWK002', 2, 'Banyak perusahaan asing yang menanamkan modal di Indonesia. Perusahaan-perusahaan tersebut\r\nmengelola sumber daya alam dan sumber daya ekonomi Indonesia pada berbagai bidang yang\r\nmeliputi pertambangan dan migas, perkebunan, industri jasa serta sektor real. Namun yang\r\nmenjadi perhatian banyak kalangan adalah perusahaan eksploratif yang mengelola sumber daya\r\nalam seperti pertambangan, perminyakan, dan perkebunan. Pada kegiatan eksploitasi yang\r\ndilakukan oleh perusahaan tersebut memberikan dampak yang besar bagi kerusakan alam. Salah\r\n\r\nsatu bentuk kerusakan lingkungan yang sering terjadi adalah kebakaran hutan dan lahan.\r\nBerdasarkan data dari Kementerian Kehutanan dan Lingkungan Hidup, sejak tahun 2015 hingga\r\nawal 2019 terdapat 171 kasus pelanggaran yang dijatuhi sanksi administrasi,11 gugatan perdata\r\nserta 150 kasus pidana. Dari jumlah kasus tersebut hanya dari 8 kasus perdata saja yang digugat\r\ndiperkirakan nilai gugatan ganti rugi mencapai Rp 2,7 triliun. Angka tersebut menunjukkan begitu\r\nburuknya praktek korporasi yang menyebabkan kerusakan lingkungan hidup. Lingkungan hidup\r\nyang seharusnya dijaga dan dilestarikan untuk kelangsungan hidup generasi mendatang, namun\r\nhak mereka untuk hidup dengan daya dukung lingkungan dirampas. Pada kasus tersebut prakterk\r\nkegiatan usaha korporasi bertentangan dengan nilai Pancasila sila ke...', NULL, 5, 'Butiran pengamalan pancasila, sila ke Lima, poin ke-8 bahwa : Tidak menggunakan\r\nhak milik untuk bertentangan dengan atau merugikan kepentingan umum.', NULL, '2024-05-18 16:05:55', '2024-05-18 16:05:55'),
(1031, 'POLTWK002', 3, 'Perumusan Pancasila memiliki dinamika yang panjang, termasuk sebelum Piagam\r\nJakarta disahkan menjadi dasar negara Pancasila terdapat sila yang diubah, yakni sila\r\nKetuhanan dengan menjalankan syariat islam bagi para pemeluknya diubah menjadi\r\nKetuhanan yang maha esa. Ini membuktikan pada saat perumusan Pancasila para\r\nFounding Fathers sudah menjunjung tinggi nilai dari Pancasila, yakni sila ke...', NULL, 1, 'Dihapusnya menjalankan syariat islam bagi para pemeluknya membuktikan adanya\r\nsikap toleransi beragama yang dilakukan oleh para Founding Fathers, ini termasuk\r\npengamalan Pancasila yakni sila pertama', NULL, '2024-05-18 16:07:44', '2024-05-18 16:07:44'),
(1032, 'POLTWK002', 4, 'Peraturan perundang-undangan yang berlaku di Indonsia sesuai sila-sila Pancasila. Pernyataan tersebut menunjukkan bahwa....', NULL, 3, 'Pancasila merupakan hukum tertinggi yang berlaku di Indonesia. Peraturan yang di bawahnya tidak boleh bertentangan dengan peraturan di atasnya sehingga kedudukan pancasila menjadi dasar tertib hukum nasional dalam pemberlakuan peraturan perundang-undangan di Indonesia', NULL, '2024-05-18 16:22:02', '2024-05-18 16:22:02'),
(1033, 'POLTWK002', 5, 'Sila persatuan indonesia dilambangkan dengan&', NULL, 3, 'Sesuai dengan lambang garuda pancasila pohon beringin melambangkan sila persatuan Indonesia.<br>Sedangkan <br>Bintang melambangkan sila ke-1<br>Rantai Emas melambangkan sila ke-2<br>Kepala Banteng melambangkan sila k-4<br> Padi dan Kapas melambangkan sila-5', NULL, '2024-05-18 16:28:16', '2024-05-18 16:28:16'),
(1034, 'POLTWK002', 6, 'Proses amandemen UUD 1945 yang dilakukan MPR memiliki beberapa alasan \r\ndiantaranya...', NULL, 5, 'Alasan MPR melakukan amandemen UUD 1945 yaitu: <br>\r\n\" Pemanfaatan sumber dana yang kurang jelas dan tidak transparan<br>\r\n\" Kritik saran dari masyarakat dapat untuk perbaikan<br> \r\n\" Dualisme peradilan kurang menjamin kepastian hukum <br>\r\n\" Kekuasaan BPKP tidak jelas karena sangat tergantung kepada Presiden<br> \r\n\" Kekuasaan Presiden terlalu dominan, semakin mutlak dan bersifat personal<br>', NULL, '2024-05-18 16:33:53', '2024-05-18 16:33:53'),
(1035, 'POLTWK002', 7, 'Esensi pilar kebangsaan dalam memahami keberagaman sesuai amanat UUD 1945 Pasal \r\n18B ayat 2 adalah...', NULL, 2, 'Bunyi dari UUD 1945 Pasal 18B Ayat 2 yaitu negara mengakui dan menghormati \r\nkesatuan-kesatuan masyarakat hukum adat beserta hak-hak tradisionalnya sepanjang \r\nmasih hidup dan sesuai dengan perkembangan masyarakat dan prinsip NKRI, yang diatur \r\ndalam undang-undang.', NULL, '2024-05-18 16:36:01', '2024-05-18 16:36:01'),
(1036, 'POLTWK002', 8, 'Makna alinea keempat pembukaan UUD 1945 adalah...', NULL, 1, 'Alinea ke 4 dalam UUD 1945 bermakna tentang cita-cita negara.', NULL, '2024-05-18 16:37:38', '2024-05-18 16:37:38'),
(1037, 'POLTWK002', 9, 'Salah satu hak asasi yang dilindungi adalah hak setiap orang untuk mendapatkan status \r\nkewarganegaraan. Hal ini diatur dalam Undang-Undang Dasar 1945 Pasal....', NULL, 2, 'Pasal 28D ayat 4 berbunyi tentang setiap orang berhak atas status kewarganegaraan.', NULL, '2024-05-18 16:40:50', '2024-05-18 16:40:50'),
(1038, 'POLTWK002', 10, 'membiayainya ini menjadi landasan hukum bahwa pembiayaan pendidikan itu adalah \r\ntanggung jawab negara. Pembiayaan pendidikan dasar untuk setiap warga negara diatur \r\ndalam UUD 1945 Pasal...', NULL, 5, 'Pasal 31 Ayat 2 berbunyi setiap warga negara wajib mengikuti pendidikan dasar dan pemerintah wajib membiayainya.', NULL, '2024-05-18 16:42:53', '2024-05-18 16:42:53'),
(1039, 'POLTWK002', 11, 'Lambang bhinneka tunggal ika untuk pertama kali dipakai secara resmi pada tanggal ...', NULL, 1, '. Jawaban A \r\nSecara resmi, bhinneka tunggal ika dipakai dalam Sidang Kabinet Indonesia Serikat pada \r\ntanggal 11 Februari 1950.', NULL, '2024-05-18 17:20:28', '2024-05-18 17:20:28'),
(1040, 'POLTWK002', 12, 'Lembaga yang secara resmi menetapkan Pancasila sebagai dasar negara adalah ...', NULL, 2, 'PPKI atau Panitia Persiapan Kemerdekaan Indonesia pada sidang yang pertama tanggal \r\n\r\n\r\n \r\n\r\n18 \r\n\r\n \r\n\r\n18 Agustus 1945 tepat 1 hari setelah Indonesia merdeka mengesahkan Pancasila sebagai \r\ndasar negara.', NULL, '2024-05-18 17:22:05', '2024-05-18 17:22:05'),
(1041, 'POLTWK002', 13, 'Secara konstitusional negara Indonesia dalam UUD 1945 Pasal 1 ayat 3 menyatakan \r\ntentang ...', NULL, 3, 'Negara Indonesia adalah negara hukum sesuai dengan UUD 1945 Pasal 1 ayat 3.', NULL, '2024-05-18 17:24:03', '2024-05-18 17:24:03'),
(1042, 'POLTWK002', 14, 'Undang-undang yang mengatur tentang pengelolaan sumber daya nasional untuk \r\npertahanan negara diatur dalam ...', NULL, 5, 'UU No. 23 Tahun 2019 tentang Pengelolaan Sumber Daya Nasional untuk Pertahanan \r\nNegara mencabut UU No. 27 Tahun 1997 tentang Mobilisasi dan Demobilisasi serta UU \r\nNo. 56 Tahun 1999 tentang rakyat terlatih. Undang-undang disahkan Presiden Joko \r\nWidodo pada tanggal 24 Oktober 2019 di Jakarta.', NULL, '2024-05-18 17:34:50', '2024-05-18 17:34:50'),
(1043, 'POLTWK002', 15, 'Dalam arti sempit konstitusi adalah hukum dasar yang memuat aturan pokok atau aturan-\r\naturan dasar negara. Dalam arti luas konstitusi adalah keseluruhan sistem aturan yang \r\nmenetapkan dan mengatur kehidupan kenegaraan melalui sistem pemerintahan negara dan \r\ntata hubungan secara timbal balik antar lembaga negara dan antara negara dengan warga \r\nnegara. Berdasarkan UU No. 12 Tahun 2011 yang menjadi urutan tertinggi perundangan \r\nRepublik Indonesia adalah...', NULL, 2, 'Dalam hierarki peraturan perundang undangan UU No.12 Tahun 2011 bahwa UUD 1945 \r\nmerupakan urutan tertinggi dari perundangan di Indonesia.', NULL, '2024-05-18 17:38:20', '2024-05-18 17:38:20'),
(1045, 'POLTBG001', 2, '<p align=\"justify\">\nREADING (1-20)<br>\nThe questions number 13 are based on the following passage.\n<br><br>\nIn the US, consumers spend around $700 million a year keeping their fabrics soft. In the UK people spend\n', NULL, 1, '<p align=\"justify\">\r\nJawaban: A\r\nSoal  tersebut  menanyakan  kata  yang  maknanya  sama  dengan  kata permeating. Kata permeating memiliki  arti  \'meresap\'  sehingga  kata  dengan  makna  yang  serupa adalah filling (mengisi).\r\n</p>', NULL, '2024-05-18 20:18:20', '2024-05-23 15:42:36'),
(1046, 'POLTBG001', 3, '<p align=\"justify\">\nREADING (1- 20)<br>\nThe questions number 13 are based on the following passage.\n<br><br>\nIn the US, consumers spend around $700 million a year keeping their fabrics soft. In the UK people spend\n', NULL, 5, '<p align=\"justify\">\r\nJawaban: E\r\nSoal tersebut menanyakan hipotesis atau kesimpulan sementara yang bisa dibuat berdasarkan teks tersebut. Kesimpulan tersebut masih perlu dibuktikan kebenarannya melalui penelitian. Pada paragraf 3 dijelaskan bahwa bahan kimia parfum dari pelembut kain dapat menjadi pemicu asma dan masalah pernafasan lainnya. Dari pernyataan ini dapat dibuat hipotesis (kesimpulan sementara), yaitu jika pelembut kain mengandung lebih sedikit bahan kimia parfum, maka akan memperkecil kemungkinan timbulnya masalah pernafasan sehingga membuat mereka yang memiliki masalah pernafasan akan merasa lebih aman menggunakannya\r\n</p>', NULL, '2024-05-18 20:33:18', '2024-05-23 15:43:19'),
(1047, 'POLTWK002', 16, 'Mekanisme pembagian kekuasaan Republik Indonesia menurut UUD 1945 memungkinkan adanya kerja sama antar lembaga pemerintahan. Contoh kerja sama antara lembaga eksekutif dan yudikatif adalah...', NULL, 2, 'Pemberian grasi dan rehabilitasi kepada merupakan hak presiden dengan memperhatikan pertimbangan mahkamah agung. dan presiden merupakan lembaga eksekutif dan mahkamah agung merupakan lembaga yudikatif. sehingga hal tersebut merupakan kerja sama antar lembaga eksekutif dan yudikatif', NULL, '2024-05-18 20:59:27', '2024-05-18 20:59:27'),
(1048, 'POLTWK002', 17, 'Zaman sekarang sudah sering terjadi pembajakan di bidang seni seperti film dan\r\nmusik. Tindakan ini tidak sesuai dengan pengamalan Pancasila...', NULL, 4, 'sila ke-5 butir 1\r\nmelakukan pembajakan atas suatu karya seni tidak sesuai dengan pengamalan\r\nPancasila sila ke-5 butir 10 yg berbunyi: suka menghargai hasil karya orang lain yg\r\nbermanfaat bagi kemajuan dan kesejahteraan bersama', NULL, '2024-05-18 21:08:17', '2024-05-18 21:08:17'),
(1049, 'POLTWK002', 18, 'Pemerintah Negara republik Indonesia yang saat ini dipimpin oleh Joko widodo harus\r\nmenciptakan iklim penyelenggaraan Negara yang lebih sehat dan dinamis, dalam\r\nbentuk pemerintahan yang aspiratif, kuat serta terpercaya yang dibangun sebagai\r\npenjelmaan kedaulatan rakyat.Wacana diatas merupakan implementasi dari\r\nperwujudan wawasan nusantara bidang....', NULL, 2, 'Perwujudan Kepulauan Nusantara sebagai Satu Kesatuan Politik\r\nBangsa Indonesia bersama bangsa-bangsa lain ikut menciptakan ketertiban dunia dan\r\nperdamaian abadi melalui politik luar negeri yang bebas aktif. Implementasi wawasan\r\nnusantara dalam kehidupan politik akan menciptakan iklim penyelenggaraan negara\r\nyang sehat dan dinamis. Hal tersebut tampak dalam wujud pemerintahan yang kuat\r\naspiratif dan terpercaya yang dibangun sebagai penjelmaan kedaulatan rakyat.', NULL, '2024-05-18 21:09:50', '2024-05-18 21:09:50'),
(1050, 'POLTPU002', 1, '<p align=\"justify\">\r\nDemonstrasi yang dilakukan oleh Kepala Desa pada Januari 2023 membawakan beberapa tuntutan, salah satunya adalah perpanjangan masa jabatan Kepala Desa, sebelum akhirnya UU Desa direvisi oleh DPR, masa jabatan seorang Kepala Desa adalah &\r\n</p>', NULL, 1, '<p align=\"justify\">\r\nSebelumnya, masa jabatan Kepala Desa adalah 6 tahun, paling banyak 3 kali periode, setelah berlakunya UU No. 23 Tahun 2024, masa jabatan Kepala Desa berubah \r\nmenjadi 8 tahun maksimal 2 periode \r\n</p>', NULL, '2024-05-18 21:16:21', '2024-05-23 16:39:19'),
(1051, 'POLTPU002', 2, 'Berikut ini benda langit yang memancarkan cahayanya sendiri adalah....', NULL, 3, 'Matahari merupakan benda langi yang dapat memancarkan cahanya sendiri', NULL, '2024-05-18 21:19:23', '2024-05-18 21:19:23'),
(1052, 'POLTPU002', 3, 'Suatu ritme yang berjalan secara siklikal selama 24 jam yang juga berperan dalam \r\nmengatur fungsi dan proses penting yang terjadi dalam tubuh adalah &', NULL, 2, '<p align=\"justify\">\r\nRitme Sirkadian adalah proses internal tubuh yang mengatur siklus tidur-bangun yang diulang dalam kurun waktu 24 setiap harinya</p>', NULL, '2024-05-18 21:25:12', '2024-05-23 16:41:18'),
(1053, 'POLTBG001', 4, '<p align=\"justify\">\r\nREADING (1- 20)<br>\r\nThe questions number 13 are based on the following passage.\r\n<br><br>\r\nIn the US, consumers spend around $700 million a year keeping their fabrics soft. In the UK people spend\r\n', NULL, 2, '<p align=\"justify\">\r\nJawaban: B\r\nSoal tersebut menanyakan pernyataan yang sesuai dengan teks.\r\nPada paragraf pertama kalimat ketiga disebutkan bahwa dalam memberi makan astronot selama eksplorasi ruang angkasa jangka panjang, NASA memaksimalkan sumber daya untuk menumbuhkan tanaman di luar angkasatermasuk meminimalkan penggunaan air dan konsumsi energi serta menghilangkan tanah. Jadi, NASA telah memaksimalkan metode bercocok tanam yang membutuhkan sedikit air.\r\n</p>', NULL, '2024-05-18 21:52:29', '2024-05-23 15:40:54'),
(1054, 'POLTPU002', 4, 'Tarian adat yang berasal dari Bali yang menjadi simbol keseimbangan antara kebaikan dan kejahatan dikenal dengan tarian &', '1716097561.jpg', 1, 'Tari Barong merupakan peninggalan kebudayaan pra-Hindu yang melambangkan \r\npertempuran antara kebaikan (dharma) dan keburukan (adharma). Menurut keyakinan \r\nmasyarakat Bali, khususnya yang beragama Hindu, kebaikan dan keburukan selalu \r\nberdampingan atau disebut juga sebagai Rwa Bhineda. Kata Barong berasal dari kata \r\nbahruang yang berarti beruang.', NULL, '2024-05-18 22:22:53', '2024-05-18 23:02:50'),
(1055, 'POLTPU002', 5, 'Pakaian tradisional dari suku Bugis dikenal dengan nama &', '1716097165.jpg', 2, 'Baju Nggembe: Suku Kaili, Sulawesi Tengah\r\nBaju Bodo: suku Bugis, Sulawesi Selatan\r\nKebaya: Jawa \r\nPakaian Songket, Minang, Sumatera Barat \r\nBaju Kurung, Jambi', NULL, '2024-05-18 22:39:25', '2024-05-18 23:04:19'),
(1056, 'POLTPU002', 6, 'Rumah Adat Tongkonan sebagai Rumah Adat yang berasal dari...', '1716098502.jpg', 3, 'Rumah Adat Tongkonan sebagai Rumah Adat yang berasal dari Toraja, Sulawesi Selatan dengan filosofi Aluk Todolo. Rumah Tongkonan juga menjadi simbol martabat keluarga dari masyarakat Toraja sehingga pembangunannya tidak sembarangan.', NULL, '2024-05-18 23:01:42', '2024-05-18 23:01:42'),
(1058, 'POLTPU002', 7, 'Ketua PSSI yang terpilih setelah Kongres Luar Biasa PSSI pada 16 Februari 2023 adalah &', NULL, 2, 'Erick Thohir secara resmi terpilih sebagai Ketua Umum PSSI untuk periode 2023-2027. Kepastian itu diketahui setelah Kongres Luar Biasa Persatuan Sepak Bola Seluruh Indonesia (KLB PSSI) rampung diselenggarakan pada Kamis 16 Februari 2023 (16/2/2023).', NULL, '2024-05-18 23:08:16', '2024-05-18 23:08:16'),
(1060, 'POLTPU002', 8, 'Salah seorang pelaku dalam pembunuhan berencana Brigadir J, pelaku Richard  Eliezer Pudihang Lumiu alias Bharada E divonis 1 tahun 6 bulan penjara karena  bersedia menjadi Justice Collaborator. Yang dimaksud dengan Justice Collaborator  adalah &', NULL, 2, 'Justice collaborator adalah sebutan bagi saksi pelaku yang bekerja sama dengan aparat penegak hukum dalam mengungkap suatu tindak pidana tertentu. Secara sederhana, arti justice collaborator adalah pelaku kejahatan yang memberikan keterangan dan bantuan kepada para penegak hukum.', NULL, '2024-05-18 23:16:42', '2024-05-18 23:16:42'),
(1062, 'POLTPU002', 9, 'Dokumen yang memberikan suatu kepemilikian seorang penemu kepada barang temuannya disebut dengan &', NULL, 4, 'Hak Cipta: Hak pencipta terhadap karya ciptanya, setelah diwujudkan dalam bentuk nyata. \r\nHak cipta berlaku selama pemilik masih hidup, dan berlangsung sampai dengan 70 tahun \r\nHak Paten: hak penemu atas hasil temuannya dalam bidang teknologi. Jangka waktu selama 20 \r\ntahun, dan tidak dapat diperpanjang. Setelahnya, pihak lain dapat memproduksi dan \r\nmenjualnya secara bebas', NULL, '2024-05-18 23:30:56', '2024-05-18 23:33:16'),
(1063, 'POLTPU002', 10, 'Di bawah ini yang merupakan satwa endemic yang berasal dari Papua adalah &', '1716100688.jpg', 2, 'Burung cenderawasih adalah sekelompok burung yang termasuk dalam famili Paradiseidae, Ordo Passeriformes. Spesies burung ini ditemukan di pulau Papua', NULL, '2024-05-18 23:37:24', '2024-05-18 23:38:08'),
(1064, 'POLTWK002', 19, '\"Kami bangsa Indonesia dengan ini menyatakan kemerdekaan Indonesia\". Makna penggalan pernyataan Proklamasi Kemerdekaan Indonesia tersebut bagi bangsa Indonesia adalah ....', NULL, 2, '\"Kami bangsa Indonesia dengan ini menyatakan kemerdekaan Indonesia\". Makna penggalan pernyataan Proklamasi Kemerdekaan Indonesia tersebut bagi bangsa Indonesia adalah saatnya membangun kehidupan baru yang merdeka, bersatu, dan berdaulat.', NULL, '2024-05-19 06:22:12', '2024-05-19 06:22:12'),
(1065, 'POLTWK002', 20, 'Dalam hal menjalankan tugasnya, Dewan Perwakilan Rakyat (DPR) mempunyai hak untuk mengajukan usulan serta pertanyaan mengenai suatu masalah. Hak ini disebut?\r\nA. hak inisiatif\r\nB. hak amandemen\r\nC. hak budget\r\nD. hak interpelasi\r\nE. hak petisi', NULL, 5, 'Hak inisiatif = mengusulkan rancangan undang-undang<br>\r\nHak amandemen = mengajukan perubahan rancangan undang- undang<br>\r\nHak budget = anggaran / RAPBN mengasahkan<br>\r\nHak interpelasi keterangan = meminta<br>\r\nHak petisi mengajukan usulan serta pertanyaan mengenai suatu masalah<br>\r\nHak ratifikasi mengesahkan peraturan dengan negara lain<br>', NULL, '2024-05-19 06:26:25', '2024-05-19 06:26:25'),
(1066, 'POLTWK002', 21, 'Salah satu keputusan penting dalam Kongres Pemuda II di Jakarta tahun 1928 adalah ....', NULL, 1, 'Kongres Pemuda II yang berlang- sung di Jakarta, pada 27-28 Oktober 1928, menghasilkan Ikrar Sumpah Pemuda yang berisi:\r\nKami putra-putri Indonesia, mengakui bertumpah darah satu, tanah air Indonesia.<br>\r\nKami putra-putri Indonesia, mengakui berbangsa satu, bangsa Indonesia.<br>\r\nKami putra-putri Indonesia, menjunjung tinggi bahasa per- satuan, bahasa Indonesia.', NULL, '2024-05-19 06:59:00', '2024-05-19 06:59:00'),
(1068, 'POLTWK002', 23, 'Isi dari Perjanjian Tordesillas antara Spanyol dan Portugis adalah....', NULL, 3, 'Pembahasan:\r\nPerjanjian Tordesillas merupakan kesepakatan antara Spanyol dan Portugis mengenai pembagian dunia ke dalam dua wilayah kekuasaan menurut garis Tordesillas yang disetujui oleh Paus Julius II. Garis Tordesillas membentang dari Kutub Utara ke Kutub Selatan melalui Kepulauan Verde di sebelah barat Benua Afrika. Atas dasar Perjanjian Tordesillas, Spanyol diberi hak untuk melayani dan menguasai negeri-negeri di sebelah barat, sedangkan Portugis dapat menguasai negeri-negeri di sebelah timur.', NULL, '2024-05-19 07:05:57', '2024-05-19 07:05:57'),
(1069, 'POLTWK002', 24, 'Isi perjanjian Bongaya antara Sultan Hasanuddin dan VOC adalah....', NULL, 1, 'Isi Perjanjian Bongaya:\r\nVOC memperoleh hak mono- poli dagang di Makassar<br>\r\nBelanda dapat mendirikan benteng di pusat kerajaan Makassar yang diberi nama Benteng Rotterdam<br>\r\nMakassar harus melepaskan daerah kekuasaannya seperti Bone dan pulau-pulau di luar wilayah Makassar<br>\r\nAru Palaka diakui sebagai raja Bone<br>', NULL, '2024-05-20 03:42:12', '2024-05-20 03:42:12'),
(1070, 'POLTWK002', 25, 'Penyerahan kedaulatan RIS dilaku- kan pada tanggal 27 Desember 1949. Wakil dari Indonesia pada saat penyerahan kedaulatan RIS di Belanda adalah ....', NULL, 2, 'Pengakuan kedaulatan RIS dilaku- kan di dua tempat yaitu di Indonesia, yang menandatangani adalah Sri Sultan Hamengku Buwono IX dan AH Lovink, dan di Belanda yang menandatangani adalah Drs. Moh. Hatta dan Ratu Yuliana.', NULL, '2024-05-20 03:45:11', '2024-05-20 03:45:11'),
(1071, 'POLTWK002', 26, 'Penyebab kemunduran Kerajaan Samudra Pasai adalah ....', NULL, 3, 'Kerajaan Samudra Pasai mengalami kemunduran pada abad 15 karena diserang oleh Kerajaan Aceh.', NULL, '2024-05-20 03:53:10', '2024-05-20 03:53:36'),
(1072, 'POLTWK002', 27, 'ASEAN berdiri pada tanggal 8 Agustus 1967 yang ditandai dengan penan- datanganan Deklarasi Bangkok. Negara-negara yang terlibat dalam penandatanganan Deklarasi Bangkok adalah, kecuali ....', NULL, 3, 'Tokoh-tokoh yang menandatangani Deklarasi Bangkok adalah:<br>\r\nAdam Malik, mewakili Indonesia<br>\r\nTun Abdul Rozak, mewakili\r\nMalaysia<br>\r\nS. Rajaratnam, mewakili\r\nSingapura<br>\r\nNarcisco Ramos, mewakili\r\nFilipina<br>\r\nThanat Khoman, mewakili\r\nThailand<br>', NULL, '2024-05-20 04:03:45', '2024-05-20 04:03:45'),
(1073, 'POLTWK002', 28, 'Naskah teks Proklamasi ditandata- ngani oleh Ir. Soekarno dan Mohammad Hatta atas nama bang- sa Indonesia. Penandatanganan yang dilakukan oleh kedua tokoh tersebut dilakukan atas usul....', NULL, 4, 'Penandatanganan teks Proklamasi oleh Ir. Soekarno dan Mohammad Hatta dilakukan atas usul dari Sukarni.', NULL, '2024-05-20 04:07:15', '2024-05-20 04:07:15'),
(1074, 'POLTWK002', 29, 'Penggantian nama Irian Jaya menjadi Papua terjadi pada masa\r\npemerintahan\r\nA. B.J. Habibie\r\nB. Gus Dur\r\nC. Megawati\r\nD. SBY\r\nE. Soeharto', NULL, 2, 'Pada masa pemerintahannya, Gus Dur mengambil langkah kontrover- sial dengan mengganti nama Irian Jaya menjadi Papua dan mengi- jinkan pengibaran bendera kejora sebagai bendera Papua.', NULL, '2024-05-20 04:27:13', '2024-05-20 04:27:13'),
(1075, 'POLTWK002', 30, 'Krisis politik yang berlangsung di Indonesia diawali dengan adanya peristiwa....', NULL, 3, 'Reformasi yang terjadi di Indonesia dilatar belakangi oleh berbagai krisis yang ada di Indonesia. Krisis politik diawali dengan adanya dominasi ka- langan tertentu yang duduk dalam keanggotaan MPR maupun DPR', NULL, '2024-05-20 04:29:50', '2024-05-20 04:29:50'),
(1076, 'POLTWK002', 31, 'Dalam pembangunan ekonomi kerakyatan yang memiliki peranan dalam menciptakan kemakmuran dan kesejahteraan rakyat. Hal terse- but sesuai dengan bunyi UUD 1945 pasal 33 ayat 1 yang berbunyi...', NULL, 2, 'Kemakmuran rakyat merupakan tujuan utama dari pembanguan ekonomi kerakyatan. Hal tersebut sesuai dengan bunyi UUD 1945 pasal 33 ayat 1 yang berbunyi: Perekonomian disusun sebagai usaha bersama berdasar atas asas kekeluargaan<br>\r\nbunyi UUD 1945 pasal 33 ayat 2, yaitu: \"Cabang-cabang produksi yang penting bagi negara dan yang menguasai hajad hidup orang banyak dikuasai oleh negara\"<br>\r\nbunyi UUD 1945 pasal 33 ayat 3, yaitu: \"Bumi dan air dan kekayaan alam yang terkandung di dalamnya dikuasai oleh negara dan dipergunakan untuk sebesar-besarnya kemakmuran rakyat\"<br>\r\nbunyi UUD 1945 pasal 33 ayat 4, yaitu: \"Perekonomian nasional diselenggarakan berdasarkan atas demokrasi ekonomi dengan prinsip kebersamaan, efisiensi keadilan,<br>keberlanjutan, wawasan lingkungan, kemandirian, serta dengan menjaga keseimbangan kemajuan dan kesatuan ekonomi nasional\".<br>\r\nbunyi UUD 1945 pasal 33 ayat 5, yaitu: \"ketentuan lebih lanjut mengenai pelaksanaan pasal ini diatur dalam undang-undang\".', NULL, '2024-05-20 06:16:51', '2024-05-20 06:16:51'),
(1077, 'POLTWK002', 32, 'Lambang negara ialah Garuda Pancasila dengan semboyan Bhinneka Tunggal Ika, merupakan isi UUD 1945 pasal ....', NULL, 3, '\"Lambang Negara ialah Garuda Pancasila dengan semboyan Bhinneka Tunggal Ika\", merupakan isi UUD 1945 pasal 36 A', NULL, '2024-05-20 06:24:25', '2024-05-20 06:24:25'),
(1078, 'POLTWK002', 33, 'Berdasarkan bunyi UUD 1945 pasal 10, bahwa Presiden memiliki kekuasaan tertinggi atas....', NULL, 2, 'Berdasarkan bunyi UUD 1945 pasal\r\n10, bahwa kekuasaan Presiden sebagai Kepala Negara adalah sebagai\r\n: Presiden memegang kekuasaan\r\nyang tertinggi atas Angkatan Darat,\r\nAngkatan Laut, Angkatan Udara.', NULL, '2024-05-20 06:27:23', '2024-05-20 06:32:10'),
(1079, 'POLTWK002', 34, 'Negara Kesatuan Republik Indonesia berdasarkan Pasal 1 ayat (3) UUD 1945 adalah Negara ....', NULL, 3, 'Negara Kesatuan Republik Indonesia berdasarkan Pasal 1 ayat (3) UUD 1945 adalah Negara Indonesia adalah negara hukum\".', NULL, '2024-05-20 06:35:26', '2024-05-20 06:35:26'),
(1080, 'POLTWK002', 35, 'Berdasarkan UUD 1945, terdapat suatu lembaga Negara yang berwenang dalam memberikan grasi, amnesty dan rehabilitasi adalah lembaga tersebut adalah ....', NULL, 1, 'Suatu lembaga Negara yang ber-wenang dalam memberikan grasi dan rehabilitasi adalah Presiden', NULL, '2024-05-20 06:38:36', '2024-05-20 06:38:36'),
(1081, 'POLTWK002', 36, 'Bagian dari UUD 1945 yang disebut preambule adalah bagian ....', NULL, 1, 'Preambule adalah sebutan lain/ nama lain dari Pembukaan UUD 1945. Preambule terdiri dari 4 alinea', NULL, '2024-05-20 06:57:45', '2024-05-20 06:57:45'),
(1082, 'POLTWK002', 37, 'Dalam pembukaan UUD 1945, ale- nia yang menyatakan cita-cita dan tujuan bangsa Indonesia tertuang dalam Pembukaan UUD 1945 alinea....', NULL, 2, 'Dalam pembukaan UUD 1945, alinea yang menyatakan cita-cita dan tujuan bangsa Indonesia tertuang dalam Pembukaan UUD 1945 alinea ke-4', NULL, '2024-05-20 07:03:50', '2024-05-20 07:03:50'),
(1083, 'POLTWK002', 38, 'Untuk mencapai salah satu tujuan Indonesia, yaitu mencerdaskan kehidupan bangsa,\r\npemerintah memberikan anggaran khusus dibidang pendidikan. Pemerintah menganggarkan\r\nminimal 20% dari total APBN. Dengan adanya anggaran tersebut, diharapkan terjadi\r\npemerataan pendidikan di Indonesia dan tidak terjadi kekurangan anggaran Pendidikan di\r\nsekolah-sekolah. Hal ini sesuai dengan UUD 1945 pasal....', NULL, 4, 'Berdasarkan penjelasan di atas, sesuai dengan UUD 1945 pasal 31 ayat 4, yang berbunyi\r\nNegara memprioritaskan anggaran pendidikan sekurang-kurangnya 20% dari anggaran\r\npendapatan dan belanja negara serta dari anggaran pendapatan dan belanja daerah untuk\r\nmemenuhi kebutuhan penyelenggaraan pendidikan nasional', NULL, '2024-05-20 07:09:16', '2024-05-20 07:09:16'),
(1084, 'POLTWK002', 39, 'Yang berkedudukan sebagai landasan idiil dalam wawasan nusantara dalam\r\nparadigma sosial adalah ....', NULL, 3, 'Pancasila sebagai falsafah dan dasar negara berfungsi sebagai landasan idiil dari\r\nwawasan nusantara, karena pada hakikatnya wawasan nusantara adalah perwujudan\r\ndari Pancasila', NULL, '2024-05-20 07:11:29', '2024-05-20 07:11:29'),
(1085, 'POLTWK002', 40, 'Menurut Lembaga Ketahanan Nasional Tahun 1999, Wawasan Nusantara adalah cara\r\npandang dan sikap bangsa Indonesia mengenai diri dan lingkungannya yang serba\r\nberagam dan bernilai strategis dengan mengutamakan persatuan dan kesatuan bangsa\r\nserta kesatuan wilayah dalam penyelenggaraan kehidupan bermasyarakat, berbangsa\r\ndan bernegara untuk mencapai tujuan nasional. Berdasarkan pengertian tersebut,\r\nmaka hakikat wawasan nusantara adalah....', NULL, 5, 'Hakikat wawasan nusantara adalah kesatuan dan keutuhan nasional negara Indonesia.\r\nHal tersebutsecara luas dapat diartikan sebagai cara pandang yang selalu utuh\r\nmenyeluruh dalam lingkup nusantara, demi kepentingan nasional', NULL, '2024-05-20 07:12:58', '2024-05-20 07:12:58'),
