(1166, 'POLPMK001', 27, '<p align=\"justify\">Ketika pegiat olahraga yang dikontrak untuk meningkatkan kualitas olahraga di Indonesia tidak maumenghormat bendera merah putih saat menyanyikan lagu Indonesia Raya tanggapan anda&\n</p>', NULL, 1234, 'Tidak ada pilihan jawaban yang salah', NULL, '2024-05-26 18:32:58', '2024-05-27 16:15:41'),
(1167, 'POLPMK001', 28, 'Dalam suatu destinasi wisata, anda diminta untuk memakai perlengkapan pakaian yang diharuskan sesuai peraturan adat dan aliran kepercayaan leluhur yang berlaku di daerah itu. Sikap seorang wisatawan yang berasal dari luar daerah adalah ....', NULL, 1234, 'Tidak ada pilihan jawaban yang salah', NULL, '2024-05-26 18:39:19', '2024-08-02 07:40:48'),
(1168, 'POLPMK001', 29, 'Melakukan pesta pora yang menggaungkan kebebasan hak kaum LGBT di suatu wisata lokal di Indonesia adalah hal yang bagaimana menurut anda?', NULL, 1234, 'Tidak ada pilihan jawaban yang salah', NULL, '2024-05-26 18:41:47', '2024-05-26 18:44:23'),
(1169, 'POLPMK001', 30, 'Apakah anda setuju jika Negara Kesatuan Republik Indonesia dipimpin oleh seseorang yang agama atau sukunya yang mayoritas di Indonesia?', NULL, 1234, 'Tidak ada pilihan  jawaban yang salah', NULL, '2024-05-26 18:43:46', '2024-05-26 18:43:46'),
(1170, 'POLPMK001', 31, 'Saat terjadi demonstrasi di depan gedung DPR atau Lembaga Pemerintahan Negara, pengunjuk rasa\r\nmelakukan perusakan fasilitas yang di sekitar gedung tersebut. Bagaimana menurut anda?', NULL, 1234, 'Tidak ada jawaban yang salah', NULL, '2024-05-26 19:41:50', '2024-05-26 19:41:50'),
(1171, 'POLPMK001', 32, 'Tidak ikut serta dalam pemilihan umum karena tidak calon yang cocok memimpin atau mewakili aspirasi\r\nrakyat. Pendapat anda adalah ....', NULL, 1234, 'Tidak ada jawaban yang salah', NULL, '2024-05-26 19:44:40', '2024-08-02 07:40:45'),
(1173, 'POLPMK001', 33, '<p align=\"justify\">Anda sedang tergabung dalam grup whatsapp yang saat ini sedang ramai oleh isu yang mengarah ke ujarankebencian pada etnis tertentu. Pada awalnya ada salah satu anggota grup yang membagikan pesan broadcast ke dalam grup dan kemudian ditanggapi oleh sebagian besar anggota grup whatsapp. Diawali dengan diskusi, kemudian dengan keluarnya hujatan pada etnis tertentu. Dalam kondisi ini, apa sika panda?</p>', NULL, 12345, 'Tidak ada jawaban yang salah', NULL, '2024-05-26 19:48:03', '2024-05-27 16:28:35'),
(1182, 'POLPMK001', 34, '<p align=\"justify\">Sesuai dengan makna Negara Indonesia yang berdasarkan Pancasila dan UUD 1945, maka Negara\r\nIndonesia memiliki sifat kebersamaan, kekeluargaan serta religiusitas. Dalam pengertian inilah maka\r\nNegara Indonesia pada hakikatnya adalah Negara kebangsaan yang Berketuhanan Yang Maha Esa. Ketika\r\nkamu memiliki tetangga yang berbeda agama dengan mu, yang pada suatu hari mengalami musibah\r\nkebakaran rumah sehingga menyebabkan kehilangan tempat tinggal. Sebagai bagian dari masyarakat,\r\nsikap anda adalah.....</p>', NULL, 12345, 'Tidak ada pilihan jawaban yang benar', NULL, '2024-05-26 23:07:15', '2024-05-27 16:27:56'),
(1183, 'POLPMK001', 35, '<p align=\"justify\">Pengeboman Makassar 2021 adalah sebuah peristiwa ledakan bom yang terjadi di depan Gereja Katedral\r\nMakassar, Kota Makassar, Sulawesi Selatan, Indonesia pada tanggal 28 Maret 2021. Akibat peristiwa ini,\r\n20 orang mengalami luka-luka dan 2 orang yang diduga pelaku bom bunuh diri meninggal dunia.\r\nInvestigasi terhadap kejadian pengeboman ini terus dilakukan oleh Kepolisian untuk mengungkap\r\nkelompok yang terlibat dalam kasus tersebut. Apabila anda mengetahui bahwa ada tetangga dekat anda\r\nyang terlibat dalam kasus tersebut, sikap anda adalah....</p>', NULL, 12345, 'Tidak ada pilihan jawaban yang benar', NULL, '2024-05-26 23:10:38', '2024-05-27 16:27:32'),
(1184, 'POLPMK001', 36, '<p align=\"justify\">Anda baru saja mendapatkan pekerjaan baru sebagai anggota dan Badan Nasional Penanggulangan \r\nterorisme. Sebagai anggota badan tersebut, anda dalam melaksanakan pemberantasan tindak pidana \r\nterorisme harus mengedepankan aspek pencegahan secara simultan, terencana dan terpadu untuk \r\nmeminimalisasi terjadinya tindak pidana terorisme. Pencegahan secara optimal dilakukan dengan \r\nmelibatkan kementerian atau lembaga terkait serta seluruh komponen bangsa melaui kesiapsiagaan \r\nnasional, kontra radikalisasi, dan deradikalisasi. Pada suatu hari ada suatu kasus Terorisme yang terjadi \r\ndan anda diminta atasan agar segera membentuk tim khusus untuk menangani kasus terorisme tersebut. \r\nAnda juga dipercaya oleh atasan agar menjadi ketua dari tim khusus tersebut. Padahal, anda adalah \r\nanggota baru yang belum begitu mengenal rekan kerja anda. Sikap anda yang tepat adalah....</p>', NULL, 12345, 'Tidak ada pilihan jawaban yang benar', NULL, '2024-05-27 07:35:29', '2024-05-27 16:30:43'),
(1186, 'POLPMK001', 37, '<p align=\"justify\">Danu mempunyai rekan satu bidang yang baru dibentuk oleh kantor, Danu sudah sangat akrab dengan \r\nrekan kerja tersebut meskipun baru beberapa hari kenal. Pada suatu ketika Dia bercerita bahwa pernah \r\nterlibat dalam organisasi terlarang yang berupaya merongrong Pancasila. Namun ia sekarang sudah tidak \r\nterlibat lagi karena menyadari berbahayanya organisasi tersebut. Sikap Danu adalah....</p>', NULL, 12345, 'Tidak ada pilihan jawaban yang salah', NULL, '2024-05-27 07:40:11', '2024-05-27 16:26:35'),
(1187, 'POLPMK001', 38, '<p align=\"justify\">Anda adalah seorang ketua RT di suatu desa padat penduduk. Warga masyarakat di desa anda selalu aktif \r\ndi berbagai kegiatan sosial. Beberapa waktu yang lalu, ada warga pendatang dengan usia yang masih muda \r\nmengontrak di salah satu rumah di wilayah anda. Dari awal kedatangan mereka tampak pendiam, jarang \r\nmelakukan sosialisasi dengan warga lainnya. Aktivitas mereka terkesan tertutup dan mencurigakan. Selain \r\nitu, sering terlihat juga pemuda lain yang datang dan pergi dari rumah tersebut setiap harinya. Pekerjaan \r\nmereka juga tidak jelas karena hanya datang dan pergi dari rumah tersebut. Anda sudah berusaha \r\nmengajak pendatang tersebut untuk mengikuti segala kegiatan sosial, tetapi responnya pasif dan tidak ada \r\nperubahan. Yang anda lakukan adalah ...</p>', NULL, 12345, 'Tidak ada pilihan jawaban yang salah', NULL, '2024-05-27 07:41:51', '2024-05-27 16:25:49'),
(1188, 'POLPMK001', 39, '<p align=\"justify\">Negara Indonesia sejak lahirnya memiliki beragam latar belakang seperti budaya, suku, bahasa, etnis, \r\ntradisi dan agama. Apabila setiap umat beragama bersikap intoleran, tidak akan tercipta keharmonisan \r\nantar umat beragama. Selain itu munculnya paham radikalisme dinilai menjadi ancaman serius bagi \r\nkeutuhan bangsa. Sepuluh tahun terakhir ini terkonfirmasi banyak kelompok yang menganut paham \r\nradikalisme. Tidak hanya muncul di institusi pemerintah, namun juga di institusi masyarakat, termasuk di \r\nbidang pendidikan. Banyak dosen dan mahasiswa yang terpapar pandangan ekstrem tersebut. Jika anda  diposisikan seorang pimpinan sebuah kampus, langkah awal yang anda lakukan untuk memerangi paham \r\nradikalisme tersebut adalah...</p>', NULL, 12345, 'Tidak ada pilihan jawaban yang salah', NULL, '2024-05-27 07:44:10', '2024-05-27 16:25:20'),
(1189, 'POLPMK001', 40, '<p align=\"justify\">Sesuai dengan makna Negara Indonesia yang berdasarkan Pancasila dan UUD 1945, maka Negara Indonesia memiliki sifat kebersamaan, kekeluargaan serta religiusitas. Dalam pengertian inilah maka Negara Indonesia pada hakikatnya adalah Negara kebangsaan yang Berketuhanan Yang Maha Esa. Ketika kamu memiliki tetangga yang berbeda agama dengan mu, yang pada suatu hari mengalami musibah kebakaran rumah sehingga menyebabkan kehilangan tempat tinggal. Sebagai bagian dari masyarakat, sikap anda adalah.....</p>', NULL, 12345, 'Tidak ada pilihan jawaban  yang salah', NULL, '2024-05-27 16:10:52', '2024-05-27 16:24:09'),
