(1992, 'PNSSKD001', 1, 'Sungguh heroik perjuangan Jenderal Sudirman. Ia telah menempuh perjalanan 1000 km dan menempuh \r\nwaktu gerilya selama 6 bulan dengan penuh derita. Sekalipun dalam keadaan sakit, Sudirman tetap \r\nberperang dan memberi semangat ke anak buahnya untuk berjuang melawan kegigihan Belanda. \r\nSikap bela negara yang patut diteladani dari kejadian tersebut adalah…', NULL, 1, 'Jenderal Sudirman yang sedang sakit, hanya dengan satu paru-paru tetap teguh memimpin perang \r\ngerilya. Hingga Sudirman harus dipandu atau dipapah dalam memimpin peperangan. Maka sikap \r\nyang patut kita teladani adalah jiwa dan raga rela dikorbankan untuk kedaulatan bangsa dan negara.', NULL, '2024-07-19 22:27:47', '2024-07-19 22:27:47'),
(1993, 'PNSSKD001', 2, 'Dedy adalah seorang pekerja kantor. Suatu hari Dedy terlambat berangkat bekerja. Saat di dalam \r\nperjalanan berangkat dia tergesa-gesa yang mengakibatkannya melanggar peraturan lalu lintas \r\ndengan menerobos lampu merah. Perbuatan Dedy ini tidak sesuai dengan kedudukan Pancasila \r\nsebagai…', NULL, 5, 'Pancasila sebagai sumber dari segala sumber hukum merupakan asal setiap pembentuk hukum di \r\nIndonesia mengambil atau menimba unsur-unsur dasar yang diperlukan untuk tugasnya dan tempat\r\nuntuk menemukan ketentuan-ketentuan yang akan menjadi sisi dari peraturan hukum yang akan \r\ndibuat.', NULL, '2024-07-19 22:42:35', '2024-07-19 22:42:35'),
(1994, 'PNSSKD001', 3, 'Secara historis, Indonesia pernah mengalami penjajahan oleh sejumlah bangsa asing. Sejarah \r\nPanjang Nusantara memperlihatkan bahwa perpecahan wilayah pada akhirnya merugikan bangsa \r\nIndonesia sendiri. Oleh karena itu muncul konsep persatuan yang digunakan sebagai konsep \r\nWawasan Nusantara untuk menyatukan cara pandang nasional. Bangsa Indonesia tanpa terkecuali \r\nmemili hak yang sama dalam segala aspek kehidupan. Oleh karenanya kepentingan umum atau \r\nnasional harus diatas kepentingan pribadi maupun kelompok. Asas yang dimaksud adalah…', NULL, 2, 'Asas keadilan memiliki makna bahwa bangsa Indonesia tanpa terkecuali memili hak yang sama \r\ndalam segala aspek kehidupan. Oleh karenanya kepentingan umum atau nasional harus diatas \r\nkepentingan pribadi maupun kelompok.', NULL, '2024-07-19 22:45:51', '2024-07-19 22:45:51'),
(1995, 'PNSSKD001', 4, 'Berikut ini yang bukan termasuk perilaku nasionalisme yang tercermin pada kehidupan\r\nbernegara adalah....', NULL, 5, 'Berikut ini yang termasuk perilaku nasionalisme yang tercermin pada kehidupan bernegara\r\nadalah : <br>\r\n- Menghormati keputusan hakim <br>\r\n- Ikut serta dalam pasukan perdamaian dunia <br>\r\n- Mematuhi rambu-rambu lalu lintas <br>\r\n- Tidak menyelenggarakan PTM saat pelarangan PTM diberlakukan <br>', NULL, '2024-07-19 22:55:20', '2024-07-19 22:55:20'),
(1996, 'PNSSKD001', 5, 'Selain suku bangsa, di Indonesia juga terdapat 6 agama yang diakui oleh negara kita.\r\nMulai dari agama Islam, Kristen, Katolik, Hindu, Budha, dan Konghuchu hidup rukun\r\nberdampingan. Pengakuan terhadap keberagaman agama merupakan wujud semangat\r\nnasionalisme dalam mempersatukan keberagaman nasional. Landasan dari pengakuan\r\ntersebut adalah....', NULL, 4, 'Pengakuan terhadap keberagaman agama merupakan wujud semangat nasionalisme dalam\r\nmempersatukan keberagaman nasional. Landasan dari pengakuan tersebut adalah Agama\r\nmerupakan nilai positif warga negara yang wajib dijamin.', NULL, '2024-07-19 22:58:25', '2024-07-19 22:58:25'),
(1997, 'PNSSKD001', 6, 'Masyarakat Indonesia merupakan masyarakat yang majemuk. Kemajemukan tersebut\r\nditunjukkan dengan terdapat berbagai macam suku bangsa, agama, adat istiadat,\r\nrumah adat, Bahasa daerah, dan lain sebagainya. Melihat kenyataan tersebut, diperlukan\r\nadanya sikap nasionalisme berdasarkan keanekaragaman tersebut. Hal ini bertujuan\r\nagar....', NULL, 1, 'Melihat kenyataan tersebut, diperlukan adanya sikap nasionalisme berdasarkan\r\nkeanekaragaman tersebut. Hal ini bertujuan agar bangsa Indonesia tidak kehilangan\r\nkepribadian bangsanya. Keanekaragaman tersebut merupakan ciri khas yang membedakan\r\nbangsa Indonesia dengan bangsa lain.', NULL, '2024-07-19 23:00:41', '2024-07-19 23:00:41'),
(1998, 'PNSSKD001', 7, 'ASIAN GAMES adalah ajang olahraga regional yang diikuti oleh negara-negara di kawasan Asia. Selain menjadi wadah untuk mempertandingkan prestasi atlet-atlet terbaik, ASIAN GAMES juga memiliki peran penting dalam membangun rasa nasionalisme dan persatuan di antara bangsa-bangsa di kawasan tersebut. Mengapa acara ini dapat memperkuat nasionalisme di negara peserta?', NULL, 2, 'Melalui persaingan yang sehat, ASIAN  GAMES membangun rasa solidaritas dan persatuan di antara bangsa-bangsa Asia Tenggara. ASIAN GAMES apat memperkuat nasionalisme di negara peserta karena melalui persaingan yang sehat dalam ajang ini, atlet-atlet mewakili negara mereka dengan semangat kebangsaan yang tinggi. Persaingan ini membangun rasa solidaritas dan persatuan di antara bangsa-bangsa Asia. Atlet-atlet tersebut saling menghormati dan mendukung satu sama lain, tanpa memedulikan perbedaan budaya, bahasa, atau kebangsaan. Melalui persaingan yang fair, ASIAN GAMES menciptakan ikatan yang kuat di antara negara-negara peserta dan memperkuat rasa nasionalisme di kawasan tersebut.', NULL, '2024-07-19 23:22:36', '2024-07-20 03:18:30'),
(2000, 'PNSSKD001', 8, 'Pada zaman modern ini, di tengah arus globalisasi yang semakin kuat, nasionalisme tetap menjadi landasan yang penting dalam mempertahankan identitas dan keberlanjutan suatu bangsa. Lingkungan keluarga memiliki peran sentral dalam membentuk pemahaman dan penghayatan nilai-nilai nasionalisme pada generasi muda. Oleh karena itu, penting bagi kita untuk menggali pemikiran dan pemahaman mendalam tentang wujud nasionalisme di lingkungan keluarga. Dalam konteks wujud nasionalisme di lingkungan keluarga, mengapa penting untuk mengenalkan sejarah bangsa kepada anggota keluarga?', NULL, 1, 'Melalui pengetahuan tentang sejarah bangsa, anggota keluarga dapat memahami perjalanan dan pencapaian bangsa mereka dari masa lampau. Hal ini membantu memperkuat rasa identitas sebagai warga negara dan membangkitkan kebanggaan terhadap warisan budaya, prestasi sejarah, serta nilai-nilai yang dijunjung tinggi oleh bangsa tersebut. Dengan mengetahui sejarah bangsa, anggota keluarga akan lebih mudah mengaitkan diri dengan identitas nasional, memahami akar-akar budaya mereka, dan merasa terikat dengan bangsa dan negara. Pemahaman sejarah bangsa juga dapat membuka wawasan anggota keluarga tentang perjuangan dan tantangan yang dihadapi oleh bangsa tersebut. Ini membantu mengembangkan apresiasi terhadap perjuangan para pendahulu dan pahlawan bangsa, serta memupuk semangat juang untuk melanjutkan perjalanan pembangunan dan menjaga keberlanjutan bangsa.\r\nDengan demikian, pengenalan sejarah bangsa kepada anggota keluarga menjadi penting dalam memperkuat identitas dan kebanggaan sebagai warga negara, serta membantu memahami dan mewariskan nilai-nilai nasionalisme yang kuat kepada generasi muda.', NULL, '2024-07-19 23:47:30', '2024-07-19 23:47:30'),
(2001, 'PNSSKD001', 9, 'Lunturnya nasionalisme salah satunya disebabkan permasalahan kompleks yang\r\ndialami oleh bangsa Indonesia. Permasalahan kompleks yang dihadapi Indonesia\r\nadalah....', NULL, 2, 'Lunturnya nasionalisme salah satunya disebabkan permasalahan kompleks yang dialami oleh\r\nbangsa Indonesia. Permasalahan kompleks yang dihadapi Indonesia adalah Gerakan Organisasi PKI yang\r\nmengancam ideologi bangsa', NULL, '2024-07-19 23:51:13', '2024-07-19 23:51:13'),
(2002, 'PNSSKD001', 10, 'Perwujudan kepulauan Nusantara sebagai satu kesatuan politik antara lain memiliki makna bahwa….', NULL, 2, 'Kepulauan Nusantara sebagai satu kesatuan politik mengandung arti bahwa kebudayaan\r\nwilayah nasinal dengan segala isi dan kekayaannya merupakan satu kesatuan wilayah,\r\nwadah, ruang hidup, kesatuan matra seluruh bangsa yang menjadi modal dari milik\r\nbersama bangsa Indonesia.', NULL, '2024-07-20 03:22:59', '2024-07-20 03:22:59'),
(2003, 'PNSSKD001', 11, 'Pak Rahman adalah seorang ASN bagian Pejabat publik di suatu daerah tertentu. Sebagai ASN tentunya pak\r\nRahman harus menjadi pribadi yang dapat menjadi teladan yang baik bagi masyarakat umum di tempat pak\r\nRahman mengabdi.Keutamaan seorang ASN sebagai Pejabat publik harus berintegritas tinggi pada nilai ...', NULL, 1, 'Indikator dalam soal ini berkaitan dengan Integritas. <br>\r\nOpsi A benar karena sesuai dengan pengertian integritas yang tercantum pada\r\nPermenpanRB No 38 Tahun 2017 yang berbunyi, “Integrotas adalah konsisten\r\nberperilaku selaras dengan nilai, norma dan/atau etika organisasi, dan jujur dalam\r\nhubungan dengan manajemen, rekan kerja, bawahan langsung, dan pemangku\r\nkepentingan....,”<br>\r\nOpsi B salah karena seseorang dengan kejujuran yang tinggi akan berpegang teguh\r\npada komitmennya kepada manajemen salah satunya adalah untuk bersikap\r\ndisiplin. <br>\r\nOpsi C salah karena seseorang yang memiliki kejujuran yang tinggi akan memiliki\r\nhati yang tulus dalam bekerja dimana dalam hal ini adalah senantiasa menjunjung\r\ntinggi tanggung jawabnya.<br>\r\nOpsi D salah karena seseorang yang memiliki kejujuran yang tinggi mereka akan\r\nbekerja dengan penuh rasa empati <br>\r\nOpsi E salah karena seseorang dengan kejujuran yang tinggi memiliki rasa rendah\r\nhati dan tulus ikhlas dalam melayani sektor publik.', NULL, '2024-07-20 03:26:29', '2024-07-20 03:26:29'),
(2004, 'PNSSKD001', 12, 'Sarekat islam yang dahulunya bernama Sarekat Dagang Islam merupakan organisasi\r\npolitik yang didirikan oleh Haji Samanhudi. Namun, seiring berjalannya waktu untuk\r\nmemperluas anggota, maka H.O.S. Cokroaminoto mengubah Sarekat Dagang Islam\r\nmenjadi Sarekat Islam. Pada tahun 1921, Sarekat Islam pecah menjadi dua kubu, yaitu Si\r\nMerah dan Si Putih. Berikut ini yang termasuk kedalam kubu si Merah adalah....', NULL, 5, 'Berikut ini yang termasuk kedalam kubu si Merah adalah Semaun, Darsono, dan Alimin.', NULL, '2024-07-20 03:31:38', '2024-07-20 03:31:38'),
(2005, 'PNSSKD001', 13, '<b>Perhatikan wacana berikut ini!<br></b>\r\nAda pemandangan yang tidak biasa saat K.H. Idham Chalid dan Buya Hamka\r\nmelakukan perjalanan ke tanah suci. Di tengah perjalanan, mereka melaksanakan salat\r\nshubuh bersama. Sebagai pemimpin organisasi Nahdatul Ulama kala itu, K.H. Idham\r\nChalid tidak membaca doa qunut saat salat shubuh berlangsung. Buya hamka dan\r\njamaah lainnya pun terheran dengan sikap yang ditunjukkan oleh Idham Chalid\r\ntersebut. Padahal, dalam tuntunan orang Nahdatul Ulama membaca qunut saat salat\r\nshubuh dihukumi sunnah muakad. Berdasarkan wacana di atas, nilai integritas yang\r\nselayaknya dicontoh dari seorang K.H. Idham Chalid adalah....', NULL, 1, 'Berdasarkan wacana di atas, nilai integritas yang selayaknya dicontoh dari seorang K.H. Idham\r\nChalid adalah Toleransi sangat diperlukan dalam kehidupan antar umat beragama.', NULL, '2024-07-20 03:37:13', '2024-07-20 03:38:17'),
(2006, 'PNSSKD001', 14, 'Sikap integritas sesuai dengan pengamalan Pancasila sila ke-2 adalah....', NULL, 3, 'Sikap integritas sesuai dengan pengamalan Pancasila sila ke-2 adalah Fajar menjadi\r\nkoki di dapur umum Palestina. Hal ini sesuai butir gemar melakukan kegiatan kemanusiaan.', NULL, '2024-07-20 03:43:08', '2024-08-16 04:11:08'),
(2007, 'PNSSKD001', 15, 'Saat perundingan sila-sila Pancasila terjadi perdebatan diantara anggota PPKI, terutama\r\ndalam pembahasan sila ke-1. Hal ini dikarenakan tidak semua warga negara Indonesia\r\nberagama islam sehingga sila tersebut jika tidak diubah kurang menunjukkan\r\nkemajemukan Indonesia. Sebagai salah satu anggota PPKI, Kasman Dimejo membujuk\r\nteman-temannya yang lain untuk menghilangkan tujuh kata tersebut. Tindakan yang\r\ndilakukan Kasman tergambar melalui sikap....', NULL, 4, 'Tindakan yang dilakukan Kasman tergambar melalui sikap Rasa tanggung jawab yang\r\ndilandasi oleh semangat persatuan.', NULL, '2024-07-20 03:45:19', '2024-07-20 03:45:19'),
(2008, 'PNSSKD001', 16, 'Perhatikan ciri-ciri masyarakat berikut ini! <br>\r\n1) Masyarakat industri<br>\r\n2) Nilai prestasi dan universalisme<br>\r\n3) Spesialisasi tinggi<br>\r\n4) Sistem politik demokratis<br>\r\n5) Birokrasi rasional<br>\r\nCiri-ciri masyarakat di atas merupakan ciri-ciri masyarakat…', NULL, 2, 'Ciri-ciri masyarakat modern yaitu:<br>\r\na. Masyarakat industri<br>\r\nb. Nilai prestasi dan universalisme<br>\r\nc. Spesialisasi tinggi<br>\r\nd. Sistem politik demokratis<br>\r\ne. Birokrasi rasional<br>', NULL, '2024-07-20 03:53:09', '2024-07-20 03:53:09');

