('POLPKC001', 'Tryout Psikologi Kecerdasan Paket 1', 10000, 5400, 'Selamat datang para peserta tes psikologi <br>                Sebelum mengerjakan tes, bacalah petunjuk pengerjaan tes psikologi ini dengan saksama. <br>                Dalam tes kecerdasan ini, Anda akan dihadapkan pada serangkaian soal dimana masing-masing                persoalan memiliki cara mengerjakan sendiri-sendiri. Anda diminta untuk membaca setiap                Soal yang ada, dan memberikan jawaban sesuai jawaban yang menurut Anda paling benar.                Perlu diingat masing-masing soal memiliki jumlah jawaban yang berbeda-beda, ada yang soal                dengan satu jawaban yang benar dan adapula soal dengan dua jawaban yang benar.                Adapunpetunjuk untuk mengerjakan soal berpedoman pada beberapa tipe soal yang                dicontohkan berikut ini: <br>                Contoh 1. Pilihlah dua kata yang memiliki makna yang sama <br>                a) Duka b) Buruk c) Sulit d) Sedih e) Jelek <br>                Pada tipe soal ini Anda diminta untuk mencari dua kata dari pilihan jawaban yang mempunyai                makna sama atau yang paling dekat. Pada contoh soal di atas terdapat kata \"Duka\" dan                \"Sedih\"memiliki arti sama yaitu suasana hati yang tidak enak. Maka jawaban yang tepat adalah                pilihan hurut a dan d. <br>                Contoh 2. Pilihlah dua kata yang memiliki makna yang berlawanan <br>                a) Lemas b) Lembut c) Licin d) Keras e) Tebal <br>                Pada tipe soal ini Anda diminta untuk mencari dua kata dari pilihan jawaban yang mempunyai                arti berlawanan atau yang paling jauh. Pada contoh soal di atas terdapat kata \"Lembut\" dan                \"keras\" memniliki arti berlawanan, Maka jawaban yang tepat adalah pilihan huruf b dan d. <br>                Contoh 3. Basah : Kering = ......... : .......... <br>                a) Rentan b) Rawan c) Sayang d) Baik e) Buruk <br>                Pada tipe soal ini Anda diminta untuk mencari jawaban dua kata yang memiliki hubungan yang                sama dengan pasangan kata pada soal. Pada contoh diatas, hubungan dari kata \"Basah\" dan                \"Kering\" adalah lawan katanya, maka dari pilihan jawaban yang memiliki hubungan lawan                kata adalah \"Baik\"dan \"Buruk\" Maka jawaban yang tepat adalah pilihan huruf d dan e.', NULL, NULL, 61, 0, '2024-05-05 00:12:47', '2024-08-07 02:29:45'),
