('POLPKR001', 'Tryout Psikologi Kepribadian Paket 1', 10000, 3600, 'Berikut adalah cara menjawab soal: <br>                Pilihlah A bila anda SANGAT TIDAK SESUAI dengan pernyataan tersebut. <br>                Pilihlah B bila anda TIDAK SESUAI dengan pernyataan tersebut. <br>                Pilihlah C bila anda SESUAI dengan pernyataan tersebut. <br>                Pilihlah D bila anda SANGAT SESUAI dengan pernyataan tersebut. <br>                CONTOH: <br>                NO	Pernyataan <br>                1	Pemimpin lebih utama dibanding relawan', NULL, NULL, NULL, 0, '2024-05-05 00:12:55', '2024-08-07 02:30:39'),
