(111, 'POLPKC001', 11, 'Tino senang menabung. Setiap hari kecuali Minggu, Tino diberi uang saku oleh orang tuanya sebanyak Rp. 5000. Biasanya Tino hanya membelanjakan uangnya sebanyak Rp. 1.500,- / hari dan sisanya ditabung di celengan. Berapa banyak uang pecahan Rp.500 yang Tino peroleh jika membongkar celengan selama seminggu?', NULL, 2, NULL, NULL, '2024-05-09 03:06:43', '2024-05-09 03:06:43'),
(112, 'POLPKC001', 12, 'Jika seorang buruh digaji selama satu bulan (30 hari) sejumlah Rp. 1.311.000 / bulan karena tidak masuk selama 7 hari, maka berapakah upah per hari buruh tersebut?', NULL, 4, NULL, NULL, '2024-05-09 03:06:43', '2024-05-09 03:06:43'),
(113, 'POLPKC001', 13, 'Dido ingin menjadi seorang Polri, syarat menjadi seorang Polri adalah sehat jasmani. Awalnya Dido dapat berlari di halaman Gelora Bung Karno (GBK) sebanyak 3 putaran. Keliling halaman GBK adalah 700 m. Jika setiap minggu Dido mampu meningkatkan ketahanan berlarinya sebanyak 1 putaran, berapa putaran yang dapat dicapai Dido 4 minggu kemudian jika Dido berlari di Lapangan Bhayangkara Mabes Polri yang hanya 400 m?', NULL, 2, NULL, NULL, '2024-05-09 03:06:43', '2024-05-09 03:06:43'),
(114, 'POLPKC001', 14, 'Di dalam sebuah peti terdapat 7 pucuk senjata yang masing masing senjata memiliki tipe dan jenis yang berbeda. Jika di gudang senjata terdapat 137 peti senjata berapa banyak pucuk senjata yang ada di dalam gudang tersebut ?', NULL, 2, NULL, NULL, '2024-05-09 03:06:43', '2024-05-09 03:06:43'),
(115, 'POLPKC001', 15, 'Desi menyewakan kedua mobilnya selama satu minggu. Mobil A disewakan dengan harga Rp.2.500/hari. Bila dari penyewaan kedua mobil tersebut Desi menerima uang sebesar Rp36.750,- maka mobil B disewakan Desi per hari dengan harga?', NULL, 4, NULL, NULL, '2024-05-09 03:06:43', '2024-05-09 03:06:43'),
(116, 'POLPKC001', 16, 'Sebuah bus Trans Jakarta menempuh perjalanan dari halte Ragunan ke halte Kuningan dengan kecepatan rata-rata 40 km / jam dan kembali dengan kecepatan rata-rata 60 km / jam. Jika jarak dari halte Ragunan ke halte Kuningan adalah 120 km. Berapakah kecepatan rata- rata untuk seluruh perjalanan?', NULL, 2, NULL, NULL, '2024-05-09 03:06:43', '2024-05-09 03:06:43'),
(117, 'POLPKC001', 17, 'Demi menambah berat badannya agar dapat bersaing di kelasnya, Chris John berlatih beban selama 25 menit per hari dan banyak mengonsumsi makanan yang mengandung karbohidrat dan protein tinggi sehingga mampu menaikkan berat badannya sebanyak 5 kg. Seandainya Chris John meningkatkan waktu latihannya menjadi 50 menit tiap hari, maka kira-kira berapa kg berat badan yang dapat ia naikkan?', NULL, 2, NULL, NULL, '2024-05-09 03:06:43', '2024-05-09 03:06:43'),
