(141, 'POLPKC001', 41, 'Samsat Daan Mogot merekrut PHL sebanyak tiga kali jumlah PHL tahun lalu. Tahun lalu PHL nya berjumlah 29 orang, yang keluar tiga orang dan yang masuk sebanyak dua kali lipat dari jumlah yang keluar. Setelah itu jumlah PHL-nya tidak berubah hingga sekarang. Berapakah jumlah PHL Samsat Daan Mogot sekarang?', NULL, 3, NULL, NULL, '2024-05-09 03:06:43', '2024-05-09 03:06:43'),
(142, 'POLPKC001', 42, 'Seseorang saat ini berusia 6 windu. 5 tahun masa hidupnya ia habiskan di kota A dan 15 tahun di kota  Kemudian ia menghabiskan 17 tahun hidupnya di kota  Berapa tahun ia tinggal di tempatnya sekarang ini?', NULL, 4, NULL, NULL, '2024-05-09 03:06:43', '2024-05-09 03:06:43'),
(143, 'POLPKC001', 43, 'Agar dapat sampai ke tempat tugas 2 kali lebih cepat dibandingkan dengan berjalan kaki, Kompol Bima sebaiknya mengendarai motor. Hari ini, Kompol Bima terpaksa berjalan kaki dari rumahnya ke tempat tugas dan itu menghabiskan waktu selama 50 menit. Jarak dari rumahnya ke tempat tugas adalah 1 km. Seandainya Kompol Bima pergi dari rumah ke tempat tugas dengan mengendarai motornya, maka berapa kecepatan rata-rata Kompol Bima untuk sampai ke tempat tugas dari rumahnya?', NULL, 3, NULL, NULL, '2024-05-09 03:06:43', '2024-05-09 03:06:43'),
(144, 'POLPKC001', 44, 'AKP Arini yang hendak apel pagi terjebak kemacetan parah di jalan Tendean selama setengah jam. AKP Arini berangkat dari rumah tepat pukul 06.00, namun karena macet, baru tiba di kantor pada pukul 08.30. Jika mobil AKP Arini berkecepatan rata-rata 50 km/jam, maka berapa jarak yang telah ditempuh AKP Arini dari rumah ke kantor?', NULL, 5, NULL, NULL, '2024-05-09 03:06:43', '2024-05-09 03:06:43'),
(145, 'POLPKC001', 45, 'Pada HUT Bhayangkara 1 Juli 2017 rombongan Kapolri akan berkunjung ke kota Jayapur Rombongan tersebut berangkat dari Jakarta ke kota Jayapura pada pukul 07.00 dan tiba di kota Jayapura sekitar 5 jam kemudian. Jika waktu di kota Jakarta ternyata lebih cepat 1 jam dari kota Jayapura, maka pada pukul berapa tepatnya rombongan Kapolri tersebut tiba di kota Jayapura?', NULL, 2, NULL, NULL, '2024-05-09 03:06:43', '2024-05-09 03:06:43'),
