INSERT INTO `soals` (`id`, `id_paket`, `nomor_soal`, `isi_soal`, `gambar_soal`, `nomor_jawaban`, `isi_solusi`, `gambar_solusi`, `created_at`, `updated_at`) VALUES
(702, 'POLPKR001', 2, 'Saya lebih tertarik untuk mencoba hal-hal baru dibandingkan melakukan pekerjaan rutin.', NULL, 5, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(703, 'POLPKR001', 3, 'Saya lebih memilih mengekspresikan kekecewaan saya dalam bentuk gurauan daripada mengekspresikan apa adanya.', NULL, 1, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(704, 'POLPKR001', 4, 'Dalam sebuah diskusi, saya lebih memilih diam dan mengamati daripada memberikan pendapat yang belum tentu benar.', NULL, 1, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(705, 'POLPKR001', 5, 'Saat merasa marah saya memilih diam daripada keluar dari ruangan.', NULL, 1, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(706, 'POLPKR001', 6, 'Mengikuti pendapat teman tidak lebih baik dibanding pendapat sendiri dalam menyelesaikan tugas.', NULL, 5, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(707, 'POLPKR001', 7, 'Dalam menyelesaikan masalah, saya cenderung emosional daripada rasional.', NULL, 5, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(708, 'POLPKR001', 8, 'Saya akan langsung marah apabila teman saya tidak sengaja merusak buku yang dia pinjam.', NULL, 1, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(709, 'POLPKR001', 9, 'Saya bisa bertoleransi apabila ada teman yang menggunakan barang tanpa izin.', NULL, 5, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(710, 'POLPKR001', 10, 'Saat apa yang diharapkan tidak menjadi kenyataan, saya akan sangat kecewa.', NULL, 1, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(711, 'POLPKR001', 11, 'Saya sering merasa jengkel apabila ada teman yang menyela pembicaraan.', NULL, 1, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(712, 'POLPKR001', 12, 'Saya sulit menerima teguran meskipun itu dari orangtua.', NULL, 1, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(713, 'POLPKR001', 13, 'Apabila ada teman yang bercanda menyinggung perasaan, saya tidak marah.', NULL, 5, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(714, 'POLPKR001', 14, 'Ketika gagal mencapai sesuatu saya melakukan introspeksi dan memperbaiki upaya.', NULL, 5, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(715, 'POLPKR001', 15, 'Apabila ada teman yang salah memanggil nama, saya akan langsung tersinggung.', NULL, 1, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(716, 'POLPKR001', 16, 'Jika hal-hal kecil merusak rencana besar, saya dengan cepat melakukan evaluasi.', NULL, 5, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(717, 'POLPKR001', 17, 'Saya langsung menggerutu saat pulang sekolah yang tiba-tiba hujan lebat.', NULL, 1, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(718, 'POLPKR001', 18, 'Saya memaklumi apabila teman satu kelompok melakukan kesalahan.', NULL, 5, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(719, 'POLPKR001', 19, 'Saya lebih suka bercerita kepada sahabat dekat saat memiliki masalah.', NULL, 5, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(720, 'POLPKR001', 20, 'Saya meninggalkan ruangan diskusi saat terjadi perdebatan.', NULL, 1, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(721, 'POLPKR001', 21, 'Saya mengkoordinir teman-teman kelas mengumpulkan uang untuk membantu bencana tanah longsor.', NULL, 5, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(722, 'POLPKR001', 22, 'Saya enggan menjadi relawan bencana karena hal tersebut akan merepotkan.', NULL, 1, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(723, 'POLPKR001', 23, 'Ketika menolong orang lain perasaan saya biasa saja.', NULL, 1, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(724, 'POLPKR001', 24, 'Saya tidak pernah mengikuti organisasi apapun, karena hal itu membuang-buang waktu.', NULL, 1, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(725, 'POLPKR001', 25, 'Saya memilih tidur di rumah daripada mengikuti kerja bakti di lingkungan tempat tinggal.', NULL, 1, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(726, 'POLPKR001', 26, 'Mengikuti organisasi merupakan hal yang merepotkan.', NULL, 1, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(727, 'POLPKR001', 27, 'Saya akan datang takziah ke rumah duka di lingkungan tempat tinggal hanya jika disuruh oleh orangtua.', NULL, 1, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(728, 'POLPKR001', 28, 'Saya sesekali tidak mengikuti kegiatan yang diadakan di lingkungan tempat tinggal, seperti perayaan HUT RI.', NULL, 1, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(729, 'POLPKR001', 29, 'Saya menyumbangkan sebagian tabungan untuk korban bencana alam.', NULL, 5, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(730, 'POLPKR001', 30, 'Saya rutin menyumbangkan pakaian ke panti asuhan setiap akhir tahun.', NULL, 5, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(731, 'POLPKR001', 31, 'Saya mengikuti rapat di karang taruna di lingkungan tempat tinggal hanya jika ada waktu luang.', NULL, 1, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(732, 'POLPKR001', 32, 'Saya membantu mengajar TPA di masjid dekat rumah hanya jika ada waktu luang.', NULL, 1, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(733, 'POLPKR001', 33, 'Saya memberikan bantuan kepada tetangga hanya jika diminta saja.', NULL, 1, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(734, 'POLPKR001', 34, 'Saya hanya mau berteman dengan anak-anak yang cerdas.', NULL, 1, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(735, 'POLPKR001', 35, 'Saya merasa minder jika berada di antara teman-teman yang pintar.', NULL, 1, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(736, 'POLPKR001', 36, 'Saya merasa canggung dengan orang lain selain keluarga, meskipun dengan teman satu kelas.', NULL, 1, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(737, 'POLPKR001', 37, 'Saya dapat membuat topik pembicaraan yang menyenangkan meskipun di lingkungan baru.', NULL, 5, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(738, 'POLPKR001', 38, 'Saya sesekali merasa rendah diri dan tidak nyaman berada di antara para senior.', NULL, 1, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(739, 'POLPKR001', 39, 'Saya sulit untuk tidur nyenyak apabila bukan di kamar sendiri.', NULL, 1, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(740, 'POLPKR001', 40, 'Saya tidak suka makan jika bukan masakan dari ibu.', NULL, 1, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
(741, 'POLPKR001', 41, 'Saya mudah kelelahan jika mengikuti kegiatan seperti berkemah.', NULL, 1, NULL, NULL, '2024-05-09 03:06:49', '2024-05-09 03:06:49'),
