(818, 'POLTWK001', 17, 'Setiap warga negara wajib mengikuti pendidikan dasar dan pemerintah wajib  membiayainyaINSERT INTO `soals` (`id`, `id_paket`, `nomor_soal`, `isi_soal`, `gambar_soal`, `nomor_jawaban`, `isi_solusi`, `gambar_solusi`, `created_at`, `updated_at`) VALUES
(954, 'POLTPN002', 2, 'Sebuah gedung direncanakan selesai dibangun 20 hari oleh 28 pekerja. Setelah\r\ndikerjakan 8 hari, pekerjaan dihentikan selama 4 hari. Jika kemampuan bekerja setiap\r\norang sama dan supaya pembangunan selesai tepat waktu, banyak pekerja tambahan\r\nyang diperlukan adalah...', NULL, 4, NULL, '1716011837.png', '2024-05-16 21:31:59', '2024-05-17 23:24:42'),
(971, 'POLTPN002', 11, 'Penyelesaian paket-paket soal tryout direncanakan akan selesai dalam waktu 34 hari\r\noleh 4 orang pekerja. Setelah dikerjakan selama 13 hari, pekerjaan dihentikan selama\r\n7 hari karena ada sesuatu hal. Jika kemampuan bekerja setiap orang sama dan agar\r\npenyelesaian paket-paket soal selesai tepat waktu maka banyak pekerja tambahan\r\nyang dibutuhkan adalah ....', NULL, 1, 'Penyelesaian paket soal telah dikerjakan selama 13 hari sebelum ada kendala.\r\nArtinya sisa pengerjaan tinggal = 34  13 = 21 hari.<br>\r\nPenyelesaian yang harusnya selesai dalam sisa waktu 21 hari karena ada kendala\r\nselama 7\r\nhari maka artinya hanya dapat dikerjakan dalam jangka waktu = 21  7 = 14 hari.<br>\r\nKemudian,<br>\r\nMisal:<br>\r\nJika banyak pekerja yang dibutuhkan agar pekerjaan selesai dalam waktu 14 hari\r\nadalah x.<br>\r\n21 hari butuh 4 pekerja<br>\r\n14 hari butuh x pekerja<br>\r\nSemakin sedikit waktu yang tersisa maka semakin banyak pekerja yang diperlukan,\r\nsehingga permasalahan tersebut dapat diselesaikan dengan menggunakan konsep\r\nperbandingan berbalik nilai.<br>', '1716020213.png', '2024-05-17 05:49:28', '2024-05-18 02:05:13'),
(972, 'POLTPN002', 12, '13, 13, 26, 39, 65, ....', NULL, 1, 'Pola barisan tersebut adalah fibonaci\r\nJadi, suku selanjutnya adalah 39 + 65 = 104', NULL, '2024-05-17 05:57:12', '2024-05-18 02:23:22'),
(973, 'POLTPN002', 13, 'B, J, D, L, H, N, ..., ....', NULL, 5, 'Pola:<br>\r\nSuku ganjil x2<br>\r\nSuku genap +2<br>\r\nsuku selanjutnya adalah P dan P.', NULL, '2024-05-17 05:58:17', '2024-05-18 02:24:38'),
(974, 'POLTPN002', 14, NULL, '1715951168.png', 2, NULL, '1716024484.png', '2024-05-17 06:06:08', '2024-05-18 02:28:04'),
(975, 'POLTPN002', 15, 'Tes seleksi TIU diikuti oleh 7 orang peserta dengan inisial N, O, P, J, K, L, dan M. Mereka memilki nilai yang berbeda satu sama lain. Point O lebih sedikit daripada M. Point L lebih sedikit daripada P. Jika diurutkan berdasarkan point terbanyak, N berada pada urutan ketiga. Point J tepat lebih banyak daripada N. Urutan point dari terbanyak ke point paling sedikit yang mungkin adalah ....', NULL, 5, 'Karena M > O maka opsi B salah<br>\r\nKarena P > L maka opsi A salah<br>\r\nKarena J > N maka opsi C dan D salah<br>\r\nUrutan point dari yang erbanyak ke paling sedikit yang mungkin adalah P, J, N, M, L, O, K', NULL, '2024-05-17 06:11:11', '2024-05-18 02:31:50'),
(976, 'POLTPN002', 16, NULL, '1716033214.png', 3, NULL, '1716031646.png', '2024-05-17 06:17:07', '2024-05-18 04:55:26'),
(977, 'POLTPN002', 17, 'Chandra olahraga setiap 4 hari, Alvin setiap 3 hari, dan Siska setiap 8 hari. Jika merekaberolahraga bersama-sama pertama kali pada tanggal 23 Februari 2021 maka merekaakan olahraga kembali bersama-sama untuk ketiga kali pada tanggal ...', NULL, 3, 'KPK 3, 4 dan 8 adalah 24<br>\r\nMereka olahraga bersama-sama untuk kedua kali 24 hari kemudian<br>\r\nMereka olahraga bersama-sama untuk ketiga kali 48 hari kemudian,<br>\r\nyaitu 12 April 2021', NULL, '2024-05-17 06:18:57', '2024-05-18 05:10:17'),
(978, 'POLTPN002', 18, 'Harga sebuah baju dinaikan 25% dari harga sebelumnya, berapakah presentasepenurunan harga agar harga baju tersebut kembali ke harga semula?', NULL, 4, 'Asumsikan harga awal = 100%<br>\r\nHarga setelah naik = 125%<br>\r\nKita ingin mengubah dari harga 125 % ke 100%,<br>\r\nberarti gunakan rumus persentase turun, besar turunnya 25 %', '1716033607.png', '2024-05-17 06:23:51', '2024-05-18 05:00:07'),
(979, 'POLTPN002', 19, 'Tiga orang siswa A, B, dan C melakukan pinjam meminjam kelereng. Pada awalnyaketiga orang tersebut memiliki kelereng dengan jumlah yang sama. Jika A memberi 2kelereng kepada C dan B memberi 4 kelereng kepada C maka jumlah kelereng C menjadidari kelereng B, dan kelereng B menjadi 2 kurangnya dari kelereng A. Berapakahjumlah kelereng mereka bertiga mula-mula...', NULL, 1, NULL, '1716033860.png', '2024-05-17 06:25:27', '2024-05-18 05:04:20'),
(980, 'POLTPN002', 20, NULL, '1715952425.png', 5, 'Jika a = 0 dan b = 0 maka m = 0 dan n = 0 atau m = n<br>\r\nJika a = 1 dan b = 2 maka m = 1 dan n = 2 atau n ', NULL, '2024-05-17 06:27:05', '2024-05-18 05:09:13'),
(981, 'POLTPN002', 21, 'Aldy mengendarai sepeda mobil dengan kecepatan rata-rata 20 km/jam dari Jakarta ke\r\nbandung dengan jarak 87 km. dari arah yang berlawanan, Latif mengendarai motor\r\ndengan kecepatan rata-rata 25 km/jam menuju Jakarta melalui jalan yang sama. Jika Aldy\r\nberangkat pukul 05.00 dan Latif berangkat pukul 05.45. pukul berapa mereka berpapasan....', NULL, 4, NULL, '1716034336.png', '2024-05-17 08:20:17', '2024-05-18 05:12:16'),
(982, 'POLTPN002', 22, 'Sebuah keluarga memiliki beberapa anak. Jumlah anak perempuan satu lebih sedikit\r\ndibandingkan anak laki-laki. Rata-rata usia keluarga tersebut adalah 28 tahun. Jika anak\r\npaling bungsu yang berusia 4 tahun tidak diikutsertakan maka rata-rata mereka menjadi\r\n30 tahun. Maka jumlah anak laki-laki adalah ...', NULL, 1, NULL, '1716034584.png', '2024-05-17 08:22:08', '2024-05-18 05:16:24'),
(983, 'POLTPN002', 23, '1, 2, 9, 64, 625, ...,', NULL, 3, '1, 2,9, 64,625, ...,\r\nPoIa = 10,21, 32,43,...', NULL, '2024-05-17 08:23:35', '2024-05-18 05:30:08'),
