(985, 'POLTPN002', 25, 'Berat rata-rata sekelompok siswa adalah 54 kg. Berat rata-rata siswi putri dari\r\nkelompok tersebut adalah 48 kg, sedangkan berat rata-rata siswa putranya 62\r\nkg. Berapa perbandingan jumlah siswa putra dan putri pada kelompok tersebut....', NULL, 1, 'Misal:<br>\r\nPutri = x<br\r\nPutri = y<br>\r\n48x + 62y = 54(x + y)<br>\r\n48x + 62y = 54x + 54y<br>\r\n8y = 6x ', NULL, '2024-05-17 08:33:59', '2024-05-18 05:41:23'),
(986, 'POLTPN002', 26, 'Jumlah yang harus dibayar untuk satu tiket dewasa dan dua tiket anak-anak\r\nadalah Rp165.000. Jika harga sebuah tiket dewasa adalah Rp30.000 lebih\r\n\r\nmahal daripada sebuah tiket anak-anak, berapakah harga sebuah tiket anak-\r\nanak....', NULL, 4, 'Misalkan:<br>\r\nHarga tiket dewasa = x<br>\r\nHarga tiket anak - anak = y<br>\r\nHarga tiket dewasa = y + Rp 30.000<br>\r\nKalimat matematikanya menjadi:<br>\r\nx + 2 y = 165.000<br>\r\n(y + 30.000) + 2y = 165.000<br>\r\n3y + 30.000 = 165.000<br>\r\n3y = 135.000<br>\r\ny = 45.000<br>\r\njadi, harga tiket anak - anak adalah Rp 45.000', NULL, '2024-05-17 08:35:36', '2024-05-18 05:43:36'),
(987, 'POLTPN002', 27, 'Seorang anak yang tingginya 150 cm difoto dalam ukuran kecil dengan skala 1 :\r\n30. Foto tersebut kemudian ukurannya diperbesar dengan skala 4 : 1. Tinggi\r\nanak dalam foto yang terakhir adalah .....', NULL, 2, 'Tinggi sebenarnya = 150 cm, skala 1:30, maka tinggi difoto = 150 cm/30 = 5 cm.<br>\r\nDiperbesar dengan skala 4 : 1, sehingga: 4 ', NULL, '2024-05-17 08:36:53', '2024-05-18 05:46:20'),
(988, 'POLTPN002', 28, 'Usia rata-rata sekelompok orang yang terdiri atas akuntan dan pengacara\r\n\r\nadalah 40 tahun. Jika usia rata-rata para akuntan adalah 35 tahun dan usia rata-\r\nrata para pengacara adalah 5 tahun, berapakah perbandingan antara jumlah\r\nakuntan dan jumlah pengacara...', NULL, 2, 'Dengan mencoba tiap option, didaptakan perbandingan 2 : 1, sehingga jika\r\ndihitung [(2 ', NULL, '2024-05-17 08:38:17', '2024-05-18 05:45:39'),
(989, 'POLTPN002', 29, 'Mita adalah karyawan pada perusahaan tekstil yang bertugas menyimpan data\r\nkenaikan produksi selama 5 periode. Setelah dicari, Mita menemukan empat\r\ndata kenaikan, yaitu 4%, 9%, 7%, dan 5%. Satu data lagi, yaitu data ke-5. Jika\r\nMita hanya ingat bahwa rata-rata hitung dan median dari lima data tersebut\r\nadalah sama, maka kenaikan produksi yang mungkin pada periode kelima\r\nadalah berkisar antara .....', NULL, 1, 'x = (4 + 9 + 7 + 5 + y) : 5 = Me<br>\r\n5 . 1/5 = Me<br>\r\nMin . 5 + (1/5)x = 5<br>\r\nx = 5<br>\r\nMax . 5 + (1/5)x = 7<br>\r\nx = 10', NULL, '2024-05-17 08:39:30', '2024-05-18 05:47:55'),
(990, 'POLTPN002', 30, 'Sebuah perusahan penyewaan mobil mengenakan sewa Rp350.000 setiap\r\npemakaian 24 jam untuk jam pertama, ditambah Rp50.000 untuk setiap 6 jam\r\natau bagian dari 6 jam setelah 72 jam pertama. Jika sebuah mobil diambil pada\r\npukul 08.00 hari senin dan dikembalikan pada hari kamis pukul 21.45 di minggu\r\nyang sama, berapakah jumlah sewa yang harus dibayar....', NULL, 2, 'Waktu pinjam 93 jam 45 menit<br>\r\n= 72 jam + 18 jam + 3 jam 45 menit<br>\r\n= 3 (350 rb) + 3 (50 rb) ', NULL, '2024-05-17 08:41:44', '2024-05-18 05:49:03'),
(991, 'POLTPN002', 31, '<b>Bacaan berikut digunakan untuk soal no. 31  34:</b><br>\r\nAngela, Lilian, Marry dan Cindy adalah 4 orang petenis profesional yang bertanding\r\ndi Tokyo Open. Mereka bertanding satu sama lain sehingga terdapat 6 pertandingan\r\nuntuk menentukan pemenang. Setiap kali memenangkan 1 pertandingan, tiap\r\npeserta memperoleh 100 poin. Cindy dikalahkan oleh Angela, Lilian mengalahkan\r\nAngela dan Cindy, dan Marry mengalahkan Lilian, Angela dan Cindy.<br><br>\r\n31. Berapa pertandingan yang dimenangkan Lilian?', NULL, 2, 'Dari tabel terlihat bahwa pertandingan yang dimenangkan oleh Lilian adalah 2\r\npertandingan.', '1716036717.png', '2024-05-17 08:45:49', '2024-05-18 05:51:57'),
(992, 'POLTPN002', 32, '<b>Bacaan berikut digunakan untuk soal no. 31  34:</b><br>\nAngela, Lilian, Marry dan Cindy adalah 4 orang petenis profesional yang bertanding\ndi Tokyo Open. Mereka bertanding satu sama lain sehingga terdapat 6 pertandingan\nuntuk menentukan pemenang. Setiap kali memenangkan 1 pertandingan, tiap\npeserta memperoleh 100 poin. Cindy dikalahkan oleh Angela, Lilian mengalahkan\nAngela dan Cindy, dan Marry mengalahkan Lilian, Angela dan Cindy.<br><br>\n32. Siapa yang selalu kalah....', NULL, 3, 'Dengan melihat tabel tersebut, juga dapat diketahui bahwa yang tidak pernah\r\nmenang adalah Cindy.', '1716036774.png', '2024-05-17 08:49:13', '2024-05-18 05:52:54'),
(993, 'POLTPN002', 33, '<b>Bacaan berikut digunakan untuk soal no. 31  34:</b><br>\r\nAngela, Lilian, Marry dan Cindy adalah 4 orang petenis profesional yang bertanding\r\ndi Tokyo Open. Mereka bertanding satu sama lain sehingga terdapat 6 pertandingan\r\nuntuk menentukan pemenang. Setiap kali memenangkan 1 pertandingan, tiap\r\npeserta memperoleh 100 poin. Cindy dikalahkan oleh Angela, Lilian mengalahkan\r\nAngela dan Cindy, dan Marry mengalahkan Lilian, Angela dan Cindy.<br><br>\r\n33. Siapakah yang mendapat 200 poin.....', NULL, 1, 'Jika mendapat poin 200, berarti dia memenangkan pertandingan sebanyak dua\r\nkali. Maka orang yang mendapat 200 poin adalah Lilian.', '1716036812.png', '2024-05-17 08:51:53', '2024-05-18 05:53:32'),
(994, 'POLTPN002', 34, '<b>Bacaan berikut digunakan untuk soal no. 31  34:</b><br>\r\nAngela, Lilian, Marry dan Cindy adalah 4 orang petenis profesional yang bertanding\r\ndi Tokyo Open. Mereka bertanding satu sama lain sehingga terdapat 6 pertandingan\r\nuntuk menentukan pemenang. Setiap kali memenangkan 1 pertandingan, tiap\r\npeserta memperoleh 100 poin. Cindy dikalahkan oleh Angela, Lilian mengalahkan\r\nAngela dan Cindy, dan Marry mengalahkan Lilian, Angela dan Cindy.<br><br>\r\n34. Siapakah yang mendapat 200 poin.....', NULL, 2, 'Terdapat lima orang antri. Jika Q adalah anak kedua di belakang P, maka\r\nsetelah P harus ada minimal dua orang di belakangnya. Sehingga, dalam urutan\r\nsituasi apapun P berada pada urutan pertama atau urutan ketiga (karena P tidak\r\nberada pada urutan kedua).\r\nSaat P berada pada urutan pertama pada urutan ketiga adalah Q.\r\nP, ...., O,....,.... (posisi T bisa dimana saja kecuali urutan kesatu dan ketiga).\r\nSaat P berada pada urutan ketiga, urutan kelimanya adalah Q.\r\n...., ...., P, ...., Q (posisi T bisa berada dimana saja kecuali urutan ketiga dan\r\nkelima).\r\nSehingga, dalam situasi dengan syarat tersebut, T tidak bisa menempati urutan\r\nketiga.', '1716036845.png', '2024-05-17 08:53:39', '2024-05-18 05:54:05'),
