(1000, 'POLTPN002', 39, 'Nomor absen Didi berada pada urutan ke-16 dari atas dan uru-tan ke-16 dari bawah di kelasn-ya. Berapakah jumlah siswa di dalam kelas Didi...', NULL, 2, 'Didi berada pada urutan ke-16 \r\ndari atas dan urutan ke-16 dari \r\nbawah di kelasnya, maka jum-\r\nlah siswa seluruhnya adalah:<br>\r\n= 16 + 16  1<br>\r\n= 32  1<br>\r\n= 31 siswa', NULL, '2024-05-17 21:38:36', '2024-05-17 21:39:11'),
(1001, 'POLTPN002', 40, 'Dua buah pesawat terbang \r\nmeninggalkan bandara pada \r\npukul 17.00. Pesawat pertama \r\nmenuju arah timur dengan ke-\r\ncepatan 150 km/jam dan pesa-\r\nwat kedua menuju arah utara \r\ndengan kecepatan 200 km/jam. \r\nBerapa jarak antara kedua pesa-\r\nwat tersebut pada pukul 19.00 \r\njika kedua pesawat tersebut ter-\r\nbang lurus dan tanpa berhenti \r\ndengan kecepatan yang sama...', NULL, 2, 'Berangkat pukul 17.00 hingga \r\npukul 19.00, sehingga kedua \r\npesawat terbang selama 2 jam.<br>\r\nPesawat 1:<br>\r\n= 150 km/jam ', '1716007470.png', '2024-05-17 21:44:30', '2024-05-17 21:44:30'),
