(1016, 'POLTBG001', 1, '<p align=\"justify\">\r\nREADING (1- 20)<br>\r\nThe questions number 13 are based on the following passage.\r\n<br><br>\r\nIn the US, consumers spend around $700 million a year keeping their fabrics soft. In the UK people spend\r\n', NULL, 1, '<p align=\"justify\">\r\nJawaban: A\r\nSoal menanyakan gagasan utama dari teks. Untuk menentukan gagasan utama keseluruhan teks, gagasan utama dari setiap paragraf perlu dipahami terlebih dulu. Secara keseluruhan, dapat dipahami bahwa gagasan utama teks tersebut adalah sisi negatif dari penggunaan pelembut kain seperti gangguan pernafasan dan potensi kerusakan di kehidupan laut.\r\n</p>', NULL, '2024-05-18 00:04:55', '2024-05-23 15:42:02'),
