(1020, 'POLTPN002', 4, 'Harga sewa kereta dorong bayi disebuah persewaan peralatan bayi adalah Rp 150.000,00 pada bulan pertamanya. Sedangkan kelebihan seminggu berikutnya dikenai denda Rp 35.000,00. Jika suatu hari, Hana menyewa kereta bayi dan diharuskan membayar Rp 225.000,00 maka Hana menyewa kereta dorong selama.....', NULL, 5, 'Sewa 1 Bulan pertama = Rp 150.000,00<br>\r\nSewa per 1 minggu berikutnya = Rp 35.000,00<br>\r\nBiaya sewa selanjutnya = 225.000  150.000 = 105.000<br>\r\nLama sewa selanjutnya = 105.000 6 35.000 = 3 minggu<br>\r\nJadi Hana telah menyewa selama 1 bulan 3 minggu.', NULL, '2024-05-18 02:02:43', '2024-05-18 04:34:12'),
(1021, 'POLTPN002', 5, 'Sebuah pabrik makanan membutuhkan gas sebanyak 12 tabung untuk menyalakan 4 buah kompor selama 1 bulan. Untuk mengejar jumlah produksi makanan maka pabrik menambah kompor menjadi 6 buah. Jumlah tabung gas yang butuh sekarang dalam waktu 1 bulan adalah....', NULL, 2, 'Jumlah tabung gas untuk 6 kompor dalam 1 bulan adalah : x = 6/4 ', NULL, '2024-05-18 02:07:27', '2024-05-18 04:36:57'),
