(1025, 'POLTPN002', 9, 'Dari survei kesehatan usia senja terhadap 250 lansia, diperoleh 164 orang diantaranya\r\nmemiliki gejala hipertensi, 148 orang memiliki gejala rematik dan 16 orang tidak\r\nmemiliki gejala hipertensi dan gejala rematik. Berapa jumlah orang yang memiliki\r\ngejala rematik dan gejala hipertensi....', NULL, 3, NULL, '1716032536.png', '2024-05-18 02:15:33', '2024-05-18 04:42:16'),
