(1029, 'POLTWK002', 1, 'Konflik Poso yang berawal dari pertikaian antar pemuda Muslim dan Kristen terkait masalah\r\npenyegelan toko minuman alkohol terjadi pada malam Natal 24 Desember 1998 yang tertepatan\r\npada bulan Ramadhan. Pada pertikaian dua kubu tersebut, terjadi penikaman terhadap Ahmad\r\nRidwan pemuda Muslim Kelurahan Kayamanya oleh Roy Runtu Bisalemba pemuda Kristen dari\r\nLombogia. Meskipun terdapat beberapa versi baik dari kalangan Muslim dan Kristen terkait\r\nmasalah tersebut, namun dari hasil pertemuan dari para tokoh dan pemuka agama dari kedua belah\r\npihak menyepakati bahwa alkohol yang menjadi sumber masalah. Konflik yang berawal dari\r\npertikaian antara pemuda Muslim dan Kristen tersebut bertentangan dengan nilai luhur yang\r\nterkandung dalam Pancasila, yaitu sila ke ......', NULL, 3, 'Bertentangan degnan sila ketiga, Persatuan Indonesia. Lebih detail lagi adalah butiran\r\nke-1 pengalaman Pancasila yang berbunyi (1) INSERT INTO `soals` (`id`, `id_paket`, `nomor_soal`, `isi_soal`, `gambar_soal`, `nomor_jawaban`, `isi_solusi`, `gambar_solusi`, `created_at`, `updated_at`) VALUES
(1092, 'POLTPU002', 16, 'Ketentuan Anggota Kepolisian Negara republic\r\nIndonesia dalam menjalani Tugas sehari hari\r\ndilengkapi oleh surat tugas yang ditanda tangani\r\npejabat kepolisan yang mana hal tersebut sesuai\r\nPeraturan Pemerintah yaitu....', NULL, 3, 'Ketentuan Anggota Kepolisian Negara republic\r\nIndonesia dalam menjalani Tugas sehari hari\r\ndilengkapi oleh surat tugas yang ditanda tangani\r\npejabat kepolisan yang mana hal tersebut sesuai\r\nPeraturan Pemerintah yaitu PP No 80 Tahun 2012 tentang Tata Cara Pemeriksaan Kendaraan Bermotor Di Jalan Dan Penindakan Pelanggaran Lalu Lintas Dan Angkutan Jalan', NULL, '2024-05-20 23:28:05', '2024-05-20 23:28:05'),
(1093, 'POLTWK002', 41, 'Panitia kecil perumus Piagam Jakarta yang kemudian disebut panitia Sembilan, berjumlah Sembilan orang. Tokoh-tokoh tersebut diantaranya ....', NULL, 4, 'Salah satu tokoh panitia sembilan adalah Ahmad Subardjo. Tokoh yang lain:\r\n1. Ir. Soekarno<br>\r\n2. Moh. Hatta<br>\r\n3. A. A. Maramis<br>\r\n4. Wachid Hasyim<br>\r\n5. Abi Kusumo Cokrosuyoso<br>\r\n6. H. Agus Salim<br>\r\n7. Abdul Kahar Muzakir<br>\r\n8. Muh. Yamin', NULL, '2024-05-21 17:30:26', '2024-05-21 17:30:26'),
(1094, 'POLTWK002', 42, 'Penculikan atau pengamanan Soekarno dan Hatta ke Rengasdengklok dibawah pimpinan ....', NULL, 2, 'Penculikan Soekarno/Hatta ke Rengasdengklok dibawah pimpinan Sukarni. Hal ini merupakan hasil kesepakatan dalam rapat golongan pemuda di Lembaga Bakteriologi di Pegangsaan Timur, Jakarta', NULL, '2024-05-21 17:38:11', '2024-05-21 17:38:11'),
(1095, 'POLTWK002', 43, 'Surat kabar pertama yang terbit di Bandung dan Surabaya yang menyiarkan berita proklamasi adalah ....', NULL, 1, 'Surat kabar yang pertama kali mem-beritakan tentang proklamasi adalah surat kabar Tjahaja, Bandung dan Soeara Asia, Surabaya', NULL, '2024-05-21 17:45:32', '2024-05-21 17:45:32'),
(1098, 'POLTWK002', 45, 'Kasus yang menimpa seseorang ketika tidak memiliki kewarganegaraan (apatride) \r\nterjadi ketika...', NULL, 1, 'Berasal dari negara yang menganut asas ius soli dan melahirkan di negara yang menganut \r\nasas ius sanguinis.\r\nKeterangan:<br>\r\n\" Ius sanguinis adalah asas kewarganegaraan yang ditentukan berdasarkan pada \r\nketurunan. Asas ini mengikuti kewarganegaraan orang tuanya tanpa memperhatikan \r\ndimana orang tersebut lahir.<br>\r\n\" Ius soli adalah asas kewarganegaraan berdasarkan asas kedaerahan/tempat kelahiran.\r\nAsas ini tidak terpengaruh oleh kewarganegaraan orang tuanya, tetapi tempat dimana \r\nia dilahirkan.', NULL, '2024-05-21 19:12:32', '2024-05-21 19:12:32'),
(1099, 'POLTWK002', 46, 'Belanda mengakui secara de facto wilayah Indonesia atas Sumatera, Jawa, Madura merupakan isi perjanjian ....', NULL, 3, 'Belanda mengakui secara de facto wilayah Indonesia atas Sumatera, Jawa, Madura merupakan bagian dari isi perjanjian Linggarjati', NULL, '2024-05-21 20:00:27', '2024-05-21 20:00:27'),
(1100, 'POLTWK002', 47, 'Sebuah konflik atau pergolakan di Indonesia yang berkaitan dengan ideologi adalah ....', NULL, 2, 'Pergolakan di Indonesia yang berkaitan dengan ideologi adalah:<br>\r\n1. Pemberontakan PKI Madiun 1948<br>\r\n2. DI/TII<br>\r\n3. Pemberontakan G 30 S/PKI', NULL, '2024-05-21 20:03:02', '2024-05-21 20:06:45'),
(1101, 'POLTWK002', 48, 'PDRI di Sumatera Barat lahir dilatarbelakangi oleh peristiwa ....', NULL, 3, 'PDRI, Pemerintahan Darurat Republik Indonesia lahir saat terjadi Agresi Militer Belanda II. Pada waktu itu semua pimpinan RI ditawan oleh Belanda. Maka Soekarno mengirim kawat kepada Syafruddin Prawiranegara untuk membentuk pemerintahan darurat di Bukittinggi, Sumatera Barat', NULL, '2024-05-21 20:05:53', '2024-05-21 20:05:53'),
(1102, 'POLTWK002', 49, 'Setelah mendapat pengakuan kedaulatan dari Belanda, Indonesia kembali ke negara kesatuan pada ....', NULL, 3, 'Setelah mendapat pengakuan kedaulatan dari Belanda dalam bentuk Republik Indonesia Serikat (RIS) pada tanggal 27 Desember 1949, Indonesia kembali ke bentuk negara kesatuan pada tanggal 17 Agustus 1950. Dan konstitusi yang digunakan adalah UUDS 1950. Indonesia menganut sistem Demokrasi Liberal/ Parlementer', NULL, '2024-05-21 20:10:11', '2024-05-21 20:10:11'),
(1103, 'POLTWK002', 50, 'Untuk sementara waktu, pasca proklamasi pemerintah menetapkan tiga mata uang sekaligus, yaitu.....', NULL, 3, 'Setelah merdeka, pemerintah mene- tapkan tiga mata uang sekaligus, yaitu:<br>\r\n1. Mata uang de Javasche Bank<br>\r\n2. Mata uang pemerintah Kolonial<br>\r\nBelanda\r\n3. Mata uang pendudukan Jepang', NULL, '2024-05-21 20:13:40', '2024-05-21 20:13:40'),
(1104, 'POLTWK002', 22, 'Pemerintah Orde Baru melakukan penyimpangan yang mendasar terhadap UUD 1945 yaitu lahirnya produk hukum yang memberikan peluang terhadap aparatur negara untuk melakukan...', NULL, 3, 'Pemerintah Orde Baru melakukan\r\npenyimpangan yang mendasar\r\nterhadap UUD 1945 yaitu lahirnya\r\nproduk hukum yang memberikan\r\npeluang terhadap aparatur negara\r\nuntuk melakukan: korupsi, kolusi\r\ndan nepotisme (KKN).', NULL, '2024-05-21 23:24:42', '2024-05-21 23:24:42'),
(1105, 'POLTWK002', 44, 'Penyimpangan yang dilakukan oleh orde lama terhadap UUD 1945 adalah ...', NULL, 3, 'Penyimpangan yang dilakukan oleh orde lama terhadap UUD 1945 adalah: Monopoli disegala bidang kehidupan yang berkuasa', NULL, '2024-05-21 23:35:14', '2024-05-21 23:35:14'),
(1106, 'POLTPU002', 17, 'Sebagai realisasi janjinya akan kemerdekaan Indonesia, Jepang membentuk suatu badan yang bertugas menyelidiki bahan penting persiapan kemerdekaan Indonesia pada tanggal 1 Maret 1945. Badan tersebut adalah ....', NULL, 2, 'Untuk merealisasikan janjinya akan Kemerdekaan Indonesia, pemerintah Jepang pada tanggal 1 Maret 1945 membentuk suatu badan, yaitu Badan Penyelidik Usaha-Usaha Persiapan Kemerdekaan Indonesia (BPUPKI) atau Dokuritsu Junbi Cosakai.....', NULL, '2024-05-22 18:40:49', '2024-05-23 01:31:19'),
(1107, 'POLTPU002', 18, 'Jepang menyerah kepada sekutu pada tanggal ....', NULL, 1, 'Jepang menyerah kepada sekutu pada 14 Agustus 1945 yang disampaikan Kaisar Hirohito. Hal ini setelah Jepang mendapat serangan bom atom dari Sekutu pada tanggal 6 dan 9 Agustus 1945', NULL, '2024-05-23 01:36:15', '2024-05-23 01:36:15'),
(1108, 'POLTPU002', 19, 'Pembacaan teks proklamasi dilakukan di ....', NULL, 2, 'Pembacaan naskah Proklamasi dilakasanakan di kediaman Ir. Soekarno, Jl. Pegangsaan Timur 56 Jakarta', NULL, '2024-05-23 01:42:46', '2024-05-23 01:42:46'),
(1109, 'POLTPU002', 20, 'Yang diangkat sebagai Kepala Staf Umum TKR adalah ....', NULL, 1, 'Pertempuran Ambarawa merupakan pertempuran antara rakyat Indonesia dengan tentara Sekutu', NULL, '2024-05-23 01:46:47', '2024-05-23 01:46:47'),
(1110, 'POLTPU002', 21, 'Turunnya Soeharto dari jabatan Presiden Indonesia ditandai dengan pidato pengunduran dirinya yang berlangsung pada tanggal....', NULL, 3, 'Kebijakan politik Orde Baru yang dianggap melanggar HAM adalah pembatasan partai politik peserta pemilu, yang hanya berjumlah 3 partai politik yang berkuasa, sedangkan adanya partai-partai kecil belum diakui oleh negara.', NULL, '2024-05-23 01:57:15', '2024-05-23 01:57:15'),
(1111, 'POLTPU002', 22, 'Ketua PSSI yang terpilih setelah Kongres Luar Biasa PSSI pada 16 Februari 2023 adalah &', NULL, 2, 'Cukup  Jelas', NULL, '2024-05-23 04:56:43', '2024-05-23 04:56:43'),
(1112, 'POLTPU002', 23, 'Tarian yang berasal dari suku Dayak Kenyah dari di Kalimantan Timur yang menceritakan tentang turunnya nenek moyang mereka ke bumi dikenal dengan tarian', NULL, 4, 'Tari Paksa Kembang: Banjar, Kalsel<br>\r\nTari Belian: Daya, Kaltim<br>\r\nTari Kancet Papatai: Dayak Kenyah', NULL, '2024-05-23 05:01:20', '2024-05-23 05:01:20'),
(1113, 'POLTPU002', 24, 'Di dalam Pasal 34 (1) UU Kepolisian, dinyatakan bahwa INSERT INTO `soals` (`id`, `id_paket`, `nomor_soal`, `isi_soal`, `gambar_soal`, `nomor_jawaban`, `isi_solusi`, `gambar_solusi`, `created_at`, `updated_at`) VALUES
(2009, 'PNSSKD001', 17, 'Tekad, sikap dan perilaku, serta tindakan warga negara, baik secara perseorangan maupun kolektif dalam\nmenjaga kedaulatan negara, keutuhan wilayah, dan keselamatan bangsa dan negara, yang dijiwai oleh\nkecintaannya kepada NKRI yg berdasarkan Pancasila & UUD 1945 dalam menjamin kelangsungan hidup\nbangsa dan negara dari ancaman.<br>\nMerupakan pengertian dari . .', NULL, 3, 'Pembahasan: Indikator dalam soal ini berkaitan dengan bela negara.<br>\r\n- Opsi A salah karena telah jelas bahwa dalam pernyataan tersebut nasionalisme\r\n(cinta tanah air) menjadi salah satu bagian dalam implementasi sikap yang\r\ndimaksud.<br>\r\n- Opsi B salah karena Pilar Negara di dalamnya mencakup nilai Pancasila, UUD\r\n1945, NKRI dan juga Bhinneka Tunggal Ika<br>\r\n- Opsi C Benar karena sesuai dengan UU No.23 Tahun 2019 pernyataan tersebut\r\nmerupakan pengertian dari bela negara.<br>\r\n- Opsi D salah karena pariotisme termasuk dalam salah satu komponen sikap yang\r\ntertulis dalam pernyataan soal tersebut.<br>\r\n- Opsi E salah karena integritas mencerminkan sikap kejujuran, kepedulian,\r\ntanggung jawab terhadap manajemen dan lain sebagainya.', NULL, '2024-07-20 03:55:58', '2024-07-20 03:55:58'),
(2011, 'PNSSKD001', 18, 'Pernahkah kalian mendengar nama Herman Johannes? Kalau belum pernah\r\nmendengarnya, akan aku ceritakan sedikit tentang kisahnya. Herman Johannes berasal\r\ndari Kepulauan Rote, Nusa Tenggara Timur. Selama menempuh pendidikan, ia tidak\r\nhanya rajin belajar, namun juga aktif berorganisasi. Saat kampusnya ditutup sementara,\r\nPak Jo sapaannya tetap belajar dan sudah dipercaya mengajar di beberapa Sekolah\r\nMenengah Tinggi di Jakarta, Sekolah Tinggi Kedokteran, dan Akmil Yogyakarta. Setelah\r\nIndonesia merdeka, Belanda menunjukkan sikapnya untuk kembali lagi menjajah\r\nIndonesia. Para pejuang bangsa berusaha mempertahankan kemerdekaan Indonesia,\r\ntermasuk Pak Jo. Pak Jo bergerak menyelamatkan bahan-bahan peledak peninggalan\r\nJepang yang ada di beberapa gudang penyimpanan. Berkat pengetahuan tentang\r\nfisika dan kimia, Pak Jo seringkali dimintai bantuan untuk merakit senjata api,\r\nmembuat detonator serta alat peledak oleh para pejuang muda. Seiring berjalannya\r\nwaktu, Pak Jo berhasil memproduksi berbagai macam bahan peledak seperti bom asap\r\ndan granat. Pengetahuannya tentang bom pun diuji, pada 19 Desember 1948, Pak Jo\r\ndiminta untuk memasang bom di jembatan kereta api Sungai Progo oleh Letkol\r\nSoeharto. Berdasarkan penggalan cerita di atas, nilai integritas yang dimiliki oleh\r\nHerman Johannes adalah....', NULL, 2, 'Berdasarkan penggalan cerita di atas, nilai integritas yang dimiliki oleh Herman Johannes\r\nadalah berani menggunakan ilmu yang dimiliki untuk melakukan upaya bela negara.', NULL, '2024-07-20 04:01:06', '2024-07-20 04:01:06'),
(2012, 'PNSSKD001', 19, 'Salah satu ciri globalisasi adalah tidak ada batas yang jelas antara dua negara dimana\r\nglobalisasi telah mendekatkan yang jauh dan menjauhkan yang dekat. Sebagai negara\r\nyang memiliki ideologi terbuka, sudah menjadi hal pasti kita merasakan dampak dari\r\nglobalisasi. Berikut ini sikap yang bijak dalam menghadapi globalisasi adalah....', NULL, 4, 'Berikut ini sikap yang bijak dalam menghadapi globalisasi adalah Menerimanya sebagai\r\nancaman negara sehingga perlu mempertahankan kepribadian bangsa.', NULL, '2024-07-20 04:03:09', '2024-07-20 04:03:09'),
(2013, 'PNSSKD001', 20, 'Apabila negara kita mendapatkan ancaman militer, sikap yang tepat dilakukan oleh\r\nwarga negara sebagai perwujudan bela negara adalah....', NULL, 3, 'Apabila negara kita mendapatkan ancaman militer, sikap yang tepat dilakukan oleh warga\r\nnegara sebagai perwujudan bela negara adalah Bersatu padu dengan seluruh komponen\r\nmasyarakat mengusir penjajah.', NULL, '2024-07-20 04:05:18', '2024-07-20 04:05:18'),
(2014, 'PNSSKD001', 21, 'Salah satu faktor yang menyebabkan menurunnya sikap bela negara pemuda Indonesia\r\nadalah pemahaman bela negara yang hanya dicerminkan dalam hal mengangkat\r\nsenjata. Padahal, dalam kondisi seperti sekarang ini bela negara dapat diwujudkan\r\ndalam beberapa hal. Berdasarkan UUD 1945 pasal 30 ayat 1, perilaku yang dapat\r\ndiwujudkan adalah....', NULL, 4, 'Berdasarkan UUD 1945 pasal 30 ayat 1, perilaku yang dapat diwujudkan adalah Luky mengikuti\r\nekstrakurikuler pramuka di sekolah.', NULL, '2024-07-20 04:07:26', '2024-07-20 04:07:26'),
(2015, 'PNSSKD001', 22, 'Demo yang terjadi belum lama ini meresahkan masyarakat. Bagaimana tidak, disaat\r\npemerintah menggembor-gemborkan PPKM, pengurangan kerumunan, namun aliansi\r\nBEM dari seluruh Indonesia melakukan demonstrasi. Demo tersebut diisinyalir terkait\r\ndengan pemecatan 57 pegawai KPK yang tidak lulus Tes Wawasan Kebangsaan.\r\nPadahal, sebenarnya mahasiswa bisa melakukan audiensi dengan pemerintah secara\r\nbaik-baik tanpa harus menggunakan cara demonstrasi. Tindakan yang dilakukan oleh\r\nmahasiswa tersebut bertentangan dengan Pancasila khususnya sila ke....', NULL, 4, 'Tindakan yang dilakukan oleh mahasiswa tersebut bertentangan dengan Pancasila khususnya\r\nsila ke-4. Hal ini sesuai butir mengutamakan musyawarah dalam mengambil keputusan untuk\r\nkepentingan bersama.', NULL, '2024-07-20 04:10:37', '2024-07-20 04:10:37'),
(2016, 'PNSSKD001', 23, 'Di negara demokrasi seperti di Indonesia, kebebasan berpendapat dilindungi Undang-\r\nundang. Meskipun demikian, dalam berpendapat harus menerapkan prinsip kebebasan yang bertanggung jawab, artinya....', NULL, 4, 'Meskipun demikian, dalam berpendapat harus menerapkan prinsip kebebasan yang\r\nbertanggung jawab, artinya Kebebasan berpendapat harus memperhatikan norma dan aturan\r\nyang berlaku di Indonesia.', NULL, '2024-07-20 04:12:37', '2024-07-20 04:12:37'),
(2017, 'PNSSKD001', 24, 'Dalam pelaksanaan pembangunan di Indonesia harus memenuhi prinsip yang telah\r\nada. Salah satunya adalah pembangunan tidak boleh merugikan kepentingan umum.\r\nMisalnya saja, jika akan dibangun lapangan golf di wilayah pesisir. Padahal wilayah\r\npesisir merupakan tempat permukiman para nelayan. Selain itu, pembangunan\r\nlapangan golf juga dapat memberikan dampak negatif bagi lingkungan. Hal ini\r\nbertentangan dengan sila Pancasila yang berlambangkan....', NULL, 2, 'Selain itu, pembangunan lapangan golf juga dapat memberikan dampak negatif bagi\r\nlingkungan. Hal ini bertentangan dengan sila Pancasila yang berlambangkan Padi dan kapas.\r\nHal ini sesuai butir menghormati hak orang lain.', NULL, '2024-07-20 04:14:04', '2024-07-20 04:14:04'),
(2018, 'PNSSKD001', 25, 'Valentinus adalah mahasiswa asal Papua yang ingin melanjutkan studinya di Pulau Jawa, khususnya di\r\nUniversitas Gadjah Mada Yogyakarta. Setelah sampai disana, selama seminggu ia mengalami perlakuan yang\r\ntidak menyenangkan berbalut rasisme yang membuatnya merasa sedih dan marah.', NULL, 1, 'Dalam teks dijelaskan terkait perilaku yang tidak menyenangkan kepada Valentinus.\r\nYaitu perlakuan Rasisme dan Diskriminatif yang membuat dia sedih dan marah,\r\nPerilaku seperti ini tentu menyimpang daripada pengamalan sila yang ke-2<br>\r\nCara Cepat :<br>\r\n1. Memanusiakan Manusia<br>\r\n2. Hubungan Manusia', NULL, '2024-07-20 04:17:27', '2024-07-20 04:17:27'),
(2019, 'PNSSKD001', 26, 'Bacalah tulisan berikut, kemudian jawablah soal-soal yang tersedia dengan memilih jawaban\r\nyang tepat di antara pilihan jawaban A, B, C, D atau E. <br>\r\nPernahkah Anda bertanya-tanya, mengapa rambut hanya tumbuh di kepala dan beberapa tempat lainnya. Sementara itu, pada telapak tangan dan telapak kaki tak ada satu pun rambut yang tumbuh. Menurut para ilmuan, ini dikarenakan oleh adanya molekul khusus di tubuh kita\r\nyang menghalangi pertumbuhan rambut. Molekul khusus ini protein bernama Dickkopf 2 (DKK2)\r\nyang secara efektif merusak jalur WNT, bagian yang bertanggung jawab untuk memicu\r\npertumbuhan rambut di tubuh kita. Hal ini diungkapkan oleh para ilmuan dari University of\r\nPennsylvania School of Medicine yang percaya bahwa dalam konsep evolusi, hewan-hewan\r\ntertentu telah mengembangkan protein DKK2 ini pada bagian-bagian tertentu di tubuh mereka\r\ndengan tujuan membantu makhluk bertahan hidup.<br><br>\r\nGagasan utama pada paragraf tersebut adalah…', NULL, 1, 'Gagasan utama adalah dasar dari pengembangan paragraf,\r\npada pembahasan bacaan di atas memiliki gagasan tentang pertumbuhan\r\nrambut di tubuh manusia karena pembahasan keseluruhan mengenai\r\npertumbuhan rambut pada tubuh.', NULL, '2024-07-20 04:51:48', '2024-07-26 17:45:21'),
(2020, 'PNSSKD001', 27, 'Bacalah tulisan berikut, kemudian jawablah soal-soal yang tersedia dengan memilih jawaban\r\nyang tepat di antara pilihan jawaban A, B, C, D atau E.<br> \r\n          Kebudayaan sudah menjadi darah daging bagi identitas bangsa, dimana kebudayaan tidak hanya dilihat\r\ndari sisi fisiknya sebagai suatu bentuk keindahan saja tetapi lebih dari itu adalah nilai-nilai filosofis yang\r\nterkandung di dalamnya. Seiring berjalannya waktu ditambah dinamika peradaban yang bergerak begitu cepat,\r\nmaka mau tidak mau, siap tidak siap kita akan dihadapkan pada keadaan dimana eksistensi kebudayaan di\r\ntengah-tengah prikehidupan masyarakat mengalami proses pengikisan, entah dari segi fisiknya maupun nilai-\r\nnilai filosofis yang mengakar di dalam kebudayaan yang ada. Eksistensi kebudayaan semakin mengalami\r\npengikisan di tengah-tengah kehidupan masyarakat. Terlebih pada masa kini dengan kemajuan komunikasi\r\nglobal dan meningkatnya hubungan antar budaya, menimbulkan pemikiran dan kesadaran bahwa di balik\r\nkeragaman .... timbul berbagai kekuatan dan kekayaan budaya hingga timbulnya berbagai permasalahan\r\nsosial. Hal ini berdasarkan adanya perbedaan pendapat yang memandang keragaman budaya sebagai sesuatu\r\nyang positif, sedangkan ada pula yang menganggap perbedaan budaya tersebut akan mengakibatkan hilangnya\r\nrasa kemanusiaan dan menjadi akar berbagai konflik.<br><br>\r\nJika dilihat dari kalimat utamanya, paragraf tersebut termasuk kedalam paragraf ..', NULL, 2, 'Paragraf tersebut termasuk dalam paragraf deduktif karena kalimat\r\nutamanya terdapat pada awal paragraf.', NULL, '2024-07-20 04:54:31', '2024-08-06 23:39:52'),
(2021, 'PNSSKD001', 28, 'Di bawah ini kalimat efektif yang benar adalah....', NULL, 5, 'Di bawah ini kalimat efektif yang benar:<br>\r\n<ul>- Mari kita semua saling membantu\r\nmembersihkan halaman sekolah <br>\r\n- Meskipun sakit, Ari tetap belajar dengan giat<br>\r\n- Saya mandi sebelum sarapan<br>\r\n- Para pejabat negara seharusnya dapat hidup sederhana<br>\r\n- Para peserta rapat dipersilahkan masuk ke dalam ruangan</ul>', NULL, '2024-07-20 04:58:39', '2024-07-21 03:44:04'),
(2022, 'PNSSKD001', 29, 'Penggunaan kalimat baku yang tepat ditunjukkan pada kalimat....', NULL, 1, 'Penggunaan kalimat baku yang tepat ditunjukkan pada kalimat....<br>\r\n- Sumilir saat ini menjadi salah satu desa wisata di Kabupaten Purbalingga yang patut\r\ndikunjungi<br>\r\n- Rencana ini masih tentatif sekali, masih jauh dari kata pasti<br>\r\n- Queen harus mendapatkan pengawasan ekstra ketika di rumah sendirian<br>\r\n- Nana mengambil jurusan Teknik Sipil di Universitas Sebelas Maret<br>\r\n- Komoditas Desa Pratin adalah sayur mayur', NULL, '2024-07-20 05:02:09', '2024-07-20 05:02:09'),
(2023, 'PNSSKD001', 30, '<b>Perhatikan wacana berikut ini!</b><br>\r\nBantuan rumah tidak layak huni diperuntukan kepada masyarakat miskin yang belum\r\nmemiliki tempat tinggal dalam kondisi yang layak. Bantuannya berupa bahan\r\nbangunan senilai dua puluh juta. Masyarakat yang menerima bantuan tersebut harus\r\nmenyediakan uang sendiri untuk membiayai pembanguman perbaikan rumahnya. Tak\r\nsedikit yang tidak mau diberi bantuan ini, karena tidak memiliki biaya untuk membayar\r\ntukang. Perbaikan kata yang tepat pada wacana di atas adalah....', NULL, 4, 'Perbaikan kata yang tepat pada wacana di atas adalah penghilangan tanda koma sebelum\r\nkarena.', NULL, '2024-07-20 05:04:50', '2024-07-26 17:46:34'),
(2024, 'PNSSKD001', 31, 'Bola : Gelinding = ....', NULL, 1, 'Bola bergerak dengan menggelinding, maka kincir bergerak dengan berputar.', NULL, '2024-07-21 00:37:04', '2024-08-20 06:38:55'),
(2025, 'PNSSKD001', 32, 'Pandir : Bodoh = ....', NULL, 2, 'Pandir sama artinya dengan bodoh, maka bagak sama artinya dengan sombong.', NULL, '2024-07-21 00:39:26', '2024-07-21 00:39:26'),
(2026, 'PNSSKD001', 33, 'Pola kalimat Sekolah kami mendapat predikat sekolah bersih terdapat juga dalam kalimat…', NULL, 1, 'Pola kalimat pada “Sekolah kami mendapat predikat sekolah bersih” adalah Sekolah kami sebagai Subjek, mendapat sebagai Predikat, predikat sebagai Objek, sekolah bersih sebagai Keterangan.', NULL, '2024-07-21 00:43:05', '2024-07-21 00:43:05'),
(2027, 'PNSSKD001', 34, 'Bangir : Pesek = ....', NULL, 3, 'Bangir lawan katanya pesek, maka las lawan katanya bubut.', NULL, '2024-07-21 00:47:01', '2024-07-21 00:47:01'),
(2028, 'PNSSKD001', 35, 'Sebelum mendirikan pabrik itu, Pak Yono adalah seorang tukang ojek di desanya.\r\nKalimat yang memiliki pola sama dengan kalimat tersebut adalah …', NULL, 2, 'Pola kalimat pada “Sebelum mendirikan pabrik itu, Pak Yono adalah seorang tukang ojek di desanya” adalah Sebelum mendirikan pabrik itu sebagai Keterangan, Pak Yono sebagai Subjek, adalah sebagai Predikat, seorang tukang ojek sebagai Pelengkap, di desanya sebagai Keterangan.', NULL, '2024-07-21 00:54:23', '2024-07-21 00:54:23'),
(2029, 'PNSSKD001', 36, 'Jika mendapat tunjangan hari raya, maka Luki membagikan uang kepada saudaranya. Jika Luki\r\nmembagikan uang kepada saudaranya maka ia harus pulang kampung. Kesimpulan ....', NULL, 1, 'Jika mendapat tunjangan hari raya, maka <s>Luki membagikan uang kepada saudaranya</s>. <s>Jika Luki\r\nmembagikan uang kepada saudaranya</s> maka ia harus pulang kampung. Kesimpulan jika mendapat\r\ntunjangan hari raya maka Luki harus pulang kampung', NULL, '2024-07-21 01:00:52', '2024-07-21 01:03:58'),
(2030, 'PNSSKD001', 37, 'Tidak ada anak kembar yang sama persis. Naya dan Nandika adalah anak kembar, maka ....', NULL, 4, 'Tidak ada anak kembar yang sama persis. Naya dan Nandika adalah anak kembar, maka Naya dan Nandika tidak sama persis', NULL, '2024-07-21 01:07:02', '2024-07-21 01:07:02'),
(2031, 'PNSSKD001', 38, 'Tidak ada satupun dosen di kampus X yang tidak lulus S2. Mahardika dosen di kampus X. Maka ....', NULL, 3, 'Tidak ada satupun dosen di kampus X yang tidak lulus S2. Mahardika dosen di kampus X. Maka\r\nMahardika lulus S2', NULL, '2024-07-21 01:08:41', '2024-07-21 01:08:41'),
(2032, 'PNSSKD001', 39, 'Semua siswa yang rajin belajar akan mendapatkan nilai yang baik. Siswa yang mendapatkan nilai yang baik biasanya akan diterima di perguruan tinggi pilihan. Ali adalah seorang siswa yang rajin belajar.\r\nKesimpulan yang tepat adalah ..', NULL, 3, 'Silogisme : <br>\r\nPremis 1 : p → q <br>\r\nPremis 2 : q → r  <br>\r\n               ∴  p → r <br>\r\nPremis 3 : p       <br>\r\n               ∴  r <br>\r\n<br>\r\nPremis 1 : Semua siswa yang rajin belajar akan mendapatkan nilai yang baik. <br>\r\np = Semua siswa yang rajin belajar <br>\r\nq = akan mendapatkan nilai yang baik. <br>\r\n<br>\r\nPermis 2 : Siswa yang mendapatkan nilai yang baik biasanya akan diterima di perguruan tinggi pilihan.<br>\r\nq = Siswa yang mendapatkan nilai yang baik<br>\r\nr = diterima di perguruan tinggi pilihan<br>', NULL, '2024-07-21 01:13:30', '2024-07-21 07:06:15'),
(2033, 'PNSSKD001', 40, 'Tidak satupun tumbuhan yang tidak memiliki akar. Bakau tumbuhan yang hidup di air. Maka ....', NULL, 5, 'Tidak satupun tumbuhan yang tidak memiliki akar. Bakau tumbuhan yang hidup di air. Maka Tidak\r\ndapat ditarik kesimpulan.', NULL, '2024-07-21 01:15:05', '2024-07-21 01:15:05'),
(2034, 'PNSSKD001', 41, 'Sebuah tim peneliti akan mengikuti konferensi di Kota X yang hanya dapat dijangkau melalui pesawat. Ada penerbangan langsung dari Kota Y ke Kota X. Namun, ada alternatif jalur lain yang lebih hemat. Ada penerbangan dari Kota Y ke Kota Z, dan dari Kota Z ada penerbangan menuju Kota W atau Kota V. Sementara itu, dari Kota Y ada penerbangan menuju Kota U, dan dari Kota U ada penerbangan menuju Kota X. Berapa banyak jalur yang bisa diambil oleh tim peneliti dari Kota Y ke Kota X?', NULL, 3, 'Diberikan bahwa:<br>\r\n\r\n• Dari Kota Y, ada penerbangan langsung ke Kota X. <br>\r\n• Juga dari Kota Y, ada penerbangan ke Kota U.<br>\r\n• Dari Kota U, ada penerbangan ke Kota X.<br>\r\n• Dari Kota Y, ada penerbangan ke Kota Z.<br>\r\n• Dari Kota Z, ada penerbangan ke Kota W dan Kota V.<br><br>\r\nJadi, jalur-jalur yang bisa diambil dari Kota Y ke Kota X adalah sebagai berikut:<br>\r\n1) Jalur langsung dari Kota Y ke Kota X.<br>\r\n2) Jalur dari Kota Y ke Kota U, lalu dari Kota U ke Kota X.<br><br>\r\nSehingga, jumlah jalur yang bisa diambil adalah 2.', NULL, '2024-07-21 01:42:18', '2024-07-21 01:42:18'),
(2035, 'PNSSKD001', 42, '<b>Perhatikan bacaan di bawah ini!</b><br>\r\nEmpat orang anak duduk di hadapan meja persegi. Masing-masing anak duduk di sisi-sisi meja,\r\nsedang menunggu antren yang bernomor 17, 21, 29 dan 32. Mereka adalah Bety, Brisia, Belinda\r\ndan Bianka dengan ketentuan sebagai berikut : <br>\r\n- Pemilk nomor antrean paling kecil duduk berhadapan dengan nomor antrean paling besar<br>\r\n- Bety tidak mau duduk di sebelah Bianka<br>\r\n- Nomor antrean Bianka lebih dulu dali Belinda, tetapi tidak lebih dulu dari Brisia<br>\r\n- Bety dipanggil sebelum Belinda, dan tidak lebih dulu dari Bianka<br><br>\r\nSiapa yang paling pertama dipanggil?', NULL, 1, NULL, '1727345506.png', '2024-07-21 02:52:31', '2024-09-26 02:11:46'),
(2036, 'PNSSKD001', 43, 'Siapa yang duduk di depan Brisia?', NULL, 1, 'Belinda', NULL, '2024-07-21 02:55:48', '2024-07-21 02:55:48'),
(2037, 'PNSSKD001', 44, 'Pemilik nomor antrean 29 adalah ....', NULL, 5, 'Bety antrian 29', NULL, '2024-07-21 02:57:43', '2024-07-21 02:57:43'),
(2038, 'PNSSKD001', 45, 'Rafiq ingin mengunjungi rumah sahabatnya di jalan E. Dia berangkat dari rumahnya yang berada di jalan A menggunakan sepeda. Rafiq bisa melewati satu jalan yang bisa langsung sampai ke rumah sahabatnya, namun terdapat banyak lubang besar di jalan tersebut yang akan membahayakan keselamatannya. Ada jalur alternatif yang lebih rata karena telah diaspal yaitu rute dari jalan A ke jalan B atau ke jalan C. Dari jalan B ada rute ke jalan D. Dari jalan C ada rute langsung menuju jalan E. Rute dari jalan D bisa langsung menuju jalan E. Berapa banyak jalur yang bisa ditempuh oleh Rafiq dari rumahnya di jalan A menuju rumah sahabatnya di jalan E?', NULL, 3, '<b>1. Rute langsung dengan resiko lubang besar :</b> Rafiq langsung dari jalan A ke jalan E.<br>\r\n<b>2. Rute melalui jalan B :</b> Rafiq dari jalan A ke jalan B, lalu dari jalan B ke jalan D, dan terakhir dari jalan D ke jalan E.<br>\r\n<b>3. Rute melalui jalan C:</b> Rafiq dari jalan A ke jalan C, langsung ke jalan E. <br>Maka, terdapat 3 jalur yang dapat ditempuh oleh Rafiq dari rumahnya di jalan A menuju rumah sahabatnya di jalan', NULL, '2024-07-21 03:03:30', '2024-09-26 02:14:28'),
(2039, 'PNSSKD001', 46, '2, 20 × 0, 75 + <sup>3</sup>/<sub>5</sub> ÷ <sup>1</sup>/<sub>8</sub> = …', NULL, 5, '<p>Untuk mengerjakan soal seperti diatas dengan cepat, dapat digunakan Konsep\r\nPerkiraan, namun sebelum masuk ke dalam konsep tersebut, ada sebuah aturan yang\r\nharus dipahami terlebih dahulu yaitu Urutan Bilangan dimana proses hitung didahulukan\r\nsecara berurutan mulai dari :</p><br><br>\r\n , × , ÷ , + , - atau dapat disebut Didalam kurung → Kabataku (Kali,\r\nBagi, Tambah, Kurang).<br>\r\n= 2, 20 × 0, 75 + 53 ÷ 81 → dikelompokan berdasarkan aturan Kabutaku<br>\r\n= 2 × 43 + 53 × 18 → 2,20 dibulatkan menjadi 2<br>\r\n= 1, 5 + 254 ⇒ 1, 5 + 4, 8<br> \r\n= 6, 4', NULL, '2024-07-21 03:14:19', '2024-07-26 17:50:17'),
(2040, 'PNSSKD001', 47, '7, 7 ÷ 2, 5 - <sup>2</sup>/<sub>4</sub> × <sup>3</sup>/<sub>4</sub>=....', NULL, 4, '<p><b>Menggunakan konsep perkiraan dan aturan kabataku.</b><br>\r\n= 7, 5 ÷ 2, 5 - 42 × 43 → 7, 7 dibulatkan menjadi 7,5<br>\r\n= 3 - 166 → disini didapat jika 166 sama dengan sekitar 0,… (nol koma sekian)<br>\r\n= 3 - 0, … → sehingga dapat diperkirakan hasilnya sekitar 2,… (dua koma\r\nsekian)</p>', NULL, '2024-07-21 03:35:30', '2024-07-26 17:52:04'),
(2041, 'PNSSKD001', 48, '<sup>1</sup>/<sub>4</sub> x 164 x <sup>1</sup>/<sub>2</sub>', NULL, 1, '= <sup>1</sup>/<sub>4</sub> × 164 × <sup>1</sup>/<sub>2</sub> <br>\r\n= <sup>164</sup>/<sub>4</sub> × × <sup>1</sup>/<sub>2</sub><br>\r\n= 41 × <sup>1</sup>/<sub>2</sub> <br>\r\n= 20,50', NULL, '2024-07-21 03:50:30', '2024-08-02 07:11:44'),
