(2046, 'PNSSKD001', 53, 'Peserta seminar pendidikan terdiri dari peserta laki-laki dan peserta perempuan. Sebanyak 40% peserta laki-laki\r\ndan 60% peserta perempuan adalah guru. Jika banyak guru yang berjenis kelamin perempuan adalah 50% dari\r\nseluruh peserta guru maka perbandingan peserta seminar pendidikan laki-laki dan perempuan adalah ……', NULL, 2, NULL, '1721698138.png', '2024-07-21 04:05:55', '2024-07-22 17:28:58'),
