(2049, 'PNSSKD001', 56, 'Rata-rata ujian matematika dari sepuluh siswa termasuk Andi dan Budi adalah 𝑥. Ternyata terdapat kesalahan\r\nguru dalam mengoreksi jawaban sehingga seharusnya nilai Andi ditambah 15 dan nilai Budi dikurangi 5. Nilai\r\nrata-rata ujian yang seharusnya adalah ……', NULL, 4, NULL, '1721699687.png', '2024-07-21 04:53:53', '2024-07-22 17:54:47'),
(2050, 'PNSSKD001', 57, 'Pak Anton mempekerjakan seorang tukang dan dua orang asisten tukang untuk memperbaiki kamar mandi\r\nrumahnya. Selama lima hari pertama, ketiga orang tersebut bekerja bersama dan Pak Anton membayarkan upah\r\nmereka sebesar Rp 2.125.000. Lima hari berikutnya satu asisten tukang tidak ikut bekerja dan Pak Anton\r\nmengeluarkan uang Rp 1.500.000 sebagai upah untuk pekerjanya. Selisih gaji antara tukang dan asisten tukang per\r\nhari adalah ……', NULL, 2, NULL, '1721699900.png', '2024-07-21 04:57:03', '2024-07-22 17:58:20'),
(2051, 'PNSSKD001', 58, 'Karmini membeli sebuah mesin jahit seharga Rp2.432.000,00. Jika ia mendapat diskon sebesar\r\n15% maka uang yang harus dibayar Karmini adalah ....', NULL, 4, NULL, '1721700085.png', '2024-07-21 05:00:48', '2024-07-22 18:01:25'),
(2052, 'PNSSKD0001', 1, 'Tujuan nasional bangsa Indonesia yang merangkum partisipasi Indonesia dalam dunia \r\ninternasional adalah....', NULL, 5, 'Tujuan negara tercantum dalam Pembukaan UUD RI Tahun 1945 alinea ke-4 yang \r\nberbunyi “... yang melindungi segenap bangsa Indonesia dan seluruh tumpah darah \r\nIndonesia dan untuk memajukan kesejahteraan umum, mencerdaskan kehidupan bangsa, \r\ndan ikut melaksanakan ketertiban dunia yang berdasarkan kemerdekaan, perdamaian \r\nabadi dan keadilan sosial, ...”.', NULL, '2024-07-21 05:59:01', '2024-07-21 05:59:01'),
(2053, 'PNSSKD0001', 2, 'Muhammad Yamin merupakan tokoh nasionalis yang mengusulkan tentang batas-batas \r\nwilayah Indonesia. Masukan Muhammad Yamin mengenai Papua pada saat pembentukan \r\nIndonesia merdeka yaitu....', NULL, 2, 'Muhammad Yamin mengusulkan Tanah Papua secara otomatis menjadi wilayah \r\nIndonesia. Pada saat itu M. Yamin menyampaikannya pada saat usulan tentang batas-\r\nbatas wilayah negara.', NULL, '2024-07-21 06:00:19', '2024-07-21 06:00:19'),
(2054, 'PNSSKD0001', 3, 'Sebelum Indonesia memperoleh kemerdekaan, banyak dibentuk organisasi maupun badan-\r\nbadan yang bertugas untuk mempersiapkan Indonesia merdeka. Badan yang bertugas \r\nuntuk menyelidiki serta menyampaikan pendapat untuk disampaikan kepada pemerintah \r\nJepang sebagai sebagai bahan pertimbangan Indonesia merdeka adalah ....', NULL, 4, 'BPUPKI atau Badan Penyelidikan Usaha Persiapan Kemerdekaan Indonesia yang \r\nbertugas untuk menyelidiki persiapan-persiapan apa-apa saja yang harus dipersiapkan \r\nmenuju kemerdekaan Indonesia', NULL, '2024-07-21 06:02:09', '2024-07-21 06:02:09'),
(2055, 'PNSSKD0001', 4, 'Gagasan peleburan (Fusi) semakin lama semakin dirasakan perlunya oleh pemimpin-\r\npemimpin pemuda di Indonesia, bahkan secara mendesak. Semangat untuk merdeka terus \r\ndigelorakan oleh gerakan-gerakan pemuda yang berada di Indonesia maupun gerakan \r\nmuda Indonesia yang berada di Belanda juga. Maka pada tanggal 30 April 1926 di Jakarta \r\ndiselenggarakan Kongres Pemuda yang pertama.  Kongres Pemuda ini dihadiri oleh wakil-\r\nwakil organisasi pemuda dari berbagai daerah antara lain Jong Java, Jong Sumatra Bond, \r\nJong Ambon, Sekar Rukun Jong Islamieten, Studerenden Minahasaeres, kemudian Jong \r\nBataks Bond, dan Pemuda Kaum Theosofi. Pada kongres pemuda yang pertama ini \r\ndiketuai oleh....', NULL, 3, 'Ketua pertama dalam kongres pemuda yang pertama adalah Mohammad Tabrani \r\nSoerjowitjitro.', NULL, '2024-07-21 06:03:45', '2024-07-21 06:03:45'),
(2056, 'PNSSKD0001', 5, 'Konflik antara Indonesia dengan Cina yang memperebutkan wilayah perairan Natuna yang \r\nsebenarnya masuk ke wilayah teritorial Indonesia. Setiap negara mempunyai batas \r\nwilayahnya masing-masing. Indonesia sebagai negara yang dikelilingi laut memiliki batas \r\nwilayah laut teritorial. Mulai tanggal 21 Maret 1980 batas wilayah laut Indonesia selebar....', NULL, 5, 'Berdasarkan Zona Ekonomi Eksekutif batas wilayah laut teritorial Indonesia selebar 200 \r\nmil ditarik dari garis pangkal wilayah laut Indonesia.', NULL, '2024-07-21 06:05:12', '2024-07-21 06:05:12'),
(2057, 'PNSSKD0001', 6, 'Pada masa pendudukan di Indonesia, Jepang berkepentingan untuk merangkul golongan \r\nnasionalis sekuler dan intelektual Indonesia. Dalam membantu usahanya menghadapi \r\nperang melawan Sekutu. Untuk itu Jepang membentuk suatu organisasi yang bernama....', NULL, 1, 'POETRA atau Poesat Tenaga Rakjat organisasi ini dibentuk oleh Jepang dan menunjuk \r\n4 serangkai sebagai ketuanya yaitu Soekarno, Ki Hajar Dewantara, Moh. Hatta, Mas \r\nMansyur. Gerakan ini didirikan pada tanggal 16 April 1943.', NULL, '2024-07-21 06:06:28', '2024-07-21 06:06:28'),
(2058, 'PNSSKD0001', 7, '. Secara astronomi ASEAN terletak pada 28°LU-11°LS dan 92°BT-141°BT, sedangkan \r\nsecara geografis terletak antara Samudera Pasifik dan Samudera Hindia serta Benua Asia dan Benua Australia. Indonesia sebagai salah satu anggota ASEAN secara astronomi \r\nterletak pada...', NULL, 4, 'Indonesia sebagai salah satu anggota ASEAN secara astronomi terletak pada 6°LU-11°LS \r\ndan 95°BT-141°BT.', NULL, '2024-07-21 06:07:58', '2024-07-21 06:07:58'),
(2059, 'PNSSKD0001', 8, 'Sifat rasional dari nasionalisme Indonesia adalah adanya sikap realitas dan keterbukaan. \r\nHal ini berarti nasionalisme Indonesia harus...', NULL, 5, 'Sikap realitas dan keterbukaan dalam nasionalisme Indonesia dapat diartikan bahwa nasionalisme Indonesia harus berani mengambil yang baik dari luar untuk memperbaiki \r\nbangsa dan juga berani menghilangkan segala hal yang tidak baik pada diri bangsa \r\nIndonesia.', NULL, '2024-07-21 06:09:34', '2024-07-21 06:09:34'),
(2060, 'PNSSKD0001', 9, 'Semangat nasionalisme kaum terpelajar dalam membangun pendidikan skala nasional \r\npada masa pergerakan kemerdekaan didasarkan pada...', NULL, 5, 'Pendidikan pada masa pergerakan kemerdekaan RI yang digawangi oleh kolonial \r\nBelanda sangat terbatas dan berlatar belakang Barat. Sehingga kesesuaian terhadap nilai \r\ndan norma luhur masyarakat Indonesia terbatas pada ilmu Barat.', NULL, '2024-07-21 06:15:45', '2024-07-21 06:15:45'),
(2061, 'PNSSKD0001', 10, 'Nasionalisme humaniter adalah nasionalisme yang bersifat toleran yang berpandangan \r\nbahwa setiap bangsa berhak memperjuangkan kesejahteraan bangsanya berdasarkan...', NULL, 5, 'Nasionalisme humaniter adalah nasionalisme yang bersifat toleran yang berpandangan \r\nbahwa setiap bangsa berhak memperjuangkan kesejahteraan bangsanya berdasarkan cara \r\nyang dipercaya bangsa tersebut.', NULL, '2024-07-21 06:17:02', '2024-07-21 06:17:02'),
(2062, 'PNSCAC001', 1, 'Seorang sosiolog mengamati bahwa kelompok masyarakat A dan kelompok masyarakat B memiliki cara yang sangat berbeda dalam menyelesaikan konflik. Kelompok A cenderung menggunakan mediasi dan dialog, sedangkan kelompok B cenderung menggunakan pendekatan legalistik dan formal. Berdasarkan teori sosiologi, jelaskan faktor-faktor apa saja yang mungkin mempengaruhi perbedaan cara penyelesaian konflik tersebut.', NULL, 5, 'Perbedaan cara penyelesaian konflik antara kelompok masyarakat A dan B dapat dipengaruhi oleh berbagai faktor seperti tingkat pendidikan yang mungkin mempengaruhi kemampuan untuk berkomunikasi dan mencari solusi yang damai (a), <br> nilai budaya yang mengajarkan cara-cara tertentu dalam menangani konflik (b),<br> serta kondisi ekonomi dan politik yang dapat membentuk struktur sosial dan hukum yang berbeda (c). <br>Selain itu, lingkungan fisik dan geografis juga dapat mempengaruhi interaksi sosial dan metode penyelesaian konflik (d).<br> Jadi, semua jawaban benar.', NULL, '2024-07-22 03:45:04', '2024-07-23 19:41:48'),
(2063, 'PNSCAC001', 2, 'Konsep \"sosialisasi\" dalam sosiologi merujuk kepada?', NULL, 2, 'Sosialisasi adalah proses di mana individu mempelajari dan menginternalisasi norma, nilai, dan peran sosial yang diperlukan untuk berpartisipasi sebagai anggota masyarakat. Proses ini melibatkan pengajaran dan penanaman budaya serta nilai-nilai yang ada dalam masyarakat kepada individu sejak masa kanak-kanak hingga dewasa.', NULL, '2024-07-22 03:46:38', '2024-07-22 03:46:38'),
(2064, 'PNSCAC001', 3, 'Sebuah penelitian menunjukkan bahwa masyarakat dengan tingkat keberagaman etnis yang tinggi cenderung memiliki dinamika sosial yang kompleks, termasuk potensi konflik yang lebih tinggi. Berdasarkan teori interaksi simbolik, apa yang bisa dilakukan untuk mengurangi potensi konflik dalam masyarakat tersebut?', NULL, 2, 'Teori interaksi simbolik menekankan pentingnya komunikasi dan interaksi dalam membentuk hubungan sosial. Dengan meningkatkan komunikasi dan pemahaman antar kelompok etnis, individu dapat lebih memahami dan menghargai perbedaan, mengurangi prasangka, dan mencegah potensi konflik. Hal ini dapat dilakukan melalui program pendidikan, dialog antar budaya, dan kegiatan komunitas yang inklusif.', NULL, '2024-07-22 03:58:18', '2024-07-22 03:58:18'),
(2065, 'PNSSKD001', 59, 'Suatu proyek pembangunan rumah berlantai dua ditargetkan selesai dalam waktu 60 hari dengan melibatkan 15 orang pekerja. Jika setelah bekerja selama 15 hari, pembangunan terhenti\r\nselama 9 hari. Jika pembangunan ingin selesai tepat waktu, maka tambahan pekerja yang harus dilibatkan sebanyak .... orang', NULL, 5, NULL, '1721713844.png', '2024-07-22 21:50:44', '2024-07-22 21:50:44'),
(2068, 'PNSCAC001', 4, 'Sifat nisbi hukum pidana merujuk kepada konsep pendefinisian sistem nilai yang diadopsi hukum pidana. Dalam konteks ini, kenisbian itu disebabkan oleh adanya....', NULL, 2, 'Sifat nisbi hukum pidana memang merujuk pada konsep pendefinisian sistem nilai yang diadopsi hukum pidana. Kenisbian ini muncul karena hukum pidana tergantung pada kelompok dominan di masyarakat dalam menentukan apa yang dianggap sebagai kejahatan dan bagaimana kejahatan tersebut dihukum.', NULL, '2024-07-22 22:57:41', '2024-07-22 22:57:41'),
(2069, 'PNSCAC001', 5, 'Primary conflict culture, dalam upaya menjelaskan masalah kejahatan, pada umumnya digunakan untuk....', NULL, 1, 'Teori Primary Culture Conflict (PCC) dalam kriminologi fokus pada benturan nilai dan norma antara dua atau lebih budaya yang berbeda. Dalam konteks migrasi, teori ini digunakan untuk menjelaskan bagaimana perbedaan budaya antara pendatang dan masyarakat penerima dapat memicu masalah, termasuk kejahatan.', NULL, '2024-07-22 23:00:37', '2024-07-22 23:00:37'),
(2070, 'PNSCAC001', 6, 'Upaya untuk melihat keterkaitan antara kriminologi dengan hukum pidana dapat dilihat pada aspek-aspek yang terkait dengan masalah-masalah di bawah ini, kecuali....', NULL, 1, 'Kriminologi dan hukum pidana memiliki hubungan yang erat dalam berbagai aspek, termasuk:\r\nAparatur penegak hukum: Kriminologi dapat membantu memahami perilaku kriminal dan faktor-faktor yang mendorongnya, sehingga penegak hukum dapat lebih efektif dalam melakukan tugasnya.\r\nPencegahan dan penanggulangan kejahatan: Kriminologi dapat membantu mengidentifikasi faktor-faktor risiko kejahatan dan mengembangkan strategi pencegahan yang lebih efektif.\r\nPelaksanaan tugas penegak hukum: Kriminologi dapat membantu memahami budaya dan norma masyarakat, sehingga penegak hukum dapat lebih sensitif dan profesional dalam menjalankan tugasnya.\r\nNamun, pelaksanaan penghukuman lebih fokus pada aspek hukum dan peradilan pidana, dan tidak secara langsung terkait dengan teori dan konsep kriminologi.', NULL, '2024-07-22 23:03:05', '2024-07-22 23:03:05'),
(2071, 'PNSSKD0002', 1, 'Lagu kebangsaan Indonesia Raya yang dikenalkan oleh Wage Rudolf Soepratman\r\npertama kali diperdengarkan untuk membangkitkan rasa nasionalisme pada saat...', NULL, 3, 'Lagu Indonesia raya pertama berkumandang saat rapat Kongres Pemuda 2 setelah ikrar\r\nSumpah Pemuda.', NULL, '2024-07-22 23:23:29', '2024-07-24 12:12:13'),
(2072, 'PNSSKD0002', 2, 'Hadirnya kehidupan masyarakat saat ini dipelopori oleh sejarah pergerakan nasional\r\nIndonesia yang dilakukan oleh...', NULL, 2, '. Jawaban B\r\nKaum terpelajar adalah tonggak dari adanya nasionalis di Indonesia dengan terbukti berdirinya Budi Utomo.', NULL, '2024-07-22 23:25:37', '2024-07-22 23:25:37'),
(2073, 'PNSSKD0002', 3, 'Konflik sosial yang dilatarbelakangi isu SARA pernah terjadi di suatu daerah. Selain\r\nmembawa kerugian harta benda, trauma yang ditimbulkan akibat konflik juga sangat\r\nmendalam. Untuk itu diperlukan kesadaran bersama untuk mencegah terulangnya konflik\r\nserupa. Cara pengendalian sosial yang tepat untuk mengatasi konflik adalah...', NULL, 5, 'Pengendalian sosial yang tepat untuk mengatasi konflik harus dimulai dari diri sendiri, jadi harus memahami terlebih dahulu apa yang dimaksud dengan SARA, sehingga dapat terhindarkan konflik tersebut.', NULL, '2024-07-22 23:29:40', '2024-07-22 23:29:40'),
(2074, 'PNSSKD0002', 4, 'Sebelum perjuangan pada masa pergerakan nasional, perjuangan mengusir penjajah masih bersifat kedaerahan, seperti yang dipimpin oleh Kapitan Pattimura di…', NULL, 3, 'Thomas Matulessy, dikenal sebagai Kapitan Pattimura, memimpin perjuangan rakyat Maluku melawan Belanda.', NULL, '2024-07-22 23:31:26', '2024-07-22 23:31:26'),
(2075, 'PNSSKD0002', 5, '<b>Perhatikan penyataan berikut ini:</b><br>\r\n1) Mengembangkan sikap toleransi terhadap nilai-nilai dan norma sosial yang berbedabeda dari setiap anggota kelompok masyarakat yang ada<br>\r\n2) Menegakkan supremasi hukum<br>\r\n3) Mengembangkan sikap chauvinism melalui penghayatan wawasan berbangsa dan\r\nbernegara<br>\r\n4) Menyelesaikan konflik yang ada dengan keselarasan dan voting<br>\r\n5) Meninggalkan sikap primodialisme yang berlebihan<br\r\nYang merupakan sikap kritis yang harus dikembangkan untuk menjaga persatuan dan\r\nkesatuan dalam masyarakat multikultural adalah…', NULL, 5, 'Pernyataan:<br>\r\n1) Mengembangkan sikap toileransi terhadap nilai-nilai dan norma sosial yang berbedabeda dari setiap anggota kelompok masyarakat yang ada. ⟶ <b>Benar</b><br>\r\n2) Menegakkan supremasi hukum. ⟶ <b>Salah.</b><br>\r\nSupremasi hukum adalah menegakkan hukum sesuai apa yang telah tertulis, dan tidak\r\nberlaku pasang surut. Kalimatnya memang positif, namun kita harus melihat apa yang\r\nditanyakan.<br>\r\n3) Mengembangkan sikap chauvinism melalui penghayatan wawasan berbangsa dan\r\nbernegara. ⟶ <b>Salah.</b><br>\r\nChauvinisme adalah rasa cinta, bangga, loyalitas, fanatisme dan kesetiaan terhadap\r\nnegara dengan cara mengagungkan bangsa sendiri serta merendahkan bangsa lainnya.\r\nPada praktiknya, chauvinisme seringkali menyebabkan permusuhan kepada bangsa\r\nlain. Contoh sikap chauvinisme misalnya membakar bendera bendera negara lain.<br>\r\n4) Menyelesaikan konflik yang ada dengan keselarasan dan voting. ⟶ <b>Benar</b><br>\r\n5) Meninggalkan sikap primodialisme yang berlebihan. ⟶ <b>Benar</b><br>\r\nSikap primodialisme adalah sebuah pandangan atau paham yang memegang teguh halhal yang dibawa sejak kecil baik mengenai tradisi adat istiadat, suku bangsa, ras,\r\nagama, kepercayaan daerah asal kelahiran serta segala sesuatu yang ada di dalam\r\nlingkungan pertamanya. Jadi meninggalkan rasa cinta kepada adat yang berlebihan\r\nmerupakan sikap yang tepat.<br>\r\n<b>Jadi pernyataan yang benar adalah 1, 4, dan 5.</b>', NULL, '2024-07-22 23:34:30', '2024-07-24 12:22:48'),
(2076, 'PNSSKD0002', 6, 'Sikap-sikap di bawah ini dapat menurunkan dan memudarkan rasa nasionalisme Indonesia, kecuali…', NULL, 2, 'Animisme adalah kepercayaan bahwa roh (jiwa) itu tidak hanya berada pada makhluk\r\nhidup, tetapi juga pada benda-benda tertentu.<br>\r\n• Sukuisme: Paham mementingkan suku bangsa sendiri.<br>\r\n• Chauvinisme: Rasa cinta tanah air yang berlebihan dengan mengagungkan bangsa\r\nsendiri, dan merendahkan bangsa lain.<br>\r\n• Etnosentrisme: Paham yang bersifat kedaerahan, dimana menganggap suku/budaya\r\nsendiri yang lebih baik daripada suku/budaya orang lain.<br>\r\n• Ekstrimisme: bentuk penyalahgunaan kegiatan berpolitik yang memanfaatkan\r\nkelompok atau organisasi minoritas.', NULL, '2024-07-22 23:46:07', '2024-07-23 19:35:36'),
(2077, 'PNSSKD002', 1, 'Sebagai seorang pelajar, Nina sering mengikuti lomba olimpiade bahkan sampai kancah\r\ninternasional. Nina dengan bangganya memperkenalkan dirinya sebagai seorang warga\r\nnegara Republik Indonesia dan tak jarang pada kesempatan lombanya, ia memakai baju batik\r\nkhas Indonesia. Sikap yang ditunjukkan oleh Nina adalah...', NULL, 5, 'Nasionalisme adalah rasa cinta dan kebanggaan terhadap negara atau bangsa yang diwujudkan dalam berbagai bentuk, seperti identitas nasional, budaya, dan simbol-simbol nasional. Dalam konteks yang diberikan, Nina menunjukkan sikap nasionalisme dengan memperkenalkan dirinya sebagai warga negara Republik Indonesia dan menggunakan pakaian tradisional Indonesia (baju batik khas Indonesia) pada kesempatan lomba olimpiade internasional.', NULL, '2024-07-23 04:36:55', '2024-07-23 04:36:55'),
(2078, 'PNSSKD002', 2, 'Sikap nasionalisme harus menjadi kesadaran dari masing-masing diri manusia tanpa adanya\r\npaksaan dari pihak manapun. Kesadaran sikap nasionalisme seharusnya sudah dididik dalam\r\nlingkup kecil yaitu lingkup keluarga. Hal kecil yang dapat menimbulkan sikap nasionalisme\r\ndalam lingkungan keluarga adalah, kecuali ...', NULL, 5, 'Opsi E terlalu menekankan pada aspek fanatisme dan pemaksaan dalam menerapkan sikap nasionalisme. Sikap nasionalisme seharusnya tumbuh secara alami dari pemahaman dan kesadaran individu, bukan karena adanya paksaan atau fanatisme. Oleh karena itu, hal ini tidak sesuai dengan pendidikan sikap nasionalisme yang seharusnya dilakukan dalam lingkup keluarga.', NULL, '2024-07-23 04:39:03', '2024-07-23 04:39:03'),
(2079, 'PNSSKD002', 3, 'Wujud sikap nasionalisme yang seharusnya dilakukan oleh masyarakat bisa ditunjukkan\r\ndengan...', NULL, 1, 'Sikap nasionalisme seharusnya tercermin dalam tindakan nyata sehari-hari dalam berbagai aspek kehidupan, seperti dalam pekerjaan, pendidikan, budaya, dan interaksi sosial. Ini mencakup penghargaan terhadap nilai-nilai dan simbol-simbol kebangsaan, serta partisipasi aktif dalam memperkuat persatuan dan kesatuan bangsa. Menciptakan lagu bertema nasionalisme (E) atau mengoleksi barang-barang bersejarah (D) dapat menjadi ekspresi dari nasionalisme, tetapi yang paling esensial adalah implementasi sikap nasionalisme dalam tindakan nyata sehari-hari untuk membangun kehidupan berbangsa yang kokoh dan berkelanjutan.', NULL, '2024-07-23 04:41:41', '2024-07-23 04:41:41'),
(2080, 'PNSSKD002', 4, '<b>Perhatikan pernyataan berikut :</b><br>\r\n1. Menjadi jurnalis yang kritis<br>\r\n2. Menyumbangkan buah pemikirannya dalam pembentukan dari dasar negara bagi Republik\r\nIndonesia.<br>\r\n3. Penengah golongan tua dan muda dalam peristiwa Rengasdengklok<br>\r\n4. Mendirikan partai politik pertama di Indonesia, bernama Indische Partij<br>\r\n5. Menjabat sebagai menteri negara<br><br>\r\n\r\nErnest Douwes Dekker adalah seorang peletak dasar nasionalisme Indonesia di awal abad ke-\r\n20. Perannya sebagai tokoh nasionalisme Indonesia yang sesuai dengan pilihan di atas adalah ....', NULL, 3, 'Peran Ernest Douwes Dekker sebagai tokoh nasionalisme yaitu :<br> 1. Menjadi jurnalis yang kritis<br< 4. Mendirikan partai politik pertama di Indonesia, bernama Indische Partij <br> 5. Menjabat sebagai menteri negara', NULL, '2024-07-23 04:48:45', '2024-07-23 04:48:45'),
(2081, 'PNSSKD002', 5, 'Sebuah negara Y terdiri dari ragam identitas seperti suku,\r\nagama dan bahasa serta gender, namun semuanya hidup dalam rukun. Baru 1 tahun\r\nnegara Y ini dipimpin oleh penguasa yang memberlakukan kebijakan membatasi urusan\r\nagama hanya dalam ruang privat seperti ruang ibadah (tempat ibadah), sekolah teologi\r\ndan rumah masing-masing. Sejak penguasa ini memimpin negara Y, organisasi\r\nkeagamaan dibatasi secara ketat pergerakannya di ruang publik sehingga kegiatan berbau\r\nagama hanya dilakukan di ruang privat, pun jika ada hanya sebatas seremonial acara\r\nkenegaraan. Alhasil nilai agama dan moral dalam masyarakat negara Y seolah-olah\r\npudar dan kehidupan negara Y menjadi kering dalam makna. Jika demikian keadaannya,\r\nbagaimana penilaian anda terhadap akibat yang ditimbulkannya dari kebijakan penguasa\r\nnegara Y ini....', NULL, 4, 'llustrasi kasus diatas menggambarkan tidak berjalannya dan\r\nberkembangnya toleransi kembar di suatu negara. Toleransi kembar ialah situasi ketika\r\ninstitusi agama dan negara menyadari batas otoritasnya lalu mengembangkan toleransi\r\nsesuai fungsinya masing-masing. lnstitusi-institusi negara harus bebas dalam membuat\r\nkebijakan sesuai amanat konstitusi yang disepakati. Sementara institusi agama tidak\r\nboleh memaksakan kebijakan publik kepada pemerintah yang telah dipilih secara\r\ndemokratis. Sementara individu dan komunitas agama harus memiliki kebebasan penuh\r\nuntuk menjalanakan ibadah. Mereka juga harus bisa mengembangkan nilai-nilai agama\r\ndalam kehidupan bermasyarakat, termasuk mengembangkan organisasi masyarakat\r\nmaupun partai politik, dengan mengindahkan aturan hukum yang berlaku. Adanya\r\ntoleransi antara otoritas agama dan otoritas negara membuat agama tidak bisa dibatasi\r\nhanya dalam ruang privat. Agama punya kemungkinan terlibat dalam ruang publik. Jika\r\n\r\nagama hanya berada dalam ruang privat, kehidupan publik menjadi kering dalam\r\nmakna. Ada kekosongan nilai dalam aktivitas publik masyarakat. Jika demikian\r\nkeadaannya, bukan tidak mungkin bisa memunculkan pemberontakan agama\r\n(fundamentalisme) akibat adanya pembatasan fungsi agama dalam ruang publik.\r\nFundamentalisme sendiri - yang identik dengan radikalisme agama merupakan gejala\r\nkeagamaan yang lahir dari semua agama. Karena itu, dikenal istilah fundamentalisme\r\nIslam, fundamentalisme Hindu, fundamentalisme Kristen, dan seterusnya.\r\nFundamentalisme adalah paham yang berjuang untuk menegakkan lagi norma-norma\r\ndan keyakinan agama tradisional guna menghadapi sekularisme.', NULL, '2024-07-23 05:01:07', '2024-07-23 05:01:07'),
(2082, 'PNSSKD002', 6, 'Tak seperti kebanyakan dokter pada umumnya yang biasa bergaul dengan kalangan\r\ndokter saja, Dokter Yusuf lebih senang bergaul dengan kalangan golongan bawah\r\ndaripada kalangan golongan atas. Sikap demikian saat ini sudah jarang kita jumpai.\r\nKeteladanan yang dimiliki oleh Dokter Yusuf adalah....', NULL, 4, 'Keteladanan yang dimiliki oleh Dokter Moewardi adalah Dalam bergaul, hendaknya kita tidak\r\nmemperhatikan latar belakang sosial dengan siapa kita bergaul.', NULL, '2024-07-23 05:04:57', '2024-07-23 16:52:25'),
(2083, 'PNSSKD002', 7, 'Mr. Sartono merupakan salah satu pahlawan nasional. Salah satu kisah yang menarik\r\ndari kehidupannya adalah ketika beliau akan diangkat sebagai anggota/ketua DPR\r\nGotong Royong. Saat beliau ditunjuk untuk menduduki jabatan tersebut, beliau\r\nmenolak dengan alasan “Menjadi anggota DPR yang bukan karena pilihan rakyat\r\nmerupakan hal yang bertentangan dengan hati nurani”. Atas keputusannya tersebut ia\r\nmenjadi seorang pengangguran. Sikap yang bisa kita teladani dari sikap Mr. Sartono\r\nadalah....', NULL, 3, 'Sikap yang bisa kita teladani dari sikap Mr. Sartono adalah Apapun kondisi kita sekarang, kita\r\nharus berusaha mempertahankan nilai integritas kita.', NULL, '2024-07-23 17:18:00', '2024-07-23 17:18:00'),
(2084, 'PNSSKD002', 8, 'Pernah mendengar kisah Kahar Muzakir? Salah satu anggota Panitia Sembilan?. Suatu\r\nhari, Pak Kahar sedang mengajar mahasiswanya di UII. Tiba-tiba ada yang mengetuk\r\npintu kelasnya dari luar. Rupanya, ada salah satu mahasiswanya yang terlambat datang.\r\nTak seperti dosen pada umumnya yang marah ketika mahasiswanya terlambat datang,\r\nKahar justru mengatakan “Tolong Anda tutup pintu ruang ini, tetapi dari luar\".\r\nBerdasarkan cerita di atas, nilai keteladanan yang bisa kita contoh dari seorang Kahar\r\nMuzakar adalah....', NULL, 3, 'nilai keteladanan yang bisa kita contoh dari seorang Kahar Muzakar adalah menjadi Dosen hendaknya bersikap arif dalam mendidik mahasiswanya tentang pentingnya\r\nkedisiplinan', NULL, '2024-07-23 19:25:46', '2024-09-26 00:59:23'),
(2085, 'PNSSKD002', 9, 'Survei terhadap institusi perlu dilakukan untuk menjamin kinerja pegawai bahkan lembaga tersebut secara\r\ninternal ataupun eksternal. Manfaat lain perlunya survei integritas pegawai adalah ........', NULL, 4, '<b>Indikator dalam soal ini berkaitan dengan survei kinerja pegawai ASN.</b>\r\nOpsi A salah karena merupakan manfaat utama dilakukannya survei kinerja<br>\r\npegawai ASN, sedangkan yang diinginkan oleh pertanyaan adalah manfaat lain\r\ndari survei kinerja pegawai ASN.<br>\r\nOpsi B salah karena pernyataan tersebut merupakan manfaat diadakannya\r\npendidikan karakter.<br>\r\nOpsi C salah karena pernyataan tersebut tidak termasuk dalam manfaat\r\ndiadakannya survei integritas sesuai dengan PermenpanRB No. 38 Tahun 2017.<br>\r\nOpsi D benar karena sesuai dengan PermenpanRB No. 38 Tahun 2017, bahwa\r\nsurvei integritas pegawai yang dilakukan secara berkala dan terus-menerus dapat\r\ndijadikan sebagai benteng pencegahan perbuatan buruk seperti korupsi.\r\nOpsi E salah karena pernyataan tersebut tidak termasuk dalam manfaat\r\ndiadakannya survei integritas yang tercantum pada PermenpanRB No. 38 Tahun\r\n2017.', NULL, '2024-07-23 19:29:10', '2024-07-23 19:29:10'),
(2086, 'PNSSKD002', 10, 'Dalam buku mengenang Bung Hatta, Mantan sekretaris Pribadi Bung Hatta menulis, semasa\r\nBung Hatta Wakil Presiden sering pada akhir bulan ada sisa anggaran rutin biaya rumah tangga\r\nwakil presiden dan sisa uang tersebut dikembalikan ke kas negara. Sejalan dengan prinsip\r\nhemat dan jujur Bung Hatta, tidak satu rupiah pun uang negara dihamburkan untuk keperluan\r\ndi luar kedinasan atau untuk kepentingan pribadi dan keluarga. Dari cerita tentang Bung Hatta\r\ndiatas sikap yang tercermin dari Bung Hatta adalah...', NULL, 3, 'Cerita tentang Bung Hatta tersebut mencerminkan sikap yang berintegritas. Integritas adalah kualitas yang menunjukkan kejujuran dan prinsip moral yang kuat, serta berperilaku sesuai dengan nilai-nilai etika yang dipegang teguh. Dalam hal ini, Bung Hatta menunjukkan integritas dengan mengembalikan sisa anggaran rumah tangga ke kas negara dan tidak menggunakan uang tersebut untuk keperluan pribadi atau keluarga.', NULL, '2024-07-23 19:34:36', '2024-07-23 19:34:36'),
(2087, 'PNSSKD0002', 7, 'Permufakatan Perhimpunan politik Kebangsaan Indonesia atau PPPKI yang awal\r\nmunculnya berfungsi untuk menyatukan gerakan atau organisasi politik pada masa Hindia\r\nBelanda. PPPKI dibentuk dan mengadakan rapat pertamanya yang dihadiri berbagai\r\nmacam organisasi politik maupun non politik yang berlokasi di ...', NULL, 2, 'Lokasi pembentukannya PPPKI di Bandung', NULL, '2024-07-23 19:49:02', '2024-07-23 19:49:02'),
(2088, 'PNSSKD0002', 8, 'Embrio dari berdirinya Sarekat Islam adalah....', NULL, 2, 'Embrio berdirinya Sarekat Islam adalah Sarekat Dagang Islam.', NULL, '2024-07-23 19:50:04', '2024-07-23 19:50:04');
INSERT INTO `soals` (`id`, `id_paket`, `nomor_soal`, `isi_soal`, `gambar_soal`, `nomor_jawaban`, `isi_solusi`, `gambar_solusi`, `created_at`, `updated_at`) VALUES
(2089, 'PNSSKD0002', 9, 'Setelah Boedi Oetomo berdiri kemudian disusul pula dengan berdirinya organisasi lain\r\nsalah satunya Syarekat Islam yang didirikan pada tahun 1911 di Solo oleh H. Samanhudi.\r\nTujuan utama H. Samanhudi mendirikan Sarekat Islam adalah untuk membela kepentingan\r\npedagang-pedagang Indonesia dari persaingan dagang dengan para pedagang Tionghoa.\r\nKongres pertama Syarekat Islam diadakan pada Januari 1913 di Surabaya dan yang terpilih\r\nsebagai ketua H.O.S. Tjokroaminoto. Di bawah ini yang bukan merupakan tujuan Syarekat\r\nIslam yang dirumuskan pada kongres .......', NULL, 3, 'Tujuan Syarekat Islam yang dirumuskan pada kongres pertama adalah sebagai berikut:<br>\r\n1) Mengembangkan jiwa dagang.<br>\r\n2) Membantu anggota-anggota yang mengalami kesulitan dalam bidang usaha.<br>\r\n3) Memajukan pengajaran dan semua usaha yang mempercepat derajat rakyat.<br>\r\n4) Memperbaiki pendapat-pendapat keliru tentang agama Islam.<br>\r\n5) Hidup menurut perintah agama.<br>', NULL, '2024-07-23 19:52:01', '2024-07-23 19:52:16'),
(2090, 'PNSSKD0002', 10, '6. Pada bulan Juni 2012, Presiden Susilo Bambang Yudhoyono mengumumkan lima\r\nkebijakan energi nasional yang salah satunya adalah....', NULL, 3, 'Lima kebijakan Hemat Energi Nasional yang dikeluarkan Presiden Susilo Bambang yang\r\nberlaku pada Juni 2012 yaitu:<br>\r\n1) Pengendalian sistem distribusi di setiap SPBU.<br>\r\n2) Pelarangan BBM bersubsidi untuk kendaraan pemerintah pusat dan pemerintah\r\ndaerah serta BUMN dan BUMD.<br>\r\n3) Pelarangan BBM bersubsidi untuk perkebunan dan pertambangan.<br>\r\n4) Konversi BBM ke BBG untuk transportasi penghematan penggunaan listrik dan air di\r\nkantor pemerintah, pemda, BUMN, BUMD, dan penerangan jalan.<br>\r\n5) Penghematan penggunaan listrik dan air di kantor pemerintah, pemda, BUMN,\r\nBUMD, dan penerangan jalan.<br>', NULL, '2024-07-23 19:56:04', '2024-07-23 19:56:04'),
(2091, 'PNSSKD002', 11, 'Akbar merupakan warga negara asing yang mendapatkan bayaran untuk memata-matai\r\nrahasia militer negara Indonesia. Tindakan yang dilakukan oleh Akbar  merupakan ancaman\r\nmiliter dalam bentuk....', NULL, 2, 'Spionase merupakan suatu bentuk kegiatan dari intelijen yang dilakukan guna mendapatkan suatu informasi atau rahasia militer atau negara.', NULL, '2024-07-24 11:49:42', '2024-07-24 11:49:42'),
(2092, 'PNSSKD002', 12, 'Di bawah ini yang merupakan perwujudan bela negara dalam indikator cinta tanah air,\r\nkecuali....', NULL, 5, 'Perwujudan bela negara dalam indikator cinta tanah air:<br><br>\r\n- Pak Bani enggan menjual tanah pekarangannya kepada investor asing<br>\r\n- Pak Rahman berinovasi mengubah permainan tradisional kedalam permainan tradisional\r\ndengan sistem digital<br>\r\n- Sebagai sarjana teknik kimia, Akbar melakukan penelitian untuk mengatasi kelangkaan\r\nBBM dengan menggunakan biodiesel<br>\r\n- Dengan bangganya, Tia memperkenalkan diri sebagai perwakilan Indonesia di sidang\r\numum PBB', NULL, '2024-07-24 11:53:24', '2024-07-24 11:53:24'),
(2093, 'PNSSKD002', 13, 'Kalian hobi menonton Youtube? Jika ia, pasti kalian tak asing dengan istilah mukbang.\r\nBeberapa waktu lalu dan mungkin sampai sekarang banyak youtuber yang mukbang\r\nmie ramen yang notabennya adalah barang impor. Padahal, di Indonesia banyak sekali\r\nmakanan khas daerah yang tak kalah untuk dijadikan sebagai primadona anak muda.\r\nJika kalian adalah warga negara yang baik, kira-kira upaya bela negara apa yang bisa\r\nkita lakukan mengatasi hal tersebut adalah....', NULL, 3, 'Jika kalian adalah warga negara yang baik, kira-kira upaya bela negara apa yang bisa kita\r\nlakukan mengatasi hal tersebut adalah membeli produk dalam negeri.', NULL, '2024-07-24 11:59:43', '2024-07-24 11:59:43'),
(2094, 'PNSSKD002', 14, 'Upaya sidak ke pasar-pasar tradisional yang dilakukan oleh Menteri Perdagangan,\r\nmerupakan tugas dan tanggung jawab pemerintah dalam hal....', NULL, 2, 'Upaya sidak ke pasar-pasar tradisional yang dilakukan oleh Menteri Perdagangan, merupakan\r\ntugas dan tanggung jawab pemerintah dalam hal Menjaga stabilitas harga kebutuhan pokok.', NULL, '2024-07-24 12:01:57', '2024-07-24 12:01:57'),
(2095, 'PNSSKD002', 15, 'Yang bukan termasuk kedalam indikator rela berkorban bagi bangsa dan negara\r\nadalah....', NULL, 5, 'Yang merupakan indikator rela berkorban bagi bangsa dan negara yaitu :<br><br>\r\n- Wildan hanya tidur selama 3 jam ketika kasus corona di rumah sakit tempatnya berkerja\r\nbanyak pasien covid berjatuhan<br>\r\n- Tejo siap mengawal pemberantasan kasus separatisme di Indonesia<br>\r\n- Sebagai seorang sarjana IT, Damas ikut mencari siapa dalang peretas website\r\npemerintah di kotanya<br>\r\n- Pak Anjar menghibahkan rumahnya yang kosong untuk dijadikan tempat isolasi\r\nmandiri warga masyarakat yang positif Corona<br>', NULL, '2024-07-24 12:05:17', '2024-07-24 12:05:17'),
(2096, 'PNSSKD002', 16, 'Belum lama ini telah terjadi banjir dan longsor di Malang. Sejumlah ahli menyebut,\r\nbahwa banjir di Malang disebabkan karena berubahnya ruang terbuka hijau menjadi\r\nkawasan terbangun. Baik berubah menjadi permukiman, hotel, maupun pusat\r\nperbelanjaan. Upaya bela negara untuk mengatasi hal tersebut adalah....', NULL, 5, 'Upaya bela negara untuk mengatasi hal tersebut adalah mengajak masyarakat untuk\r\nmembuat sumur resapan.', NULL, '2024-07-24 21:17:32', '2024-07-24 21:17:32'),
(2097, 'PNSSKD002', 17, 'Berikut ini yang bukan merupakan contoh pengamalan Pancasila sebagai paradigma pembangunan nasional\r\nadalah ...', NULL, 1, 'Soal ini menanyakan yang bukan contoh pengamalan Pencasila sebagai paradigma\r\npembangunan nasional<br>\r\nDalam paradigma pembangunan nasional tentu saja membicarakan prinsip yang sangat\r\ntinggi, besar, berkelanjutan, berkesinambungan.<br>\r\nBahkan dalam Pembukaan UUD 1945 disebutkan empat pokok tujuan pembangunan\r\nnasional mencakup: mencerdaskan kehidupan bangsa, menciptakan kesejahteraan umum,\r\nmelindungi seluruh tumpah darah Indonesia, dan berperan serta dalam membantu\r\nketertiban dunia dan perdamaian abadi.<br>\r\nMaka dari itu kita ditungtut untuk mencari dari ke-5 option manakah yang bukan contoh\r\npengamalan pancasila sebagai paradigma pembangunan nasional adalah jawaban yang A\r\nKarna terkait dengan Pancasila harus bersifat pragmatis, maksudnya kita sebagai warga\r\nnegara Indonesia hanya harus mengamalkan pancasila yang simpel-simpel saja, yang\r\npraktis-praktis saja, tentu saja tidak sejalan dengan paradigma pembangunan nasional.', NULL, '2024-07-24 21:21:53', '2024-07-24 21:21:53'),
(2098, 'PNSSKD002', 18, 'Budi ikut pemilihan RT, pada saat pemilihan Budi merasa diperlakukan tidak adil sehingga dia dan\r\nsimpatisannya melakukan mosi tidak percaya, demo bahkan melakukan intimidasi terhadap panitia seperti\r\nmeneror dan lain-lain agar menganulir keputusan panitia.<br>\r\nSebenarnya hal ini tidak akan terjadi apabila Budi dan simpatisannya mengamalkan Pancasila, khususnya sila ...', NULL, 2, 'Dalam teks tersebut dijelaskan.<br>\r\nBudi ikut pemilihan RT, pada saat pemilihan Budi merasa diperlakukan tidak adil\r\nsehingga dia dan simpatisannya melakukan mosi tidak percaya, demo bahkan melakukan\r\nintimidasi terhadap panitia seperti meneror dan lain-lain agar menganulir keputusan\r\npanitia.<br>\r\nDari teks tersebut bahwa terlihat budi ini TIDAK MENERIMA HASIL YANG SUDAH\r\nDIPUTUSKAN, Tidak menerima hasil musyawarah yang sudah mufakat,\r\nMaka tentu saja menyimpang daripada pengamalan sila ke-4\r\n“Kerakyatan yang dipimpin oleh hikmat kebijaksanaan dalam permusyawaratan\r\nperwakilan.<be>\r\nYaitu simbol = Kepala Banteng<br>\r\nMaka jawaban yang tepat adalah yang B', NULL, '2024-07-24 21:28:53', '2024-07-26 05:23:08'),
(2099, 'PNSSKD002', 19, 'Pandemi yang sudah berlangsung hampir 2 tahun lamanya ini telah menimbulkan\r\nbanyak korban jiwa. Tak sedikit yang kehilangan handai taulan, anak, kerabat, teman,\r\nguru, tetangga, dan lain sebagainya. Sebagai Kepala Desa, mala mini Bu Yani mengajak\r\nseluruh warga desanya untuk melakukan doa bersama dengan tujuan untuk meminta\r\nkepada Tuhan Yang Maha Esa untuk mengangkat corona dari bumi pertiwi. Selain doa\r\nbersama, Bu Yani juga mengajak warganya untuk sholat shubuh berjamaah dengan\r\nmenerapkan protocol kesehatan. Tindakan yang dilakukan oleh Bu Yani patut kita\r\nteladani, karena sesuai dengan pengamalan Pancasila khususnya sila ke....', NULL, 3, 'Tindakan yang dilakukan oleh Bu Yani patut kita teladani, karena sesuai dengan pengamalan\r\nPancasila khususnya sila ke-1. Hal ini sesuai butir manusia Indonesia percaya dan takwa\r\nterhadap Tuhan Yang Maha Esa, sesuai dengan agama dan kepercayaannya masing-masing\r\nmenurut dasar kemanusiaan yang adil dan beradab.', NULL, '2024-07-25 03:33:42', '2024-07-25 03:33:42'),
(2100, 'PNSSKD002', 20, 'Di bawah ini yang merupakan perwujudan dari nilai praksis adalah....', NULL, 4, 'Nilai praksis merupakan implementasi nilai-nilai Pancasila dalam kehidupan sehari-hari.\r\nMisalnya: Bumilia mengajak keluarga, teman, tetangga dan sahabat untuk mengikuti\r\nvaksinasi merupakan cerminan dari nilai persatuan dan kesatuan Indonesia.', NULL, '2024-07-25 03:35:40', '2024-07-25 03:35:40'),
(2101, 'PNSSKD002', 21, 'Tujuan adanya bhineka tunggal ika adalah sebagai berikut, kecuali....', NULL, 1, 'Tujuan adanya bhineka tunggal ika adalah sebagai berikut: <br><br>\r\nBersatu di tengah kemajemukan bangsa<br>\r\nUntuk mewujudkan pergaulan yang lebih akrab<br>\r\nMenciptakan kehidupan yang selaras, serasi, dan seimbang<br>\r\nPeningkatan toleransi terhadap perbedaan<br>', NULL, '2024-07-25 03:39:38', '2024-07-25 03:39:38'),
(2102, 'PNSSKD002', 22, 'Amel merupakan mahasiswa Fakultas Bahasa dan Sastra Indonesia di universitas negeri\r\ndi Kota Solo. Amel berasal dari Pulau Kalimantan. Meskipun sudah tiga tahun tinggal di\r\nKota Solo, Amel enggan menggunakan Bahasa Jawa dalam berkomunikasi dengan\r\nteman-teman di kampusnya. Ia lebih memilih untuk tetap menggunakan Bahasa\r\nKalimantan yang sulit untuk dimengerti oleh teman-teman di kampusnya yang\r\nmayoritas berbahasa Jawa. Padahal, Amel bisa menggunakan Bahasa Indonesia untuk\r\nberkomunikasi dengan teman-temannya. Namun, Amel enggan melakukan hal\r\ntersebut. Menurutnya, Bahasa Jawa sulit dipelajari sehingga ia malas untuk belajar\r\nmenggunakan Bahasa Jawa. Perilaku yang dilakukan oleh Amel menghambat bhineka\r\ntunggal ika, sebab....', NULL, 5, 'Perilaku yang dilakukan oleh Amel menghambat bhineka tunggal ika, sebab sikap\r\netnosentrisme yang tinggi, yang menyebabkan ia enggan untuk berlatih Bahasa Jawa', NULL, '2024-07-25 03:44:35', '2024-07-25 03:44:35'),
(2103, 'PNSSKD002', 23, 'Kepala SMP Maju Bersama bersama para guru sudah memutuskan untuk mewajibkan\r\nsiswa memakai masker pada saat Pembelajaran Tatap Muka (PTM) berlangsung.\r\nMeskipun baru dilakukan uji coba PTM, nyatanya SMP Maju Bersama sudah menerapkan\r\nprotokol kesehatan dengan sangat ketat. Siswa yang datang ke sekolah dicek suhunya,\r\ndiwajibkan cuci tangan, dan memakai masker selama di lingkungan sekolah. Hari ini\r\nBagyo datang ke sekolah dengan muka cemberut. Bagyo termasuk siswa yang acuh\r\nterhadap masker. Ia anti sekali menggunakan masker. Padahal, masker merupakan\r\npiranti sekolah yang harus digunakan pada saat siswa ada di lingkungan sekolah. Sikap\r\nyang dilakukan oleh Bagyo, bertentangan dengan Pancasila sila ke....', NULL, 4, 'Sikap yang dilakukan oleh Bagyo, bertentangan dengan Pancasila sila ke-4. Hal ini\r\nbertentangan dengan butir dengan itikad baik dan rasa tanggung jawab menerima dan\r\nmelaksanakan hasil keputusan musyawarah.', NULL, '2024-07-25 03:47:45', '2024-07-25 03:47:45'),
(2104, 'PNSSKD002', 24, 'Perhatikan wacana berikut ini!\r\nReni tiba-tiba datang ke rumah dengan muka bingung. Ibunya kemudian\r\nmenanyakan keadaan putrinya tersebut. “Ada apa Ren, tumben sekali kamu datang ke\r\nrumah?”. “Begini Bu, Kak Hendi mau menjual tanahnya dengan harga murah.\r\nBagaimana kalau tanah Ibu dijual terus hasil penjualannya untuk membeli tanah Kak\r\nHendi?”, tanya Reni. Ibu pun terdiam. Ibu kemudian berkata, “Tak mungkin ibu menjual\r\ntanah itu Ren. Anak ibu kan tidak hanya kau saja. Ada kakakmu Ratma. Kakakmu Ratma\r\njuga berhak atas tanah itu”, jawab Ibu. “Kak Ratma kan tidak butuh uang Bu. Suaminya\r\nkaya raya, hidupnya berkecukupan. Kak Ratma tak perlu mendapatkan warisan Ibu”\r\nNilai moral pada penggalan cerita di atas adalah....', NULL, 5, 'Nilai moral pada penggalan cerita di atas adalah Seorang adik yang hanya memikirkan\r\nkepentingannya sendiri.', NULL, '2024-07-25 03:52:34', '2024-07-25 03:52:34'),
(2105, 'PNSSKD002', 25, 'Penggunaan tanda baca yang benar ditunjukkan pada kalimat....', NULL, 4, 'Penggunaan tanda baca yang benar ditunjukkan pada kalimat....<br>\r\n- Kemarin aku menemukan uang berjumlah Rp157.500,00.<br>\r\n- Saya akan berobat kalau sakit lagi.<br>\r\n- Mama memerlukan bahan bangunan: pasir, semen, dan keramik.<br>\r\n- Keripik pisang Bu Mami telah menjadi primadona snack tradisional se-Jawa Tengah<br>\r\n- Mahasiswa/ mahasiswi jurusan Pendidikan Geografi sedang melaksanakan KKL di Wonogiri', NULL, '2024-07-25 03:57:08', '2024-07-25 03:57:08'),
(2106, 'PNSSKD002', 26, 'Perhatikan bacaan berikut!<br>\r\n\r\n    (1) Tantrum adalah keadaan ketika anak meluapkan emosinya dengan cara menangis kencang, berguling-guling di lantai, hingga melempar barang. (2) Kondisi ini pasti membuat Bunda stres dan bingung.(3) Tenang ya,Bun. (4) Kondisi ini normal dan merupakan bagian dari proses perkembangan anak, kok.<br>\r\n    (5) Tantrum biasanya dialami oleh anak yang berusia 1—4  tahun. (6)[…], tidak hanya pada anak-anak, orang dewasa pun bisa mengalami tantrum. (7) Ketika Si Kecil mengalami tantrum, Bunda sebaiknya jangan panik dan ikut terbawa emosi. (8) Ada beberapa cara Bunda yang bisa lakukan untuk mengatasi anak tantrum.<br>\r\n    (9) Tantrum umumnya disebabkan karena terbatasnya kemampuan bahasa anak untuk mengekspresikanperasaannya. (10) Mereka hanya bisa meluapkan emosinya dengan cara meronta, berteriak, menangis, menjerit, serta menghentakkan kedua kaki dan tangannya ke lantai. (11) Pada kasus tertentu, tantrum pada anak mungkin bisa disebabkan oleh gangguan prilaku atau masalah psikologis, seperti autisme.<br>\r\nSumber: alodokter.com<br>\r\nKalimat tidak efektif pada teks ditandai oleh nomor…', NULL, 4, 'salah satu syarat untuk menjadi kalimat efektif adalah kepaduan kalimat,\r\nsedangkan pada nomor 8 tidak terdapat kepaduan dalam kalimat yang\r\nmenyebabkan sulitnya memaknai kalimat tersebut. Kalimat nomor 8 ini\r\nkalimat yang tidak efektif. Perbaikan yang tepat untuk kalimat nomor 8 yakni\r\n“Ada beberapa cara yang bisa Bunda lakukan untuk mengatasi tantrum pada\r\nanak.”', NULL, '2024-07-25 04:08:36', '2024-07-26 05:18:57'),
(2107, 'PNSSKD002', 27, 'Perhatikan bacaan berikut!<br>\r\n\r\n    (1) Tantrum adalah keadaan ketika anak meluapkan emosinya dengan cara menangis kencang, berguling-guling di lantai, hingga melempar barang. (2) Kondisi ini pasti membuat Bunda stres dan bingung.(3) Tenang ya,Bun. (4) Kondisi ini normal dan merupakan bagian dari proses perkembangan anak, kok.<br>\r\n    (5) Tantrum biasanya dialami oleh anak yang berusia 1—4  tahun. (6)[…], tidak hanya pada anak-anak, orang dewasa pun bisa mengalami tantrum. (7) Ketika Si Kecil mengalami tantrum, Bunda sebaiknya jangan panik dan ikut terbawa emosi. (8) Ada beberapa cara Bunda yang bisa lakukan untuk mengatasi anak tantrum.<br>\r\n    (9) Tantrum umumnya disebabkan karena terbatasnya kemampuan bahasa anak untuk mengekspresikanperasaannya. (10) Mereka hanya bisa meluapkan emosinya dengan cara meronta, berteriak, menangis, menjerit, serta menghentakkan kedua kaki dan tangannya ke lantai. (11) Pada kasus tertentu, tantrum pada anak mungkin bisa disebabkan oleh gangguan prilaku atau masalah psikologis, seperti autisme.<br>\r\nSumber: alodokter.com<br>\r\nKalimat tidak baku pada teks ditemukan pada kalimat nomor…', NULL, 1, 'Pada kalimat nomor 11 terdapat kata prilaku, yaitu bentuk tidak baku dari kata perilaku.', NULL, '2024-07-25 04:13:33', '2024-07-26 05:19:23'),
(2108, 'PNSSKD002', 28, 'Perhatikan bacaan berikut!<br>\r\n    (1) Tantrum adalah keadaan ketika anak meluapkan emosinya dengan cara menangis kencang, berguling-guling di lantai, hingga melempar barang. (2) Kondisi ini pasti membuat Bunda stres dan bingung.(3) Tenang ya,Bun. (4) Kondisi ini normal dan merupakan bagian dari proses perkembangan anak, kok.<br>\r\n    (5) Tantrum biasanya dialami oleh anak yang berusia 1—4  tahun. (6)[…], tidak hanya pada anak-anak, orang dewasa pun bisa mengalami tantrum. (7) Ketika Si Kecil mengalami tantrum, Bunda sebaiknya jangan panik dan ikut terbawa emosi. (8) Ada beberapa cara Bunda yang bisa lakukan untuk mengatasi anak tantrum.<br>\r\n    (9) Tantrum umumnya disebabkan karena terbatasnya kemampuan bahasa anak untuk mengekspresikanperasaannya. (10) Mereka hanya bisa meluapkan emosinya dengan cara meronta, berteriak, menangis, menjerit, serta menghentakkan kedua kaki dan tangannya ke lantai. (11) Pada kasus tertentu, tantrum pada anak mungkin bisa disebabkan oleh gangguan prilaku atau masalah psikologis, seperti autisme.<br>\r\nSumber: alodokter.com<br>\r\nAntonim dari kata kencang ialah…', NULL, 4, 'Menurut Tesaurus Bahasa Indonesia, antonim dari kata kencang ialah lambat.', NULL, '2024-07-25 04:15:31', '2024-07-26 05:19:51'),
(2109, 'PNSSKD002', 29, 'Perhatikan bacaan berikut!<br>\r\n    (1) Tantrum adalah keadaan ketika anak meluapkan emosinya dengan cara menangis kencang, berguling-guling di lantai, hingga melempar barang. (2) Kondisi ini pasti membuat Bunda stres dan bingung.(3) Tenang ya,Bun. (4) Kondisi ini normal dan merupakan bagian dari proses perkembangan anak, kok.<br>\r\n    (5) Tantrum biasanya dialami oleh anak yang berusia 1—4  tahun. (6)[…], tidak hanya pada anak-anak, orang dewasa pun bisa mengalami tantrum. (7) Ketika Si Kecil mengalami tantrum, Bunda sebaiknya jangan panik dan ikut terbawa emosi. (8) Ada beberapa cara Bunda yang bisa lakukan untuk mengatasi anak tantrum.<br>\r\n    (9) Tantrum umumnya disebabkan karena terbatasnya kemampuan bahasa anak untuk mengekspresikanperasaannya. (10) Mereka hanya bisa meluapkan emosinya dengan cara meronta, berteriak, menangis, menjerit, serta menghentakkan kedua kaki dan tangannya ke lantai. (11) Pada kasus tertentu, tantrum pada anak mungkin bisa disebabkan oleh gangguan prilaku atau masalah psikologis, seperti autisme.<br>\r\nSumber: alodokter.com<br>\r\nMakna kata kondisi pada teks di atas ialah…', NULL, 3, 'Menurut Kamus Besar Bahasa Indonesia, arti dari kata kondisi ialah keadaan;\r\npersyaratan.', NULL, '2024-07-25 04:20:00', '2024-07-26 05:20:29'),
(2110, 'PNSSKD002', 30, 'Perhatikan bacaan berikut!<br>\r\n    (1) Tantrum adalah keadaan ketika anak meluapkan emosinya dengan cara menangis kencang, berguling-guling di lantai, hingga melempar barang. (2) Kondisi ini pasti membuat Bunda stres dan bingung.(3) Tenang ya,Bun. (4) Kondisi ini normal dan merupakan bagian dari proses perkembangan anak, kok.<br>\r\n    (5) Tantrum biasanya dialami oleh anak yang berusia 1—4  tahun. (6)[…], tidak hanya pada anak-anak, orang dewasa pun bisa mengalami tantrum. (7) Ketika Si Kecil mengalami tantrum, Bunda sebaiknya jangan panik dan ikut terbawa emosi. (8) Ada beberapa cara Bunda yang bisa lakukan untuk mengatasi anak tantrum.<br>\r\n    (9) Tantrum umumnya disebabkan karena terbatasnya kemampuan bahasa anak untuk mengekspresikanperasaannya. (10) Mereka hanya bisa meluapkan emosinya dengan cara meronta, berteriak, menangis, menjerit, serta menghentakkan kedua kaki dan tangannya ke lantai. (11) Pada kasus tertentu, tantrum pada anak mungkin bisa disebabkan oleh gangguan prilaku atau masalah psikologis, seperti autisme.<br>\r\nSumber: alodokter.com<br>\r\nJika dilihat dari kalimat utamanya, paragraf tersebut termasuk kedalam paragraf ..', NULL, 2, 'Paragraf tersebut termasuk dalam paragraf deduktif karena kalimat\r\nutamanya terdapat pada awal paragraf.', NULL, '2024-07-25 04:22:43', '2024-07-26 05:20:56'),
(2111, 'PNSSKD002', 31, 'Muktabar : Hina = ....', NULL, 3, 'Muktabar lawan katanya hina, maka asli lawan katanya artifisial.', NULL, '2024-07-25 05:06:53', '2024-07-25 05:06:53'),
(2112, 'PNSSKD002', 32, 'Neurologi : Saraf<br>\r\nHidrologi : Air<br>\r\nKardiologi : Otot<br>\r\nEtnologi : Suku<br>\r\nGeologi : Tanah<br><br>\r\nYang berbeda dengan yang lain adalah ……', NULL, 5, 'Pada soal diatas terdapat 2 bagian kata, kata bagian kiri adalah ilmu dan yang\r\nsebelah kanan adalah objek, Jika kita bedah satu persatu, maka :<br>\r\nNeurologi merupakan ilmu tentang saraf (benar)<br>\r\nHidrologi merupakan ilmu tentang air (benar)<br>\r\nEtnologi merupakan ilmu tentang suku (benar)<br>\r\nGeologi merupakan ilmu tentang tanah (benar)<br>\r\nKardiologi merupakan ilmu tentang Otot (salah) karena kardiologi\r\nmerupakan ilmu tentang jantung.', NULL, '2024-07-25 05:11:16', '2024-07-25 05:11:16'),
(2113, 'PNSSKD002', 33, 'Hangat : Mendidih = .... : ....', NULL, 2, 'Pada soal terdapat kata Hangat : Mendidih, dimana hubungan 2 kata tersebut adalah,\r\nair yang direbus awalnya hangat lama kelamaan akan mendidih. Maka jawaban yang\r\nmempunyai hubungan yang sama adalah Redup : Gelap. Dimana cahaya awalnya\r\nredup lama kelamaan akan menjadi gelap.', NULL, '2024-07-25 05:13:10', '2024-07-25 05:13:10'),
(2114, 'PNSSKD002', 34, 'Semua tumbuhan membutuhkan cahaya matahari. Beberapa tumbuhan tidak perlu\r\ndiberi pupuk. Kesimpulan ....', NULL, 4, 'Semua tumbuhan membutuhkan cahaya matahari. Beberapa tumbuhan tidak perlu diberi\r\npupuk. Kesimpulan ada tumbuhan yang membutuhkan cahaya matahari dan perlu diberi\r\npupuk', NULL, '2024-07-25 05:16:48', '2024-07-25 05:16:48'),
