(2117, 'PNSSKD002', 37, 'Sebuah keluarga terdiri dari delapan orang: A, B, C, D, E, F, G, H.<br>\r\nTerdapat tiga pasang suami istri.<br>\r\n- A adalah saudara dari F dan anak dari C.<br>\r\n- H adalah cucu dari G dan anak dari B.<br>\r\n- B adalah saudara ipar dari A dan F.<br>\r\n- D adalah menantu C dan saudara ipar A.<br>\r\nPernyataan yang benar adalah……', NULL, 4, NULL, '1721952561.png', '2024-07-25 16:09:21', '2024-07-26 17:00:29'),
(2118, 'PNSSKD002', 38, 'Delapan anak tinggal di delapan lantai apartemen berurutan yang berbeda.<br>\r\n- Bima tinggal tepat diatas Hana.<br>\r\n- Arini tinggal di lantai kedua di bawah Hana.<br>\r\n- Hana tinggal di bawah Edi.<br>\r\n- Dewi tepat tinggal di bawah Farhan.<br>\r\n- Gio tinggal di antara Farhan dan Arini.<br>\r\nPernyatan yang salah adalah ……', NULL, 4, NULL, '1722000317.png', '2024-07-25 16:19:15', '2024-07-26 05:25:17'),
(2119, 'PNSSKD002', 39, 'Panitia Lomba Kebersihan antar sekolah akan memberikan penilaian kepada lima\r\nsekolah berbeda. Jika skor untuk masing-masing aspek per satuan adalah UKS : 10,\r\nkamar mandi : 5, petugas kebersihan : 5 dan tempat sampah : 2, maka sekolah yang\r\nmenang adalah ......', '1721955057.png', 2, 'Untuk menjawab soal tabel seperti ini, cukup dengan mencermati pertanyaan dan data\r\nyang tersedia pada tabel. Maka jika pertanyaannya sekolah mana yang menang, yang\r\nmenang adalah sekolah yang memperoleh skor paling tinggi. Yaitu B. Sekolah B.', NULL, '2024-07-25 16:50:57', '2024-07-25 16:50:57'),
(2120, 'PNSSKD002', 40, '<b>Perhatikan teks di bawah ini!!</b><br>\r\nEnam orang anak duduk berhadapan di depan meja persegi. Dua orang anak duduk\r\nbersebelahan menghadap ke dua anak lain yang duduk di sisi persegi berbeda.\r\nSementara dua lainnya duduk berhadapan di sisi lain. Mereka adalah A, B, C, D, E dan F\r\ndengan ketentuan posisi duduk sebagai berikut:<br>\r\n-  A dan E duduk bersebelahan di satu sisi meja yang sama<br\r\n- B tidak duduk di depan A dan C <br>\r\n-  F duduk di sebelah A<br>\r\nSiapa yang mungkin duduk di depan B?', NULL, 4, NULL, '1721999621.png', '2024-07-25 16:54:58', '2024-07-26 17:07:11'),
