(2131, 'PNSSKD002', 50, 'Jik A = berat total x kotak yang masing masing beratnya y kg dan B = berat total y kotak yang masing masing beratnya x kg, maka ...', NULL, 3, 'A = x.y<br>\r\nB = y.x = x.y<br>\r\nMaka jika dilihat pada rumus di atas A sama denga B dimana A = x.y dan B = x.y.<br>\r\nJawaban yang tepat adalah C. A = B', NULL, '2024-07-26 05:50:55', '2024-07-26 05:50:55'),
