(2134, 'PNSSKD002', 52, 'Sebuah pabrik direncanakan selesai dibangun dalam waktu 90 hari dengan melibatkan\r\n20 orang pekerja. Jika ternyata sebelum dibangun ada 2 orang pekerja mengundurkan\r\ndiri, maka kemungkinan pembangunan akan mundur selama .... hari dari rencana\r\npenyelesaian.', NULL, 5, NULL, '1722041521.png', '2024-07-26 15:24:38', '2024-07-26 16:52:01'),
