(2136, 'PNSSKD002', 54, 'Untuk menempuh perjalanan sejauh 240 km, Rafdan membutuhkan waktu 5 jam dengan\r\nistrahat di rest area sebanyak dua kali, masing-masing selama 15 menit. Kecepatan yang dibutuhkan Rafdan untuk sampai ke tempat tujuan adalah ....', NULL, 2, '<b>Diketahui</b><br>\r\nJarak = 240 km<br>\r\nwaktu = 5 jam – 30 menit = 4,5 jam<br>\r\nKecepatan = 240 : 4,5 jam = 53,3 km/jam', NULL, '2024-07-26 15:35:59', '2024-07-26 15:35:59'),
(2137, 'PNSSKD002', 55, 'Pak Hasan memiliki 2 hektar tanah. <sup>3</sup>/<sub>5</sub> bagian dari tanahnya ia Tanami dengan padi. <sup>1</sup>/<sub>4</sub>\r\nditanami pisang dan sisanya ditanami cabai. Luas tanah yang ditanami cabai adalah ....m<sup>2</sup>', NULL, 5, '<b>Diketahui</b><br>\r\nLuas Tanah :<br>\r\n2 hektar = 2000 m<sup>2</sup><br>\r\n- Padi = <sup>3</sup>/<sub>5</sub> x 20.000 m<sup>2</sup> = 12.000 m<sup>2</sup><br>\r\n- Pisang = <sup>1</sup>/<sub>4</sub> x 20.000 m<sup>2</sup> = 5.000 m<sup>2</sup><br>\r\n- Cabai = 20.000 m<sup>2</sup>  - ( 12.000 m<sup>2</sup> + 5.000 m<sup>2</sup> ) = 3.000 m<sup>2</sup>', NULL, '2024-07-26 16:07:16', '2024-07-26 16:58:07'),
