(2139, 'PNSSKD003', 1, 'Setelah Indonesia merdeka, sikap nasionalisme sangat diperlukan oleh seluruh\r\nmasyarakat Indonesia dengan tujuan untuk....', NULL, 1, 'Setelah Indonesia merdeka, sikap nasionalisme sangat diperlukan oleh seluruh masyarakat\r\nIndonesia dengan tujuan untuk mempertahankan negara.', NULL, '2024-07-26 19:35:58', '2024-07-26 19:37:03'),
(2140, 'PNSSKD003', 2, 'Pada saat detik-detik menjelang proklamasi kemerdekaan, Sayuti Melik bertugas\r\nsebagai pengetik naskah proklamasi. Berkat pendidikannya di sekolah guru dan\r\nmerupakan seorang wartawan, Sayuti Melik mengubah beberapa ejaan dan kalimat di\r\nnaskah teks proklamasi. Ejaan atau kalimat yang diubah Sayuti Melik adalah....', NULL, 4, 'Ejaan atau kalimat yang diubah pada teks proklamasi oleh Sayuti Melik adalah<br>\r\n- Kalimat “wakil-wakil bangsa Indonesia” diubah menjadi “atas nama bangsa Indonesia”<br>\r\n- “tempoh” diubah menjadi “tempo”<br>\r\n- Adanya penambahan nama Soekarno-Hatta di bagian bawah<br>\r\n- Djakarta, 17-8-05 diubah menjadi Djakarta, hari 17 boelan 8 tahun 05', NULL, '2024-07-26 19:41:13', '2024-07-26 19:41:13'),
(2141, 'PNSSKD003', 3, 'Penyimpangan yang terjadi pada masa demokrasi terpimpin Ir. Soekarno adalah ....', NULL, 2, 'Penyimpangan yang terjadi pada masa demokrasi terpimpin Soekarno adalah membagi\r\nkekuatan politik dunia menjadi dua, yaitu nefo dan oldefo. Nefo merupakan negara-negara\r\nbaru penentang imperialisme dan kapitasme sedangkan oldefo merupakan negara-negara\r\nbarat yang menganut imperialisme dan kapitalisme. Soekarno mengajak negara-negara\r\nmelawan oldefo di dunia internasional yang bertentangan dengan prinsip dasar Gerakan Non\r\nBlok.', NULL, '2024-07-26 19:43:11', '2024-07-26 19:43:11'),
(2142, 'PNSSKD003', 4, 'Nasionalisme Indonesia adalah nasionalisme yang tak bisa dilepaskan dari kemanusiaan universal dalam pergaulan antarbangsa. Selain itu, ada dua tujuan nasionalisme yang mau disasar dari semangat gotong royong, yaitu kedalam dan keluar. Tujuan nasionalisme ke dalam ditunjukkan melalui peristiwa ....', NULL, 4, 'Ada dua tujuan nasionalisme yang mau disasar dari semangat\r\ngotong royong, yaitu kedalam dan keluar. Kedalam, kemajemukan dan\r\nkeanekaragaman budaya, suku, etnis, agama yang mewarnai kebangsaan Indonesia,\r\ntidak boleh dipandang sebagai hal negatif dan menjadi ancaman yang bisa saling\r\nmenegasikan. Sebaliknya, hal itu perlu disikapi secara positif sebagai limpahan karunia\r\nyang bisa saling memperkaya khazanah budaya dan pengetahuan melalui proses\r\npenyerbukan budaya. Keluar, nasionalisme Indonesia adalah nasionalisme yang\r\nmemuliakan kemanusiaan universal dengan menjunjung tinggi persaudaraan,\r\nperdamaian, dan keadilan antar umat manusia. Jadi jika dilihat dari konsep tersebut\r\n(tujuan nasionalisme ke dalam), opsi D menunjukkan implementasi peristiwa yang tepat', NULL, '2024-07-26 19:50:19', '2024-07-26 19:50:19'),
(2143, 'PNSSKD003', 5, 'Pada kongres pemuda kedua, tepatnya agenda rapat\r\nkedua yang diselengarakan pada Minggu, 28 Oktober 1928 di Gedung Oost Java\r\nBioscoop. Rapat ini membahas permasalahan pendidikan di Hindia Belanda. Ada tokoh\r\nyang berpendapat bahwa anak-anak di Hindia Belanda harus mendapatkan pendidikan\r\nkebangsaan. Tokoh yang dimaksud yakni....', NULL, 3, 'Tokoh tersebut adalah Poernomowoelan dan Sarmidi Mangoensarkoro yang\r\nberpendapat bahwa anak-anak di Hindia Belanda harus mendapatkan pendidikan\r\nkebangsaan. Selanjutnya, Soenario pada sesi berikutnya menjelaskan tentang\r\npentingnya nasionalisme dan demokrasi selain gerakan kepanduan.', NULL, '2024-07-26 19:55:42', '2024-07-26 19:55:42'),
(2144, 'PNSSKD003', 6, 'Peran aktif Indonesia dalam upaya penanganan global pendemi Covid-19\r\ndilanjutkan dengan keikutsertaannya dalam forum International Coordination Group on\r\nCOVID-19 (ICGC). Menlu, Retno L. P. Marsudi menegaskan kebutuhan atas kerja sama\r\nyang erat dan konkret dari tiap negara untuk bersama-sama menanggulangi dampak\r\npenyebaran Covid-19 bagi masyarakat. Indonesia menyatakan upaya kolektif dalam\r\nupaya memutus mata rantai penularan dan penyebaran Covid-19 yang harus diiringi\r\ndengan koordinasi lebih lanjut dalam pemulihan ekonomi global pasca-pandemi. Setelah\r\nmembaca dan menelaah informasi tersebut, bagaimana anda menyikapi isu penguatan\r\npolitik luar negeri Indonesia jika dikaitkan dengan kepentingan nasional di masa\r\npandemi ini ....', NULL, 4, 'Sebagai warga negara yang baik dalam hal mendukung\r\npemerintah guna mewujudkan tujuan nasional yakni melindungi segenap bangsa\r\nIndonesia dan seluruh tumpah darah Indonesia, maka manifestasi sikap yang paling\r\ntepat adalah opsi D (mendukung upaya pemerintah dalam hal penyaluran dan\r\npengadaan vaksin dari China dengan menyambut antusias dan bersedia divaksin\r\nsewaktu-waktu) . Hal ini relevan dengan pernyataan diplomatik Kemenlu RI bahwa\r\nupaya kolektif dalam pembuatan dan penyaluran vaksin harus diiringi dengan\r\nkoordinasi lebih lanjut dalam pemulihan ekonomi global pasca-pandemi. Sebagai\r\nwarga negara kita harus mendukung langkah dan ittikad baik ini.', NULL, '2024-07-26 19:57:51', '2024-07-26 19:57:51'),
