(2147, 'PNSSKD003', 7, 'Seorang ASN dikatakan memiliki nilai integritas tinggi, jika pada dirinya tertanam nilai....', NULL, 3, 'Seorang ASN dikatakan memiliki nilai integritas tinggi, jika pada dirinya tertanam nilai\r\nkejujuran.', NULL, '2024-07-26 21:15:03', '2024-07-26 21:15:03'),
(2148, 'PNSSKD003', 8, 'Kapitan Pattimura merupakan pahlawan yang berasal dari Maluku. Beliau merupakan pimpinan perang pada saat perang Pattimura berkecamuk. Pada saat itu, rakyat Maluku\r\nbersama-sama melawan Belanda. Karena dianggap memberontak dan tidak bisa\r\nbekerja sama dengan pihak Belanda, akhirnya Kapitan Pattimura diadili di Pengadilan\r\nKolonial Belanda. Kapitan Pattimura kemudian dijatuhi hukuman gantung. Sebelum\r\ndieksekusi, Pattimura terus dibujuk oleh Belanda agar mau bekerja sama dengan\r\npemerintah Kolonial Belanda namun beliau menolaknya. Kapitan Pattimura akhirnya\r\nmenghembuskan nafas terakhirnya di tiang gantungan. Berdasarkan wacana di atas,\r\nsikap integritas yang bisa kita teladani adalah....', NULL, 2, 'Berdasarkan wacana di atas, sikap integritas yang bisa kita teladani adalah semangat\r\npatriotisme sangat diperlukan dalam membela tanah air meskipun nyawa menjadi taruhan.', NULL, '2024-07-26 21:17:11', '2024-07-26 21:17:11'),
(2149, 'PNSSKD003', 9, 'Siapapun pasti kenal dengan Ki Hajar Dewantara, seseorang yang diberi julukan sebagai\r\nBapak Pendidikan Indonesia. Ki Hajar Dewantara merupakan keturunan bangswan,\r\nyaitu putra dari GPH Soerjaningrat dan merupakan cucu dari Pakualam III. Atas latar\r\nbelakangnya tersebut, ia tak kesulitan mengeyam pendidikan. Ki Hajar, pernah\r\nmengenyam sekolah dokter, namun tak urung lulus karena beliau sakit. Ki Hajar juga\r\npernah berkiprah di dunia jurnalistik dan dunia politik. Ia sempat bergabung dengan\r\norganisasi Budi Utomo dan sempat mendirikan Indische Partij pada tahun 1912.\r\nTulisannya yang tajam menyebabkan dirinya dimusuhi oleh Pemerintah Kolonial\r\nBelanda. Oleh karena itu, beliau menanggalkan gelar kebangsawanannya dengan\r\nmengganti namanya menjadi Ki Hajar Dewantara. Bersama dengan dua pendiri\r\nIndische Partij lainnya, Ki Hajar Dewantara dijatuhi hukuman tanpa proses pengadilan.\r\nMereka harus menjalani pembuangan di Belanda atas permintaan mereka sendiri.\r\nSelama 5 tahun, Ki Hajar memanfaatkan waktu pembuangannya tersebut untuk\r\nmendalami masalah pendidikan dan pengajaran sampai akhirnya beliau mendapatkan Europeesche Akte yang memungkinkannya untuk mendirikan Lembaga Pendidikan.\r\nSaat Indonesia merdeka, ia pun menjabat sebagai Menteri Pendidikan dan pengajaran\r\nyang pertama. Namun, tak seperti Menteri pada umumnya yang selepas dilantik\r\nmengadakan syukuran besar, beliau tak melakukannya. Saat Ki Hajar pulang ke rumah,\r\ntak ada makanan di meja makan. Istrinya kemudian meminta anaknya untuk membeli\r\nmie godhok di pinggir jalan. Makan malam dengan mie godhok serantang menjadi\r\nmenu syukuran kala itu. Nilai integritas yang dapat kita contoh dari seorang Ki Hajar\r\nDewantara adalah....', NULL, 2, 'Nilai integritas yang dapat kita contoh dari seorang Ki Hajar Dewantara adalah setinggi-\r\ntingginya status sosial seseorang hendaknya untuk selalu bersikap sederhana', NULL, '2024-07-26 21:19:38', '2024-07-26 21:19:38'),
(2150, 'PNSSKD003', 10, 'Untuk mencapai tujuan nasional dan tercipta good governance maka diperlukan norma\r\netika PNS yang memiliki landasan konstitusional berupa....', NULL, 4, 'Untuk mencapai tujuan nasional dan tercipta good governance maka diperlukan norma etika\r\nPNS yang memiliki landasan konstitusional berupa UUD 1945.', NULL, '2024-07-26 21:20:56', '2024-07-26 21:20:56'),
(2151, 'PNSSKD003', 11, 'Pasti kalian tak asing lagi dengan nama “Sayuti Melik”! Sayuti Melik merupakan\r\npengetik naskah proklamasi kemerdekaan Indonesia. Nama Melik merupakan nama\r\nsamaran yang dipergunakan di Semarang sekitar tahun 1938 pada Majalah Pesat\r\nmiliknya. Pada tahun 1920-1924, Sayuti Melik mengeyam sekolah guru yang berada di\r\nSolo. Beberapa bulan menjelang kelulusannya, saat beliau berusia 17 tahun, ia\r\nditangkap oleh polisi rahasia Belanda. Atas peristiwa tersebut, ia dikeluarkan dari\r\nsekolah. Meskipun demikian, ia tak patah semangat untuk belajar mandiri. Sayuti Melik\r\njuga menghabiskan waktunya untuk membantu perjuangan rakyat Indonesia agar\r\nterlepas dari penjajahan. Berdasarkan wacana di atas, nilai integritas yang dapat kita\r\nteladani adalah....', NULL, 3, 'Berdasarkan wacana di atas, nilai integritas yang dapat kita teladani adalah apapun kondisimu\r\nsaat ini, jangan pernah berhenti untuk menuntut ilmu', NULL, '2024-07-26 21:23:53', '2024-07-26 21:23:53'),
(2152, 'PNSSKD003', 12, 'Saat itu, sebagai menteri keuangan, Syafruddin membuat kebijakan untuk\r\nmemotong nilai uang menjadi setengahnya. Hal itu dilakukan karena negara sedang\r\nkesulitan dana. Kebijakan tersebut dikenal dengan \"Gunting Syafuddin\". \"Kok tidak\r\nbilang-bilang?\" protes Tengku Halimah kepada suaminya. Namun, Syafruddin\r\nmenjawab. \"Kalau bilang-bilang, tidak rahasia, dong!\"Kebijakan pemerintah yang\r\nditandangani Syafruddin itu memang bersifat rahasia. Akhirnya, bersama rakyat\r\nIndonesia lainnya, isteri menteri itu turut merasakan tajamnya \"Gunting Syafruddin\".\r\nKasus tersebut merupakan keteladanan tokoh yang memiliki nilai anti korupsi terutama...', NULL, 4, 'Kasus tersebut merupakan keteladanan tokoh yang memiliki\r\nnilai disiplin khususnya komitmen. Komitmen merupakan salah satu kunci\r\n\r\nterbentuknya disiplin. Komitmen adalah sikap mental pada diri seseorang untuk\r\nmelakukan segala sesuatu yang telah ditetapkan . Hal itu terbentuk dengan pembiasaan.\r\nSeseorang yang memiliki komitmen tinggi akan selalu melakukan segala sesuatu\r\nsesuai yang telah ditetapkannya', NULL, '2024-07-26 21:27:02', '2024-07-26 21:27:02'),
(2153, 'PNSSKD003', 13, 'Pandemi covid-19 yang terjadi hampir 2 tahun lamanya menyebabkan terjadinya\r\nperubahan pada setiap lini kehidupan. Kebiasaan yang tadinya merupakan hal baru\r\nmenjadi hal biasa saat ini. Salah satu kebiasaan baru pada masa covid-19 adalah\r\nmenggunakan masker. Tak hanya itu, masyarakat juga menjadi tidak asing lagi\r\nmenggunakan handsanitizer. Sebelum adanya pandemi, mungkin kita hanya\r\nmenjumpai handsanitizer di fasilitas kesehatan. Namun, saat ini handsanitizer dapat kita\r\njumpai di tempat makan, sekolah, rumah, gedung pemerintahan, dan sebagainya.\r\nKasus corona yang belum mereda juga mengharuskan semua masyarakat berpartisipasi\r\nmemutus rantai penyebaran covid-19 sebagai bentuk upaya wujud bela negara. Jika\r\nkamu adalah seorang kepala desa, apa wujud bela negara yang bisa dilakukan dalam\r\nmenghadapi pandemi ini?', NULL, 4, 'Jika kamu adalah seorang kepala desa, wujud bela negara yang bisa dilakukan dalam\r\nmenghadapi pandemi ini adalah dengan mengajak masyarakat untuk melakukan vaksinasi.', NULL, '2024-07-26 22:03:12', '2024-07-26 22:03:12'),
(2154, 'PNSSKD003', 14, 'Salah satu komponen cadangan yang dilatih dan dipersiapkan untuk mempertahankan\r\nNKRI sebagai perwujudan sistem pertahanan dan keamanan rakyat semesta adalah....', NULL, 3, 'Wanra adalah satu komponen cadangan yang dilatih dan dipersiapkan untuk\r\nmempertahankan NKRI sebagai perwujudan sistem pertahanan dan keamanan rakyat\r\nsemesta.', NULL, '2024-07-26 22:06:00', '2024-07-26 22:06:00'),
(2155, 'PNSSKD003', 15, 'Peristiwa Rengasdengklok diakibatkan oleh…', NULL, 3, 'Perbedaanpandangan kemerdekaan Negara Indonesia antara golongan\r\nmuda dengan golongan tua  <br>\r\n   \r\nPeristiwa Rengasdengklok diakibatkan perbedaan pandangan\r\nkemerdekaan Negara Indonesia antara golongan muda dengan\r\ngolongan tua. Sehingga, golongan muda (antara lain, Soekarni,\r\nWikana, Aidit, dan Chaerul Saleh) menculik Soekarno dan\r\nHatta selaku golongan tua. Kemudian, Para golongan tua\r\ndibawa ke Rengasdengklok. Mereka dipaksa untuk segera\r\nmemproklamasikan kemerdekaan. Peristiwa itu terjadi pada\r\ntanggal 16 Agustus 1945', NULL, '2024-07-26 22:08:39', '2024-07-26 22:08:39'),
(2156, 'PNSSKD003', 16, 'Yang paling penting menjadi Nilai Dasar Bela Negara adalah . . .', NULL, 5, '<b>Nilai Dasar Bela Negara</b><br>\r\n\r\n \r\n\r\n1.Cinta tanah air – Setia<br>\r\n 2.Sadar berbangsa dan bernegara – Bersatu<br>\r\n3.Setia pada Pancasila sebagai ideologi negara – Pengamalan 45\r\nButir Pancasila<br>\r\n4.Rela berkorban untuk bangsa dan negara – Ikhlas - Tidak\r\nPamrih – Berprestasi sesuai profesi<br>\r\n5.Kemampuan awal Bela Negara – Belajar, Memahami Konsep\r\nBela Negara<br>\r\nMaka jawaban yang tepat adalah E,', NULL, '2024-07-26 22:11:07', '2024-07-26 22:24:43'),
(2157, 'PNSSKD003', 17, 'Cinta tanah air merupakan usaha membela dari segala macam gangguan dan\r\nancaman yang datang dari manapun. Berikut ini merupakan contoh dari cinta tanah air\r\nyang merupakan perwujudan dari upaya bela negara adalah....', NULL, 1, 'Berikut ini merupakan contoh dari cinta tanah air yang merupakan perwujudan dari upaya\r\nbela negara adalah membantu memasarkan produk UMKM agar dapat terjual di kancah\r\ninternasional', NULL, '2024-07-26 22:13:13', '2024-07-26 22:13:13'),
(2158, 'PNSSKD003', 18, 'Selama suatu negara berdiri pastinya akan dibayangi dengan ancaman, baik itu ancama\r\ntradisional maupun ancaman non tradisional. Ancaman negara merupakan setiap usaha\r\ndan kegiatan, yang berasal dari dalam dan luar negeri yang dinilai membahayakan\r\nkedaulatan negara, keutuhan negara, dan mengancam keselamatan segenap bangsa.\r\nBerikut ini yang merupakan ancaman terhadap bangsa dan negara yang pelakunya\r\nnegara....', NULL, 4, '<b>Ancaman yang pelakunya negara (ancaman tradisional), meliputi:</b><br>\r\n- Agresi militer<br>\r\n- Pelanggaran wilayah<br>\r\n- Aksi terror bersenjata<br>\r\n- Bombardemen<br>\r\n- Invasi<br>\r\n- Blockade<br>\r\n- Sabotase<br>\r\n- Perang saudara<br>\r\n- Spionase<br>\r\n- Pemberontakan bersenjata', NULL, '2024-07-26 22:15:13', '2024-07-26 22:22:08'),
(2159, 'PNSSKD003', 19, '<b>Perhatikan pernyataan berikut ini!</b><br>\r\n1. Presiden<br>\r\n2. Pancasila<br>\r\n3. Burung garuda<br>\r\n4. Bhineka tunggal ika<br>\r\n5. NKRI<br>\r\n6. UUD 1945<br>\r\n7. Bendera merah putih<br>\r\nPilar-pilar kehidupan berbangsa dan bernegara ditunjukkan oleh nomor....', NULL, 2, 'Pilar-pilar kehidupan berbangsa dan bernegara meliputi:<br><br>\r\n- Pancasila<br>\r\n- UUD 1945<br>\r\n- NKRI<br>\r\n- Bhineka Tunggal ika', NULL, '2024-07-26 22:20:32', '2024-07-26 23:20:40'),
(2160, 'PNSSKD003', 20, 'Sudah hampir 2 pekan lamanya, Sintang Kalimantan Barat dilanda banjir. Dilihat dari\r\nkondisi morfologinya, Sintang merupakan wilayah yang rawan terjadi banjir karena\r\nberada di tengah DAS Kapuas. Ahli hidrologi juga mengatakan salah satu penyebab\r\nbanjir di Sintang adalah adanya alih fungsi lahan dari lahan konservasi menjadi lahan\r\nproduktif. Hal ini tentunya berdampak pada menurunnya daerah resapan air pada\r\nwilayah tersebut. Peristiwa di atas, merupakan bentuk pelanggaran terhadap Pancasila\r\nkhususnya sila ke....', NULL, 5, 'Peristiwa di atas, merupakan bentuk pelanggaran terhadap Pancasila khususnya sila ke-5. Hal\r\nini bertentangan dengan butir tidak menggunakan hak milik untuk bertentangan dengan\r\natau merugikan kepentingan umum.', NULL, '2024-07-26 22:26:38', '2024-07-26 22:26:38'),
(2161, 'PNSSKD003', 21, 'Berikut ini yang mencerminkan pelanggaran terhadap pasal\r\n28 tentang HAM yang mencederai nilai kemanusiaan yang adil dan beradab adalah ....', NULL, 5, '-Opsi A melanggar sila 5 (pasal tentang hak milik pribadi),<br>\r\n- opsi B sila 5 (dan pasalnya keliru karena pasal 28 B ayat 2 terkait hak perlindungan dari\r\nkekerasan dan diskriminasi), <br>\r\n- opsi C sila 5 (pasal tentang hak jaminan sosial), <br>\r\n- opsi D sila 4 (pasal tentang hak memperoleh kesempatan yang sama dalam\r\npemerintahan). <br>\r\n- opsi E melanggar nilai kemanusiaan yang adil dan beradab,\r\nbutir tidak bertindak sewenang-wenang . Pun pasal 28 B ayat 2 juga mengandung\r\nkonteks HAM terkait hak mendapatkan perlindungan, hak terbebas dari kekerasan dan\r\ndiskriminasi. Kasus di opsi E merupakan contoh implementasi negatif atasan ke\r\nbawahan yang mengarah pada kekerasan dan pelecehan seksual, baik kepada bawahan\r\nperempuan maupun laki-laki. Sederhananya opsi E merupakan tindakan yang tidak\r\nberadab/bermoral.', NULL, '2024-07-26 22:36:49', '2024-07-26 23:21:47'),
(2162, 'PNSSKD003', 22, 'Penanganan pandemi Covid-19 merupakan tantangan\r\nterhadap implementasi otonomi daerah, sebab hampir semua daerah di Indonesia dilanda\r\npandemi. Dalam hal ini, asas otonomi daerah yang diterapkan pada situasi tersebut lebih\r\nmengedepankan asas ...', NULL, 2, 'Dalam hal penanganan Covid-19,\r\npemerintah daerah diberikan diskresi sehingga lebih leluasa berkreasi dan berinovasi\r\nuntuk merespon dinamika penanganan pandemi Covid-19 di daerah yang disertai\r\nalokasi anggaran pemerintah pusat ke daerah', NULL, '2024-07-26 22:38:40', '2024-07-26 22:38:40'),
(2163, 'PNSSKD003', 23, 'Saat terjadinya kenaikan kasus covid-19, Pak Rahmat tetap melangsungkan acara\r\npernikahan putrinya secara mewah. Padahal, H-7 sebelum acara berlangsung, sudah\r\nterbit surat edaran yang melarang dilakukan hajatan, namun Pak Rahmat tak\r\nmengindahkannya. Ribuan tamu undangan datang menghadiri pernikahan putri Pak\r\nRahmat. Sebagian dari tamu undangan banyak yang tidak memakai masker saat\r\nmenghadiri acara tersebut. Tamu undangan pun tampak berdesak-desakan di dalam\r\nacara tersebut. Mereka berebutan untuk mengantre hidangan dan bersalaman dengan\r\nkedua mempelai. Maklum, Pak Rahmat merupakan wirausahawan kaya raya di\r\nkabupaten tersebut. Atas peristiwa tersebut, ratusan orang mengalami anosmia.\r\nTindakan yang dilakukan Pak Rahmat, bertentangan dengan Pancasila sila ke....', NULL, 2, 'Tindakan yang dilakukan Pak Rahmat, bertentangan dengan Pancasila sila ke-4. Hal ini\r\nbertentangan dengan butir menghormati dan menjunjung tinggi setiap keputusan yang\r\ndicapai sebagai hasil musyawarah.', NULL, '2024-07-26 22:41:03', '2024-07-26 22:41:03'),
(2164, 'PNSSKD003', 24, 'Kur danmIne ialah CPNS di Kemendikbud tepatnya di Direktorat Pengembangan dan Pemanfaatan\r\nKebudayaan. Menjelang HUT RI ke 75, keduanya ditunjuk sebagai ketua pelaksana\r\nacara \"Eksistensi Kebudayaan untuk Indonesia Maju.\" Keduanya sepakat untuk\r\nmempertunjukan tarian yang ada di Indonesia meliputi tari saman, tari jaipong, tari\r\nperang dan Reog Ponorogo dalam perayaan tersebut. Hal ini bertujuan terutama agar...', NULL, 4, 'Jawaban D. Hal yang dilakukan oleh Kur dan lne merupakan\r\nimplementasi kebhinekaan guna menumbuhkan toleransi yang tinggi antarkebudayaan.\r\nSikap saling menghargai antargolongan, mengenali, dan mencintai budaya lain adalah\r\nhal yang perlu dibudayakan. Contoh nyata implementasi hal tersebut adalah dengan\r\nmempertunjukkan tarian suku-suku yang ada di Indonesia. Dengan demikian, setiap\r\nsuku mempunyai rasa simpati, apresiasi dan aktualisasi diri satu sama lainnya', NULL, '2024-07-26 22:45:11', '2024-07-26 22:45:11'),
(2165, 'PNSSKD003', 25, '<b>Perhatikan penulisan dalam surat dibawah ini:</b><br>\r\n<i>Kepada Yth. Kepala Dinas Perpustakaan dan Kearsipan Kota Salatiga, jalan Mawar\r\nnomor 5 Salatiga.</i><br> Menurut anda, bagaimana perbaikan penulisan surat yang tepat!', NULL, 2, 'Penulisan nama tempat menggunakan huruf awal kapital\r\nseuai dengan kaidah PUEBI setiap nama geografi menggunakan huruf awal kapital<br>Yth. Kepala Dinas Perpustakaan dan Kearsipan Kota Salatiga (tuliskan alamat misalnya\r\nJalan Mawar Nomor 5, Salatiga)', NULL, '2024-07-26 22:56:56', '2024-07-26 23:29:37');
INSERT INTO `soals` (`id`, `id_paket`, `nomor_soal`, `isi_soal`, `gambar_soal`, `nomor_jawaban`, `isi_solusi`, `gambar_solusi`, `created_at`, `updated_at`) VALUES
(2166, 'PNSSKD003', 26, '<b>Perhatikan wacana berikut ini!</b><br>\r\nSaat ini, banyak petani mengeluhkan biaya pertanian yang mahal tak sebanding\r\ndengan harga jual padi. Tidak hanya harga pupuk yang mahal, prosedur untuk membeli\r\npupuk saat ini juga diatur dengan regulasi yang tak semua petani bisa memahaminya.\r\nMemang serba salah jika akan menggarap lahan pertanian. Jika menggarap sawah,\r\ndefisit pendapatan seringkali terjadi. Apalagi, jika musim kemarau tiba, di wilayah\r\npertanian dengan sistem tadah hujan, a petani harus merogok kocek dalam-dalam\r\nuntuk biaya pembelian air. Berdasarkan wacana di atas, kalimat utamanya adalah....', NULL, 4, 'Berdasarkan wacana di atas, kalimat utamanya adalah Saat ini, banyak petani mengeluhkan\r\nbiaya pertanian yang mahal tak sebanding dengan harga jual padi setelah masa panen tiba.', NULL, '2024-07-26 23:03:58', '2024-09-26 01:50:45'),
(2167, 'PNSSKD003', 27, 'Manakah penggunaan kata baku yang benar?', NULL, 3, 'Berikut ini penggunaan kata baku yang benar:<br><br>\r\n- Pada bulan <u>November</u> ini, aku kehilangan adiku tercinta<br>\r\n- Setelah kepergiannya, ia berencana membangunkann <u>masjid</u> atas nama Ayahnya<br>\r\n- Jika dibandingkan rumahnya yang lain, rumah tua itu sangat <u>mencolok</u> pemandangan<br>\r\n- Aku tak habis <u>pikir</u>, kamu bisa memutuskan hal seceroboh itu<br>\r\n- Cepatlah kau pergi, ambil <u>nomor</u> antrian sekarang!', NULL, '2024-07-26 23:08:43', '2024-07-26 23:08:43'),
(2168, 'PNSSKD003', 28, 'Di bawah ini yang merupakan kalimat efektif adalah....', NULL, 5, 'Di bawah ini yang merupakan kalimat efektif adalah<br><br>\r\n- Purbalingga merupakan salah satu kabupaten di Provinsi Jawa Tengah<br>\r\n- Demi adiknya, Vina rela tidak melanjutkan ke perguruan tinggi<br>\r\n- Ada banyak oleh-oleh yang disediakan di Getuk Goreng Haji Tohirin Sokaraja<br>\r\n- Rina adalah anak termanja di keluarganya<br>\r\n- Saran yang dikemukakanmu akan kami pertimbangkan', NULL, '2024-07-26 23:11:45', '2024-07-26 23:11:45'),
(2169, 'PNSSKD003', 29, '<b>Bacalah tulisan berikut!!,</b><br>\r\nFungsi pendidikan adalah serangkaian tugas ataupun misi yang\r\ndiemban dan dilaksanakan oleh pendidikan. Dari pengertian ini dapat\r\ndijelaskan, bahwa sesungguhnya kegiatan atau praktik pendidikan dimanapun\r\nbukanlah kegiatan tanpa makna dan tujuan yang jelas. Dalam kegiatan\r\npendidikan tersirat suatu tugas atau misi yang harus diwujudkan. Oleh karena\r\nitu, para pendidik, pengelola pendidikan, dan pihak-pihak yang terlibat dalam\r\nkegiatan pendidikan seharusnya selalu menyadari akan tugas atau misi\r\nkegiatan pendidikan yang dilaksanakan atau yang dikelolanya.<br><br>\r\nDari segi kultural dan sosial, fungsi pendidikan adalah menumbuhkan\r\nkreativitas subjek didik: menjaga kelestarian nilai-nilai insaniah dan ilahiah:\r\nserta menyiapkan tenaga kerja produktif. Sementara itu, Bock mengatakan\r\nbahwa peran pendidikan adalah memasyarakatkan ideologi dan nilai-nilai\r\nsosio-kultural bangsa: mempersiapkan tenaga kerja untuk memerangi\r\nkemiskinan, kebodohan, dan mendorong perubahan sosial serta memeratakan\r\nkesempatan dan pendapatan. Dari sumber tersebut jelas bahwa kegiatan atau\r\npraktik pendidikan memiliki tugas bukan hanya menjadikan peserta didik\r\ntumbuh dan berkembang potensi atau kemampuannya, melainkan juga\r\nmenjaga dan melestarikan nilai-nilai yang dianggap baik dan benar oleh\r\nmasyarakat dan bangsa serta menyiapkan peserta didik menjadi tenaga kerja\r\nproduktif. Di pihak lain, fungsi pendidikan nasional adalah mengembangkan\r\nkemampuan dan membentuk watak serta peradaban bangsa yang bermartabat\r\ndalam rangka mencerdaskan bangsa.<br><br>\r\nSumber: materibindo.com<br>\r\n\r\n \r\n\r\n<b>Judul yang tepat untuk bacaan tersebut adalah ..</b>', NULL, 2, 'Judul dalam suatu bacaan harus mencangkup atau menjiwai\r\nisi bacaan secara menyeluruh. Pada pilihan B judul sudah tepat karena\r\ndapat mewakili seluruh bacaan.', NULL, '2024-07-26 23:15:41', '2024-07-26 23:30:12'),
(2170, 'PNSSKD003', 30, '<b>Bacalah tulisan berikut!!</b><br>\r\nTenaga ahli kesehatan masyarakat segara garis besar\r\ndiperuntukkan untuk pemberantasan penyakit menular ataupun tidak menular,\r\nperbaikan kesehatan lingkungan: pemberantasan vektor: penyuluhan ke\r\nmasyarakat: pelayanan kesehatan: pembinaan gizi masyarakat: pengawasan\r\nobat dan minuman: serta pengawasan sanitasi tempat umum. (2)\r\nPemberantasan vektor rupanya memberikan andil yang cukup penting bagi\r\ntercapainya lingkungan yang sehat dari penyakit. (3) Karena dari\r\npemberantasan vektor inilah, semua asal penyakit bisa diketahui, dipelajari,\r\ndicari penyebab, pencegahan, dan penyembuhannya bagaimana. (4) Selain itu\r\npengawasan sanitasi tempat-tempat umum di Indonesia juga masih rendah. (5)\r\nPadahal hal ini sangat berpengaruh bagi kesehatan manusia, bahkan bisa\r\nsangat merugikan manusia dan lingkungan sendiri. (6) Masih banyak\r\nditemukan fasilitas umum seperti bak sampah, toilet umum, saluran air yang\r\njauh dari kebersihan dan kelayakan.<br><br>\r\nStruktur kalimat 1 adalah ....', NULL, 5, 'Berikut ini analisis kalimat 1.\r\n\r\n \r\n\r\nTenaga ahli kesehatan masyarakat (S) secara garis besar (K)\r\ndiperuntukkan (P) untuk pemberantasan penyakit menular ataupun tidak\r\nmenular: perbaikan kesehatan lingkungan:<br>\r\npemberantasan vektor, penyuluhan ke masyarakat: pelayanan kesehatan:\r\npembinaan gizi masyarakat: pengawasan obat dan minuman: serta\r\npengawasan sanitasi tempat umum (K).', NULL, '2024-07-26 23:17:59', '2024-07-26 23:17:59'),
(2172, 'PNSSKD003', 31, 'Maklumat : Manifesto = ....', NULL, 1, 'Maklumat sama artinya dengan manifesto maka level sama artinya dengan kelas.', NULL, '2024-07-27 03:41:16', '2024-07-27 03:41:16'),
(2173, 'PNSSKD003', 32, 'Gradasi : Tingkatan = ....', NULL, 1, 'Gradasi sama artinya dengan tingkatan, maka fortifikasi sama artinya dengan penguatan.', NULL, '2024-07-27 03:43:29', '2024-07-27 03:43:29'),
(2174, 'PNSSKD003', 33, 'Bajau : Memukul = .... : .....', NULL, 5, 'Bajau sama dengan Memukul, Provokasi sama dengan Gangguan<br>\r\njadi Jawabannya E', NULL, '2024-07-27 03:45:45', '2024-07-27 03:45:45'),
(2175, 'PNSSKD003', 34, 'Codak : Mencongak = .... : .....', NULL, 4, 'Codak sama artinya dengan mencongak, maka fitur sama artinya dengan sifat.', NULL, '2024-07-27 03:48:43', '2024-07-27 03:48:43'),
(2176, 'PNSSKD003', 35, 'Anggota yang tidak memiliki  anak lebih dari tiga orang menerima piagam dan hadiah.  Dedo menerima piagam organisasi, tetapi tidak menerima hadiah.<br>Simpulan yang tepat adalah ....', NULL, 4, 'Walaupun Dedo menerima piagam organisasi, bukan berarti \r\nia termasuk anggota yang tidak \r\nmemiliki anak lebih dari tiga \r\norang. Dan karena ia tidak termasuk anggota, maka ia tidak \r\nberhak menerima hadiah.', NULL, '2024-07-27 03:54:00', '2024-07-27 03:54:00'),
(2177, 'PNSSKD003', 36, 'Semua sekolah suka mengadakan pertunjukan musik. \r\nSekolah yang suka mengadakan pertunjukan musik suka \r\nmengadakan bakti sosial.Sebagian sekolah yang suka mengadakan bakti sosial tidak \r\nsuka mengikuti kompetisi olahraga antar sekolah.', NULL, 1, 'P1 :<b>Semua</b> sekolah suka mengadakan pertunjukan musik.<br> \r\nP2 : Sekolah yang suka mengadakan pertunjukan \r\nmusik suka mengadakan \r\nbakti sosial.<br>\r\nP3 : <b>Sebagian</b> sekolah yang \r\nsuka mengadakan bakti \r\nsosial tidak <b>suka mengikuti kompetisi olahraga \r\nantar sekolah.</b><br>\r\nK : <b>Sebagian</b> sekolah suka \r\nmengikuti kompetisi olahraga antar sekolah.', NULL, '2024-07-27 04:05:11', '2024-07-27 04:05:11'),
(2178, 'PNSSKD003', 37, 'Semua murid yang mengikuti ujian tidak menggunakan \r\nkalkulator. Sebagian murid yang mengikuti \r\nujian mengenakan jam tangan.\r\nSimpulan yang tepat adalah ....', NULL, 1, 'P1 : <b>Semua</b> murid yang mengikuti ujian tidak menggunakan kalkulator. <br>\r\nP2 : <b>Sebagian</b> murid yang \r\nmengikuti ujian mengenakan jam tangan.<br>\r\nK : <b>Sebagian</b> murid yang \r\nmengikuti ujian tidak \r\nmenggunakan kalkulator \r\ntetapi mengenakan jam \r\ntangan.', NULL, '2024-07-27 04:11:46', '2024-07-27 04:11:46'),
(2179, 'PNSSKD003', 38, '<b>Perhatikan bacaan berikut!!</b><br>\r\nDi sekolah Tina setiap murid harus \r\nmakan siang di kantin sekolah. Karena sedang batuk-pilek. Tina tidak \r\nboleh makan gorengan, minum \r\nyang dingin, dan harus lebih banyak makan sayuran dan buah-buahan. Selain itu, ada beberapa hal \r\nyang harus diingatnya:<br>\r\n(a) Ia hanya boleh minum es paling banyak 2 kali seminggu.<br>\r\n(b) Makanan gorengan hanya \r\nboleh dimakan 1 kali seminggu dan tidak boleh dengan \r\nminuman dingin.<br>\r\n(c) Ia boleh mengambil 4 jenis \r\nmakanan, diantaranya adalah \r\n1 jenis minuman (Jus buah \r\natau teh es) dan 1 porsi say-\r\nuran.<br>\r\n(d) Ia tidak boleh makan gorengan dan makanan pedas bersama-sama.<br><br> Jika hari Senin Tina sudah makan es buah, makanan yang \r\ntidak boleh dimakan Tina pada \r\nhari Rabu adalah ....', NULL, 4, 'Dari kelima pilihan jawaban, \r\npilihan jawaban D melanggar \r\nsyarat (b), yaitu Tina tidak boleh \r\nmakan gorengan bersama-sama dengan minuman dingin. \r\nJadi, jawaban yang tepat adalah pilihan jawaban (D).', NULL, '2024-07-27 04:21:11', '2024-07-27 04:21:11'),
(2180, 'PNSSKD003', 39, 'Warso, Budi, Hamid, Sakinah, dan Joyo adalah siswa SMA Dr. Syifa. \r\nJika diukur dari sekolah, maka rumah Warso lebih jauh daripada \r\nrumah Hamid. Rumah Budi lebih \r\ndekat daripada rumah Sakinah dan \r\nrumah Joyo.<br>Jika rumah Hamid lebih jauh \r\ndaripada rumah Joyo, maka \r\nanak yang paling dekat rumahnya dari sekolah adalah...', NULL, 1, 'Jika H lebih jauh daripada J, <br>\r\nmaka: urutan jarak dari sekolah yaiu :  B  S  J  H  W', NULL, '2024-07-27 04:24:45', '2024-07-27 04:24:45'),
(2181, 'PNSSKD003', 40, '<b>Bacalah teks di bawah ini</b><br>\r\nEmpat orang anak A, B, C, dan D duduk di depan sebuah meja persegi panjang Dua\r\norang anak duduk bersebelahan di bagian sisi meja dan berhadapan dengan dua lainya\r\ndi sisi depan serta anak lain berada di sisi lain saling berhadapan. Dengan ketentuan\r\nbahwa A duduk di samping F. D duduk diantara A dan C. B tidak mau di dekat C.\r\nSiapa yang duduk di hadapan A?', NULL, 2, NULL, '1722083255.png', '2024-07-27 04:27:35', '2024-07-27 04:27:35'),
