(2195, 'PNSSKD003', 54, 'Total harga tiket bioskop untuk satu orang dewasa dan dua \r\nanak-anak adalah Rp165.000,00. \r\nJika harga tiket orang dewasa \r\nadalah Rp30.000,00 lebih tinggi \r\ndaripada harga tiket anak-anak, \r\nberapakah harga tiket untuk \r\nanak-anak?', NULL, 1, NULL, '1722091557.png', '2024-07-27 06:45:57', '2024-07-27 06:45:57'),
(2196, 'PNSSKD003', 55, 'Seorang penjahit bisa menyelesaikan 20 buah kaus selama 5 hari. Jika ada pesanan 48\r\nkaus, maka ia bisa menyelesaikan selama .... hari', NULL, 4, '20 baju =  5 hari<br>\r\n48 baju = x<br>\r\n<sup>20</sup>/<sub>48</sub>    =   <sup>5</sup>/<sub>x</sub><br>\r\n20x = 48. 5<br>\r\n4x = 48<br>\r\nx= 12 hari', NULL, '2024-07-27 06:49:40', '2024-07-27 06:49:40'),
(2197, 'PNSSKD003', 56, 'Anita ingin mengisi sebuah bak mandi di rumahnya yang berukuran 1,5 m x 10 dm x 2 m.\r\nJika bak terisi penuh dalam kurun waktu 10 menit, maka debit aliran keran adalah ....\r\n<sup>liter</sup>/<sub>detik</sub>', NULL, 2, 'Debit = Volume : Waktu<br>\r\nVolume = p X l x t = 1,5 m . 1 m . 2 m = 3 m = 3000 liter<br>\r\nDebit = 3000 liter : 600 detik = 5 liter /detik', NULL, '2024-07-27 06:51:33', '2024-08-08 18:26:08'),
(2198, 'PNSSKD004', 1, 'Indonesia merupakan negara multikulural yang rentan terhadap etnosentrisme,\r\nintoleransi beragama, serta eksklusivisme. Di bawah ini tindakan yang tepat untuk\r\nmenghadapi fenomena tersebut adalah ....', NULL, 5, 'Tindakan yang tepat untuk menghadapi fenomena tersebut adalah menjadi relawan sosial\r\nyang aktif melakukan aksi sosial tanpa pandang bulu.', NULL, '2024-07-27 16:40:29', '2024-07-27 16:40:29'),
(2199, 'PNSSKD004', 2, 'Pulau Natuna sepertinya tidak pernah sepi dari pembicaraan. Bagaimana tidak, salah\r\nsatu pulau di Indonesia ini menyimpan berbagai kekayaan alam yang membuat siap saja\r\ningin memilikinya. Selain lokasinya yang strategis, kekayaan laut terutama ikan juga\r\nmasih belum dieksplorasi secara maksimal. Tak hanya itu, pulau ini juga berpotensi\r\nsebagai salah satu sumber gas alam di Indonesia yang dapat memenuhi kebutuhan\r\ndalam negeri. Berkat kekayaannya alam yang sangat potensial, tidak mengherankan\r\nnegara lain ada yang mengaku menjadi pemiliknya. Di bawah ini, peran yang bisa ....', NULL, 2, 'Peran yang bisa dilakukan oleh pemerintah Indonesia dalam menjaga kedaulatan NKRI\r\nterutama Pulau Natuna adalah memperkuat pengamanan wilayah di Pulau Natuna', NULL, '2024-07-27 16:42:19', '2024-07-27 16:42:19'),
(2201, 'PNSSKD004', 3, 'Sikap berdasarkan nasionalisme yang berpengaruh terhadap kebijakan moneter negara\r\nadalah ...', NULL, 2, 'Sikap berdasarkan nasionalisme yang berpengaruh terhadap kebijakan moneter negara\r\nadalah Bank Indonesia membeli surat-surat berharga di pasar modal. Kebijakan moneter\r\nberkaitan dengan kebijakan yang dilakukan oleh bank sentral (Bank Indonesia).', NULL, '2024-07-27 16:56:45', '2024-07-27 16:56:45'),
(2202, 'PNSSKD004', 4, 'Bangsa Indonesia merupakan bangsa yang majemuk. Salah satu kemajemukan dapat\r\nkita lihat dari keragaman masyarakat Indonesia berdasarkan agama yang ditandai\r\ndengan ....', NULL, 3, 'Salah satu kemajemukan dapat kita lihat dari keragaman masyarakat Indonesia berdasarkan\r\nagama yang ditandai dengan diakuinya berbagai agama dan kebebasan untuk beribadah\r\nsesuai dengan agama yang dianutnya', NULL, '2024-07-27 16:59:44', '2024-07-27 16:59:44'),
(2203, 'PNSSKD004', 5, '<b>Perhatikan pernyataan berikut ini!</b><br>\r\n1. Memiliki rasa cinta tanah air<br>\r\n2. Menghargai kebersamaan dalam perbedaan<br>\r\n3. Rela berkorban demi kepentingan negara<br>\r\n4. Mengakui dan menghargai sepenuhnya keanekaragaman pada diri bangsa Indonesia<br>\r\n5. Berani dan bertanggung jawab terhadap kesalahan yang diperbuat<br>\r\n6. Bangga menjadi bangsa dan bagian dari masyarakat Indonesia<br>\r\n7. Bersikap etnosentrisme<br>\r\n8. Mementingkan kepentingan bersama daripada kepentingan kelompok<br><br>\r\nBerdasarkan pernyataan di atas, ciri-ciri nasionalisme ditunjukkan pada nomor', NULL, 4, 'Ciri-ciri nasionalisme:<br><br>\r\n- Memiliki rasa cinta tanah air<br>\r\n- Mengakui dan menghargai sepenuhnya keanekaragaman pada diri bangsa Indonesia<br>\r\n- Bangga menjadi bangsa dan bagian dari masyarakat Indonesia<br>\r\n- Mementingkan kepentingan bersama daripada kepentingan kelompok', NULL, '2024-07-27 17:07:00', '2024-07-28 05:03:19'),
(2204, 'PNSSKD004', 6, 'Selain rasa cinta terhadap bangsa, upaya Bela negara harus berdasarkan rasa kesetiaan. Berikut ini\r\nbentuk kesetiaan terhadap bangsa dan negara nampak pada...', NULL, 1, 'Untuk soal ini sudah cukup jelas jawabannya adalah yang A,<br>\r\nOption B salah – karna arti dari skeptis itu adalah ragu\r\natau memangdang sebelah mata atau TIDAK MENGUTAMAKAN. Jadi kalo\r\nkita tidak mengikuti perubahan zaman yang sekarang sudah menggunakan\r\nteknologi karna takut terancam budaya, maka tidak akan maju dan bersaing\r\nsecara nasional.<br>\r\nOption C salah – seharusnya kita betul harus menjaga ideologi kita,\r\nyaitu pancasila. Dimana pancasila ini sudah final dan tidak bisa digantikan.<br>\r\nOption D salah – seharusya mengembangkan budaya sendiri dan menjaganya<br>\r\nOption E salah -  seharusnya membeli produk dalam negeri unutk membantu\r\nUMKM supaya sejahtera', NULL, '2024-07-27 17:13:21', '2024-07-27 17:13:21'),
(2205, 'PNSSKD004', 7, '“.... Bahwa saya menyesal sekali, bahwa permintaan saya agar anggota yang terhormat\r\nMuhammad Yamin diangkat menjadi anggota panitia kita ini ditolak, terlebih lagi\r\nmenyesal oleh karena Mr. Yamin sendiri menyatakan dirinya sama sekali bukan ahli dan\r\ntidak paham tentang keuangan dan perekonomian.” Sikap Mr. Muhammad Yamin yang\r\nditunjukkan pada pernyataan tersebut adalah....', NULL, 4, 'Jujur . karena Mr. Yamin sendiri menyatakan dirinya sama sekali bukan ahli dan\r\ntidak paham tentang keuangan dan perekonomian meggambarkan kejujuran Mr. Muhammad Yamin.', NULL, '2024-07-27 17:26:22', '2024-07-27 17:26:22'),
(2206, 'PNSSKD004', 8, 'Berobat ke dokter ternyata tidak harus mahal lho? Bahkan Anda pun bisa gratis berobat\r\nke dokter. Penasaran kira-kira dimana kita bisa mendapatkan pengobatan gratis dari\r\nseorang dokter? Ternyata, di Malang, tepatnya di Kelurahan Mulyoagung Kecamatan Dau\r\nada tempat praktek Dr. Gunawan Winarta C.Ht, CT yang menggratiskan warga tidak\r\nmampu untuk berobat pada dirinya. Sebelum ada pandemi, Dr. Gun sapaannya\r\nbiasanya mendatangi warga yang tidak mampu yang sakit ke rumahnya untuk diobati.\r\nNamun, setelah adanya pandemi, Dr. Gun melayani pengobatan warga di tempat\r\nprakteknya. Bagi warga tidak mampu yang datang ke kliniknya, tidak dikenai biaya\r\nsepeserpun. Bahkan, tak hanya menggratiskan warga tidak mampu yang butuh berobat,\r\nia juga kerap membagikan paket sembako kepada pasiennya yang berasal dari keluarga\r\ntidak mampu. Tujuan dari Dr. Gun melakukan ini semua agar semua warganya\r\nmendapatkan kesempatan yang sama memperoleh layanan kesehatan. Sikap yang bisa\r\nkita contoh dari wacana di atas adalah.', NULL, 5, 'Sikap yang bisa kita contoh dari wacana di atas adalah Dokter memang seharusnya bisa\r\nmemilah-pilah mana pasien yang wajib dikenakan biaya mana yang tidak.', NULL, '2024-07-27 17:31:45', '2024-07-27 17:31:45'),
(2207, 'PNSSKD004', 9, 'Pada pertengahan tahun media dibuat viral oleh pemberitaan seorang polisi\r\nberpangkat Brigadir Polisi yang sering melakukan aksi sosial membantu masyarakat\r\nyang kurang beruntung. Madian merupakan seorang anggota Brigpol yang bertugas di\r\nMapolres Bungo. Sosok Madian membuat banyak masyarakat berdecak kagum karena\r\naksi sosial yang dilakukannya. Tidak hanya membagikan sembako, ia juga membagikan\r\nuang tunai. Bahkan ia juga pernah bangunkan sebuah rumah warga yang tuna wicara\r\nhingga selesai. Tidak lama ia juga tengah membangunkan satu rumah janda tua yag\r\nhidup sebatang kara di desa tanah kelahirannya. Selain itu, Madian juga kerap\r\nmembantu biaya berobat, bangun masjid, madrasah dan lain sebagainya. Sikap yang\r\nbisa kita teladani dari seorang Madian adalah ....', NULL, 3, 'Sikap yang bisa kita teladani dari seorang Madian adalah hendaknya kita ringan tangan dalam\r\nmembantu kesulitan orang lain', NULL, '2024-07-27 17:36:22', '2024-07-27 17:36:22'),
(2208, 'PNSSKD004', 10, 'Pernahkah kalian mendengar seorang sosok besar A.H. Nasution? Nasution merupakan\r\nseseorang yang berpangkat jenderal namun ia memutuskan untuk mengambil jalan\r\nhidup yang berbeda dengan anggota militer lainnya. Sosoknya yang religius\r\nmenjadikan ia disegani oleh banyak orang. Ia merupakan salah satu sosok yang taat\r\nberibadah bahkan di kapal yang sedang berlayar sekalipun. Ia pun sering meminta izin\r\nuntuk meninggalkan rapat sementara untuk melaksanakan sholat. Mungkin sikap\r\ntersebut sudah jarang kita jumpai apalagi bagi sosok yang berpangkat jenderal. Sikap\r\napa yang bisa kita teladani dari seorang A.H. Nasution?', NULL, 1, 'Sikap apa yang bisa kita teladani dari seorang A.H. Nasution adalah sebagai seorang yang\r\nberagama, hendaknya selalu berdisplin dalam menjalankan ibadah', NULL, '2024-07-27 17:39:18', '2024-07-27 17:39:18'),
(2209, 'PNSSKD004', 11, 'Keteladanan seorang pemimpin jelas diperlukan demi terwujudnya kepemimpinan dan kebijkan\r\nyang baik dan benar. Istilah tersebut dalam falsafah jawa dikenal dengan...', NULL, 2, 'Untuk menjawab soal ini kita harus mengetahui beberapa istilah penting\r\ndalam falsafah jawab seabgai berikut :<br><br>\r\na.Tut wuri handayani = Dibelakang seorang pemimpin harus bisa\r\nmemberikan dorongan<br>\r\nb.Ing ngarso sung tulodo = Didepan Seorang pemimpin menjadi\r\nteladan yang baik<br>\r\nc.Ing madya mangun karsa = Ditengah Seorang pemimpin harus bisa\r\nmemberikan ide<br\r\nd.Sengkut gemregut = Semangat<br>\r\ne.Dumadi tumrap sesami = ?<br>\r\nMaka dari itu yang sesuai dengan keteladanan seorang pemimpin\r\nadalah pada jawaban B', NULL, '2024-07-27 18:02:14', '2024-07-27 18:02:14'),
(2210, 'PNSSKD004', 12, 'Salah satu pahlawan revolusi yang menjadi korban keganasan G30SPKI adalah Kapten\r\nPierre Tendean. Kapten Pierre Tendean merupakan orang terakhir yang dimasukkan ke\r\ndalam sumur lubang buaya. Tendean merupakan anak dari seorang dokter yang\r\nberdarah Minahasa dan ibunya seorang Belanda yang berdarah Perancis. Orangtua\r\nTendean menginginkan Tendean untuk menjadi seorang dokter seperti ayahnya.\r\nSebagai seorang yang beragama, hendaknya selalu berdisplin dalam menjalankan\r\nibadah. Hendaknya, kita menunda waktu beribadah ketika rapat berlangsung\r\nSetiap orang seharusnya memberikan keluwesan dalam beribadah meskipun saat rapat\r\npenting berlangsung. Semua yang berpangkat jenderal seharusnya memiliki kedisiplinan dalam segala hal\r\nKehidupan dunia memang menyibukkan, banyak orang yang terlena karenanya\r\nNamun, Tendean menolaknya karena ia ingin menjadi seorang militer. Atas saran dari\r\nkakaknya, Tendean tetap berusaha untuk mengikuti tes masuk perguruan tinggi\r\njurusan kedokteran, namun ia tidak lulus. Berkat tekad yang kuat, akhirnya Tendean\r\nberhasil masuk ke Akademi Teknik Angkatan Darat tahun 1958 di Bandung. Sikap yang\r\nbisa kita teladani dari seorang Pierre Tendean adalah ...', NULL, 1, 'Sikap yang bisa kita teladani dari seorang Pierre Tendean adalah Untuk bisa meraih cita-cita\r\nkita harus memiliki tekad dan semangat yang kuat.', NULL, '2024-07-27 18:05:35', '2024-07-27 18:05:35'),
(2211, 'PNSSKD004', 13, 'Kita sering menjumpai para pejabat publik yang tidak professional namun mampu\r\nmenjabat di jabatan penting. Entah menjadi kepala daerah, anggota DPR, MPR,\r\nmaupun pejabat publik lainnya. Hal tersebut, tentunya menjadi ancaman yang dapat\r\nmenggerus ideologi Pancasila. Berikut ini, sikap yang perlu dilakukan untuk mengatasi\r\nhal tersebut adalah ....', NULL, 1, 'Sikap yang perlu dilakukan untuk mengatasi hal tersebut adalah bersikap cerdas\r\ndalam memilih pemimpin', NULL, '2024-07-28 02:28:35', '2024-07-28 02:28:35'),
(2212, 'PNSSKD004', 14, 'Salah satu alat negara yang mempunyai tugas menjaga keamanan dan ketertiban\r\nmasyarakat adalah…', NULL, 2, 'Alat negara yang bertujuan untuk mejaga ketertiban masyarakat dan\r\nkeamanan masyarakat adalah Polri', NULL, '2024-07-28 02:32:19', '2024-07-28 02:32:19'),
(2213, 'PNSSKD004', 15, 'Persamaan peran warga negara dalam upaya pembelaan negara adalah\r\nkeseimbangan antara hak dan kewajiban, maksudnya . . .', NULL, 1, '<b>BELA NEGARA</b> : Tekad, sikap dan perilaku, serta tindakan warga\r\nnegara, baik secara perseorangan maupun kolektif dalam menjaga\r\nkedaulatan negara, keutuhan wilayah, dan keselamatan bangsa dan\r\nnegara, yang dijiwai oleh kecintaannya kepada NKRI yg berdasarkan\r\nPancasila & UUD 1945 dalam menjamin kelangsungan hidup bangsa\r\ndan negara dari ancaman.<br>\r\nBELA NEGARA<br>\r\n> Tidak hanya angkat senjata<br>\r\n> Tidak harus jadi Tentara<br>\r\n> Jadilah Kader Bela Negara<br>\r\n> Lakukan yang terbaik untuk Bangsa dan Negara sesuai dengan profesi\r\nmasing-masing', NULL, '2024-07-28 02:40:00', '2024-07-28 02:40:00'),
(2214, 'PNSSKD004', 16, 'Sebagai bangsa yang majemuk dan memiliki pedoman Pancasila, perbedaan merupakan karakter bangsa yang mempersatukan bukan sebagai bentuk ancaman.Selain itu, banyak masalah yang dihadapi negara yang bersumber pada keragamansuku bangsa. Tak hanya bersumber dari keragaman suku bangsa, konflik negara juga seringkali bersumber dari sikap eksklusivisme negara lain. Oleh karena itu, sebagai warga negara jika negara terjadi konflik dengan negara lain, sikap yang diperlukan adalah ....', NULL, 1, 'Sebagai warga negara jika negara terjadi konflik dengan negara lain, sikap yang diperlukan\r\nadalah bela negara.', NULL, '2024-07-28 02:42:42', '2024-07-28 02:45:15'),
(2215, 'PNSSKD004', 17, 'Jika kalian mendengar apa melihat sekelompok orang yang berupaya untuk\r\nmelepaskan diri dari NKRI, maka upaya yang Anda lakukan adalah ....', NULL, 2, 'Jika kalian mendengar apa melihat sekelompok orang yang berupaya untuk melepaskan diri\r\ndari NKRI, maka upaya yang Anda lakukan adalah Segera melaporkan kepada pihak yang\r\nberwajib dengan menunjukkan bukti-bukti', NULL, '2024-07-28 02:47:15', '2024-07-28 02:47:15'),
(2216, 'PNSSKD004', 18, 'Salah satu hak bela negara bagi warga negara Indonesia adalah ....', NULL, 2, 'Salah satu hak bela negara bagi warga negara Indonesia adalah memperoleh bantuan sosial.', NULL, '2024-07-28 02:49:05', '2024-07-28 05:04:04'),
(2217, 'PNSSKD004', 19, 'Pokok pikiran kedua pada pembukaan UUD 1945 mengandung makna ....', NULL, 4, 'Pokok pikiran kedua pada pembukaan UUD 1945 mengandung makna negara hendak\r\nmewujudkan keadilan sosial bagi seluruh rakyat Indonesia', NULL, '2024-07-28 04:59:08', '2024-07-28 04:59:08'),
(2218, 'PNSSKD004', 20, 'Setiap tahunnya selalu terjadi kebakaran hutan dan lahan yang menyebabkan kabut asap\r\nterjadi di berbagai wilayah di Indonesia. Presiden Joko Widodo telah memerintahkan\r\nmenteri terkait untuk mengambil langkah penanggulangan dan pencegahan agar hal\r\ntersebut tidak terjadi lagi di masa yang akan datang. Peristiwa ini amat menganggu\r\nkegiatan sehari-hari masyarakat dan menyebabkan sekolah diliburkan di beberapa\r\ntempat, penundaan penerbangan dan banyak lainnya. Setelah ditelusuri ternyata banyak\r\nkebakaran yang terjadi tidak disebabkan oleh peristiwa alam, melainkan ulah tangan\r\nmanusia khususnya perusahaan-perusahaan sawit yang ingin mengambil langkah cepat\r\nuntuk melancarkan bisnis mereka. Hal ini adalah bentuk sikap yang sangat bertentangan\r\ndengan Pancasila khususnya sila ke ....', NULL, 5, 'Peristiwa tersebut berkaitan dengan sila ke-5, yaitu \"Keadilan Sosial bagi Seluruh Rakyat Indonesia,\" di mana tindakan perusahaan-perusahaan tersebut menciptakan ketidakadilan dan mengganggu kepentingan umum atau dan dampak negatif bagi masyarakat, seperti gangguan kesehatan, pendidikan, dan ekonomi.', NULL, '2024-07-28 05:11:36', '2024-07-28 05:11:36'),
(2219, 'PNSSKD004', 21, 'Sejak awal Janauri 2020, hujan deras yang melanda berbagai wilayah Jabodetabek telah\r\nmengakibatkan banjir di sejumlah tempat. Kerusakan yang ditimbulkan pun beragam,\r\nseperti rumah-rumah yang terendam banjir, terputusnya akses jalan, hingga rusaknya\r\nberbagai dokumen dan barang penting. Pun, ketika banjir surut mereka yang terdampak\r\nmasih punya banyak PR. Sebagai bentuk kepedulian terhadap sesama dan untuk\r\nmembantu meringankan beban pra korban bnjir, ILUNI FH UI, ILUNI UI, dan Boston\r\nUniversity Alumni telah mengumpulkan dana lebih dari Rp 250 juta yang dibelanjakan\r\ndalam bentuk cara package dan cleaning package untuk dewasa dan anak. Selain donasi\r\nberupa uang tunai, aksi bantuan atas korban bencana banjir ini juga didukung oleh PT\r\nKimia Farma (Persero) Tbk. Dan PT Combiphar dalam bentuk penyediaan obat dan\r\nvitamin, serta Shopee dalam bentuk tambahan care package. Adapun sumbangan lain\r\nberupa paket sekolah anak, terdiri atas tas sekolah dan alat tulis diterima dari beberapa\r\nalumni dan diberikan ke lokasi yang terdampak bencana. Berdasarkan cerita tersebut,\r\nmembantu korban bencana alam termasuk pengamalan pancasila sila ke ....', NULL, 2, 'Berdasarkan cerita tersebut, membantu korban bencana alam mencerminkan pengamalan Pancasila, khususnya sila ke-2, yaitu \"Kemanusiaan yang Adil dan Beradab.\" Sila ini menekankan pentingnya kepedulian terhadap sesama, terutama kepada mereka yang sedang mengalami kesulitan atau penderitaan. Tindakan yang dilakukan oleh ILUNI FH UI, ILUNI UI, Boston University Alumni, serta dukungan dari berbagai perusahaan dalam memberikan bantuan kepada korban banjir menunjukkan saling membantu dan empati yang sesuai dengan nilai-nilai kemanusiaan yang terkandung dalam Pancasila.', NULL, '2024-07-28 05:13:53', '2024-07-28 05:13:53'),
(2220, 'PNSSKD004', 22, 'Pembangunan infrastruktur di era Presiden Joko Widodo (Jokowi) dinilai tepat karena\r\nterbukti berhasil mendorong perekonomian daerah. Namun, pemerintah daerah didorong\r\nuntuk terus berinovasi agar dapat makin mengoptimalkan potensi daerah masing-masing\r\nterutama di sektor pariwisata dan ekonomi perdesaan. Deputi 1 Kepala Staf\r\nKepresidenan Bidang Pengendalian Pembangunan Program Prioritas mengungkapkan\r\nproyek infrastruktur bukan hanya mengurangi waktu tempuh perjalanan ataupun\r\nmempercepat jalur logistik, tapi lebih jauh lagi mendorong dan menggerakkan ekonomi\r\nkerakyatan. Kehadiran infrastruktur juga mendorong industri pariwisata dan bisnis lokal.\r\nKegiatan dalam rangka mewujudkan kemajuan yang merata adalah bentuk pengamalan\r\nPancasila ...', NULL, 3, 'Bentuk pelanggaran etnosentrisme yang dijelaskan dalam konteks tersebut terkait dengan pelanggaran terhadap sila ke-3 Pancasila, yaitu \"Persatuan Indonesia.\" Sila ini menekankan pentingnya persatuan dan kesatuan di antara berbagai suku, ras, dan golongan yang ada di Indonesia. Sikap etnosentrisme, yang merendahkan orang-orang dari golongan lain atau budaya asing, bertentangan dengan semangat persatuan yang diusung oleh Bhinneka Tunggal Ika.', NULL, '2024-07-28 05:17:20', '2024-07-28 05:17:20'),
(2221, 'PNSSKD004', 23, 'Saat pemerintahan Joko Widodo banyak sekali jembatan-jembatan yang dibangun.\r\nSelain untuk menghubungkan antar wilayah, pembangunan jembatan juga\r\ndiharapkan dapat menggerakkan roda perekonomian masyarakat. Jika dibangun\r\nsebuah jembatan, biasanya akan diperhatikan mengenai dampak positif dan negatif\r\nyang akan dihasilkan. Salah satunya apakah pembangunan jembatan merugikan\r\nmasyarakat, menguntungkan masyarakat, atau malah merusak ekosistem. Dalam\r\nmelaksanakan program tersebut, Pancasila berkedudukan sebagai ....', NULL, 4, 'Dalam melaksanakan program tersebut, Pancasila berkedudukan sebagai paradigma\r\npembangunan', NULL, '2024-07-28 05:21:33', '2024-07-28 05:21:33'),
(2222, 'PNSSKD004', 24, 'Pasal 27 Ayat 3 Undang-Undang Dasar 1945 berbunyi \"Setiap warga negara berhak dan wajib ikut serta dalam upaya pembelaan negara.\"<br>\r\nContoh sikap yang mencerminkan pasal tersebut adalah ....', NULL, 2, 'Sikap dan tindakan Turut serta dalam upaya tanggap bencana dan bantuan kemanusiaan, yang merupakan bagian dari menjaga stabilitas dan keamanan nasional merupakan implementasi nyata dari kewajiban warga negara untuk berpartisipasi dalam upaya pembelaan negara, sesuai dengan amanat Pasal 27 Ayat 3 UUD 1945.', NULL, '2024-07-28 05:26:13', '2024-07-28 05:26:13'),
(2223, 'PNSSKD004', 25, 'Penggunaan kata baku yang tepat terdapat pada kalimat ....', NULL, 3, 'Penggunaan kata baku yang tepat terdapat pada kalimat : <br><br>\r\n- Seharusnya, kamu membeli baut di Bengkel Ada terlebih dahulu<br>\r\n- Kegiatan ekspor di Indonesia sudah mengalami peningkatan<br>\r\n- Saya sudah ikhlas menerima kenyataan ini<br>\r\n- Jenjang kariernya sangat moncer sekali<br>\r\n- Setelah menjadi manajer, dia tetap saja rendah hati', NULL, '2024-07-28 05:28:20', '2024-07-28 05:28:20'),
(2224, 'PNSSKD004', 26, 'Manakah kalimat di bawah ini yang termasuk kedalam kalimat efektif?', NULL, 4, 'Kalimat di bawah ini yang termasuk kedalam kalimat efektif adalah<br><br>\r\n- Tidak seperti namanya, Arif sangat tidak bijak<br>\r\n- Disiang hari, Pak Dudu berjualan dawet ayu Banjarnegara<br>\r\n- Pada bulan November, curah hujan sudah mulai tinggi<br>\r\n- Dia selalu berpangku tangan setiap kali mendapat wesel dari anaknya<br>\r\n- Tak punya malu, Gea selalu meminta uang kepada para tetangganya', NULL, '2024-07-28 05:35:24', '2024-07-28 05:35:24'),
(2225, 'PNSSKD004', 27, 'Di bawah ini yang termasuk kalimat aktif intransitif adalah ...', NULL, 1, 'Kalimat aktif intransitif adalah kalimat aktif yang tidak memerlukan objek.', NULL, '2024-07-28 05:39:46', '2024-07-28 05:39:46'),
(2226, 'PNSSKD004', 28, '<b>Perhatikan wacana berikut ini!</b>\r\nSetelah kepergian suaminya sebulan lalu, Sasa masih saja tinggal di rumah mertuanya.\r\nPadahal, sudah tak ada alasan lagi dia tinggal disana. Suaminya sudah tiada, dan Sasa\r\ntidak sedang menngandung. Tidak seperti menantu kebanyakan, Sasa malah bertindak\r\nseenaknya. Ia bangun siang, padahal ibu mertuanya pagi-pagi sudah menyiapkan\r\nsarapan seorang diri. Setelah sarapan siap, Bu Yati ibu mertua Sasa pergi ke sawah untuk\r\nmencari tambahan penghasilan. Sepanjang hari, Sasa hanya memegang hp saja. Tak\r\nada satu pekerjaan rumahpun yang dilakukannya. Ide pokok wacana di atas adalah ....', NULL, 5, 'Ide pokok wacana di atas adalah Setelah kepergian suaminya sebulan lalu, Sasa masih saja\r\ntinggal di tempat mertuanya.', NULL, '2024-07-28 05:44:10', '2024-07-28 05:44:10'),
(2227, 'PNSSKD004', 29, 'Persebaran pantun tidak dibatasi wilayah administratif Negara. Oleh karenanya, negara lain\r\nseperti Malaysia, Brunei Darussalam, dan Thailand juga turut menyusulkan pantun menjadi\r\nwarisan.<br><br>\r\nHubungan antara kalimat tersebut adalah ....', NULL, 1, 'Opsi A benar karena menunjukkan sebab-akibat karena dengan tidak adanya\r\nadministrative negara terkait dengan pantun, negara lain ikut\r\nmenyusulkannya.', NULL, '2024-07-28 05:48:04', '2024-07-28 05:48:04'),
(2228, 'PNSSKD004', 30, '<b>Perhatikan Bcaan dibawah ini!!</b>(\n1) Kenaikan jumlah pesepeda di DKI Jakarta semasa pandemi memang pesat, yaitu hingga 10\nkali lipat atau 1000% menurut data dari Institute for Transportation & Development Policy\n(ITDP) Indonesia.\n(2) Tak hanya persepeda, tren berjalan kaki juga diketahui meningkat sebesar 15%--dibandingkan\ndengan tren menggunakan kendaraan pribadi yang berkurang sebesar 6%. (3) Antusiasme untuk\nbersepeda dan berjalan kaki ini dapat disambut sebagai hal baik, sekaligus moment buat kita\nmembayangkan kota Jakarta yang bebas dari kemacetan dan polusi udara kelak. (4) Tak hanya\nsemasa PSBB, tetapi terus berlanjut ketika pandemi telah berakhir.\n(5) Selain penting untuk [...] polusi, kebutuhan akan infrastruktur perjalanan yang ramah pejalan\nkaki dan pesepeda memang besar di Indonesia. (6) Ciptaghani Antasaputra selaku perwakilan\nITDP menunjukkan bahwa berjalan kaki dan bersepeda paling banyak digunakan oleh kelompok\nmasyarakat berpendapatan di bawah Rp1 juta-2 juta. (7) Sepeda juga jadi opsi transportasi yang\ndapat mendukung pemulihan COVID-19. (8) Transportasi umum yang kapasitasnya dibatasi\nselama PSBB dapat diprioritaskan bagi orang yang lebih membutuhkan. (9) Porsi jalanan untuk\nkendaraan pribadi pun menjadi dapat diprioritaskan bagi kendaraan darurat seperti ambulans,\npemadam kebakaran, dan logistik. (10) Lebih dari itu, bersepeda atau berjalan kaki\nmemungkinkan seseorang untuk tetap menjaga jarak.<br><br>Kata yang paling tepat untuk mengisi kalimat rumpang pada kalimat nomor (5) adalah ....', NULL, 5, 'Kata yang paling tepat untuk melengkapi kalimat rumpang tersebut adalah\r\nmengurangi.', NULL, '2024-07-28 05:51:27', '2024-07-28 05:51:27'),
(2229, 'PNSSKD004', 31, 'Koper : Baju = .... : ....', NULL, 4, 'Hubungan antara Wadah dan isi', NULL, '2024-07-28 19:48:59', '2024-07-30 15:19:20'),
(2230, 'PNSSKD004', 32, 'Lampu : Cahaya =', NULL, 1, 'Lampu menghasilkan cahaya, maka kompor menghasilkan kalor', NULL, '2024-07-28 20:25:33', '2024-07-30 15:19:16'),
(2231, 'PNSSKD004', 33, 'Latihan : Lomba =…… : ……', NULL, 5, 'Hubungan antara Latihan dan Lomba adalah latihan persiapan untuk lomba, sehingga jawabannya yang\r\nmemiliki kesamaan adalah E. Belajar : Ujian karena belajar adalah persiapan untuk ujian.', NULL, '2024-07-28 20:54:01', '2024-07-30 15:19:08'),
(2232, 'PNSSKD004', 34, 'Rokok : Paru-paru =…… : ……', NULL, 2, 'Hubungan antara Rokok dan Paru - paru adalah rokok merusak paru - paru, sehingga hubungan yang\r\nsama dengan rokok dan paru - paru adalah <b>Pestisida : Tanah</b> karena pestisida itu merusak tanah.', NULL, '2024-07-28 21:03:36', '2024-07-30 15:18:15'),
(2233, 'PNSSKD004', 35, '\"Anak-anak bermain bola di lapangan setiap sore.\"<br> memiliki kesamaan kalimat dengan ....', NULL, 2, 'Kalimat B memiliki struktur SPOK yang sama dengan kalimat di soal yaitu:<br>\r\nSubjek: Mereka<br>\r\nPredikat: membaca<br>\r\nObjek: buku<br>\r\nKeterangan: di perpustakaan yang tenang<br>\r\nKalimat-kalimat lainnya memiliki struktur yang berbeda:\r\n- Kalimat A: Subjek (Ibu), Predikat (membeli), Objek (buah), Keterangan (di pasar pagi ini)<br>\r\n- Kalimat C: Subjek (Guru), Predikat (memberikan), Objek (tugas), Keterangan (kepada murid-murid di kelas)<br>\r\n- Kalimat D: Subjek (Kucing), Predikat (tidur), Keterangan (di sofa sepanjang hari)<br>\r\n- Kalimat E: Subjek (Teman-teman saya), Predikat (menonton), Objek (pertunjukan), Keterangan (di taman malam tadi).', NULL, '2024-07-28 21:13:14', '2024-07-30 15:18:43'),
(2234, 'PNSSKD004', 36, 'Jika Siska rajin belajar maka ia naik kelas. Jika Siska naik kelas maka ia mendapat hadiah. Kesimpulan ....', NULL, 2, 'Jika Siska rajin belajar maka ia naik kelas. Jika Siska naik kelas maka ia mendapat hadiah.<br>Kesimpulan jika Siska rajin belajar maka ia mendapat hadiah', NULL, '2024-07-28 21:34:04', '2024-07-30 15:18:28'),
(2235, 'PNSSKD004', 37, 'Semua makhluk hidup butuh makan. Ayam butuh makan. Maka ....', NULL, 3, 'Semua makhluk hidup butuh makan. Ayam butuh makan. Maka ayam adalah makhluk hidup.', NULL, '2024-07-28 21:36:48', '2024-07-30 15:17:43'),
(2236, 'PNSSKD004', 38, 'Jika kebakaran hutan dan lahan terjadi di kawasan hutan lindung maka pemerintah daerah akan mengerahkan pasukan pemadam api\r\ndan organisasi pecinta lingkungan akan melakukan penyelamatan satwa. Saat ini organisasi pecinta lingkungan tidak bergerak untuk\r\nmelakukan penyelamatan satwa ....', NULL, 4, NULL, '1722334929.png', '2024-07-30 02:22:09', '2024-07-30 02:22:09'),
(2237, 'PNSSKD004', 39, 'Jika perairan terpapar limbah detergen maka dapat memicu ledakan populasi tanaman air. Jika konsentrasi pestisida dalam tanah\r\ntinggi maka beberapa tanaman pangan dapat mati. Saat ini tanaman pangan masih dapat tumbuh dengan baik meskipun limbah\r\ndetergen banyak mengalir ke perairan. Kesimpulannya adalah ...', NULL, 2, NULL, '1722612222.png', '2024-07-30 02:24:04', '2024-08-02 07:23:42'),
(2238, 'PNSSKD004', 40, 'Tidak ada peserta upacara yang mengenakan jam tangan. Semua siswa kelas XII mengikuti upacara.', NULL, 2, NULL, '1722335145.png', '2024-07-30 02:25:45', '2024-07-30 02:25:45'),
(2239, 'PNSSKD004', 41, 'Dalam rangka seleksi calon anggota tim bola basket putri, maka dilakukanlah \r\npengukuran tinggi badan. Anis lebih tinggi daripada Bunga. Tinggi Cantika \r\nsama dengan tinggi Esty. Fentya lebih tinggi daripada Dawiyah. Hanya ada dua \r\npeserta yang tinggi badannya sama.<br><br>', NULL, 2, 'Berdasarkan syarat/aturan yang diberikan pada soal, maka dapat dibuat analisanya sebagai berikut:<br><br>\r\n• Anis lebih tinggi daripada Bunga.<br>\r\nA > B<br>\r\n• Tinggi Cantika sama dengan tinggi Esty.<br>\r\nC = E<br>\r\n• Fentya lebih tinggi daripada Dawiyah.<br>\r\nF > D<br><br>\r\n• Hanya ada dua peserta yang tinggi badannya sama.<br>\r\nJika Cantika lebih tinggi daripada Anis maka Esty lebih tinggi daripada Bunga, karena tinggi Esty sama dengan Cantika, dan Anis sendiri lebih tinggi daripada Bunga. Urutannya dapat digambarkan sebagai berikut: (C, E) > A > B.', NULL, '2024-07-30 02:32:40', '2024-07-30 02:32:40'),
(2240, 'PNSSKD004', 42, 'Untuk memajukan iklim demokrasi di tengah-tengah masyarakat, maka pemilihan gubernur pun sekarang dilakukan dengan pemilihan Iangsung oleh warga. \r\nAda enam kandidat yang dimungkinkan akan mampu menjadi sepasang calon \r\ngubernur dan wakil gubernur yakni Arman, Bani, Cendana, Dani, Irwan, dan \r\nFurqon. Jika mereka telah memilih pasangan maka tidak boleh berpasangan \r\ndengan yang lain. Mereka dapat dipasang-pasangkan dengan aturan: <br>\r\n• Irwan akan mencalonkan diri jika dan hanya jika Bani juga mancalonkan diri<br>\r\n• Cendana hanya barpasangan dengan Arman dan sebaliknya pun begitu<br>\r\n• Dani tidak boleh berpasangan dengan Arman dan tidak boleh mencalonkan \r\ndiri secara bersamaan<br>\r\n• Furqon boleh berpasangan dengan Irwan<br><br>\r\nJika Furqon dan Dani mencalonkan diri maka yang pasti tidak akan mencalonkan diri adalah…', NULL, 1, 'Jika Furqon dan Dani mencalonkan diri maka yang pasti tidak akan mencalonkan diri adalah Arman (lihat syarat 3).', NULL, '2024-07-30 02:39:22', '2024-07-30 02:39:22'),
(2241, 'PNSSKD004', 43, 'Untuk memajukan iklim demokrasi di tengah-tengah masyarakat, maka pemilihan gubernur pun sekarang dilakukan dengan pemilihan Iangsung oleh warga. \r\nAda enam kandidat yang dimungkinkan akan mampu menjadi sepasang calon \r\ngubernur dan wakil gubernur yakni Arman, Bani, Cendana, Dani, Irwan, dan \r\nFurqon. Jika mereka telah memilih pasangan maka tidak boleh berpasangan \r\ndengan yang lain. Mereka dapat dipasang-pasangkan dengan aturan: <br>\r\n• Irwan akan mencalonkan diri jika dan hanya jika Bani juga mancalonkan diri<br>\r\n• Cendana hanya barpasangan dengan Arman dan sebaliknya pun begitu<br>\r\n• Dani tidak boleh berpasangan dengan Arman dan tidak boleh mencalonkan \r\ndiri secara bersamaan<br>\r\n• Furqon boleh berpasangan dengan Irwan<br><br>Jika Irwan telah mencalonkan diri maka …', NULL, 3, 'Jika Irwan telah mencalonkan diri maka Bani pasti akan mencalonkan diri \r\n(lihat syarat 1).', NULL, '2024-07-30 02:41:17', '2024-07-30 02:41:17'),
(2242, 'PNSSKD004', 44, 'Iwan lebih tinggi daripada Amir. Amir lebih tinggi daripada Yudi dan Bandi. Joko lebih tinggi daripada Amir dan Ridwan. Tidak ada \r\nanak yang tingginya sama.<br><br>Jika Bandi lebih tinggi dari Ridwan maka ....', NULL, 1, 'Jika B > R, maka terdapat kemungkinan:<br>\r\nJ > I > A > Y > B > R<br>\r\nJ > I > A > B > Y > R <br>\r\nI > J > A > Y > B > R<br>\r\nI > J > A > B > Y > R<br>\r\nJadi, jawaban yang benar adalah A', NULL, '2024-07-30 02:45:29', '2024-07-30 02:45:29'),
(2243, 'PNSSKD004', 45, 'Jika 7 + 10 = 5; 8 + 5 = 1; dan 4 + 11 = 3; maka 9 + 7 = ….', NULL, 4, '7 + 10 – (12) = 5<br>\r\n8 + 5 – (12) = 1<br>\r\n4 + 11 – (12) = 3<br>\r\nSehingga dapat dihitung:<br>\r\n9 + 7 – (12) = 4', NULL, '2024-07-30 06:40:21', '2024-07-30 06:40:21'),
