(2253, 'PNSSKD004', 55, 'Jika x<sup>2</sup> - 16 = 0 dan y = 4, maka ....', NULL, 4, 'x<sup>2</sup> - 16 = 0 <br>\r\n𝑥 - 4𝑥 + 4 = 0<br>\r\n𝑥 = 4 𝑥 = - 4<br>\r\nDikarenakan x memiliki 2 nilai maka jawaban dari soal diatas adalah D. 𝑥 dan 𝑦 tidak dapat ditentukan.', NULL, '2024-07-30 07:18:29', '2024-07-30 07:18:29'),
(2254, 'PNSSKD004', 56, 'Jika a = 4, b = 3, x = 3 (4a - b), dan y = 4 (3b - a) maka....', NULL, 1, 'Dari hasil perhitungan diatas dapat disimpulkan 39 > 20 maka jawabannya adalah A. x > y', NULL, '2024-07-30 07:20:57', '2024-07-30 15:17:55'),
(2255, 'PNSSKD004', 57, 'Amir mengemudi mobil menempuh jarak 735 km dalam \r\nwaktu 5 hari. Hari pertama ia \r\nmenempuh 185 km, hari kedua \r\n95 km, hari ketiga 120 km, dan \r\nhari keempat 175 km. Berapa \r\nkilometerkah jarak yang ditempuh pada hari kelima?', NULL, 1, 'Misalkan, x = jarak yang ditempuh pada hari ke-5, maka:<br><br>\r\n185 + 95 + 120 + 175 + x = 735<br>\r\n575 + x = 735<br>\r\nx = 735 – 575<br>\r\nx = 160 km', NULL, '2024-07-30 14:50:02', '2024-07-30 14:50:02'),
(2256, 'PNSSKD004', 58, 'Seorang pedagang menjual \r\nsepasang sepatu dengan harga \r\nRp120.000,00 dan memperoleh \r\nlaba 25% dari harga beli. Berapakah harga beli sepasang \r\nsepatu tersebut?', NULL, 3, 'Misalkan, harga beli = x<br>\r\nHarga beli + Keuntungan = Harga jual<br>\r\nx + 25% = 120.000<br>\r\nx + <sup>1</sup>/<sub>4</sub>x = 120.000<br>\r\n<sup>5</sup>/<sub>4</sub>x = 120.000<br>\r\nx = 120.000 × <sup>4</sup>/<sub>5</sub><br>\r\nx = 96.000<br><br>\r\nJadi, harga beli sepatu tersebut  adalah Rp96.000,00.', NULL, '2024-07-30 14:54:59', '2024-07-30 14:54:59'),
(2257, 'PNSSKD004', 59, 'Murid dalam suatu kelas memiliki hobi berenang atau bulu \r\ntangkis. Jika dalam kelas tersebut terdapat 30 murid, sedangkan yang hobi berenang adalah \r\n27 murid dan hobi bulu tangkis 22 murid, maka murid yang \r\nhobi berenang maupun bulu \r\ntangkis adalah...', NULL, 4, 'Misalnya x = murid yang hobi berenang dan bulu tangkis', '1722380267.png', '2024-07-30 14:57:47', '2024-07-30 14:57:47'),
(2259, 'PNSSKD005', 1, '<b>Perhatikan pernyataan berikut ini!</b><br>\r\n1. Kerajaan Mataram dibagi menjadi 2, yaitu Surakarta dan Yogyakarta<br>\r\n2. Disetujuinya garis demarkasi yang memisahkan antara wilayah Indonesia dan wilayah pendudukan Belanda<br>\r\n3. Pihak Belanda dan Indonesia sepakat membentuk RIS<br>\r\n4. Belanda menyerah tanpa syarat ke Jepang<br>\r\n5. Pemerintah RI dikembalikan ke Yogyakarta<br><br>\r\nBerdasarkan pernyataan di atas, yang merupakan isi perjanjian Kalijati terdapat pada nomor....', NULL, 4, 'Isi perjanjian Kalijati: <br>\r\nBelanda menyerah tanpa syarat ke Jepang', NULL, '2024-07-30 18:00:43', '2024-08-08 22:58:40'),
(2260, 'PNSSKD005', 2, 'Berkembangnya ilmu pengetahuan dan teknologi memberikan dampak positif dan negatif. Jika kita bisa memanfaatkannya dengan bijak, maka kemajuan IPTEK dapat memajukan negara. Meskipun demikian, berkembangnya IPTEK juga menyebabkan generasi muda semakin tidak cinta Indonesia. Hal ini bisa kita lihat dengan gaya berpakaian, generasi muda yang banyak mengidolakan artis luar negeri, kesenangan menikmati film luar negeri, dan sebagainya. <br> Berikut ini yang bukan upaya untuk memupuk nasionalisme adalah....', NULL, 5, 'Upaya untuk memupuk nasionalisme meliputi:<br><br>\r\n- Menerapkan nilai-nilai Pancasila dalamkehidupan sehari-hari<br>\r\n- Mencintai produk dalam negeri<br>\r\n- Berkunjung ke museumnasional<br\r\n- Mempelajari sejarah perjuangan para pendahulu bangsa', NULL, '2024-07-30 18:06:13', '2024-08-02 05:04:22'),
(2261, 'PNSSKD005', 3, 'Di bawah ini sikap dan perilaku nasionalisme yang wajib dimiliki oleh warga negara adalah....', NULL, 4, 'Di bawah ini sikap dan perilaku nasionalisme yang wajib dimiliki oleh warga negara adalahmematuhi aturan yang berlaku, mematuhi hukumnegara, dan melestarikan budaya bangsa.', NULL, '2024-07-30 18:16:27', '2024-07-30 18:16:27');
