(2262, 'PNSSKD005', 4, 'Contoh ancaman NKRI yang berasal dari dalam negeri adalah ….', NULL, 4, 'Contoh ancaman NKRI yang berasal dari dalam negeri antara lain\r\nkerusuhan di Sampang, Madura, kerusuhan di Poso, kerusuhan di\r\nSampit. Hal ini merupakan ancaman pada Bhinneka Tunggal Ika karena\r\nkonflik bermula dari suku agama dan ras.', NULL, '2024-07-30 18:20:43', '2024-07-30 18:20:43'),
(2263, 'PNSSKD005', 5, '<b>Perhatikan pernyataan berikut ini!</b><br>\r\n- Salah satu tokoh penting pada organisasi pergerakan nasional pertama di Indonesia<br>\r\n- Tokoh yang menghimpun dana untuk pendidikan bagi masyarakat yang berprestasi namun tak memiliki biaya<br>\r\n- Tokoh yang menceritakan kondisi masyarakat saat itu kepada mahasiswa STOVIA<br><br>\r\nBerdasarkan pernyataan di atas, merupakan peran dari tokoh....', NULL, 2, 'Peran Dr. Wahidin Sudiro Husodo : <br><br>\r\n-Salah satu tokoh penting pada organisasi pergerakan nasional pertama di Indonesia<br>\r\n- Tokoh yang menghimpun dana untuk pendidikan bagi masyarakat yang berprestasinamun tak memiliki biaya<br>\r\n- Tokoh yang menceritakan kondisi masyarakat saat itu kepada mahasiswa STOVIA', NULL, '2024-07-30 18:28:57', '2024-07-30 18:28:57'),
(2264, 'PNSSKD005', 6, 'Untuk mensukseskan acara G-20, pemerintah melakukan renovasi terhadap GedungmTMII. Pembangunan TMII, merupakan salah satu upaya pemerintah untuk memupuk sikap ....', NULL, 3, 'Pembangunan TMII, merupakan salah satu upaya pemerintah untuk memupuk sikap nasionalisme.', NULL, '2024-07-30 18:33:01', '2024-08-01 21:09:14'),
(2265, 'PNSSKD005', 7, 'Berikut ini yang bukan merupakan upaya untuk menciptakan integrasi nasional adalah....', NULL, 5, 'Berikut ini yang merupakan upaya untuk menciptakan integrasi nasional antara lain:<br><br>\r\n- Pembangunan TMII<br>\r\n- Penyelenggaraan PON<br>\r\n- Akulturasi dan asimilasi budaya<br>\r\n- Mengikuti vaksinasi', NULL, '2024-07-30 20:43:03', '2024-07-30 20:43:03'),
(2266, 'PNSSKD005', 8, 'Nama Hadius Rahman pernah viral di media sosial. Hadius Rahman, merupakan seorang\r\nanggota TNI berpangkat kopral dua yang menguasai 7 bahasa asing. Bahasa asing yang ia\r\nkuasai adalah Bahasa Jerman, Bahasa Prancis, Bahasa Portugis, Bahasa Belanda, Bahasa\r\nSpanyol, dan Bahasa Itali. Kemampuan menguasai 7 bahasa asing sekaligus ia dapatkan\r\nbukan dari sekolah formal. Menurutnya, ia mempelajari bahasa asing dari sosial media\r\nmiliknya. Seperti whatsapp, facebook, google translate, dan sebagainya. Untuk semakin\r\nmempertajamkemampuannya, Hadius setiap harinya meluangkan waktu 30 menit untuk\r\nberbicara pada native speaker teman-temanya di dunia maya. Ia memang belumpernah\r\nke luar negeri, namun ia memiliki bebeberapa teman dari luar negeri yang sering\r\nberkomunikasi dengannya melalui media sosial. Hadius sempat viral ketika menjadi\r\npenerjemah 22 istri atase militer dari negara sahabat yang tengah berkunjung di Aceh. 22\r\nistri atase militer dari negara sahabat pun memuji kemampuan Hadius dan puas dengan\r\npenjelasan yang diberikan Hadius. Tak sampai disitu, saat bertemu dengan Bapak Menhan\r\nPrabowo, Hadius ditawari belajar di sekolah formal untuk mengasah kemampuannya.\r\nMeskipun memiliki menguasai 7 bahasa asing, namun Hadius tidak bermimpi untuk ikut\r\ndiberangkatkan ke luar negeri. Sikap yang bisa kita contoh dari seorang Hadius adalah....', NULL, 3, 'Sikap yang bisa kita contoh dari seorang Hadius adalah Jika kita bisa memanfaatkan sosial media\r\ndengan baik, maka kita akan mendapatkan banyak manfaat di dalamnya.', NULL, '2024-07-30 20:49:13', '2024-07-30 20:49:13'),
(2267, 'PNSSKD005', 9, 'Butet Manurung merupakan satu dari sekian banyak masyarakat Indonesia yang peduli\r\nakan pendidikan di Indonesia. Butet Manurung merupakan perintis sekolah gratis di wilayah\r\npedalaman yang diberi nama Sokola Rimba. Kini, Sokola Rimba berubah nama menjadi\r\nSokola Institute yang sudah merintis hingga 17 programdi seluruh Indonesia dan\r\nmemberikan manfaat kepada lebih dari 15.000 masyarakat adat untuk bisa mengenyam\r\npendidikan formal. Keberhasilan tersebut merupakan berkat dari kerja kerasnya selama ini.\r\nSaat pertama kali bertemu dengan masyarakat adat, Butet seringkali mendapatkan\r\npenolakan. Hingga sekitar 7 bulan melakukan pendekatan dengan masyarakat adat,\r\nakhirnya masyarakat Rimba menerimanya. Banyak sekali pengorbanan yang harus Butet\r\nlakukan hingga akhirnya masyarakat setempat menerimanya. Mulai dari menggunakan\r\npakaian yang sama seperti masyarakat adat disitu, memakan apapun yang mereka makan,\r\nhingga belajar bahasa daerahnya. Sikap yang bisa kita teladani dari seorang Butet adalah....', NULL, 2, 'Sikap yang bisa kita teladani dari seorang Butet adalah Untuk bisa meraih cita-cita yang\r\ndiinginkan dibutuhkan perjuangan dan kerja keras untuk bisa meraihnya.', NULL, '2024-07-30 20:52:22', '2024-07-30 20:52:22'),
(2268, 'PNSSKD005', 10, 'Pernah kalian mendengar tas tangan merk “Robita”? Tas tangan yang populer di kalangan\r\nsosialita Jepang, merupakan tas tangan buatan orang Indonesia lho. Orang dibalik\r\nkepopuleran tersebut adalah Sunny Kamengmau. Pemuda asal NTT yang tak pernah lulus\r\nSMA ini, tak menyangka jika perjuangannya selama ini ia lakukan membuahkan hasil.\r\nSetelah meninggalkan kampung halaman dan pergi ke Bali, Sunny bekerja sebagai\r\ntukang sapu di sebuah hotel. Berkat dedikasinya yang tinggi, Sunny kemudian diangkat\r\nmenjadi satpamdi hotel tersebut. Selama bekerja di hotel, ia memanfaatkan waktu yang\r\nada untuk belajar Bahasa Inggris dan Bahasa Jepang. Ia kemudian menyisihkan sebagian\r\ngajinya untuk membeli kamus Bahasa Inggris dan Bahasa Jepang. Nasib pun berpihak\r\npadanya, saat Sunny bekerja di hotel tersebut, Sunny bertemu dengan pengusaha asal\r\nJepang. Sunny diminta untuk memasok tas kulit ke negaranya. Meski sempat naik turun,\r\nkarena hampir kehilangan sebagian besar penjahit tas yang bekerja untuknya, Sunny\r\nakhirnya bisa bangkit dan saat ini memiliki 100 penjahit tas yang bekerja untuknya.\r\nBagaimana? Kisahnya inspiratif bukan? Berdasarkan kisah di atas, sikap yang bisa kita\r\nteladani dari Sunny Kamengmau adalah....', NULL, 4, 'Berdasarkan kisah di atas, sikap yang bisa kita teladani dari Sunny Kamengmau adalah Untuk\r\nbisa menjadi pengusaha sukses dibutuhkan kegigihan, pantang menyerah, dan kemampuan\r\nbahasa asing.', NULL, '2024-07-30 21:00:01', '2024-07-30 21:00:01'),
(2269, 'PNSSKD005', 11, 'Tak sedikit kita menjumpai orang dengan keterbatasan fisik yang minder dengan\r\nkeadaannya. Padahal, setiap orang pasti memiliki kelebihannya tersendiri. Namun,\r\nberbeda dengan Rafi Abdurahman Ridwan, meskipun ia tuna rungu, ternyata\r\nketerbatasannya tidak membuat dirinya minder. Bahkan, berkat terus mengasah kemampuannya, Rafi kini menjadi seorang fashion designer. Kariernya semakin bersinar,\r\nketika model internasional Tyra Banks menemukan bakatnya. Kemampuannya menjadi\r\nfashion designer menjadi dirinya terus berkarya hingga ke kancah internasional. Sikap\r\nintegritas yang dapat kita teladani adalah....', NULL, 1, 'Sikap integritas yang dapat kita teladani adalah Keterbatasan fisik tidaklah menjadi penghalang\r\nuntuk bisa mengoptimalkan diri.', NULL, '2024-07-30 21:04:04', '2024-07-30 21:04:04'),
(2270, 'PNSSKD005', 12, 'Pada masa sekarang ini, banyak sekali orang yang melakukan tindak pidana korupsi. Tindak pidana\r\nkorupsi terjadi ketika seseorang tidak memiliki integritas. Cara yang dapat dilakukan untuk membangun\r\nintegritas adalah dengan memegang teguh nilai ....', NULL, 4, 'Berdasarkan PermenpanRB No.38 Tahun 2017, terdapat 9\r\nnilai integritas diantaranya yaitu kejujuran, peduli, adil, disiplin, mandiri, sederhana,\r\ntanggung jawab, kerja keras, dan berani', NULL, '2024-07-30 21:08:22', '2024-07-30 21:08:22'),
(2271, 'PNSSKD005', 13, 'Perhatikan pernyataan berikut ini!\r\nMengetahui sejarah negara\r\nMelestarikan budaya\r\nMenjaga lingkungan\r\nMenjaga nama baik negara\r\nBerdasarkan pernyataan di atas, merupakan sikap ....', NULL, 1, 'Upaya untuk menumbuhkan sikap nasionalisme:<br><br>\r\n- Mengetahui sejarah negara\r\n- Melestarikan budaya\r\n- Menjaga lingkungan\r\n- Menjaga nama baik negara', NULL, '2024-07-30 23:49:39', '2024-07-30 23:49:39'),
(2273, 'PNSSKD005', 14, 'Upaya yang dapat menumbuhkan kemampuan bela negara dapat dilakukan dengan....', NULL, 2, 'Upaya yang dapat menumbuhkan kemampuan bela negara dapat dilakukan dengan menjaga\r\nkedisiplinan dalamsegala bidang kehidupan', NULL, '2024-08-01 02:37:29', '2024-08-01 02:37:29'),
(2274, 'PNSSKD005', 15, '<b>Perhatikan pernyataan berikut ini!</b><br>\r\n- Mempertahankan kedaulatan negara dan keutuhan wilayah\r\n- Melindungi kehormatan dan keselamatan bangsa\r\n- Melaksanakan operasi militer selain perang\r\n- Ikut serta aktif dalamtugas pemeliharaan perdamaian regional dan internasional<br>\r\nBerdasarkan pernyataan di atas, pihak yang bertugas melaksanakan kebiajakan di atas\r\nadalah....', NULL, 1, 'TNI bertugas melaksanakan kebijakan:<br>\r\n- Mempertahankan kedaulatan negara dan keutuhan wilayah<br>\r\n- Melindungi kehormatan dan keselamatan bangsa<br>\r\n- Melaksanakan operasi militer selain perang<br>\r\n- Ikut serta aktif dalamtugas pemeliharaan perdamaian regional dan internasional', NULL, '2024-08-01 02:40:46', '2024-08-01 02:40:46'),
(2275, 'PNSSKD005', 16, '<b>Berikut ini merupakan bunyi pasal 27 UUD 1945: </b><br>\r\n(1) Segala warga negara bersamaan kedudukannya di dalam hukum dan pemerintahan dan wajib\r\nmenjunjung hukum dan pemerintahan itu dengan tidak ada kecualinya.<br>\r\n(2) Tiap-tiap warga negara berhak atas pekerjaan dan penghidupan yang layak bagi kemanusiaan<br>\r\n(3) Setiap warga negara berhak dan wajib ikut serta dalam upaya pembelaan Negara.<br>\r\nDikatakan bahwa kita sebagai WNI berhak dan wajib ikuserta dalam upaya pembelaan Negara. \r\nMaka dibawah ini yang bukan merupakan poin paling penting sebagai Nilai Dasar Bela Negara adalah …', NULL, 1, 'nilai dasar bela Negara terdiri dari 5 nilai yaitu <br>\r\n1) cinta tanah air – setia, <br>\r\n2) sadar berbangsa dan bernegara – bersatu, <br>\r\n3) setia pada pancasila sebagai ideology negara – pengamalan butir-butir pancasila,<br>\r\n4) rela berkorban untuk bangsa dan Negara – ikhlas –tidak pamrih – berprestasi sesuai profesi,<br> \r\n5) kemampuan awal bela negara – belajar dan memahami konsep bela Negara. <br>\r\nOpsi A tidak termasuk dalam nilai dasar bela negara', NULL, '2024-08-01 02:47:51', '2024-08-01 02:47:51'),
(2276, 'PNSSKD005', 16, 'Kebulatan tekad untuk mewujudkan persatuan dan kesatuan Bangsa Indonesia ditunjukkan\r\ndengan adanya peristiwa …', NULL, 4, 'Kebulatan tekad untuk mewujudkan persatuan dan kesatuan bangsa Indonesia\r\nditunjukkan dengan adanya peristiwa Sumpah Pemuda.', NULL, '2024-08-01 02:50:34', '2024-08-01 02:50:34'),
(2277, 'PNSSKD005', 17, 'Apabila kamu menjumpai aksi “Kithih” di jalan, maka sikap yang Anda lakukan adalah....', NULL, 3, 'Apabila kamu menjumpai aksi “Kithih” di jalan, maka sikap yang Anda lakukan adalah segera\r\nmenelepon kepada pihak yang berwajib', NULL, '2024-08-01 02:55:55', '2024-08-01 02:55:55'),
(2278, 'PNSSKD005', 18, 'Berdasarkan UU RI No 3 Tahun 2002 tentang Pertahanan Negara, pasal yang mengatur\r\ntentang pengangkatan dan pemberhentian Panglima adalah....', NULL, 4, 'Presiden mengangkat dan memberhentikan Panglima setelah mendapat persetujuan\r\nDewan Perwakilan Rakyat', NULL, '2024-08-01 02:57:14', '2024-08-01 02:57:14'),
(2279, 'PNSSKD005', 19, 'Meskipun tempat ibadahnya bersebelahan, namun jamaah di masing-masing tempat\r\nibadah tersebut mampu hidup rukun. Ketika sholat jumat tiba dan gereja terpaksa\r\nmenyelenggarakan ibadah pun, tak sampai membuat jamaah sholat jumat di masjid\r\nterganggu. Begitu pula, jika masjid pada akhir pekan menyelenggarakan kegiatan, tak\r\nsampai membuat gaduh gereja yang sedang menyelenggarakan ibadah pada hari\r\nminggu pagi. Peristiwa tersebut, sesuai dengan pengamalan Pancasila khususnya sila ke....', NULL, 3, 'Peristiwa tersebut, sesuai dengan pengamalan Pancasila khususnya sila ke-1, sesuai butir\r\nmengembangkan sikap saling menghormati dan menghargai kebebasan menjalankan praktik\r\nibadah sesuai dengan agama dan kepercayaannya masing-masing.', NULL, '2024-08-01 04:30:46', '2024-08-01 04:30:46'),
(2280, 'PNSSKD005', 20, 'Tak jarang kita menjumpai berita bahwa wilayah yang justru memiliki banyak kekayaan\r\nalammalah memiliki tingkat kemiskinan tinggi. Padahal, seharusnya tingginya\r\nsumberdaya alamdi daerah dapat digunakan untuk mensejahterakan rakyatnya. Paling\r\ntidak, masyarakat sekitar ikut dilibatkan dalamproses penambangan. Namun, yang terjadi\r\nsebaliknya, kaya daerahnya malah hanya bisa mengkayakan sebagian golongan tertentu.\r\nBerdasarkan wacana di atas, merupakan salah satu bentuk pelanggaran sila ke....', NULL, 5, 'Berdasarkan wacana di atas, merupakan salah satu bentuk pelanggaran sila ke-5, yaitu pada\r\nbutir suka melakukan kegiatan dalamrangka mewujudkan kemajuan yang merata dan\r\nberkeadilan sosial.', NULL, '2024-08-01 04:31:42', '2024-08-01 04:31:42'),
(2281, 'PNSSKD005', 21, 'Penyanyi, Agnez Mo bangun klinik atau rumah sakit lapangan untuk membantu kelancaran\r\nprogram vaksinasi Covid-19 secara gratis. Klinik yang dibangun bersama AG Peduli ini didirikan\r\ndi daerah Ancol, Jakarta Utara. Dalam unggahan di halaman Instagramnya pada Rabu, 16 Juni 2021, Agnez membagikan video saat melakukan tur kunjungan ke klinik tersebut. “Aku cuma ingin kasih kalian tur kecil ke klinik yang kami bangun, supaya kalian bisa dapat vaksin kalian,” tulis Agnez.\r\nHal seperti ini merupakan pengamalan daripada sila ke ....', NULL, 5, 'Didalam teks ini dijelaskan terkait dengan salah satu penyanyi, yaitu Agnez\r\nMo yang membuat klinik ataupun Rumah Sakit lapangan yang memberikan\r\nprogram vaksinasi Covid-19 secara gratis untuk masyarakat.<br>\r\nTentu saja dengan membuatkan klinik yang didalamnya ada program\r\npemberian vaksinasi covid-19 secara gratis merupakan implementasi daripada\r\nsila yang ke-5, yaitu keadilan sosial bagi seluruh rakyat Indonesia.<br>\r\nKarna dalam poin-poin pengamalan sila ke-5 dijelaskan terkait dengan\r\nkebaikan yang dilakukan secara sosial dan dampaknya bisa diterima di\r\nmasyarakat. Contoh lain adalah seperti Program Kartu Indonesia Sehat, BPJS,\r\ndll.<br>Dengan memberikan klinik yang didalamnya ada program vaksinasi Covid-19\r\nsecara gratis tentu saja memberikan keadilan kepada masyarakat supaya\r\nmasyarakat yang kurang mampu bisa juga mendapatkan vaksin covid-19\r\nsecara gratis.<br<Maka jawaban yang tepat untuk soal ini adalah yang E', NULL, '2024-08-01 04:34:31', '2024-08-01 04:34:31'),
(2282, 'PNSSKD005', 22, 'Sikap atau implementasi yang menunjukkan Bunyi Pasal 32 ayat 1 UUD 1945 menyatakan \"Negara mengembangkan pula kebudayaan nasional Indonesia di tengah-tengah peradaban dunia dengan menjamin kebebasan masyarakat dalam memelihara dan mengembangkan kebudayaannya.\" Sikap atau implementasi yang menunjukkan pasal tersebut adalah ....', NULL, 1, 'Sikap atau implementasi yang menunjukkan pasal tersebut adalah dengan mengunjungi dan membeli karya seni dari seniman lokal, seperti lukisan, kerajinan tangan, dan pertunjukan seni, sebagai bentuk dukungan terhadap kebudayaan.', NULL, '2024-08-01 04:54:11', '2024-08-01 04:54:11'),
(2283, 'PNSSKD005', 23, 'Terjadinya demonstrasi besar-besaran di wilayah Provinsi Papua dan Papua Barat yang\r\ndisertai dengan aksi persekusi, perusakan dan penjarahan di kantor pemerintahan adalah\r\nwujud penerapan penyampaian suara publik di muka umum yang bertentangan dengan\r\nPancasila khususnya sila ke ....', NULL, 4, 'Didalam teks ini dijelaskan terkait dengan terjadinya demonstrasi besar-besaran di wilayah Provinsi Papua dan Papua Barat yang disertai dengan\r\naksi persekusi, pengrusakan dan penjarahan di kantor pemerintahan.<br>\r\nHal tersebut dalam rangka wujud penerapan penyampaian suara publik di\r\nmuka umum.<br>\r\nTentu saja hal seperti ini menyimpang daripada pengamalan sila ke-4,\r\nDimana pada sila ke-4 diatur terkait dalam memutuskan sebuah perkara, \r\nHarus betul-betul digunakan musyawarah dengan baik, menggunakan\r\nakal sehat, hati nurani, semangat kekeluargaan. Kemudian jika sudah\r\ndiputuskan, kita harus menerimanya. Maka jawaban yang paling tepat\r\nuntuk soal ini adalah jawaban yang D, Melanggar sila ke-4', NULL, '2024-08-01 04:56:39', '2024-08-01 04:56:39'),
(2284, 'PNSSKD005', 24, 'Wakil Presiden Ma\'ruf Amin meminta masyarakat untuk lebih memilih produk dalam negeri\r\nketimbang impor. Secara khusus, harapan untuk memilih itu ia minta diberikan pada\r\nproduk UMKM. Ma\'ruf mengatakan supaya permintaan itu bisa terwujud, pemerintah kini sedang menggalakkan program gerakan nasional (gernas) bangga buatan Indonesia (BBI). Pada tahun lalu, terdapat 3,7 juta pelaku UMKM yang memasarkan produknya secara daring (online) dan ikut serta dalam program tersebut.<br>\r\nUpaya untuk memilih dan menggunakan produk dalam negeri dibandingkan luar negeri\r\nmerupakan pengamalan daripada sila ke - . . .', NULL, 3, 'Presiden Indonesia menghimbau supaya masyarakat lebih memilih produk\r\ndalam negeri daripada produk impor ( Produk luar negeri )<br>\r\nTentu saja hal seperti ini merupakan pengamalan daripada sila yang ke-3,\r\nPersatuan Indonesia.<br>\r\n\r\nKenapa merupakan pengamalan daripada sila ke-3?<br>\r\nKarena dalam poin pengamalan sila yang ke-3 kita dituntut untuk mencintai\r\ndan bangga berkebangsaan Indonesia.<br>\r\n\r\nTentu saja rasa cinta dan bangga tersebut harus tertanam dalam implementasi\r\nkita lebih memilih produk dalam negeri dibandingkan dengan produk luar\r\nnegeri.<br>\r\nMaka jawaban yang tepat untuk soal ini adalah yang C', NULL, '2024-08-01 04:58:38', '2024-08-01 04:58:38'),
(2285, 'PNSSKD005', 26, 'Di bawah ini yang merupakan kalimat transitif adalah....', NULL, 5, 'Kalimat transitif adalah kalimat yang predikatnya memerlukan objek. Misalnya: Anggit menulis\r\ncerita setiap malam.', NULL, '2024-08-01 05:32:42', '2024-08-01 05:32:42'),
(2287, 'PNSSKD005', 27, 'Di bawah ini penggunaan kata baku yang benar adalah....', NULL, 1, 'Di bawah ini penggunaan kata baku yang benar adalah :<br>\r\n- Lia sedang asyik mengerjakan PR Matematika\r\n- Kakek sering memintaku membelikan balsamdi Apotek Sehat Abadi\r\n- Ketika akan membangun rumah, kita harus mempersiapkan uang yang tak sedikit\r\n- Beberapa bulan belakangan ini, di Indonesia menunjukkan terjadi cuaca yang ekstrem\r\n- Akun youtube miliknya tidak dijadikan akun komersial', NULL, '2024-08-01 05:38:12', '2024-08-01 05:38:12'),
(2288, 'PNSSKD005', 28, 'Berikut ini yang termasuk kedalamkalimat efektif adalah....', NULL, 2, 'Berikut ini yang termasuk kedalam kalimat efektif adalah : <br>\r\n- Nina sudah lama sekali tidak berkunjung ke rumah orangtuanya<br>\r\n- Dalammenyusun skripsi itu, saya dibantu oleh para dosen<br>\r\n- Setelah kepergian putranya, ia sangat berduka<br>\r\n- Para siswa SD sudah mulai melaksanakan kegiatan vaksinasi covid-19<br>\r\n- Pada bulan ini, Afisa akan melangsungkan pernikahannya', NULL, '2024-08-01 05:40:43', '2024-08-01 05:40:43'),
(2289, 'PNSSKD005', 29, '<b> Bacalah tulisan berikut!1</b><br>\r\n (1) Selama pandemi Covid-19 salah satu cara efektif untuk meningkatkan daya tahan tubuh\r\nadalah dengan pola makan gizi seimbang. (2) Jika pemenuhan gizi tak mencukupi, bisa\r\nmengonsumsi vitamin. (3) Dalam uji petik survey dan donasi yang dilakukan oleh Jurnalis\r\nPeduli Kesehatan Masyarakat (JPKM) kepada 120 warga di fasilitas umum (fasum) lingkungan\r\nRW 06 Depok 2 Tengah, Kecamatan Mekarjaya, Depok, Minggu (15/11), berdasarkan hasil uji\r\npetik (sampling) kerja sama JPKM dan mahasiswi Universitas Al-Azhar, sekitar 69 persen\r\nwarga penerima sangat setuju mengkonsumsi vitamin untuk memperkuat imunitas tubuh. (4)\r\nSementara itu, sekitar 31 persen warga setuju mengonsumsi vitamin untuk peningkatan\r\nimunitas tubuh.<br> (1) Selama pandemi Covid-19 salah satu cara efektif untuk meningkatkan daya tahan tubuh\r\nadalah dengan pola makan gizi seimbang. (2) Jika pemenuhan gizi tak mencukupi, bisa\r\nmengonsumsi vitamin. (3) Dalam uji petik survey dan donasi yang dilakukan oleh Jurnalis\r\nPeduli Kesehatan Masyarakat (JPKM) kepada 120 warga di fasilitas umum (fasum) lingkungan\r\nRW 06 Depok 2 Tengah, Kecamatan Mekarjaya, Depok, Minggu (15/11), berdasarkan hasil uji\r\npetik (sampling) kerja sama JPKM dan mahasiswi Universitas Al-Azhar, sekitar 69 persen\r\nwarga penerima sangat setuju mengkonsumsi vitamin untuk memperkuat imunitas tubuh. (4)\r\nSementara itu, sekitar 31 persen warga setuju mengonsumsi vitamin untuk peningkatan\r\nimunitas tubuh.<br><br>\r\n (5) […], hal yang menarik adalah sekitar 63 persen warga sangat mengetahui pentingnya\r\nmemiliki pikiran positif untuk meningkatkan imunitas tubuh. (6) Lalu, sekitar 37 persen\r\nmengaku mengetahui tentang cara meningkatkan imunitas tubuh. (7) Dari hasil uji petik itu,\r\nmayoritas warga juga mengetahui bahwa seseorang yang terpapar Covid-19 dapat dipulihkan.\r\n(8) Dari total responden, sekitar 46 persen sangat setuju tentang hal itu dan selebihnya sekitar\r\n54 persen mengaku setuju. (9) “Kami berharap warga dan pekerja media bisa meningkatkan\r\nimunitas tubuh, selain menerapkan protokol kesehatan,” kata Ketua JPKM, Irwen Azhari,\r\nsecara daring baru-baru ini.<br><br>\r\n(10) Sementara itu, Corporate Secretary PT Phapros Tbk, Zahmilia Akbar, mengatakan,\r\npandemi Covid-19 banyak memberikan pelajaran bagaimana menjaga imunitas dan\r\nmenerapkan protokol kesehatan dengan positive mindset. (11) Salah satunya dengan olahraga\r\ndan pola hidup bersih dan sehat. (12) “Serta tetap memakai masker, menjaga jarak, cuci tangan\r\ndan positive mindset,” kata Zahmilia. <br>Konjungsi yang tepat untuk melengkapi kalimat nomor (5) pada teks tersebut adalah…', NULL, 2, 'Konjungsi yang tepat untuk melengkapi kalimat nomor (5) adalah konjungsi\r\nnamun yang merupakan konjungsi antarkalimat.', NULL, '2024-08-01 05:46:47', '2024-08-01 05:46:47'),
