ebihnya sekitar\r\n54 persen mengaku setuju. (9) “Kami berharap warga dan pekerja media bisa meningkatkan\r\nimunitas tubuh, selain menerapkan protokol kesehatan,” kata Ketua JPKM, Irwen Azhari,\r\nsecara daring baru-baru ini.<br><br>\r\n(10) Sementara itu, Corporate Secretary PT Phapros Tbk, Zahmilia Akbar, mengatakan,\r\npandemi Covid-19 banyak memberikan pelajaran bagaimana menjaga imunitas dan\r\nmenerapkan protokol kesehatan dengan positive mindset. (11) Salah satunya dengan olahraga\r\ndan pola hidup bersih dan sehat. (12) “Serta tetap memakai masker, menjaga jarak, cuci tangan\r\ndan positive mindset,” kata Zahmilia. <br>Berdasarkan teks tersebut, terdapat kata tidak baku pada kalimat ....', NULL, 2, 'Survei adalah kata yang baku berdasarkan KBBI.', NULL, '2024-08-01 05:48:51', '2024-08-01 05:48:51'),
(2291, 'PNSSKD005', 31, '\"Setiap pagi, ibu membuatkan sarapan untuk keluarga.\"<br>Memiliki persamaan dengan kalimat ....', NULL, 1, 'Kalimat soal: \"Setiap pagi, ibu membuatkan sarapan untuk keluarga.\"<br>\r\n\r\nStruktur: Keterangan waktu + Subjek + Predikat + Objek.\r\nKeterangan waktu: Setiap pagi<br>\r\nSubjek: ibu<br>\r\nPredikat: membuatkan<br>\r\nObjek: sarapan<br>\r\nOpsi A: \"Setiap hari, Rani membaca buku sebelum tidur.\"<br>\r\n\r\nStruktur: Keterangan waktu + Subjek + Predikat + Objek.<br>\r\nKeterangan waktu: Setiap hari<br>\r\nSubjek: Rani<br>\r\nPredikat: membaca<br>\r\nObjek: buku', NULL, '2024-08-01 15:51:51', '2024-08-01 15:51:51'),
(2292, 'PNSSKD005', 32, '\"Guru memberi tugas matematika kepada siswa.\"<br>\r\nMemiliki persamaan dengan kalimat ....', NULL, 2, 'Kalimat soal: \"Guru memberi tugas matematika kepada siswa.\"<br>\r\n\r\nStruktur: Subjek + Predikat + Objek + Keterangan.<br>\r\nSubjek: Guru<br>\r\nPredikat: memberi<br>\r\nObjek: tugas matematika<br>\r\nKeterangan: kepada siswa<br>\r\nOpsi B: \"Saya menulis surat untuk nenek.\"\r\n\r\nStruktur: Subjek + Predikat + Objek + Keterangan.<br>\r\nSubjek: Saya<br>\r\nPredikat: menulis<br>\r\nObjek: surat<br>\r\nKeterangan: untuk nenek', NULL, '2024-08-01 15:56:38', '2024-08-01 15:56:38'),
(2293, 'PNSSKD005', 33, '\"Ayah sedang membaca koran di ruang tamu.\"<br>Memiliki persamaan kalimat dengan ....', NULL, 4, 'Kalimat soal: \"Ayah sedang membaca koran di ruang tamu.\"<br>\r\n\r\nStruktur: Subjek + Predikat + Objek + Keterangan tempat.<br>\r\nSubjek: Ayah<br>\r\nPredikat: sedang membaca<br>\r\nObjek: koran<br>\r\nKeterangan tempat: di ruang tamu<br>\r\nOpsi D: \"Ibu mencuci piring di dapur.\"<br>\r\n\r\nStruktur: Subjek + Predikat + Objek + Keterangan tempat.<br?\r\nSubjek: Ibu<br>\r\nPredikat: mencuci<br>\r\nObjek: piring<br>\r\nKeterangan tempat: di dapur', NULL, '2024-08-01 16:13:19', '2024-08-01 16:13:19'),
(2294, 'PNSSKD005', 34, '\"Anak itu tertawa terbahak-bahak.\"<br> Memiliki Persamaan dengan kalimat ....', NULL, 3, 'Kalimat soal: \"Anak itu tertawa terbahak-bahak.\"<br>\r\n\r\nStruktur: Subjek + Predikat + Keterangan cara.<br>\r\nSubjek: Anak itu<br>\r\nPredikat: tertawa<br>\r\nKeterangan cara: terbahak-bahak<br>\r\nOpsi C: \"Dia menangis seharian.\"<br<\r\n\r\nStruktur: Subjek + Predikat + Keterangan cara.<br>\r\nSubjek: Dia<br>\r\nPredikat: menangis<br>\r\nKeterangan cara: seharian', NULL, '2024-08-01 16:24:54', '2024-08-01 16:24:54'),
(2295, 'PNSSKD005', 35, '\"Kami membeli sayuran di pasar setiap minggu.\"<br> Memiliki kesamaan dengan kalimat ....', NULL, 5, 'Kalimat soal : \"Kami membeli sayuran di pasar setiap minggu.\"<br>\r\n\r\nStruktur: Subjek + Predikat + Objek + Keterangan tempat + Keterangan waktu.<br>\r\nSubjek: Kami<br>\r\nPredikat: membeli<br>\r\nObjek: sayuran<br>\r\nKeterangan tempat: di pasar<br>\r\nKeterangan waktu: setiap minggu<br>\r\nOpsi E : \"Saya berbelanja keperluan rumah di supermarket.\"\r\n\r\nStruktur: Subjek + Predikat + Objek + Keterangan tempat.<br>\r\nSubjek: Saya<br>\r\nPredikat: berbelanja<br>\r\nObjek: keperluan rumah<br>\r\nKeterangan tempat: di supermarket', NULL, '2024-08-01 16:47:48', '2024-08-01 16:47:48'),
(2296, 'PNSSKD005', 36, 'Semua murid pandai berhitung dan sopan.\r\nDoni tidak sopan tetapi pandai berhitung.\r\nSimpulan yang tepat adalah ....', NULL, 4, 'P1 : <b>Semua</b> murid pandai berhitung dan sopan.<br>\r\nP2 : Doni <b>tidak</b> sopan tetapi pandai berhitung.<br>\r\nK : Doni <b>bukan</b> seorang murid meskipun pandai berhitung', NULL, '2024-08-01 17:06:11', '2024-08-01 17:06:11'),
(2297, 'PNSSKD005', 37, 'Semua tanaman memiliki buah.\r\nSebagian tanaman berbunga\r\nmerah. Simpulan yang tepat\r\nadalah ....', NULL, 5, 'P1 : Semua tanaman memiliki buah.<br>\r\nP2 : Sebagian tanaman ber tanaman berbunga merah.<br>\r\nK : Sebagian tanaman yang memiliki buah, berbunga merah.<br>\r\nArtinya, sebagiannya lagi bunganya bukan merah.', NULL, '2024-08-01 20:50:28', '2024-08-01 20:50:28'),
(2298, 'PNSSKD005', 38, 'Semua pelaut adalah perenang.\r\nSebagian perenang bukan penyelam.\r\nSimpulan yang tepat adalah ....', NULL, 2, 'P1 : <b>Semua</b> pelaut adalah perenang.<br>\r\nP2 : <b>Sebagian</b> perenang bukan penyelam<br>.\r\nK : <b>Sebagian</b> pelaut bukan penyelam.', NULL, '2024-08-01 20:54:37', '2024-08-01 20:54:37'),
(2299, 'PNSSKD005', 39, 'Suatu lembaga bimbingan belajar bahasa asing memberikan 6\r\nprogram yang dapat ditempuh\r\nuntuk memberikan hasil optimal\r\ndalam TOEFL yakni: A, B, C, D, E,\r\ndan F. Masing-masing program\r\nharus ditempuh sesuai urutan\r\nyang benar karena ada program\r\nyang merupakan kelanjutan dari\r\nprogram lainnya walaupun tidak\r\nsemua. Untuk itu, diaturlah ketentuan pengambilan program sebagai berikut:<br>\r\n- D harus ditempuh tepat setelah\r\ncalon peserta TOEFL menempuh C<br>\r\n- F boleh ditempuh sebelum B\r\nnamun tidak boleh sebelum A<br>\r\n- Program E harus diambil pada\r\nurutan kedua dari seluruh program<br><br>Jika B ditempuh pada urutan kelima maka D ditempuh pada\r\nurutan ...', NULL, 4, 'Jika B ditempuh pada urutan\r\nkelima maka D ditempuh pada\r\nurutan keempat. Kemungkinannya adalah:', '1722575062.png', '2024-08-01 21:04:22', '2024-08-01 21:04:22'),
(2301, 'PNSSKD005', 40, 'Semua tempat duduk sebuah bis telah penuh dan ada 5 orang yang berdiri. Pada halte\r\nberikutnya, ada 12 orang turun dan 4 orang yang naik. Berapakah jumlah tempat duduk yang\r\nkosong jika semua penumpang telah duduk?', NULL, 3, 'Kunci: 12 orang turun maka 5 orang yang berdiri akan duduk dan tersisa 7 tempat duduk. lalu 4 orang naik maka sisa 3 tempat duduk', NULL, '2024-08-02 03:15:54', '2024-08-02 03:15:54'),
(2302, 'PNSSKD005', 41, 'Pada saat ujian, ibu guru menentukan deretan tempat duduk Anto, Budi, Cici, Didi, Edi, dan\r\nFandi sebagai berikut.<br>\r\n1) Anto tidak bersebelahan dengan Budi dan Cici.<br>\r\n2) Didi bersebelahan dengan Cici.<br>\r\n3) Anto dekat dengan Edi dan Edi dekat dengan Didi.<br>\r\n4) Budi di dekat Fandi dan Fandi bersebelahan dengan Anto.<br>\r\n5) Cici berada pada urutan terakhir.<br><br>\r\nJadi, urutan tempat duduk keenamanak adalah ....', NULL, 2, 'pernyataan 2) dan 5) menunjukkan bahwa Cici berada pada urutan ke-6 dan Didi pada urutan\r\nke-5.<br> \r\nPernyataan 3) menunjukkan bahwa Edi pada urutan ke-4 dan Anto pada urutan ke-3.<br>\r\n Pernyataan 1) dan 4) menunjukkan bahwa Budi berada pada urutan pertama dan Fandi urutan kedua.', NULL, '2024-08-02 03:20:21', '2024-08-02 03:20:21'),
