(2310, 'PNSSKD005', 49, 'Jika x = <sup>1</sup>/<sub>4</sub> + <sup>3</sup>/<sub>6</sub> , y = <sup>3</sup>/<sub>8</sub> + <sup>1</sup>/<sub>3</sub><br>Maka hubungan x dan y adalah ....', NULL, 1, NULL, '1722602087.png', '2024-08-02 04:34:47', '2024-08-02 04:34:47'),
(2311, 'PNSSKD005', 50, 'Jika x + y = 15 dan 2x - 3y = -5, maka hubungan x dan y adalah ....', NULL, 1, 'X+ y = 15 x2<br>\r\n2x – 3y = -5 x1<br>\r\n---------------- -<br>\r\n2x+2y = 30<br>\r\n2x-3y = -5<br>\r\n-------------- -<br>\r\n5y = 35<br>\r\nY =7<br>\r\nX= 8<br>\r\nX > y', NULL, '2024-08-02 04:40:58', '2024-08-02 04:40:58'),
(2312, 'PNSSKD005', 51, 'Jika A = 115 dan B = 15% maka….', NULL, 1, 'Lakukan kali silang antara pecahan A dan B<br><br>\r\n<sup>1</sup>/<sub>15</sub> x <sup>15</sup>/<sub>100</sub>\r\n100 < 225 <br>\r\nBisa dilihat hasil akhir untuk persoalan ini adalah 100 < 225 maka jawaban yang tepat\r\nuntuk persoalan ini adalah A < B', NULL, '2024-08-02 04:48:04', '2024-08-02 04:48:04'),
