(2315, 'PNSSKD005', 54, 'Sebuah bak mandi memiliki 3 keran yang mengalirkan air ke dalamnya. Keran pertama dapat mengisi bak dalam\r\nwaktu 90 menit. Keran kedua dalam waktu 80 menit dapat mengisi bak, sedangkan keran ketiga dapat mengisi bak\r\nselama satu jam. Jika dalam suatu waktu ketiga keran dibuka maka bak akan penuh dalam….menit', NULL, 3, NULL, '1722603365.png', '2024-08-02 04:56:05', '2024-08-02 04:56:05'),
(2316, 'PNSSKD005', 55, 'Ibu Sasa mempunyai uang Rp. 2.300.000,00 dan berniat untuk membeli lemari pendingin seharga Rp. 2.000.000,00.\r\nKarena tahun baru, toko memberikan diskon 20%. Selain itu, ibu Sasa juga belanja bulanan untuk keperluan rumah\r\nsebesar Rp. 550.000,00. Sisa uang ibu Sasa sekarang sebesar….', NULL, 1, NULL, '1722603473.png', '2024-08-02 04:57:53', '2024-08-02 04:57:53'),
(2318, 'PNSSKD001', 66, 'Anda bertanggung jawab dalam mengaudit data calon penerima bansos. Namun, setelah Anda telusuri banyak sekali data-data yang mengajukan bansos justru di kalangan orang yang mampu. Seharusnya di tingkat RT/RW maupun kelurahan orang-orang yang sudah dirasa mampu tidak perlu lagi diajukan untuk menerima bansos. Sikap Anda ....', NULL, 5, 'Opsi a (Menghubungi lurah setempat dan memberi teguran keras) : Tidak menyelesaikan masalah jangka panjang dan dapat menimbulkan resistensi atau ketegangan.<br>\r\nOpsi b (Melapor kepada atasan) : Tidak menyelesaikan masalah secara langsung dan cenderung pasif.<br>\r\nOpsi c (Tidak meloloskan data orang yang mampu untuk menerima bansos): Tidak mengatasi akar masalah dan tidak mencegah pengulangan di masa depan.<br>\r\nOpsi d (Menghubungi lurah yang bersangkutan dan mengajak berkomunikasi terkait hal ini, kemudian memberikan arahan): Hanya melibatkan lurah yang bersangkutan, bukan solusi menyeluruh yang melibatkan semua pemangku kepentingan.<br>\r\nOpsi e menekankan peningkatan kualitas pelayanan publik dengan cara yang proaktif dan kolaboratif. Ini menunjukkan bahwa Anda tidak hanya fokus pada solusi jangka pendek tetapi juga berupaya mencegah terulangnya masalah yang sama di masa depan.', NULL, '2024-08-03 02:42:51', '2024-08-03 02:57:31'),
(2319, 'PNSSKD001', 67, 'Anda bekerja sebagai pelayan publik di salah satu kecamatan , pada tahun ini akan diadakan\r\ntes kenaikan jabatan, kandidat untuk naik jabatan di posisi kepala bagian tahun ini dibatasi\r\nuntuk tiga orang saja. Sebelum itu, diadakan pelatihan khusus dan tes bertahap demi\r\nmendapatkan pegawai yang sesuai kriteria jabatan. Sebagai salah satu kandidat, bagaimana\r\nanda menyikapi hal ini?', NULL, 3, 'Indikator dalam soal ini berkaitan dengan menunjukkan\r\nsikap kompeten dan ingin sukses.<br><br>\r\n• Opsi A 2 poin karena pasrah sebelum mencoba yang terbaik.<br>\r\n• Opsi B 3 poin karena bersikap ambisius, tetapi mencoba segala cara\r\ntidak bisa jadi termasuk dengan cara yang tidak baik.<br>\r\n• Opsi C 5 poin karena menunjukkan tekad kuat, sikap kompeten, dan\r\nberusaha untuk sukses demi tujuannya.<br>\r\n• Opsi D 1 poin karena bersikap curang dan tidak adil dalam persaingan.<br>\r\n• Opsi E 4 poin karena menunjukkan semangat pantang menyerah,\r\nnamun kurang dalam solusi efektif dalam bersikap kompeten.<br>', NULL, '2024-08-03 02:49:38', '2024-08-03 02:49:38'),
(2320, 'PNSSKD001', 68, 'Ketika Anda ditugasi oleh atasan untuk menginput data karyawan, ternyara kerja Anda dirasa lambat. Sudah waktunya atasan meminta data tersebut, Anda belum menyelesaikannya. Menyikapi hal tersebut, maka Anda ....', NULL, 1, 'Aspek yang dinilai adalah pelayanan publik : <br>\r\nopsi a adalah pilihan yang paling tepat karena mencerminkan sikap profesional, bertanggung jawab, dan berkomitmen untuk memberikan pelayanan yang terbaik kepada atasan.<br>\r\nOpsi b (Mempercepat penyelesaian input data):Tidak menyertakan elemen tanggung jawab dengan meminta maaf, yang bisa menunjukkan ketulusan dan pengakuan atas keterlambatan.<br>\r\nOpsi c (Berjanji kelak akan bekerja lebih cepat):Tidak menawarkan solusi langsung untuk masalah saat ini.<br>\r\nOpsi d (Mengatakan bahwa menginput data membutuhkan ketelitian):Mungkin dianggap defensif dan tidak menyelesaikan masalah keterlambatan.<br>\r\nOpsi e (Meminta perpanjangan waktu mengerjakan):Tidak menawarkan solusi yang tepat waktu, terutama jika atasan sudah membutuhkan data segera.', NULL, '2024-08-03 03:03:48', '2024-08-03 03:04:17'),
(2321, 'PNSSKD001', 69, 'Anda merupakan seorang kurir yang setiap hari bertugas mengantarkan kiriman barang ke rumah pelanggan. Anda tidak\r\ntahu isi dari barang yang Anda antar tersebut, tugas Anda hanya mengantarkan ke alamat. Suatu hari Anda dikomplain\r\nkarena barang yang Anda antar keliru. Bagaimana sikap Anda?', NULL, 5, 'Indikator dalam soal ini berkaitan dengan harus cepat\r\ntanggap dengan keluhan dan segera mungkin mencarikan solusi agar\r\npelanggan merasa dilayani.<br>\r\nOpsi A 3 poin karena tugas kurir memang hanya mengantarkan\r\nbarang agar sampai ke tangan konsumen sehingga perlu\r\nmenjelaskan baik-baik kepada konsumen.<br>\r\nOpsi B 2 poin karena Anda telah berusaha untuk memberikan\r\nsolusi terhadap permasalahan yang sedang Anda hadapi.<br>\r\nOpsi C 4 poin karena Anda merupakan orang yang bertanggung\r\njawab terhadap tugas yang telah diamanahkan.<br>\r\nOpsi D 1 poin karena Anda tidak memberikan solusi apapun untuk\r\nmenyelesaikan permasalahan yang sedang dihadapi.<br>\r\nOpsi E 5 poin karena Anda memiliki orientasi pada pelayanan\r\ncepat tanggap saat itu juga dengan langsung mengkonfirmasi via\r\ntelepon kepada atasan jika barang keliru baru menunggu untuk\r\nmelakukan perintah atasan selanjutnya.', NULL, '2024-08-03 03:08:33', '2024-08-03 03:08:33'),
(2322, 'PNSSKD001', 70, 'Anda adalah pegawai baru, ketika atasan meminta Anda untuk menyusun proposal. Ternyata belum sampai tenggat waktu, atasan meminta proposal tersebut dikarenakan\r\nada perubahan jadwal presentasi proposal dengan klien. Sikap Anda ....', NULL, 2, 'Aspek yang dinilai adalah pelayanan publik :<br>\r\n•  Opsi b : Dengan mempercepat pengerjaan proposal, Anda menunjukkan sikap proaktif yang sangat penting dalam dunia kerja. Ini menandakan bahwa Anda dapat beradaptasi dengan perubahan dan siap menghadapi tantangan baru.<br>\r\n•  opsi a (Mengatakan bahwa belum waktunya dikumpulkan):Tidak menunjukkan fleksibilitas dan kemampuan beradaptasi dengan perubahan kebutuhan.<br>\r\n•  Opsi c (Meminta bantuan teman untuk mengerjakan agar cepat selesai):Mungkin tidak sepenuhnya mencerminkan kemampuan Anda sendiri dan bisa mengganggu pekerjaan teman Anda.<br>\r\n•  Opsi d (Meminta maaf karena belum bisa mengumpulkan):Tidak menawarkan solusi proaktif untuk menyelesaikan masalah.<br>\r\n•  Opsi e (Mengatakan bahwa Anda pegawai baru jadi belum bisa bekerja dengan cepat):Terlihat defensif dan menunjukkan kurangnya inisiatif untuk meningkatkan kinerja', NULL, '2024-08-03 03:16:58', '2024-08-04 04:23:39'),
(2325, 'PNSSKD001', 60, NULL, '1722701976.png', 3, 'Perhatikan bagian yang diarsir. Objek mengecil dan terbagi menjadi dua. Salah satunya diarsir, namun arsiran yang terbentuk tidak memenuhi objek.', NULL, '2024-08-03 08:19:36', '2024-08-03 08:19:36'),
(2326, 'PNSSKD001', 61, NULL, '1722702265.png', 2, 'Empat bulatan dikonversikan menjadi sebuah benda yang memiliki empat ruas garis. Begitupun dengan tiga bulatan menjadi tiga ruas garis.', NULL, '2024-08-03 08:24:25', '2024-08-03 08:24:25'),
(2327, 'PNSSKD001', 62, 'Pilihlah satu gambar di antara lima pilihan jawaban yang dalam hal tertentu berbeda dari tiga gambar!', '1722702647.png', 4, 'Perhatikan jumlah sisi pada bangun-bangun  tersebut. Semuanya merupakan bangun yang memiliki empat sisi, kecuali pada pilihan jawaban (D) \r\nyang memiliki lima sisi.', NULL, '2024-08-03 08:30:47', '2024-08-03 08:30:47'),
(2328, 'PNSSKD001', 63, 'Pilihlah satu gambar di antara \r\nlima pilihan jawaban yang dalam hal tertentu berbeda dari tiga gambar!', '1722702938.png', 4, 'Perhatikan bentuk bangun ruang yang ada. Semuanya merupakan bangun ruang berpenyiku, kecuali pada pilihan jawaban (D) yang merupakan bangun ruang silinder.', NULL, '2024-08-03 08:35:38', '2024-08-03 08:35:38'),
(2329, 'PNSSKD001', 64, NULL, '1722703287.png', 1, 'Perhatikan, gambar punya empat corak, yaitu ada 3 pola arsir an/raster dan satu warna polos putih. Jelas terlihat bahwa jawabannya adalah A.', NULL, '2024-08-03 08:41:27', '2024-08-03 08:41:27'),
(2330, 'PNSSKD001', 65, NULL, '1722703909.png', 4, 'Perhatikan posisi dari bangun \r\nyang berwarna putih polos. \r\nBerdasarkan dua bangun sebelumnya, maka jawabannya pasti yang memuat polos di tengah, \r\nyaitu B atau D. Lalu perhatikan \r\nletak trapesium, jelas bahwa \r\npada jawaban trapesium posisinya harus di tengah. Maka \r\njawaban yang tepat adalah D.', NULL, '2024-08-03 08:44:36', '2024-08-03 08:51:49'),
(2331, 'PNSSKD001', 71, 'Memberikan pelayanan terbaik sudah menjadi hal yang wajib dilakukan bagi semua PNS. Pasalnya hal ini berhubungan langsung dengan kemaslahatan masyarakat umum.\r\nTetapi, bukan berarti pengembangan pelayanan tidak dibutuhkan karena hal ini juga sesuatu yang penting. Jika Anda merupakan pimpinan suatu instansi, langkah apa yang\r\nakan Anda ambil agar masyarakat puas dengan pelayanan yang diberikan instansi Anda?', NULL, 1, 'Aspek yang dinilai adalah pelayanan publik :<br>\r\nDalam menjawab pertanyaan yang merujuk pada peningkatan pelayanan, maka jawaban utama kita adalah memberikan pelatihan kepada pegawai', NULL, '2024-08-03 19:34:35', '2024-08-03 19:36:41'),
(2332, 'PNSSKD001', 72, 'Anda pegawai di kantor kecamatan. Karena terjadi kemacetan lalu lintas, akibat adanya\r\ndemonstrasi sehingga Anda datang ke kantor tidak tepat waktu dan terburu-buru untuk\r\nsegera presensi. Namun, ada masyarakat yang mencegah Anda dan menanyakan terkait\r\nruang untuk mengurus surat pengantar pergantian data e-KTP. Sikap Anda ....', NULL, 5, 'Aspek yang dinilai adalah pelayanan publik :<br>\r\nMemberi arahan lokasi ruangan, dan meminta maaf tidak bisa mengantar karena Anda sedang terburu-buru. menunjukkan kemampuan untuk bekerja secara efektif dalam tekanan sambil tetap memberikan perhatian kepada kebutuhan masyarakat. Ini mencerminkan sikap profesional dan empati yang seimbang dalam pelayanan publik.', NULL, '2024-08-03 19:42:36', '2024-08-03 19:42:36'),
(2333, 'PNSSKD001', 73, 'Ketika ada masyarakat yang ingin mengurus pembuatan akta kelahiran, namun teman\r\nAnda yang bertugas di loket pelayanan sedang kurang sehat. Sehingga ia tampak kelelahan. Anda kebutulan sedang tidak sibuk, maka sikap Anda ....', NULL, 3, 'Aspek yang dinilai adalah pelayanan publik :<br>\r\nMenyarankan agar teman Anda istirahat dulu dan Anda meminta petunjuk atasan apakah bisa menggantikan tugasnya.Anda menunjukkan sikap yang bertanggung jawab, empatik, dan profesional dalam menghadapi situasi di mana rekan kerja memerlukan bantuan. Anda memastikan keseimbangan antara tanggung jawab terhadap teman, pelayanan publik, dan kebijakan internal kantor.', NULL, '2024-08-03 19:45:58', '2024-08-03 19:45:58'),
(2334, 'PNSSKD001', 74, 'Menghadapi keluhan masyarakat di sekitar bantaran sungai dalam menghadapi musim penghujan yang rawan banjir, maka sikap Anda selaku ketua RT dalam mencegah dan\r\nmenanggulangi banjir adalah ....', NULL, 2, 'Aspek yang dinilai  adalah jejaring kerja :<br>\r\nMengajak warga berdiskusi untuk sama-sama dicari solusi.Anda menunjukkan kepemimpinan yang inklusif dan mampu membangun jejaring kerja yang solid dengan melibatkan warga dalam mencari solusi terbaik untuk mencegah dan menanggulangi banjir. Ini adalah langkah yang strategis dalam membangun komunitas yang lebih resilien dan adaptif terhadap perubahan lingkungan.', NULL, '2024-08-03 19:50:11', '2024-08-03 19:50:11'),
(2335, 'PNSSKD001', 75, 'Anda bersama salah satu rekan kerja melakukan kunjungan ke kantor klien.\r\nPada saat kunjungan tersebut Anda melihat ada salah satu klien yang terlihat\r\nkurang profesional dan kurang cakap dalam perundingan kerjasama. Padahal\r\nAnda perlu banyak informasi dan data mengenai program kerjasama yang\r\nakan segera disepakati. Sikap Anda pada situasi tersebut adalah …..', NULL, 5, 'Aspek yang dinilai adalah jejaring kerja:<br>\r\n- Opsi A 1 poin karena anda hanya berusaha untuk menguntungkan\r\nsalah satu pihak bukan kedua belah pihak.\r\n- Opsi B 4 poin karena anda sangat profesional dalam menjalankan\r\nkerjasama dengan mitra.<br>\r\n- Opsi C 2 poin karena anda kurang profesional karena\r\nmembatalkan kesepakatan ketika programnya telah berjalan yang\r\nseharusnya anda membatalkan sebelum programnya berjalan.<br>\r\n- Opsi D 3 poin karena sudah tidak ada kepentingan yang perlu\r\ndijalin dan lebih baik anda melakukan pekerjaan yang lain.<br>\r\n- Opsi E 5 poin karena Mitra jaringan kerja bisa bermacam-macam\r\nmulai dari masyarakat, institusi dalam negeri dan institusi luar\r\nnegeri Jawaban yang paling tepat adalah Opsi E yaitu Berusaha\r\nuntuk tidak terlalu kaku dan arogan dalam menggali informasi\r\ndari klien tersebut sehingga ia tidak gugup dan bisa berunding\r\nsecara profesional.', NULL, '2024-08-03 19:56:10', '2024-08-03 19:56:10'),
(2336, 'PNSSKD001', 76, 'Anda ditunjuk oleh atasan untuk memimpin sebuah projek yang dikerjakan secara kelompok. Pekerjaan tersebut memiliki deadline yang sangat ketat. Namun anggota kerja tim Anda terlihat bersikap tidak peduli dengan tugas yang\r\ndiemban. Sikap Anda sebagai ketua tim adalah …..', NULL, 4, 'Aspek yang dinilai adalah jejaring kerja:<br>\r\n- Opsi A 3 poin karena anda telah menunjukkan jiwa seorang\r\npemimpin yaitu “Ing ngarsa sung tuladha”.<br>\r\n- Opsi B 4 poin karena anda selain telah memberikan contoh yang\r\nbaik kepada bawahan anda tetapi anda juga mengingatkan serta\r\nmendorong anggota anda untuk melakukan pekerjaannya dengan\r\nbaik.<br>\r\n- Opsi C 1 poin karena anda tidak mencerminkan jiwa seorang\r\npemimpin yang baik dalam memimpin anggotanya.<br>\r\n- Opsi D 5 poin karena Membagi tugas kepada masing-masing\r\nanggota kelompok secara adil. Saya akan terus memotivasi\r\nanggota tim saya serta terus memperhatikan pekerjaan mereka.\r\nSelain itu saya juga tetap melaksanakan bagian pekerjaan dengan\r\nsebaik mungkin.<br>\r\n- Opsi E 2 poin karena hanya menasehati tidak cukup dimana\r\nseharusnya juga memberikan contoh kepada bawahannya', NULL, '2024-08-03 19:59:13', '2024-08-03 19:59:13'),
(2337, 'PNSSKD001', 77, 'Salah satu rekan kerja Saya adalah orang yang terbilang keras kepala, beberapa kali Saya\r\ndan rekan lain memberikan saran mengerjakan tugas tetapi dia tidak mau mendengarkan.\r\nBenar saja, dia pun diminta memperbaikinya dan meminta tolong Saya untuk membantu\r\npekerjaanya. Saya pun...', NULL, 2, 'Aspek yang dinilai adalah jejaring kerja:<br>\r\njika ada yang membutuhkan bantuan sudah jelas kita bantu dan juga mengingatkan apabila seseorang memiliki kebiasaan yang tidak baik', NULL, '2024-08-03 20:06:01', '2024-08-03 20:06:01'),
(2338, 'PNSSKD001', 78, 'Anda adalah kepala divisi bagian produk makanan di suatu supermarket. Ketika ada\r\nmasalah bahwa beberapa produk makanan kedaluarsa masih dipasarkan padahal\r\nsebelumnya seharusnya sudah lulus control kualitas, maka menghadapi masalah\r\ntersebut sikap Anda ....', NULL, 2, 'Aspek yang dinilai adalah jejaring kerja:<br>\r\nMengajak diskusi karyawan terkait kelalaian ini agar kelak tidak terulang. Anda menunjukkan kemampuan untuk menangani masalah dengan cara yang kolaboratif dan berfokus pada pengembangan solusi yang berkelanjutan. Hal ini tidak hanya menyelesaikan masalah saat ini tetapi juga mencegah terulangnya kesalahan di masa depan.', NULL, '2024-08-03 20:10:44', '2024-08-03 20:10:44');
INSERT INTO `soals` (`id`, `id_paket`, `nomor_soal`, `isi_soal`, `gambar_soal`, `nomor_jawaban`, `isi_solusi`, `gambar_solusi`, `created_at`, `updated_at`) VALUES
(2339, 'PNSSKD001', 79, 'Ketika ditugaskan untuk mendampingi klien untuk melihat tempat usaha, klien\r\nmembutuhkan keputusan segera. Namun, biasanya atasan yang berhak memutuskan. Sebelum ditugaskan atasan juga sudah memberikan beberapa aturan dan rambu-\r\nrambu kepada Anda, Sikap Anda ....', NULL, 3, 'Aspek yang dinilai adalah jejaring kerja:<br>\r\nMemutuskan selama tidak melanggar ketentuan. Anda menunjukkan bahwa Anda dapat bertindak mandiri dan proaktif sambil tetap mematuhi panduan dan kebijakan yang ada, yang sangat penting dalam situasi yang memerlukan keputusan cepat. Ini membantu membangun kepercayaan dari klien dan atasan terhadap kemampuan Anda untuk menangani tugas dengan efektif dan efisien.', NULL, '2024-08-03 20:15:32', '2024-08-03 20:21:18'),
(2340, 'PNSSKD001', 80, 'Ketika Anda dan teman Anda ditugasi untuk melakukan sensus penduduk. Ternyata\r\nteman Anda mengalami kecelakaan saat mengendari sepeda motor ke lokasi sensus.\r\nSehingga kendaraanya lecet namun ia hanya mengalami luka ringan. Sikap Anda ....', NULL, 4, 'Aspek yang dinilai adalah jejaring kerja:<br>\r\nMembantu menangani luka teman, kemudian mengajaknya untuk melanjutkan tugas dan mengerjakan bersama agar cepat selesai. Anda menunjukkan bahwa Anda dapat bertindak secara efektif dan empatik dalam situasi darurat, menjaga kesejahteraan rekan kerja sambil tetap memenuhi tanggung jawab profesional. Ini adalah cerminan dari kemampuan manajemen krisis yang baik dan semangat kerjasama yang kuat.', NULL, '2024-08-03 20:25:02', '2024-08-03 20:25:02'),
(2341, 'PNSSKD001', 81, 'Ketika Anda terpilih sebagai ketua OSIS yang baru, langkah yang Anda tempuh demi kemajuan organisasi adalah ....', NULL, 3, 'Aspek yang dinilai adalah sosial budaya:<br>\r\nMenjalankan program yang sudah lebih dulu bisa berjalan, kemudian mengembangkan program baru yang bisa memajukan organisasi. Anda menunjukkan kemampuan untuk mengelola perubahan dengan bijaksana dan strategi yang seimbang, memajukan organisasi dengan cara yang berkelanjutan dan efektif.', NULL, '2024-08-03 20:34:37', '2024-08-03 20:34:37'),
(2342, 'PNSSKD001', 82, 'Anda baru saja dipindahkan ke departemen lain di kantor Anda. Departemen tersebut masih\r\nmemiliki hubungan dengan pekerjaan sebelumnya. Namun, di tempat baru ini setiap\r\nkaryawan sangat serius dalam bekerja. Anda sangat jarang bahkan tidak pernah melihat\r\nrekan kerja baru Anda bekerja dengan santai dan sedikit bercanda. Sikap yang sebaiknya\r\nAnda tunjukkan adalah …', NULL, 4, 'Aspek yang dinilai adalah sosial budaya:<br>\r\nMelakukan pembiasaan dengan cara kerja di tempat kerja Anda yang baru. Anda menunjukkan bahwa Anda dapat menyesuaikan diri dengan budaya baru sambil tetap menjaga profesionalisme dan kontribusi positif dalam tim. Ini membantu membangun hubungan kerja yang baik dan memaksimalkan efektivitas di lingkungan yang berbeda.', NULL, '2024-08-03 20:44:03', '2024-08-03 20:44:03'),
(2343, 'PNSSKD001', 83, 'Seorang pegawai baru Yusuf terlihat kesulitan melakukan pekerjaannya yang masih berkaitan\r\ndengan pekerjaan Anda. Saat itu di kantor sedang sibuk karena adanya laporan akhir bulan\r\ndan Anda pun sudah menyelesaikan semua pekerjaan mendesak Anda untuk hari itu. Saat\r\nitu tidak ada orang lain yang memperhatikan Yusuf selain Anda. Maka sebaiknya Anda …', NULL, 3, 'Aspek yang dinilai adalah sosial budaya:<br>\r\nMembantu Yusuf menyelesaikan pekerjaannya. Anda menunjukkan bahwa Anda dapat mengambil tanggung jawab dan membantu rekan kerja dalam situasi yang membutuhkan dukungan, menciptakan lingkungan kerja yang kolaboratif dan efisien.', NULL, '2024-08-03 21:00:01', '2024-08-03 21:00:01'),
(2344, 'PNSSKD001', 84, 'Pada jam istirahat siang, sudah menjadi kebiasan bagi semua orang untuk pergi ke kantin dan membeli makanan. Saya tidak perlu ke kantin karena sudah membawa bekal dari rumah. Ketika akan mengambil bekal, rekan kerja Saya membelikan nasi kotak sebagai syukuran atas kenaikan jabatan. Atas pemberian ini maka Saya...', NULL, 2, 'Aspek yang dinilai adalah sosial budaya:<br>\r\nMenerimanya dengan penuh syukur karena sudah berbaik hati tidak hanya kepada Saya tetapi juga yang lain dan nantinya bekal yang sudah dibawa akan Saya berikan kepada pegawai lain yang membutuhkan. Anda menunjukkan bahwa Anda dapat menghargai kebaikan rekan kerja sambil memastikan bahwa makanan yang Anda bawa tetap berguna bagi orang lain, menciptakan suasana kerja yang saling mendukung dan membantu.', NULL, '2024-08-03 21:05:12', '2024-08-03 21:05:12'),
(2345, 'PNSSKD001', 85, 'Ketika Anda sedang mengonsep majalah dinding dengan teman sekolah Anda, ada\r\nteman lain datang dengan raut wajah sedih. Ia menceritakan bahwa ia baru saja gagal\r\ndalam seleksi olimpiade sains di tingkat kabupaten. Ia ingin berbagi cerita, sikap Anda ....', NULL, 3, 'Aspek yang dinilai adalah sosial budaya:<br>\r\nMemberinya waktu sebentar untuk bercerita, sambil Anda istirahat kemudian baru melanjutkan tugas Anda. Anda menunjukkan bahwa Anda dapat memberikan perhatian dan dukungan penuh kepada teman yang sedang membutuhkan, sambil tetap bertanggung jawab terhadap tugas yang sedang dikerjakan. Ini menciptakan suasana yang mendukung dan saling menghargai di lingkungan sekolah.', NULL, '2024-08-04 00:59:32', '2024-08-04 00:59:32'),
(2346, 'PNSSKD001', 86, 'Ketika ada aturan di tempat yang baru Anda tinggali, bahwa warga dilarang membakar sampah. Padahal, istri Anda sebelumnya senang menyingkirkan barang-barang di\r\ngudang dengan membakarnya. Sikap Anda ....', NULL, 3, 'Aspek yang dinilai adalah sosial budaya:<br>\r\nMengikuti aturan demi menjaga keharmonisan dengan warga setempat meski harus mengingatkan istri terus menerus. Menunjukkan bahwa Anda menunjukkan kesadaran dan kepedulian terhadap peraturan setempat serta hubungan harmonis dengan lingkungan baru, yang dapat menciptakan suasana yang mendukung dan kondusif bagi kehidupan bersama warga lainnya.', NULL, '2024-08-04 01:02:54', '2024-08-04 01:02:54'),
(2347, 'PNSSKD001', 87, 'Ketika berkunjung ke rumah nenek, ada mitos di tempat nenek yang beredar bahwa tidak boleh menyapu rumah menjelang magrib. Menyikapi mitos tersebut maka ....', NULL, 2, 'Aspek yang dinilai adalah sosial budaya:<br>Memilih menghargai tradisi tersebut karena Anda berada bukan di rumah Anda. Menunjukkan bahwa sikap toleransi dan penghargaan terhadap kepercayaan lokal, yang dapat membantu menciptakan lingkungan yang harmonis dan saling menghormati. Ini juga menunjukkan pemahaman bahwa dalam konteks sosial dan budaya, penting untuk menyesuaikan diri dengan norma dan tradisi setempat, terutama ketika berada di luar lingkungan sendiri.', NULL, '2024-08-04 01:06:55', '2024-08-04 01:06:55'),
(2348, 'PNSSKD001', 88, 'Tersebar berita di media sosial bahwa seorang artis ibu kota mengalami kecelakaan di\r\njalan tol Surabaya-Jakarta dan tewas di tempat. Kabar ini sangat menghebohkan\r\nterlebih hingga tersebar video kronologis dan keadaan korban. Sikap Anda ....', NULL, 4, 'Aspek yang dinilai adalah Teknologi Informasi dan Komunikasi :<br>\r\nCukup membaca berita sampai tuntas dari sumber terpercaya tanpa menyebar foto atau video korban. Menunjukkan bahwa sikap bijaksana dan bertanggung jawab dalam menanggapi berita viral, serta mempraktikkan etika dalam penggunaan teknologi informasi dan komunikasi. Ini juga mencerminkan kesadaran akan pentingnya menghormati privasi dan etika dalam penyebaran informasi di era digital.', NULL, '2024-08-04 01:15:31', '2024-08-04 01:15:31'),
(2349, 'PNSSKD001', 89, 'Menyikapi berita di media sosial terkait kebijakan pemerintah yang berganti-ganti dan\r\nmemancing emosi masyarakat, maka sikap Anda ....', NULL, 2, 'Aspek yang dinilai adalah Teknologi Informasi dan Komunikasi :<br>\r\nHanya membaca berita dari sumber terpercaya saja. <br>\r\nAnda menunjukkan sikap bijaksana dan bertanggung jawab dalam menghadapi berita di media sosial, serta berkontribusi dalam menjaga kestabilan dan menghindari kegaduhan yang tidak perlu. Ini mencerminkan pemahaman akan pentingnya sumber informasi yang dapat dipercaya dalam era digital yang penuh dengan arus informasi yang cepat dan terkadang tidak akurat.', NULL, '2024-08-04 01:20:26', '2024-08-04 01:20:26'),
(2350, 'PNSSKD001', 90, 'Pesatnya perkembangan teknologi memungkinkan kita untuk melakukan berbagai hal\r\ndimanapun dan kapanpun. Banyak media sosial yang digunakan oleh individu untuk\r\nmempos hal-hal yang menarik menurut mereka. Salah satu rekan kerja Anda sering mempos\r\nhal-hal yang berkaitan dengan pekerjaan, terutama hal-hal yang membuatnya tidak nyaman\r\ndalam bekerja dan hal tersebut dapat merusak citra perusahaan yang Anda tempati. Padahal\r\ntidak semua yang dipos oleh rekan kerja Anda itu benar. Menanggapi hal ini, sebaiknya\r\nAnda …', NULL, 4, 'Aspek yang dinilai adalah Teknologi Informasi dan Komunikasi :<br>\r\nMenasihatinya untuk lebih berhati-hati dalam menggunakan media sosial agar tidak menggiring opini publik terhadap sesuatu yang buruk padahal semua itu tidaklah benar merupakan jawaban yang aling tepat  karena tidak mendukung perbuatan yang tidak baik dan memilih untuk bijak dalam menggunakan media sosial', NULL, '2024-08-04 02:53:19', '2024-08-04 02:53:19'),
(2351, 'PNSSKD001', 91, 'Anda berada di tim marketing. Jobdesk yang diberikan kepada Anda adalah hal-hal yang\r\nberhubungan dengan perencanaan konsep promosi. Suatu waktu ketua tim Anda memberi\r\nAnda tugas yang mengharuskan Anda untuk mengoperasikan Photoshop dan kemampuan\r\nAnda dalam aplikasi ini tidak begitu mahir. Sebaiknya Anda …', NULL, 3, 'Aspek yang dinilai adalah Teknologi Informasi dan Komunikasi :<br>\r\nMempelajari Photoshop lebih jauh secara mandiri atau dengan bantuan rekan adalah jawaban yang paling tepat arena bertanggung jawab atas tugas yang diberikan dan menunjukkan bahwa Anda berani mencoba hal baru', NULL, '2024-08-04 02:55:50', '2024-08-04 02:55:50'),
(2352, 'PNSSKD001', 92, 'Saya bekerja sebagai teknisi IT di salah satu instansi pemerintah yang bertugas menjaga\r\nagar setiap sistem pelayanan daring berjalan dengan baik. Suatu hari, atasan meminta\r\ntolong kepada Saya untuk melakukan perawatan kepada laptop pribadinya. Setelah Saya\r\nmenyelesaikannya, atasan memberikan sebuah imbalan berupa uang kepada Saya,\r\nmenanggapi ini respons Saya adalah...', NULL, 4, 'Aspek yang dinilai adalah Teknologi Informasi dan Komunikasi :<br>\r\nMengatakan kepada atasan bahwa meski ini laptop pribadinya Saya tidak dapat\r\nmenerima uang tersebut karena apa yang Saya lakukan sudah menjadi tugas merupakan jawaban yang paling tepat karena mengingat kita memberikan bantuan maka lebih jika tidak mengambil\r\nbayaran yang diberikan', NULL, '2024-08-04 03:02:30', '2024-08-04 03:02:30'),
(2353, 'PNSSKD001', 93, 'Ketika atasan memberikan kesempatan kepada semua peserta rapat untuk\r\nmemberikan usulan yang sekiranya bisa memajukan instansi, maka usulan yang akan\r\nAnda berikan ....', NULL, 2, 'Aspek yang dinilai adalah Teknologi Informasi dan Komunikasi :<br>\r\nIde yang segar, inovatif dan memungkinkan untuk terealisasi adalah jawaban yang paling tepat karena Memilih ide yang segar dan dapat direalisasikan menandakan bahwa Anda berfokus pada inovasi yang tidak hanya membawa perubahan positif tetapi juga sejalan dengan kapasitas dan sumber daya yang dimiliki oleh instansi.', NULL, '2024-08-04 03:07:26', '2024-08-04 03:07:26'),
(2354, 'PNSSKD001', 94, 'Akan ada rencana untuk memudahkan masyarakt dalam mengurus surat-surat, atasan\r\nmeminta setiap pegawai memberi usulan sekiranya langkah apa yang bisa ditempuh\r\nuntuk merealisasikan hal tersebut. Maka usulan yang akan Anda sampaikan ....', NULL, 1, 'Aspek yang dinilai adalah Teknologi Informasi dan Komunikasi :<br>Membuat mall pelayanan publik, sehingga dalam satu gedung bisa mengurus segala\r\nhal tanpa masyarakat berpindah-pindah. Inovasi ini bisa mengurangi biaya dan waktu bagi pengguna layanan, dan menonjolkan penggunaan teknologi untuk meningkatkan efisiensi layanan.', NULL, '2024-08-04 03:17:12', '2024-08-04 03:17:12'),
(2355, 'PNSSKD001', 95, 'Anda adalah customer servis di sebuah perusahaan asuransi. Ketika ada klien yang ingin\r\nmengajukan pembatalan polis sebelum 7 tahun, maka sikap Anda ....', NULL, 2, 'Aspek yang dinilai adalah Teknologi Informasi dan Komunikasi :<br>\r\nSikap ini menunjukkan perhatian terhadap kepuasan dan kebutuhan klien, serta memberikan layanan yang lebih holistik dan suportif.', NULL, '2024-08-04 03:20:09', '2024-08-04 03:20:09'),
(2356, 'PNSSKD001', 96, 'Ketika seorang guru yang berstatus PNS memiliki sebuah karya dalam bentuk buku\r\ntentulah ada point tersendiri. Sebagai seorang kepala sekolah yang ingin sekali agar\r\nguru-guru di sekolah Anda tergerak untuk menulis buku, maka upaya yang Anda\r\nlakukan adalah ....', NULL, 3, 'Aspek yang dinilai adalah Teknologi Informasi dan Komunikasi :<br>\r\nUpaya  ini menyediakan dukungan konkret dan praktis yang diperlukan untuk menulis, yang dapat langsung membantu guru-guru dalam proses penulisan. Pelatihan menulis yang dipandu oleh pemateri berpengalaman akan memberikan keterampilan dan kepercayaan diri kepada guru-guru, serta memberikan mereka alat dan teknik yang diperlukan untuk menyelesaikan buku mereka.', NULL, '2024-08-04 03:22:37', '2024-08-04 03:22:37'),
(2357, 'PNSSKD001', 97, 'Menyikapi informasi terkait adanya lonjakan kasus covid-19 pasca diadakan\r\npembelajaran dengan sistem tatap muka, sikap Anda selaku seorang guru ....', NULL, 4, 'Aspek yang dinilai adalah Teknologi Informasi dan Komunikasi :<br>\r\nIni adalah pendekatan yang paling komprehensif. Membaca berita dari sumber terpercaya memberikan informasi yang akurat, dan menjadikannya waspada membantu dalam mengambil tindakan yang tepat dan mencegah kepanikan. Ini menunjukkan kesadaran terhadap informasi dan kesiapan untuk bertindak berdasarkan data yang valid.', NULL, '2024-08-04 03:26:00', '2024-08-04 03:26:00'),
(2358, 'PNSSKD001', 98, 'Anda dan teman-teman pengajian berencana akan umrah bersama. Anda ditunjuk\r\nuntuk mengurus secara kolektif segala keperluan khususnya dokumen-dokumen\r\nkelengkapan sebagai persyaratan umrah. Salah satunya paspor. Ketika hendak\r\nmengurus paspor secara kolektif, maka Anda selaku yang bertanggungjawab akan ....', NULL, 2, 'Aspek yang dinilai adalah Profesionalisme :<br>\r\nMengajak diskusi adalah pendekatan yang inklusif dan kolaboratif. Ini memastikan bahwa semua anggota kelompok memiliki kesempatan untuk memberikan masukan dan memilih jadwal yang sesuai untuk mereka. Ini juga menunjukkan keterampilan dalam mengelola tugas secara kolektif.', NULL, '2024-08-04 03:28:29', '2024-08-04 03:28:29'),
(2359, 'PNSSKD001', 99, 'Ketika muncul suatu masalah dalam pekerjaan yang kebetulan ada kaitannya\r\ndengan hal-hal yang menjadi kewajiban saya, maka saya ....', NULL, 2, 'Aspek yang dinilai adalah Profesionalisme:<br> karena anda harus bertanggung jawab terhadap\r\nperbuatan yang telah anda lakukan.', NULL, '2024-08-04 03:32:58', '2024-08-04 03:32:58'),
(2360, 'PNSSKD001', 100, 'Jika anda menjadi atasan di perusahaan anda, namun anda mendengar aduan dari salah satu\r\nrekan kerja anda bahwa ada salah satu rekan kerja yang lain mengambil uang kantor pada\r\nsaat jam istirahat, mendengar hal tersebut anda masih belum percaya karena belum adanya\r\nbukti sama sekali dari orang yang mengadukan hal tersebut, maka apa yang akan anda\r\nlakukan untuk menyikapi hal seperti ini?', NULL, 4, 'Aspek yang dinilai adalah Profesionalisme:<br>karena dengan cara tersebut maka sudah menunjukkan\r\nsikap yang profesional dan amanah dalam bertindak.', NULL, '2024-08-04 03:35:05', '2024-08-04 03:35:05'),
(2361, 'PNSSKD001', 101, 'Instansi tempat bekerja memberlakukan penyusunan laporan dilakukan melalui web\r\ninstansi. Namun, belum semua pegawai menguasai ini khususnya pegawai yang lebih\r\nsenior. Maka sikap Anda ....', NULL, 4, 'Aspek yang dinilai adalah Profesionalisme:<br>\r\nMengusulkan pelatihan dan sosialisasi adalah solusi yang paling efektif karena memastikan semua pegawai mendapatkan pemahaman yang diperlukan dan dukungan praktis untuk menguasai sistem penyusunan laporan yang baru. Ini juga mendukung adaptasi teknologi secara menyeluruh di seluruh instansi.', NULL, '2024-08-04 03:49:40', '2024-08-04 03:49:40'),
(2362, 'PNSSKD001', 102, 'Ketika ada kewajiban dari kepala sekolah, bahwa semua guru harus bisa membuat\r\nmedia pembelajaran dengan makro media flash. Padahal belum semua guru bisa\r\nmengoperasikan aplikasi tersebut. Jika Anda adalah salah satu guru yang bisa\r\nmenggunakan aplikasi tersebut untuk membuat media, maka sikap Anda ....', NULL, 4, 'Aspek yang dinilai adalah Profesionalisme:<br>\r\nMengusulkan pelatihan dan sosialisasi adalah pendekatan paling menyeluruh untuk memastikan semua guru mendapatkan pelatihan yang memadai dalam menggunakan aplikasi makro media flash. Ini juga mendukung peningkatan kemampuan seluruh tim secara bersamaan dan meminimalkan ketergantungan pada individu.', NULL, '2024-08-04 03:51:49', '2024-08-04 03:51:49'),
(2363, 'PNSSKD001', 103, 'Anda ada jadwal webinar hari ini. Kebetulan Anda adalah pembicara. Sejam sebelum\r\nwebinar, terjadi pemadaman listrik sehingga wifie di rumah mati. Sikap Anda ....', NULL, 2, 'Aspek yang dinilai adalah Profesionalisme:<br>Mencari tempat yang menyediakan fasilitas wifi untuk melakukan webinar seperti restoran, hotel, dan lain-lain meski berbayar', NULL, '2024-08-04 03:58:46', '2024-08-04 03:58:46'),
(2364, 'PNSSKD001', 104, 'Untuk menghindari sikap radikalisme ketika Anda tinggal di asrama dengan keyakinan\r\nyang berbeda-beda maka ....', NULL, 3, 'Aspek yang dinilai adalah Anti-Radikalisme:<br> Pilihan ini secara menyeluruh menangani masalah radikalisme dengan menekankan pencegahan fanatisme dan promosi toleransi serta penghargaan. Ini adalah pendekatan yang paling holistik untuk menciptakan lingkungan yang harmonis di asrama dengan keyakinan yang berbeda-beda.', NULL, '2024-08-04 04:01:27', '2024-08-04 04:12:55'),
(2365, 'PNSSKD001', 105, 'Anda baru saja menyaksikan video pada kanal YouTube Sekretariat Presiden. Di\r\ndalam video ini, Presiden Joko Widodo menyoroti sejumlah ancaman di ruang\r\ndigital, mulai dari penyebaran hoaks hingga radikalisme berbasis digital. Presiden\r\nmeminta publik mengisi ruang digital dengan konten yang positif. Sebagai ASN,\r\ntindakan apa yang akan Anda lakukan?', NULL, 2, 'Aspek yang dinilai adalah Anti-Radikalisme:<br>karena mawas diri adalah hal yang wajib dilakukan\r\ndi era globalisasi dan digitalisasi seperti sekarang ini.', NULL, '2024-08-04 04:05:28', '2024-08-04 04:13:13'),
(2366, 'PNSSKD001', 106, 'Ketika seorang teman di sekolah terlalu fanatic dengan ajaran agamanya sehingga\r\nterkesan merendahkan martabat seorang perempuan yang belum menjalankan ajaran\r\nagama dengan berjilbab maka sikap Anda ....', NULL, 3, 'Aspek yang dinilai adalah Anti-Radikalisme:<br>Pilihan ini memfasilitasi dialog yang memungkinkan pemahaman dan empati, yang merupakan langkah penting dalam mengatasi fanatisme dan menghargai keberagaman keyakinan. Diskusi terbuka bisa membantu teman Anda melihat sudut pandang lain dan memahami pentingnya menghargai keputusan orang lain dalam beragama.', NULL, '2024-08-04 04:09:57', '2024-08-04 04:13:30'),
(2367, 'PNSSKD001', 107, 'Terhadap bibit-bibit radikalisme yang mungkin menyusup ke organisasi keagamaan\r\nmaka selaku bagian dari anggota organisasi tersebut sikap Anda ....', NULL, 2, 'Aspek yang dinilai adalah Anti-Radikalisme:<br>Pilihan ini merupakan pendekatan yang paling efektif untuk menangani bibit-bibit radikalisme dalam organisasi. Dengan saling mengingatkan dan menjaga kesadaran di antara anggota, Anda dapat membantu mencegah paham radikal menyusup ke dalam organisasi dan memastikan integritas organisasi tetap terjaga.', NULL, '2024-08-04 04:12:09', '2024-08-04 04:12:09'),
(2368, 'PNSSKD001', 108, 'Sebagai ASN menyikapi kebijakan pemerintah terkait tes PCR sebagai syarat untuk\r\nbepergian dengan alat transportasi baik darat, laut dan udara namun terkesan\r\nkebijakan tersebut berubah-ubah sehingga membingungkan masyarakat maka sikap\r\nAnda ....', NULL, 5, 'Aspek yang dinilai adalah Anti-Radikalisme:<br>\r\nPilihan ini memungkinkan Anda untuk menyampaikan ketidakpuasan atau saran secara konstruktif dan profesional. Memberikan kritik yang sopan melalui saluran yang tepat membantu memastikan bahwa masalah disampaikan dengan cara yang memungkinkan untuk perbaikan sambil menjaga hubungan baik dengan pihak terkait.', NULL, '2024-08-04 04:16:21', '2024-08-04 04:16:21'),
(2369, 'PNSSKD001', 109, 'Terhadap kebijakan pemerintah yang dirasa memberatkan rakyat kecil dan terkesan\r\ntidak nalar, maka sikap Anda ....', NULL, 1, 'Aspek yang dinilai adalah Anti-Radikalisme:<br> Sikap ini menunjukkan sikap sabar dan penerimaan yang baik, tetapi tetap membuka kemungkinan untuk beradaptasi atau mengatasi situasi jika perlu. Ini adalah sikap yang seimbang, menjaga ketenangan pribadi sambil tetap menghadapi tantangan yang ada.', NULL, '2024-08-04 04:19:16', '2024-08-04 04:19:16'),
(2370, 'PNSSKD001', 110, 'Terhadap aksi terorisme yang terjadi di Indonesia, maka sikap Anda ....', NULL, 5, 'Aspek yang dinilai adalah Anti-Radikalisme:<br>Sikap ini mencerminkan komitmen untuk mencegah dan menanggulangi terorisme secara proaktif. Ini adalah sikap yang menunjukkan kepedulian dan upaya untuk menciptakan lingkungan yang aman dari ancaman terorisme.', NULL, '2024-08-04 04:20:47', '2024-08-04 04:20:47'),
(2372, 'PNSSKD002', 56, NULL, '1722836545.png', 2, 'Gambar bangun yang di dalam menjadi di luar, dan gambar yang di dalam bertambah 1 sisi.', NULL, '2024-08-04 21:42:25', '2024-08-04 21:42:25'),
(2373, 'PNSSKD002', 57, NULL, '1722836776.png', 3, 'Bangun dicerminkan terhadap sumbu-y', NULL, '2024-08-04 21:46:16', '2024-08-04 21:46:16'),
(2375, 'PNSSKD002', 58, NULL, '1722838042.png', 4, 'Sisi bangun sama, hanya beda jenis semula segitiga siku-siku maka menjadi segitiga jenis lain.', NULL, '2024-08-04 22:07:22', '2024-08-04 22:07:22'),
(2376, 'PNSSKD002', 59, NULL, '1722838323.png', 1, 'Diputar 90 derajat ke kanan.', NULL, '2024-08-04 22:12:03', '2024-08-04 22:12:03'),
(2377, 'PNSSKD002', 60, 'Pilihlah satu gambar di antara lima pilihan jawaban yang dalam hal tertentu berbeda dari tiga gambar!', '1722844625.png', 5, 'Perhatikan jumlah objek yang berwarna hitam. Semuanya hanya memiliki satu objek yang berwarna hitam, kecuali pada pilihan jawaban (E) yang memiliki dua objek hitam.', NULL, '2024-08-04 23:57:05', '2024-08-04 23:57:05'),
(2378, 'PNSSKD002', 61, 'Pilihlah satu gambar di antara lima pilihan jawaban yang dalam hal tertentu berbeda dari tiga gambar!', '1722995841.png', 4, 'Pilihan (A), (B), (C), dan (D) merupakan hasil perputaran bangun yang sama dengan bangun yang ada pada sebelah kiri, kecuali gambar (E) yang merupakan hasil pencerminan.', NULL, '2024-08-05 00:02:54', '2024-08-06 17:57:21'),
(2379, 'PNSSKD002', 66, 'Anda seorang penilik sekolah. Ketika Anda melakukan kunjungan ke sebuah sekolah,\r\nkemudian melakukan monitoring terhadap guru mata pelajaran. Ternyata beberap guru\r\nyang Anda monitoring saat kegiatan belajar mengajar banyak yang tidak mengajar\r\nsesuai dengan RPP yang sudah dibuat oleh guru tersebut, sikap Anda ....', NULL, 3, 'Aspek yang dinilai pelayanan publik<br>\r\nDengan melibatkan guru dan kepala sekolah, semua pihak merasa memiliki tanggung jawab terhadap perbaikan dan pengembangan sekolah. pilihan C tidak hanya mendukung perbaikan kualitas pendidikan tetapi juga memperkuat prinsip-prinsip pelayanan publik dalam prosesnya.', NULL, '2024-08-05 00:16:10', '2024-08-05 00:16:10'),
(2380, 'PNSSKD002', 67, 'Anda seorang mahasiswa yang sedang praktik kerja lapangan di salah satu kantor milik pemerintah. Kebetulan Anda ditugasi membantu pegawai di bagian pelayanan\r\nmasyarakat. Namun, kerja Anda dirasa lamban sehingga malah memperlambat pelayanan. Sikap Anda, ketika menerima teguran tersebut ....', NULL, 2, 'Aspek yang dinilai pelayanan publik<br>\r\nMengambil tanggung jawab penuh atas kesalahan dan menunjukkan niat untuk memperbaiki. pilihan B tidak hanya memenuhi standar pelayanan publik tetapi juga mencerminkan sikap profesional yang diharapkan dari seorang pegawai atau mahasiswa yang sedang belajar di lapangan. Ini membantu membangun kepercayaan dan menunjukkan kemampuan untuk beradaptasi dan berkembang dalam lingkungan kerja yang dinamis.', NULL, '2024-08-05 00:19:47', '2024-08-05 00:19:47'),
(2381, 'PNSSKD002', 68, 'Seorang datang ke bank untuk memasukan sejumlah uang. Selaku satpam, Anda mengingatkan jika ingin memasukan uang ke rekening milik sendiri bisa memanfaatkan mesin setor tunai sehingga tidak perlu antre di teller. Nasabah tersebut\r\nrupanya kebingungan dalam mengoperasikan mesin setor tunai, maka sikap Anda\r\nselaku satpam di bank tersebut adalah ....', NULL, 5, 'Aspek yang dinilai pelayanan publik<br>Memberikan nomor antrean serta petunjuk secara bersamaan memastikan nasabah mendapatkan dukungan maksimal. Dengan memberikan bantuan yang komprehensif, nasabah dapat merasa didukung dan dipahami, yang merupakan inti dari pelayanan publik yang baik.', NULL, '2024-08-05 00:23:43', '2024-08-05 00:23:43'),
(2382, 'PNSSKD002', 69, 'Ketika rekan kerja Anda yang bertugas untuk melayani mahasiswa yang akan mendaftar\r\nujian skripsi berhalangan hadir, dan Ada mahasiswa yang kebetulan ingin mengajukan\r\npendaftaran ujian skripsi. Bukanlah tugas Anda melayani pendaftaran skripsi, namun\r\nkarena kebetulan Anda sedang luang sehingga ketika rekan kerja sedang tidak hadir\r\nAnda duduk-duduk di meja kerjanya. Maka sikap Anda ....', NULL, 2, 'Aspek yang dinilai pelayanan publik<br>Dengan meminta izin dari atasan, Anda memastikan bahwa tindakan Anda sesuai dengan kebijakan dan prosedur yang berlaku. Dan dengan memastikan bahwa tindakan Anda sesuai dengan kebijakan dan prosedur yang ada, Anda memberikan pelayanan publik yang berkualitas dan dapat diandalkan, sambil menjaga integritas dan akuntabilitas dalam tugas Anda.', NULL, '2024-08-05 00:29:47', '2024-08-05 00:29:47'),
(2383, 'PNSSKD002', 70, 'Seorang ibu yang sedang mengantre di loket pendaftaran mengomel karena merasa\r\nbahwa rekan Anda yang bertugas di loket terlalu bertele-tele dan tidak jelas dalam\r\nmemberikan informasi terkait persyaratan pendaftaran pasien. Terjadi sedikit perdebatan,\r\nmaka sikap Anda ....', NULL, 2, 'Aspek yang dinilai pelayanan publik<br>Menjadi penengah dan membantu memperjelas komunikasi antara rekan kerja dan ibu dapat mengurangi kebingungan dan frustrasi. Dengan menjadi penengah, Anda tidak hanya membantu menyelesaikan masalah saat ini tetapi juga berkontribusi pada peningkatan kualitas pelayanan secara keseluruhan.', NULL, '2024-08-05 00:34:50', '2024-08-05 00:34:50'),
(2384, 'PNSSKD002', 71, 'Pagi ini seperti biasanya anda selalu sibuk dengan rutinitas pekerjaan sebagai\r\nseorang customer service pada sebuah rumah sakit pemerintah. Ketika anda\r\nsedang asik bekerja datanglah seorang ibu-ibu tua yang ingin menanyakan\r\nprosedur penggunaan BPJS kesehatan untuk proses rawat inap anaknya yang\r\nsedang sakit dan membutuhkan perawatan secepatnya agar sakitnya tidak\r\nbertambah parah, Setelah anda menjelaskan panjang lebar dengan bahasa\r\nyang mudah dimengerti beberapa kali kepada sang ibu namun ternyata ibu\r\ntersebut tampak sangat kebingungan dan mengatakan bahwa dia tidak\r\nmengerti sama sekali dengan prosedur yang anda jelaskan, bagaimana sikap\r\nanda?', NULL, 4, 'Aspek yang dinilai pelayanan publik<br>\r\nkarena memenuhi kebutuhan penerima layanan dan\r\nsegera mungkin, permasalahan pada soal ibu ibu tua yang tidak\r\npaham prosedur penggunaan BPJS untuk rawat inap padahal\r\nsudah anda jelaskan bahkan dengan bahasa yang mudah\r\ndimengerti tapi sang ibu tetap tidak paham, solusinya adalah\r\nmenjelaskan kepada anggota keluarga yang lain.', NULL, '2024-08-05 03:52:25', '2024-08-05 03:52:25'),
(2385, 'PNSSKD002', 72, 'Ketika Anda sedang terburu-buru menuju ruang rapat, karena kebetulan Anda terjebak\r\nkemacetan panjang dan sedikit terlambat sampai di kantor. Seorang memanggil Anda\r\nuntuk bertanya lokasi toilet kantor. Sepertinya dia bukan pegawai di kantor ini, maka\r\nsikap Anda ....', NULL, 3, 'Aspek yang dinilai pelayanan publik<br>berhenti dan memberi penjelasan lokasi toilet dengan jelas merupakan sikap yang paling tepat dari segi pelayanan publik. Meskipun Anda mungkin terlambat, membantu orang dengan cara yang jelas dan efektif adalah bagian dari sikap profesional dan pelayanan yang baik.', NULL, '2024-08-05 03:57:40', '2024-08-05 03:58:37'),
(2386, 'PNSSKD002', 73, 'Ketika orang tua siswa yang sedang mengambil rapor, kurang memahami apa yang Anda\r\nsampaikan, terkait perkembangan belajar siswa di sekolah maka selaku wali kelas sikap\r\nAnda ....', NULL, 2, 'Aspek yang dinilai pelayanan publik<br>Berusaha sabar dan memberi penjelasan dengan bahasa yang lebih sederhana dalah yang paling tepat karena menunjukkan sikap sabar dan empati, serta berusaha untuk menyederhanakan informasi agar lebih mudah dipahami.', NULL, '2024-08-05 04:00:33', '2024-08-05 04:00:33'),
(2388, 'PNSSKD002', 74, 'Rekan saya menggunakan telepon kantor untuk menelepon keluarganya yang ada di\r\nkampung sementara saya tidak tahu apakah ia telah meminta izin atasan atau tidak. Maka,\r\nsaya akan ....', NULL, 3, 'Aspek yang dinilai jejaring kerja<br>menegur dan memberitahunya agar tidak mengulangi hal itu lagi adalah yang paling sesuai dengan prinsip jejaring kerja karena memungkinkan Anda memberikan umpan balik yang konstruktif dan memelihara hubungan kerja dengan rekan Anda, sambil memastikan bahwa aturan diikuti.', NULL, '2024-08-05 04:08:15', '2024-08-05 04:08:15'),
(2389, 'PNSSKD002', 75, 'Terdapat beberapa titik rawan banjir di daerah yang Anda pimpin. Bahkan ada satu desa\r\nyang dalam satu tahun sudah mengalami 20 kali banjir dan belum juga ada solusi.\r\nSebagai kepala daerah, maka sikap Anda ....', NULL, 2, 'Aspek yang dinilai jejaring kerja<br>\r\nOpsi B adalah yang paling sesuai dari aspek jejaring kerja karena menggabungkan berbagai pihak terkait untuk merumuskan dan menerapkan solusi yang efektif, memanfaatkan kolaborasi antar berbagai pemangku kepentingan.', NULL, '2024-08-05 04:11:10', '2024-08-05 04:11:10'),
(2391, 'PNSSKD002', 77, 'Pagi ini anda meminta bawahan anda untuk melakukan tinjauan ke lokasi\r\nproyek yang kebetulan di bawah tanggung jawab anda. Namun lagi-lagi\r\nbawahan anda tersebut mengingkari janjinya untuk melakukan tinjauan ke\r\nlokasi dengan berbagai alasan yang anda rasa kurang masuk akal. Sedangkan\r\nini merupakan pekerjaan yang sangat penting demi menjaga nama baik\r\nperusahaan dan kepercayaan pemakai jasa perusahaan anda sikap anda\r\nadalah…', NULL, 4, 'Opsi D adalah yang paling sesuai karena memungkinkan Anda untuk menangani masalah secara langsung, memberikan umpan balik yang jelas, dan mengarahkan bawahan untuk memperbaiki sikap mereka sambil menjaga profesionalisme dan hubungan kerja yang sehat.', NULL, '2024-08-05 04:24:17', '2024-08-05 04:24:17'),
(2392, 'PNSSKD002', 78, 'Anda merupakan seorang manajer pada sebuah perusahaan. Sudah beberapa\r\nbulan ini ada salah satu karyawan yang tidak dapat bekerja dengan baik,\r\nbahkan cenderung menghambat aktivitas di perusahaan, banyak pekerjaan\r\nyang tertunda karena harus menunggu dia menyelesaikan pekerjaannya,\r\nterkadang setelah ditunggu pun hasilnya sangat buruk, padahal anda sudah\r\nmemastikan bahwa beban kerja karyawan tersebut sudah sesuai dengan\r\nperaturan dan prosedur perusahaan. Perusahaan pun telah memberikan\r\nkesempatan beberapa kali untuk perbaikan dan memberi pelatihan, namun\r\nsetelah diamati tidak ada perubahan sama sekali, yang anda lakukan adalah…', NULL, 4, 'Aspek yang dinilai jejaring kerja<br>Opsi D karena sebagai atasan kita harus mampu\r\nmengkoordinir bawahan, memberikan kesempatan untuk\r\nperbaikan dan pelatihan namun jika tidak ada perubahan maka\r\nseorang atasan harus tegas, karena atasan juga punya tanggung\r\njawab terhadap kemajuan perusahaan yang dikelolanya.', NULL, '2024-08-05 04:27:35', '2024-08-05 04:27:35'),
(2393, 'PNSSKD002', 79, 'Saat sedang mengecek hasil kerja kelompok bersama-sama, teman Anda mendapati satu\r\nbagian yang penuh dengan kesalahan. Setelah Anda lihat ternyata bagian tersebut adalah\r\nbagian yang Anda kerjakan sepenuhnya secara mandiri. Namun, teman-teman satu\r\nkelompok Anda yang lain tidak ada yang tahu siap orang yang mengerjakan bagian tersebut.\r\nHal yang sebaiknya Anda lakukan dalam hal ini adalah ...', NULL, 3, 'Aspek yang dinilai jejaring kerja<br>Opsi C adalah yang paling tepat karena tidak hanya menunjukkan tanggung jawab dan integritas tetapi juga mencakup langkah-langkah konkret untuk memperbaiki masalah dengan melibatkan saran dari tim. Ini memperkuat kerja sama dan meningkatkan kualitas hasil kerja kelompok.', NULL, '2024-08-05 04:30:39', '2024-08-05 04:30:39'),
(2394, 'PNSSKD002', 80, 'Ketika sedang bertugas piket, kebetulan teman Anda tidak bisa piket hingga jam\r\nberakhir karena mendadak sakit, maka sikap Anda ....', NULL, 5, 'Aspek yang dinilai jejaring kerja<br>Opsi E adalah pilihan yang paling sesuai karena menunjukkan tanggung jawab penuh terhadap tugas yang diberikan dan komitmen untuk menjalankannya meskipun ada kesulitan. Ini juga mencerminkan sikap bisa bekerja sama  dalam menyelesaikan tugas yang penting untuk kelancaran operasional.', NULL, '2024-08-05 04:33:43', '2024-08-05 04:33:43'),
(2395, 'PNSSKD002', 81, 'Anda seorang pengusaha jasa pencucian sepatu yang sudah memiliki banyak cabang.\r\nLangkah yang Anda tempuh ketika ada masalah di salah satu atau beberapa cabang\r\nusaha Anda yang harus diambil langkah keputusan segera adalah ....', NULL, 4, 'Aspek yang dinilai jejaring kerja<br>Opsi D adalah pilihan yang paling tepat karena memungkinkan Anda untuk mengambil keputusan yang paling efektif dengan mempertimbangkan semua faktor penting dan risiko yang terkait. Ini juga menunjukkan kemampuan untuk berpikir secara strategis dan memastikan bahwa keputusan yang diambil adalah yang terbaik untuk jangka panjang perusahaan.', NULL, '2024-08-05 04:45:33', '2024-08-05 04:45:33'),
(2396, 'PNSSKD002', 82, 'Ketika bertugas menjadi guru bantu di daerah terpencil, rekan sesame guru mengalami\r\nmusibah kecelakaan sehingga ia tidak bisa melakukan tugas mengajar selama\r\nbeberapa hari, karena harus istirahat. Sikap Anda selaku rekan sesame guru bantu yang\r\nditugaskan di daerah terpencil adalah ....', NULL, 3, 'Aspek yang dinilai jejaring kerja<br>Opsi C adalah yang paling tepat karena menunjukkan dukungan aktif terhadap rekan kerja Anda dan menawarkan fleksibilitas untuk membantu sesuai dengan kebutuhan situasi. Dengan menawarkan bantuan dan kesiapan untuk menggantikan, Anda memungkinkan teman Anda untuk beristirahat dengan tenang sambil memastikan bahwa siswa tetap mendapatkan pendidikan yang mereka butuhkan.', NULL, '2024-08-05 04:48:14', '2024-08-05 04:48:14'),
(2397, 'PNSSKD002', 83, 'Anda warga baru, ketika akan mengadakan acara syukuran empat bulanan usia\r\nkehamilan istri Anda. Anda berniat mengundang tetangga untuk ikut serta doa\r\nbersama di rumah pada hari Jumat. Karena konon, hari Jumat adalah hari yang baik dan\r\nberlimpah berkah. Ketika Anda mengutarakan rencana ini kepada ketua RT setempat,\r\nketua RT mengatakan kebanyakan warga di sini adalah pekerja, sebaiknya acara\r\ndiadakan saat hari libur kerja sehingga banyak yang datang. Menyikapi hal tersebut,\r\nmaka ....', NULL, 5, 'Aspek yang dinilai sosial budaya<br>Opsi E adalah yang paling tepat karena memungkinkan Anda untuk memanfaatkan acara tersebut sebagai kesempatan untuk berinteraksi dan membangun hubungan baik dengan tetangga, yang penting sebagai warga baru. Dengan mengikuti saran ketua RT, Anda menunjukkan rasa hormat dan adaptabilitas terhadap lingkungan baru.', NULL, '2024-08-05 04:52:20', '2024-08-05 04:53:31'),
(2398, 'PNSSKD002', 84, 'Tetangga akan mengadakan acara syukuran di rumahnya. Sehari sebelumnya, ia datang\r\nke rumah Anda meminta agar Anda bisa ikut membantu memasak di rumah tetangga.\r\nSikap Anda ....', NULL, 3, 'Aspek yang dinilai sosial budaya<br>Opsi C adalah yang paling tepat karena mencerminkan sikap positif dan kooperatif yang memperkuat hubungan antar tetangga. Membantu dengan senang hati menunjukkan niat baik dan ketulusan, yang bisa meningkatkan rasa kebersamaan dan membangun reputasi positif di lingkungan tempat Anda tinggal.', NULL, '2024-08-05 04:57:30', '2024-08-05 04:57:30'),
(2399, 'PNSSKD002', 87, 'Kepercayaan di Negara kita sangat beragam, selain itu budaya dan adat istiadat yang\r\nberbeda-beda. Di perusahaan anda sendiri terdiri dari orang-orang yang berbeda latar\r\nbelakang, banyak karyawan muslim yang mengeluhkan sulitnya beribadah karena\r\nketersediaan tempat atau pada jam untuk beribadah mereka harus tetap bekerja, sikap anda', NULL, 2, 'Aspek yang dinilai sosial budaya<br>Memberikan sarana dan prasarana bagi karyawan dan memfasilitasinya termasuk dalam urusan keyakinan kita harus bersikap toleransi dan menghargai hak orang lain keputusan ini tentu harus kita diskusikan dengan perusahaan dan tidak bisa diputuskan sendiri\r\nkarena kita berada dalam sebuah organisasi.', NULL, '2024-08-05 05:00:58', '2024-08-05 05:27:16'),
(2400, 'PNSSKD002', 85, 'Dalam suatu kondisi, saya melihat seorang nenek dari jauh sedang ingin menyebrang\r\njalan pada posisi tengah trotoar jalan raya menuju trotoar pinggiran jalan. Di waktu yang\r\nsama, saya hanya memiliki waktu 10 menit untuk tiba di kantor padahal jarak tempuh\r\nyang harus saya lalui adalah 15 km lagi dimana ketika saya terlambat, gaji yang saya\r\ndapatkan dipotong 0,5%. Hal yang saya lakukan menanggapi hal ini adalah ....', NULL, 4, 'Aspek yang dinilai sosial budaya<br>Opsi D adalah yang paling tepat karena Anda menyadari bahwa tiba tepat waktu di kantor sudah tidak memungkinkan. Dengan menolong nenek tersebut, Anda menunjukkan tanggung jawab sosial dan empati, yang sangat penting dalam aspek sosial budaya. Ini juga membantu Anda merasa lebih baik tentang diri sendiri, mengetahui bahwa Anda telah membuat keputusan yang bermoral.', NULL, '2024-08-05 05:16:12', '2024-08-05 05:16:12'),
(2401, 'PNSSKD002', 86, 'Ketika Anda diingatkan oleh tetangga bahwa tidak boleh menerima tamu\r\nsembarangan apa lagi sampai menginap karena sedang rawan aksi kejahatan terutama\r\nterorisme, sehingga sebisa mungkin tamu yang menginap harap lapor ke ketua RT.\r\nMenyikapi hal tersebut maka ....', NULL, 2, 'Aspek yang dinilai sosial budaya<br>Opsi B adalah yang paling tepat karena ini mencerminkan sikap yang positif dan responsif terhadap masukan dari tetangga. Dengan berterima kasih dan menjadi lebih waspada, Anda menunjukkan bahwa Anda menghargai perhatian komunitas dan bersedia untuk meningkatkan kewaspadaan terhadap keamanan lingkungan. Ini juga membangun hubungan baik dengan tetangga, yang dapat sangat bermanfaat dalam situasi-situasi lain di masa depan. Selain itu, mengambil tindakan tambahan seperti melapor kepada ketua RT saat menerima tamu adalah langkah lanjutan yang bijaksana.', NULL, '2024-08-05 05:24:15', '2024-08-05 05:24:15'),
(2402, 'PNSSKD002', 88, 'Saudara Anda datang meminta bantuan agar Anda menjemput anaknya yang sedang\r\nsekolah di pesantren luar kota, dikarenakan anaknya sakit dan harus dirujuk ke rumah\r\nsakit. Namun, Anda harus bekerja hari itu karena kebetulan Anda bekerja dengan sistem\r\nshift. Sikap Anda ....', NULL, 2, 'Aspek yang dinilai sosial budaya<br>Opsi B adalah pilihan yang paling tepat karena memungkinkan Anda memberikan bantuan langsung dengan cara yang tidak mengganggu tanggung jawab pekerjaan Anda. Dengan meminjamkan mobil, Anda memberikan solusi praktis dan memungkinkan saudara Anda untuk segera menjemput anaknya yang sakit. Ini menunjukkan kepedulian dan dukungan keluarga Anda tanpa mengorbankan pekerjaan Anda.', NULL, '2024-08-05 06:08:34', '2024-08-05 06:08:34'),
(2403, 'PNSSKD002', 89, 'Ada tetangga baru di depan rumah Anda. Ia kurang membaur, namun Anda sering kali\r\nmendengar suara tangisan bayinya. Bahkan hingga tengah malam, sehingga\r\nmenganggu waktu istirahat Anda. Sikap Anda ....', NULL, 2, 'Aspek yang dinilai sosial budaya<br>Opsi B adalah pilihan terbaik karena memungkinkan Anda membangun hubungan positif dengan tetangga baru sambil secara sopan menyampaikan kekhawatiran Anda. Dengan bertamu dan mengakrabkan diri, Anda dapat menciptakan lingkungan yang lebih ramah dan saling pengertian, yang dapat memudahkan komunikasi di masa depan dan meningkatkan kerukunan di lingkungan tempat tinggal Anda. Pendekatan ini juga menunjukkan empati dan membantu menciptakan suasana yang saling mendukung di antara tetangga.', NULL, '2024-08-05 06:11:26', '2024-08-05 06:11:26'),
(2404, 'PNSSKD002', 90, 'Anda mengikuti kegiatan KKN. Kebetulan kelompok KKN Anda tinggal di rumah Pak\r\nDukuh (Kepala Dukuh) selama KKN. Salah satu program individu Anda adalah kegiatan\r\nbimbingan belajar. Sehingga setiap sore, rumah Pak Dukuh ramai dikunjungi anak\r\nsekolah yang akan ikut bimbel. Banyak anak yang terlibat bimbel sering membuat\r\nrumah menjadi ramai. Bu Dukuh, istri dari Pak Dukuh merasa terganggu. Ia\r\nmengutarakan kepada ketua kelompok. Ketua kelompok KKN kemudian menegur\r\nAnda. Sikap Anda ....', NULL, 3, 'Aspek yang dinilai sosial budaya<br>Memperbaiki hubungan dengan tuan rumah dan menunjukkan sikap dewasa dengan meminta maaf serta mencari solusi yang tidak mengganggu kenyamanan orang lain.', NULL, '2024-08-05 06:15:47', '2024-08-05 06:15:47'),
(2405, 'PNSSKD002', 91, 'Perusahaan Anda sedang melakukan penawaran untuk mengerjakan proyek pembuatan rumah mewah \r\nseorang artis. Atasan Anda sangat menginginkan untuk mendapatkan proyek ini karena menurutnya \r\nakan berpengaruh positif pada perusahaan. Atasan Anda menginginkan Anda untuk menyiapkan \r\npresentasi proyek pembuatan rumah mewah artis, padahal Anda masih pegawai yang belum memiliki \r\npengalaman yang banyak. Sikap Anda adalah ...', NULL, 4, 'Aspek yang dinilai Profesionalisme<br> salah satu unsur dalam profesionalisme adalah responsivitas yang mengharuskan \r\nsetiap ASN mampu beradaptasi pada perubahan yang terjadi dalam lingkungan kerja dan kemampuan \r\nuntuk menghadapi setiap tekanan yang ada.', NULL, '2024-08-05 06:19:54', '2024-09-26 01:09:44'),
(2406, 'PNSSKD002', 92, 'Saat hendak mencetak dokumen, Anda melihat rekan kerja Anda, si C dipanggil secara\r\npribadi oleh atasan Anda. Rekan kerja Anda itu merupakan orang yang Anda benci. Setelah\r\nAnda mencari tahu, ternyata rekan kerja Anda itu melakukan kesalahan dan ditegur oleh\r\natasan Anda. Tindakan apa yang sebaiknya Anda lakukan ....', NULL, 5, 'Aspek yang dinilai Profesionalisme<br>Tidak membicarakannya tentang apa yang sebenarnya terjadi  karena menunjukkan sikap profesional dan tidak\r\nmencampuri urusan orang lain lebih jauh', NULL, '2024-08-05 06:22:14', '2024-08-05 06:22:14'),
(2407, 'PNSSKD002', 93, 'Anda bekerja sebagai seorang karyawan di instansi pemerintahan, hari ini\r\nadalah hari terakhir anda bekerja, karena anda sudah mengambil cuti selama\r\nseminggu kedepan untuk menjenguk orang tua suami/istri anda yang lagi\r\ndilanda musibah. Sebelum cuti anda harus menyelesaikan tugas-tugas penting\r\nterlebih dahulu. Namun tiba-tiba anda diajak atasan anda untuk menemaninya\r\nke kantin untuk mengobrol mengenai pekerjaan & makan di waktu jam kerja.\r\nHal apa yang akan anda lakukan ....', NULL, 3, 'Aspek yang dinilai Profesionalisme<br>Menolaknya ke kantin dan mengingatkannya dengan sopan agar\r\nmenjaga profesionalisme kerja karena tanggung jawab dan kesadaran diri akan\r\nperaturan yang ada, anda dihadapkan pada masalah tugas yang\r\nharus selesai sebelum anda cuti lalu atasan anda mengajak ke\r\nkantin untuk membicarakan pekerjaan sekaligus makan,\r\nselesaikan pekerjaan kita.', NULL, '2024-08-05 06:36:56', '2024-08-05 06:36:56'),
(2408, 'PNSSKD002', 94, 'Anda merupakan seorang front office di sebuah perusahaan di instansi\r\npemerintah. Tugas anda adalah melayani setiap tamu yang datang ke instansi\r\npemerintah tempat anda mengabdi. Suatu hari anda kedatangan seorang tamu\r\ndan ingin bertemu dengan pimpinan anda untuk suatu urusan yang harus\r\ndiputuskan pada saat itu juga. Sedangkan pimpinan anda baru saja pagi tadi\r\nharus keluar kota untuk urusan lain yang juga tidak bisa ditinggalkannya. Tamu\r\ntersebut terus mendesak anda untuk mencoba menghubungi atasan anda tapi\r\nsetelah beberapa kali anda coba, nomer atasan anda tetap tidak dapat\r\ndihubungi, kemudian tamu tersebut meminta anda memberikan keputusan\r\nsikap anda adalah…', NULL, 1, 'Aspek yang dinilai Profesionalisme<br>Mengambil keputusan tanpa petunjuk atasan selama tidak bertentangan dengan kebijakan yang ada di perusahaan karena membuat keputusan yang tepat yang dapat diyakini kebenarannya, dengan berpedoman kepada prosedur,\r\naturan (SOP) yang ada selagi tidak menyalahi kebijakan perusahaan.', NULL, '2024-08-05 06:42:10', '2024-08-05 06:42:10'),
(2409, 'PNSSKD002', 95, 'Saat Anda melakukan verifikasi dokumen administrasi pendaftaran CPNS, ada seorang\r\noknum yang mengaku staf panitia seleksi CPNS menawarkan bantuan kepada Anda untuk\r\nlolos ujian seleksi CPNS dengan memberikan sejumlah dana tertentu. Di satu sisi Anda\r\nbelum memiliki pekerjaan tetap namun memiliki tabungan yang cukup untuk imbalan jasa\r\nbagi orang tersebut. Status Anda sudah menikah dan memiliki dua anak sehingga tuntutan\r\nkebutuhan hidup cukup besar. Sikap Anda .....', NULL, 4, 'Aspek yang dinilai Profesionalisme<br>Menolaknya secara tegas dan menyampaikan kepadanya bahwa hal tersebut melanggar\r\nhukum dan ketentuan dalam proses seleksi ASN dan saya ingin menjadi ASN dengan cara\r\nyang bersih karena Penilaian CPNS dari segi moral. Apakah\r\nmemiliki moral, etika, tabiat, dan watak yang layak dan sesuai\r\ndengan figure yang dibutuhkan untuk menjadi CPNS', NULL, '2024-08-05 06:45:56', '2024-08-05 06:45:56'),
(2410, 'PNSSKD002', 96, 'Secara nyata, Anda melihat secara langsung bahwasanya rekan dekat Anda, yang baru\r\nsama-sama mendapatkan jadwal penempatan, melakukan kecurangan dalam hal\r\nabsensinya, maka sikap anda menganggapi hal itu adalah ...', NULL, 5, 'Aspek yang dinilai Profesionalisme<br>Memberi nasihat dan kesempatan untuk memperbaiki diri. karena tidak baik juga untuk sedikit-sedikit lapor ke atasan, kecuali dalam hal keuagan dan hal-hal yang strategis.', NULL, '2024-08-05 06:50:48', '2024-08-05 06:51:15'),
(2411, 'PNSSKD002', 97, 'Anda mendapat penawaran untuk bisa melanjutkan S2 di negara Korea Selatan.\r\nPadahal kondisi ibu Anda sakit-sakitan, kebetulan Anda dan ibu Anda tinggal hanya\r\nberdua di rumah. Maka sikap Anda ....', NULL, 2, 'Aspek yang dinilai Profesionalisme<br> Opsi B Menghargai dan mempertimbangkan kebutuhan ibu Anda sambil tetap membuka kemungkinan untuk melanjutkan pendidikan jika situasi memungkinkan. Ini juga memberikan fleksibilitas untuk mencari solusi yang saling menguntungkan.', NULL, '2024-08-05 06:56:14', '2024-08-05 06:56:14'),
(2412, 'PNSSKD002', 98, 'Beredar kabar di media sosial terkait kasus penyalahgunaan narkoba oleh salah satu\r\nanggota DPR, sikap Anda ketika membaca berita tersebut adalah ....', NULL, 2, 'Aspek yang dinilai teknologi informasi dan komunikasi<br>Opsi B adalah pilihan terbaik karena memastikan bahwa informasi yang Anda baca dan mungkin bagikan adalah benar dan telah diverifikasi, mengurangi risiko penyebaran informasi yang tidak akurat atau menyesatkan.', NULL, '2024-08-05 07:27:22', '2024-08-05 07:27:22'),
(2413, 'PNSSKD002', 99, 'Seorang mengirim pesan kepada Anda bahwa teman kantor dikabarkan ditangkap\r\npolisi karena menjadi otak pelaku kejahatan. Sikap Anda ....', NULL, 2, 'Aspek yang dinilai teknologi informasi dan komunikasi<br>Opsi B adalah pilihan terbaik karena mencari tahu kebenaran berita dari berbagai sumber membantu memastikan bahwa informasi yang Anda terima dan mungkin bagikan adalah akurat, mengurangi risiko menyebarluaskan informasi yang salah atau menyesatkan.', NULL, '2024-08-05 07:29:39', '2024-08-05 07:29:39'),
(2414, 'PNSSKD002', 100, 'Ketika Anda bertugas sebagai customer servise, maka saat ada pelanggan yang\r\nmengadukan masalah terkait produk dari perusahaan Anda dan Anda harus bisa\r\nmemberi solusi segera terkait aduan pelanggan , maka yang harus Anda lakukan adalah', NULL, 1, 'Aspek yang dinilai teknologi informasi dan komunikasi<br>Opsi A adalah pilihan terbaik karena komunikasi yang efektif dan saran yang solutif memastikan bahwa masalah pelanggan ditangani dengan baik dan cepat, serta meningkatkan kepuasan pelanggan.', NULL, '2024-08-05 07:32:04', '2024-08-05 07:32:04'),
(2415, 'PNSSKD002', 101, 'Ketika beredar foto korban kecelakaan yang konon adalah publik figure di grup WA\r\nmaka sikap Anda selaku anggota grup ....', NULL, 3, 'Aspek yang dinilai teknologi informasi dan komunikasi<br>Dengan cara ini, grup dapat menegakkan standar etika yang jelas, melindungi privasi, dan meningkatkan kesadaran akan keamanan informasi. Membuat aturan tertulis juga memberikan kerangka kerja yang dapat dipahami dan diikuti oleh semua anggota, memastikan manajemen komunitas yang lebih efektif dan bertanggung jawab.', NULL, '2024-08-05 17:15:09', '2024-08-05 17:15:09'),
(2416, 'PNSSKD002', 102, 'Di era millenium ini, perubahan yang terjadi di dunia terjadi dengan sangat cepat, terutama\r\nperkembangan teknologi komunikasi. Adanya perrkembangan ini juga menimbulkan\r\nbanyak perubahan yang sangat mempengaruhi kehidupan sehari-hari kita. Sebaiknya saya ....', NULL, 2, 'Aspek yang dinilai teknologi informasi dan komunikasi<br>Berusaha menguasai keterampilan di bidang teknologi informasi terkini karena Anda berusaha untuk menguasai\r\nketerampilan yang dibutuhkan dan menunjukkan kemampuan\r\nuntuk beradaptasi', NULL, '2024-08-05 17:38:11', '2024-09-26 01:48:08');
INSERT INTO `soals` (`id`, `id_paket`, `nomor_soal`, `isi_soal`, `gambar_soal`, `nomor_jawaban`, `isi_solusi`, `gambar_solusi`, `created_at`, `updated_at`) VALUES
(2418, 'PNSSKD002', 103, 'Saat ini dunia sedang ada pada masa Pandemi Covid-19 yang masih terus menyebar dan menimbulkan \r\nbanyak korban jiwa. Suatu hari Anda mendapatkan sebuah berita dari situs berita anonim yang \r\nmenyatakan bahwa varian terbaru dari Covid-19 telah menyebar di Indonesia dan mempunyai efek yang \r\nlebih parah. Alhasil, teman-teman Anda merasa panik dan resah sehingga pekerjaannya terbengkalai. \r\nSikap Anda adalah ...', NULL, 2, 'Aspek yang dinilai Antiradikalisme<br> sebagai ASN Ada harus menyerap informasi secara utuh dan tidak boleh asal. Selain itu \r\nsikap untuk mencari kebenaran informasi harus dimiliki oleh ASN. Karena salah satu cara radikalisme \r\nmasuk ke dalam perilaku sesesorang karena adanya informasi yang disampaikan tidak secara utuh, \r\nnamun terlihat meyakinkan.', NULL, '2024-08-05 17:52:35', '2024-09-26 01:33:27'),
(2419, 'PNSSKD002', 104, 'Anda tidak setuju dengan pemerintahan yang sah, karena kandidat yang Anda jagokan\r\nkalah di pilpres. Menyikapi segala kebijakan pemerintah yang sah maka sikap Anda\r\nseharusnya ....', NULL, 2, 'Aspek yang dinilai anti-radikalisme<br>opsi b adalah pilihan yang paling sesuai. Sikap ini membantu mencegah radikalisasi dengan mempromosikan stabilitas sosial, toleransi, dan kerjasama.', NULL, '2024-08-05 18:05:40', '2024-08-05 18:05:40'),
(2420, 'PNSSKD002', 105, 'Sebagai orang tua tentunya Anda sangat senang jika anak Anda bergaul dengan teman\r\nsebayanya. Namun, pertemanan di zaman ini perlu diawasi lebih ketat agar mereka tidak\r\nsalah pergaulan. Ketika Anda mendapati salah satu teman anak Anda memiliki karakteristik\r\nyang ke arah negatif, apa yang sebaiknya Anda lakukan sebagai orang tua?', NULL, 4, 'Aspek yang dinilai anti-radikalisme<br>Memberitahunya untuk membatasi pergaulan dengan anak tersebut dan memberi alasannya karena hal yang patut Anda lakukan agar anak Anda tidak terpengaruh', NULL, '2024-08-05 18:18:03', '2024-08-05 18:18:03'),
(2421, 'PNSSKD002', 106, 'Terhadapa segala pemberitaan di media sosial yang sifatnya menjelek-jelekan\r\npemerintah, maka sikap Anda selaku orang yang mendukung pemerintahan yang sah\r\nadalah ....', NULL, 3, 'Aspek yang dinilai anti-radikalisme<br>Langkah ini menjaga integritas pribadi Anda, sekaligus mendukung upaya untuk meminimalkan penyebaran konten yang dapat memicu radikalisme. Selain itu, langkah ini membantu Anda tetap fokus pada informasi yang positif dan konstruktif, mendukung pemerintahan yang sah dengan cara yang bijaksana.', NULL, '2024-08-05 18:43:03', '2024-08-05 18:43:03'),
(2423, 'PNSSKD002', 109, 'Jika ada akun yang unggahanya terkait agama namun ternyata mengujar kebencian\r\nterhadap pemerintah, sikap Anda ....', NULL, 3, 'Aspek yang dinilai anti radikalisme<br>Melaporkan akun yang menyebarkan ujaran kebencian kepada platform media sosial tidak hanya melindungi diri Anda sendiri tetapi juga berkontribusi pada upaya kolektif untuk menekan penyebaran konten yang berbahaya.', NULL, '2024-08-05 18:53:06', '2024-08-05 19:00:11'),
(2424, 'PNSSKD002', 108, 'Seorang teman mengajak serta Anda untuk bisa bergabung dalam organisasi terorisme,\r\nmaka sikap Anda ....', NULL, 1, 'Aspek yang dinilai anti-radikalisme<br>Dengan memberikan argumen yang logis dan faktual, Anda berpotensi mengurangi risiko radikalisasi pada teman Anda. Dialog yang bijak dapat membantu teman Anda memahami bahaya dan konsekuensi dari terlibat dalam terorisme.', NULL, '2024-08-05 18:59:54', '2024-08-05 18:59:54'),
(2425, 'PNSSKD002', 110, 'Ketika teman Anda yang biasa mengisi ceramah di masjid dekat rumah, ternyata\r\nmengajak serta untuk melakukan ujaran kebencian terhadap salah satu golongan.\r\nSikap Anda ....', NULL, 2, 'Aspek yang dinilai anti-radikalisme<br>opsi c (mengajak diskusi teman Anda agar ia bisa berpikiran terbuka) adalah pilihan yang paling tepat. Mengambil pendekatan dialog dan diskusi memungkinkan Anda untuk berinteraksi secara konstruktif dengan teman Anda, mempromosikan pemahaman dan toleransi, serta membantu mencegah penyebaran kebencian lebih lanjut.', NULL, '2024-08-05 19:04:07', '2024-08-05 19:04:07'),
(2426, 'PNSSKD002', 62, NULL, '1723001016.png', 4, 'Perhatikan garis yang memotong bangun-bangun tersebut. Garis yang\r\nterdapat pada pilihan jawaban lainnya memotong sebagian bangun, kecuali pada pilihan jawaban (D) yang tidak memotong bangun sama sekali.', NULL, '2024-08-06 19:23:36', '2024-08-06 19:23:36'),
(2427, 'PNSSKD002', 63, NULL, '1723001861.png', 4, 'Perhatikan urutan banyak garis. Ada yang punya satu garis, dua\r\ngaris, dan tiga garis. Selanjutnya tinggal cermati arah rotasi pemberian tanda arah panah.', NULL, '2024-08-06 19:37:41', '2024-08-06 19:37:41'),
(2428, 'PNSSKD002', 64, '.', '1723002266.png', 5, 'Polanya, tiap baris, banyaknya bulatan hitam bertambah satu.', NULL, '2024-08-06 19:44:26', '2024-08-06 19:44:26'),
(2429, 'PNSSKD002', 65, NULL, '1723002537.png', 3, 'Polanya, cukup perhatikan arah perputaran/rotasi bintang. Pertama di putar 180°, lalu diputar searah jarum jam.', NULL, '2024-08-06 19:48:57', '2024-08-06 19:48:57'),
(2440, 'POLTPN001', 38, NULL, '1723040006.png', 5, NULL, NULL, '2024-08-07 06:13:26', '2024-08-07 06:14:33'),
(2441, 'POLTPN001', 39, '0,1125 : 0,45 + 0,2275 : 0,65 = …', NULL, 4, NULL, NULL, '2024-08-07 06:21:48', '2024-08-07 06:21:48'),
(2442, 'POLTPN001', 41, 'Pada suatu survei terhadap sebuah desa ,\r\ndiketahui bahwa jumlah penduduknya\r\nadalah 300 jiwa , dimana 90 % dari\r\nkeseluruhan penduduk tersebut\r\nberpendidikan. Data lainnya menyebutkan\r\n180 orang suka membaca koran A, 175\r\norang suka membaca koran B. Dan 75\r\norang suka membaca koran A dan B.\r\nMaka jumlah penduduk yang tidak\r\nberpendidikan tetapi suka membaca\r\nkorang A atau koran B adalah...', NULL, 4, NULL, NULL, '2024-08-07 06:36:45', '2024-08-07 06:36:45'),
(2443, 'POLTPN001', 42, NULL, '1723041868.png', 5, NULL, NULL, '2024-08-07 06:44:28', '2024-08-07 06:44:28'),
(2444, 'POLTPN001', 43, 'Sebuah kereta berangkat dari stasiun R menuju stasiun S dengan kecepatan 72 km/jam dan kembali dari stasiun S ke stasiun R dengan kecepatan 108 km/jam. Kecepatan rata-rata kereta tersebut adalah ..... km/jam.', NULL, 2, NULL, NULL, '2024-08-07 06:46:02', '2024-08-07 06:46:02'),
(2445, 'POLTPN001', 44, 'Della membeli gaun pesta seharga Rp156.000. Ia mendapat diskon sebesar 5%. Berapa rupiah yang harus dibayar Della?', NULL, 3, NULL, NULL, '2024-08-07 06:47:06', '2024-08-07 06:47:06'),
(2446, 'POLTPN001', 45, '6, 13, 12, 26, 18, 39...........', NULL, 3, NULL, NULL, '2024-08-07 06:49:24', '2024-08-07 06:49:24'),
(2447, 'PNSSKD003', 57, NULL, '1723170227.png', 2, 'Polanya sederhana. Gambar dicerminkan, kemudian gambar dimasukkan\r\nke dalam sebuah lingkaran.', NULL, '2024-08-08 18:23:47', '2024-08-08 18:23:47'),
(2448, 'PNSSKD003', 58, NULL, '1723170608.png', 2, 'Objek bagian atas jumlah sisinya bertambah dua. Objek bagian kanan kehilangan setengah bagiannya. Dan kemudian seluruh gambar dicerminkan secara vertikal.', NULL, '2024-08-08 18:30:08', '2024-08-08 18:30:08'),
(2449, 'PNSSKD003', 59, NULL, '1723170817.png', 1, 'Objek pada sudut kiri gambar diputar 45° berlawanan arah jarum jam. Kemudian objek pada bagian tengah gambar dimasukkan ke dalam sebuah lingkaran hitam.', NULL, '2024-08-08 18:33:37', '2024-08-08 18:33:37'),
(2450, 'PNSSKD003', 60, 'Pilihlah satu gambar di antaral ima pilihan jawaban yang dalam hal tertentu berbeda dari tiga gambar!', '1723171162.png', 1, 'Perhatikan posisi objek bintang yang ada pada gambar. Pada pilihan jawaban lainnya, posisi bintang masih berada pada posisi yang sama seperti pada gambar soal. Walaupun posisi bintang bergeser sedikit antara satu\r\ndengan lainnya, pada dasarnya posisinya masih pada posisi yang sama.\r\nHanya pada pilihan jawaban (A) yang posisinya berbeda.', NULL, '2024-08-08 18:39:22', '2024-08-08 18:39:22'),
(2451, 'PNSSKD003', 61, 'Pilihlah satu gambar di antaral ima pilihan jawaban yang dalam hal tertentu berbeda dari tiga gambar!', '1723171435.png', 3, 'Perhatikan posisi dua bulatan hitam yang terdapat pada bangun. Pilihan\r\n(A), (B), (D), dan (E) merupakan hasil perputaran bangun yang sama dengan bangun yang ada pada sebelah kiri, kecuali gambar (C) yang merupakan hasil pencerminan.', NULL, '2024-08-08 18:43:55', '2024-08-08 18:43:55'),
(2452, 'PNSSKD003', 62, 'Pilihlah satu gambar di antaral ima pilihan jawaban yang dalam hal tertentu berbeda dari tiga gambar!', '1723171691.png', 2, 'Pada pilihan jawaban lainnya, ketiga bangun yang ada tidak saling berpotongan seperti halnya pada gambar soal, kecuali pada pilihan jawaban (B) yang memiliki dua bangun yang saling berpotongan.', NULL, '2024-08-08 18:48:11', '2024-08-08 18:48:11'),
(2453, 'PNSSKD003', 63, NULL, '1723172631.png', 5, 'Masing-masing baris berupa\r\ngambar lingkaran, segilima dan\r\nsegienam. Selanjutnya, perhatikan garis dalam gambar. Jika\r\ngaris dari gambar pertama digabungkan dengan garis gambar\r\nkedua, maka akan diperoleh hasil pada gambar ke tiga. Dan bila\r\ngaris itu sejajar/berimpit maka\r\nakan saling menghilangkan.', NULL, '2024-08-08 19:03:51', '2024-08-08 19:03:51'),
(2454, 'PNSSKD003', 64, NULL, '1723172908.png', 4, 'Bila gambar pertama dan\r\nkedua digabungkan, maka sisi\r\nyang sama-sama punya gambar lingkaran akan hilang, dan\r\nsisi lainnya yang posisi gambar\r\nlingkaran awalnya berada di\r\nluar menjadi ada di dalam, serta\r\nyang awalnya di dalam menjadi\r\ndi luar.', NULL, '2024-08-08 19:08:28', '2024-08-08 19:08:28'),
(2455, 'PNSSKD003', 65, NULL, '1723173083.png', 5, 'Pertama, perhatikan arah rotasi. Gambar dirotasi 90° searah\r\njarum jam, lalu di rotasi kembali\r\n90° searah jarum jam. Lalu perhatikan blok segitiga hitam. Masing-masing gambar hanya ada\r\nsatu blok segitiga hitam.', NULL, '2024-08-08 19:11:23', '2024-08-08 19:11:23'),
(2457, 'PNSSKD004', 60, NULL, '1723185212.png', 2, 'Objek pada sudut kiri gambar diputar 45° berlawanan arah jarum jam. Kemudian objek pada bagian tengah gambar dimasukkan ke dalam sebuah\r\nlingkaran hitam.', NULL, '2024-08-08 22:33:32', '2024-08-08 22:33:32'),
(2458, 'PNSSKD004', 61, NULL, '1723185464.png', 3, 'Objek pada bagian atas berubah warna dari hitam menjadi putih atau sebaliknya. Kemudian pada bagian dalam objek bagian bawah ditambahkan\r\nsebuah objek yang sama.', NULL, '2024-08-08 22:37:44', '2024-08-08 22:37:44'),
(2459, 'PNSSKD004', 62, 'Diantara lima gambar tersebut, terdapat satu gambar yang tidak sama atau tidak\r\nmengikuti pola. Temukanlah gambar tersebut sebagai jawaban!', '1723185834.png', 1, 'Perhatikan posisi gambar yang\r\nbermotif kotak-kotak. Semuanya merupakan hasil perputaran\r\nsuatu bangun, kecuali gambar A\r\nmerupakan hasil pencerminan.', NULL, '2024-08-08 22:43:54', '2024-08-08 22:43:54'),
(2460, 'PNSSKD004', 63, 'Diantara lima gambar tersebut, terdapat satu gambar yang tidak sama atau tidak\r\nmengikuti pola. Temukanlah gambar tersebut sebagai jawaban!', '1723186574.png', 4, 'Pilihan A, B, C dan E sebenarnya\r\nmerupakan bangun yang sama,\r\nnamun diputar ke beberapa\r\narah, sedangkan D tidak.', NULL, '2024-08-08 22:45:42', '2024-08-08 22:56:14'),
(2461, 'PNSSKD004', 64, NULL, '1723186124.png', 5, 'Anak panah yang terdapat pada gambar akan terus diputar sebesar 45° berlawanan arah jarum jam. Sedangkan lingkaran kecil akan terus berpindah ke sudut berikutnya searah jarum jam.', '1723186124.png', '2024-08-08 22:48:44', '2024-08-08 22:48:44'),
(2462, 'PNSSKD004', 65, NULL, '1723186316.png', 3, 'Bulatan hitam akan terus bergerak berlawanan arah jarum jam pada deret\r\nberikutnya. Sedangkan dua garis yang terdapat di dalam kotak akan terus\r\nberpindah sesuai arah jarum jam. Pola perpindahannya sebagai berikut:<br>\r\ntengah bawah - kiri bawah - kiri atas - tengah atas - kanan atas - kanan\r\nbawah. Jadi, pola deret berikutnya adalah simbol dua garis seharusnya\r\nberada pada posisi kanan atas dan lingkaran hitam di dalamnya berada\r\nposisi kanan bawah.', '1723186316.png', '2024-08-08 22:51:56', '2024-08-08 22:51:56'),
(2463, 'PNSSKD005', 56, NULL, '1723186984.png', 3, 'Objek pada sudut kanan bawah berpindah tempat ke dalam lingkaran yang\r\nterdapat pada sudut kiri atas. Sedangkan objek yang semula ada di dalam\r\nlingkaran kini berpindah tempat ke sudut kanan atas, kemudian di dalamnya di tambahkan sebuah lingkaran.', NULL, '2024-08-08 23:03:04', '2024-08-08 23:03:04'),
(2464, 'PNSSKD005', 57, NULL, '1723187132.png', 5, 'Perhatikan dua simbol yang berada di tengah-tengah objek. Simbol yang\r\nberada di bagian paling dalam dicerminkan kemudian diputar 90° searah\r\njarum jam. Sedangkan simbol di bagian terluar terbelah menjadi dua bagian yang sama besar.', NULL, '2024-08-08 23:05:32', '2024-08-08 23:05:32'),
(2465, 'PNSSKD005', 58, NULL, '1723187296.png', 4, 'Simbol di sisi kiri atas turun ke sisi kiri bawah dan berubah bentuknya. Sedangkan simbol di sisi kanan atas tetap pada posisinya namun berubah bentuknya. Jumlah sisi tiap simbol bertambah 2 tiap perubahannya.', NULL, '2024-08-08 23:08:16', '2024-08-08 23:08:16'),
(2466, 'PNSSKD005', 59, 'Diantara lima gambar tersebut, terdapat satu gambar yang tidak sama atau tidak\r\nmengikuti pola. Temukanlah gambar tersebut sebagai jawaban!', '1723187488.png', 1, 'Perhatikan posisi lingkaran hitam dan posisi kotak. Semuanya\r\nmerupakan hasil perputaran suatu bangun, kecuali gambar A\r\nmerupakan hasil pencerminan.', NULL, '2024-08-08 23:11:28', '2024-08-08 23:11:28'),
(2467, 'PNSSKD005', 60, 'Diantara lima gambar tersebut, terdapat satu gambar yang tidak sama atau tidak mengikuti pola. Temukanlah gambar tersebut sebagai jawaban!', '1723188457.png', 3, 'Pilihan A, B, D, dan E merupakan\r\nhasil perputaran suatu bangun,\r\nkecuali gambar C merupakan\r\nhasil pencerminan.', NULL, '2024-08-08 23:12:34', '2024-08-08 23:27:37'),
(2468, 'PNSSKD005', 61, 'Diantara lima gambar tersebut, terdapat satu gambar yang tidak sama atau tidak mengikuti pola. Temukanlah gambar tersebut sebagai jawaban!', '1723187655.png', 5, 'Perhatikan posisi kotak hitam dengan kotak yang ada tanda panahnya. Semuanya merupakan hasil perputaran suatu bangun, kecuali gambar E merupakan hasil pencerminan.', NULL, '2024-08-08 23:14:15', '2024-08-08 23:14:15'),
(2469, 'PNSSKD005', 62, NULL, '1723187840.png', 1, 'Jika dilihat dari kiri ke kanan atau dari atas ke bawah, hanya\r\ngaris yang muncul dalam posisi yang sama dua kali dalam segilima pertama dan kedua yang tidak diteruskan ke segilima yang ketiga.', NULL, '2024-08-08 23:17:20', '2024-08-08 23:17:20'),
(2470, 'PNSSKD005', 63, NULL, '1723188017.png', 3, 'Setiap baris dari atas ke bawah ataupun dari kiri ke kanan, berisi\r\nsatu segitiga terbalik, satu segitiga berisi lingkaran dan satu segitiga dengan garis vertikal.\r\nTiap baris dan kolom, berisi kombinasi tersebut dengan urutan yang berbeda-beda.', NULL, '2024-08-08 23:20:17', '2024-08-08 23:20:17'),
(2471, 'PNSSKD005', 64, NULL, '1723188200.png', 2, 'Jika dilihat dari kiri ke kanan\r\natau dari atas ke bawah, hanya\r\nlingkaran yang muncul dalam\r\nposisi yang sama dua kali dalam\r\ndua kotak pertama yang diteruskan ke kotak akhir. Namun,\r\nmereka kemudian berubah dari hitam menjadi putih atau sebaliknya.', NULL, '2024-08-08 23:23:20', '2024-08-08 23:23:20'),
(2472, 'PNSSKD005', 65, NULL, '1723188352.png', 3, 'Hanya lingkaran yang muncul\r\ndi posisi yang sama dua kali\r\ndalam dua kotak pertama pada\r\ntiap baris, baik jika dilihat dari\r\nkiri ke kanan ataupun dari atas\r\nke bawah, yang diteruskan ke\r\nkotak akhir. Namun, mereka\r\nkemudian berubah dari hitam\r\nmenjadi putih atau sebaliknya.', NULL, '2024-08-08 23:25:52', '2024-08-08 23:25:52'),
(2473, 'PNSSKD003', 66, 'Anda pemilik sebuah restauran, ketika Anda mengecek kondisi restauran Anda di salah satu\r\ncabang. Anda melihat kondisi toilet yang kurang terawat. Bahkan terciumbau yang kurang\r\nsedap di salah satu toilet. Sikap Anda ....', NULL, 3, 'Aspek yang dinilai pelayanan publik<br>\r\nMengomunikasikan secara langsung hasil pantauan dan memberikan arahan membantu memastikan standar kebersihan terpenuhi. Pendekatan ini bersifat solutif dan edukatif, menciptakan kesempatan untuk perbaikan dan pembelajaran.', NULL, '2024-08-10 07:37:56', '2024-08-10 07:37:56'),
(2474, 'PNSSKD003', 67, 'Anda petugas admin pajak di media social. Seroang wajib pajak menanyakan bahwa ia kebingungan mendapat surat dari kantor pajak agar segera konfirmasi terkait hasil putusan lebih bayar pada SPT, namun surat tersebut tidak mencantumkan kepada siapa ia harus konfirmasi. Anda selaku admin pajak di media social akan melakukan ....', NULL, 3, 'Aspek yang dinilai pelayanan publik<br>Tindakan ini adalah solusi paling lengkap dan langsung. Anda berusaha menjembatani komunikasi antara wajib pajak dan pihak yang bertanggung jawab, yang dapat membantu menyelesaikan masalah dengan cepat dan efisien.', NULL, '2024-08-10 08:04:40', '2024-08-10 08:04:40'),
(2475, 'PNSSKD003', 68, 'Anda beserta 3 rekan lain adalah pegawai baru di sebuah kantor pelayanan. Di\r\nkantor Anda, terdapat loket pelayanan sebanyak 3 loket. Anda sebagai pegawai\r\nbaru ditugaskan pada loket 1 urusan administrasi surat menyurat, sedangkan\r\nrekan kerja baru Anda ditugaskan pada loket 2 urusan pembayaran. Pada suatu\r\nslang, ada seseorang meminta pelayanan pada loket 2 yang dijaga rekan Anda.\r\nAnda mendapati pelayanan rekan Anda terhadap orang tersebut secara tidak\r\nramah dan cenderung malas-malasan. Padahal, pelayanan rekan Anda sebelum\r\nseseorang tersebut datang tampak ramah dan melayani. Anda segera\r\nmenanyakan kepada rekan Anda mengapa pelayanannya berubah hanya pada\r\nseseorang tersebut. Rekan Anda menjawab bahwa seseorang tersebut tidak\r\nsealiran dengan dia. Sikap Anda melihat peristiwa tersebut adalah ....', NULL, 2, 'Aspek yang dinilai pelayanan publik<br> karena anda berusaha memeberikan penjelasan dan pemahaman kepada rekan kerja anda terkait dengan profesionalitas dalam menjalankan pekerjaan', NULL, '2024-08-10 08:08:03', '2024-08-10 08:08:03'),
(2476, 'PNSSKD003', 69, 'Saat mendata calon penerima bantuan sosial, seorang ibu kurang mengerti pertanyaan\r\nyang Anda lontarkan sehingga jawabnnya tidak mewakili hal yang ditanyakan. Sikap Anda\r\nselaku petugas pendataan bantuan sosial adalah ....', NULL, 2, 'Aspek yang dinilai pelayanan publik<br>Tindakan ini Menunjukkan kesetaraan akses dalam pelayanan, memastikan bahwa semua warga, terlepas dari latar belakang atau kemampuan pemahaman mereka, dapat berpartisipasi penuh dalam proses pendataan.', NULL, '2024-08-10 08:13:32', '2024-08-10 08:13:32'),
(2477, 'PNSSKD003', 70, 'Ketika harus menyelesaikan tugas mendadak dari atasan yang tenggat waktunya sangat\r\nsingkat, padahal Anda juga sedang ada kerjaan lain yang belumselesai. Maka sikap Anda\r\ndalammenyelesaikan tugas mendadak tersebut ....', NULL, 3, 'Aspek yang dinilai pelayanan publik<br> Menunjukkan kemampuan Anda untuk bekerja di bawah tekanan dengan tetap mempertahankan kualitas hasil kerja. Ini adalah pendekatan yang paling profesional dan diharapkan oleh atasan.', NULL, '2024-08-10 08:16:48', '2024-08-10 08:16:48'),
(2478, 'PNSSKD003', 71, 'Ketika Anda sedang terburu-buru datang ke kantor, karena terjebak kemacetan cukup\r\npanjang akibat adanya demo buruh. Seorang di parkiran bertanya prosedur untuk\r\nmembuat KTP di kantor dukcapil tempat Anda bekerja. Anda harus buru-buru masuk\r\nruangan karena akan ada rapat. Menyikapi hal tersebut ....', NULL, 2, 'Aspek yang dinilai pelayanan publik<br>karena memberikan solusi cepat dan efektif, memungkinkan orang tersebut mendapatkan informasi yang dibutuhkan tanpa mengorbankan waktu Anda.', NULL, '2024-08-10 18:39:04', '2024-08-10 18:39:04'),
(2479, 'PNSSKD003', 72, 'Jika atasan memberikan tugas yang seharusnya dikerjakan teman Anda. Namun, karena\r\nteman sedang cuti dan Anda diharuskan menyelesaikannya. Sikap Anda dalam\r\nmenghadapi tugas tersebut ....', NULL, 3, 'Aspek yang dinilai pelayanan publik<br>karena menunjukkan dedikasi dan komitmen untuk memberikan hasil terbaik.', NULL, '2024-08-10 18:42:13', '2024-08-10 18:42:13'),
(2486, 'PNSSKD0003', 1, '\"Dia sedang membaca buku di perpustakaan.\"', NULL, 4, 'Kalimat Asli: \"Dia sedang membaca buku di perpustakaan.\"<br>\r\nKalimat ini memiliki struktur sebagai berikut:<br>\r\nSubjek: \"Dia\"<br>\r\nPredikat: \"sedang membaca\"<br>\r\nObjek: \"buku\"<br>\r\nKeterangan tempat: \"di perpustakaan\"<br><br>\r\nOpsi D \"Ibu sedang memasak di dapur.\"<br>\r\n\r\nStruktur: Subjek (Ibu) + Predikat (sedang memasak) + Keterangan tempat (di dapur)<br>\r\nSama dengan kalimat asli dalam hal struktur, yaitu subjek + predikat + keterangan tempat.', NULL, '2024-08-11 17:33:11', '2024-08-11 17:33:11'),
(2487, 'PNSSKD0003', 2, '\"Saya menulis surat di meja kerja.\"', NULL, 5, 'Kalimat asli: \"Saya menulis surat di meja kerja.\"<br>\r\n\r\nStruktur: Subjek (Saya) + Predikat (menulis) + Objek (surat) + Keterangan tempat (di meja kerja)Opsi e. \"Anak-anak membaca buku di ruang tamu.\"<br>\r\n\r\nStruktur: Subjek (Anak-anak) + Predikat (membaca) + Objek (buku) + Keterangan tempat (di ruang tamu)<br>\r\nSama dengan kalimat asli dalam hal struktur: subjek + predikat + objek + keterangan tempat.', NULL, '2024-08-11 17:35:46', '2024-08-11 17:35:46'),
(2488, 'PNSSKD0003', 3, 'Payung : hujan = .....', NULL, 3, 'Payung digunakan sebagai solusi saat hujan, sedangkan lampu digunakan sebagai solusi\r\nsaat gelap.', NULL, '2024-08-11 17:38:20', '2024-08-11 17:38:20'),
(2489, 'PNSSKD0003', 4, 'Sakit : dokter = ....', NULL, 3, 'Sakit dapat diatasi/diselesaikan oleh dokter, sedangkan rusak dapat diatasi/diselesaikan\r\noleh montir.', NULL, '2024-08-11 17:39:22', '2024-08-11 17:39:22'),
(2490, 'PNSSKD0003', 5, 'Semua kertas origami sangat berguna. Sebagian kertas origami yang sangat berguna\r\nharganya murah.', NULL, 3, NULL, '1723427569.png', '2024-08-11 17:52:49', '2024-08-11 17:52:49'),
(2491, 'PNSSKD0003', 6, 'Penyelam adalah perenang. Sementara penyelam adalah pelaut.', NULL, 1, NULL, '1723427839.png', '2024-08-11 17:57:19', '2024-08-11 17:57:19'),
(2492, 'PNSSKD0003', 7, 'Teman yang baik adalah yang dapat menerima keadaan kita. Sebagian teman dari Kota\r\nCampbell tidak dapat menerima keadaan kita.', NULL, 3, NULL, '1723427955.png', '2024-08-11 17:59:15', '2024-08-11 17:59:15'),
(2493, 'PNSSKD0003', 8, 'Ivan Menawan lebih tinggi daripada Adipati Dokar. Adipati Dokar lebih tinggi daripada\r\nYura Yulita dan Brisia Rodi. Joshua Suheran lebih tinggi dari pada Adipati Dokar dan Ria\r\nReceh. Tidak ada yang tingginya sama. Jika Ivan Menawan tidak lebih tinggi daripada\r\nJoshua Suheran, maka yang tertinggi adalah…', NULL, 4, NULL, '1723428090.png', '2024-08-11 18:01:30', '2024-08-11 18:01:30'),
(2494, 'PNSSKD0003', 9, 'Tabungan Zuzu lebih banyak daripada tabungan Zara dan Rhoma Siraman. Tabungan\r\nRhoma Siraman lebih sedikit daripada tabungan Zara. Tabungan Bella Sepira lebih banyak\r\ndaripada jumlah tabungan Zuzu, Zara, dan Rhoma Siraman. Pernyataan yang benar\r\nadalah...', NULL, 5, NULL, '1723428253.png', '2024-08-11 18:04:13', '2024-08-11 18:04:13'),
(2495, 'PNSSKD0003', 10, 'Luas kebun Pak Sopan Sepian sama dengan luas kebun Pak Anang Heransyah. Luas kebun\r\nPak Sopan Sepian lebih sempit daripada luas kebun Pak Kiano Lion. Pak Ahmad Altar\r\nadalah saudara sepupu Pak Kiano Lion. Urutan dari yang paling luas adalah...', NULL, 4, NULL, '1723428368.png', '2024-08-11 18:06:08', '2024-08-11 18:06:08'),
(2498, 'PNSCAC001', 7, 'Siapa tokoh utama dalam teori hukum alam yang menekankan adanya hukum yang bersifat universal dan abadi?', NULL, 4, 'Thomas Aquinas adalah salah satu tokoh utama dalam teori hukum alam. Ia berpendapat bahwa hukum alam adalah hukum yang bersifat universal dan abadi, dan merupakan refleksi dari hukum Tuhan yang tertanam dalam diri manusia.', NULL, '2024-08-11 18:55:28', '2024-08-11 18:55:28'),
(2499, 'PNSCAC001', 8, 'Teori hukum mana yang berpendapat bahwa hukum adalah alat untuk mencapai keadilan sosial?', NULL, 3, 'Teori hukum kritis berpendapat bahwa hukum sering kali digunakan sebagai alat untuk mempertahankan kepentingan kelompok dominan dan mengeksploitasi kelompok yang kurang beruntung. Teori ini mendorong perubahan hukum untuk mencapai keadilan sosial.', NULL, '2024-08-11 18:56:48', '2024-08-11 18:56:48'),
(2500, 'PNSCAC001', 9, 'Dalam teori hukum, apa yang dimaksud dengan \"rule of law\"?', NULL, 2, 'Rule of law adalah prinsip yang menyatakan bahwa hukum harus berlaku bagi semua orang tanpa kecuali, termasuk pemerintah. Ini berarti bahwa tidak ada yang berada di atas hukum dan hukum harus diterapkan secara adil dan konsisten.', NULL, '2024-08-11 18:58:35', '2024-08-11 18:58:35'),
(2501, 'PNSCAC001', 10, 'Bagaimana penggunaan teknologi, seperti analisis data hukum dan kecerdasan buatan, dapat mempengaruhi argumentasi hukum dan keputusan pengadilan di masa depan?', NULL, 3, 'Penggunaan teknologi seperti analisis data hukum dan kecerdasan buatan dapat memberikan wawasan baru yang lebih mendalam dan objektif dalam argumentasi hukum. Teknologi ini memungkinkan pengolahan informasi dalam jumlah besar dengan cepat dan akurat, yang dapat membantu jaksa dalam menyusun argumen yang lebih kuat dan berdasar. Namun, penting untuk tetap mempertimbangkan aspek manusiawi dan etika dalam proses pengambilan keputusan.', NULL, '2024-08-11 19:05:39', '2024-08-11 19:05:39'),
(2502, 'PNSCAC001', 11, 'Salah satu tujuan dari argumentasi hukum adalah untuk...', NULL, 4, 'Salah satu tujuan utama dari argumentasi hukum adalah untuk menjamin keadilan dalam putusan hukum. Argumentasi hukum yang baik dan kuat memastikan bahwa semua fakta dan bukti yang relevan dipertimbangkan dengan cermat, dan bahwa prinsip-prinsip hukum diterapkan dengan cara yang adil dan konsisten. Dengan demikian, argumentasi hukum berperan penting dalam mencapai putusan yang tidak hanya legal tetapi juga adil bagi semua pihak yang terlibat.', NULL, '2024-08-11 19:09:18', '2024-08-11 19:09:18'),
(2503, 'PNSCAC001', 12, 'Apa tujuan utama dari argumentasi hukum dalam suatu perkara?', NULL, 3, 'Tujuan utama dari argumentasi hukum dalam suatu perkara adalah untuk mempengaruhi hakim agar mengambil keputusan yang adil. Argumentasi hukum bertujuan untuk menyajikan bukti dan interpretasi hukum dengan cara yang meyakinkan sehingga hakim dapat memahami dan mempertimbangkan semua aspek dari kasus tersebut untuk mencapai putusan yang adil. Meskipun menemukan kebenaran material (B) dan menganalisis bukti fisik (E) juga merupakan bagian penting dari proses hukum, tujuan utama dari argumentasi hukum itu sendiri adalah untuk meyakinkan hakim mengenai keadilan dari posisi yang diambil oleh pihak yang berargumen.', NULL, '2024-08-11 19:20:26', '2024-08-11 19:20:26'),
(2504, 'PNSSKD003', 73, 'Anda adalah ketua panitia lomba cerita pendek dalam rangka bulan bahasa di salah satu\r\nsekolah. Sehari sebelum pengumuman pemenang, Anda mengecek naskah cerpen yang\r\nmasuk. Ternyata banyak naskah yang belum diriview oleh panitia, namun Anda sudah\r\nmenerima hasil keputusan pemenang. Tentu saja ini tidak adil. Sikap Anda ....', NULL, 2, 'Aspek yang dinilai pelayanan publik<br>Opsi b menunjukkan bahwa Anda sebagai ketua panitia berusaha memahami dan mengevaluasi situasi dengan bijaksana. Ini menunjukkan komitmen terhadap transparansi dan akuntabilitas, yang penting dalam penilaian publik.', NULL, '2024-08-12 03:38:50', '2024-08-12 03:38:50'),
(2505, 'PNSSKD003', 74, 'Anda seorang guru mata pelajaran. Saat masuk ke ruang kelas, ternyata susunan tempat\r\nduduk tampak tidak rapi bahkan sampah berceceran di lantai. Maka sikap Anda ....', NULL, 3, 'Aspek yang dinilai pelayanan publik<br>Dengan memilih opsi ini, Anda menunjukkan bahwa Anda menghargai kebersihan dan kedisiplinan tanpa harus langsung menyalahkan siswa. Mengajak siswa untuk bersama-sama menjaga kebersihan juga membangun rasa tanggung jawab bersama dalam menciptakan lingkungan belajar yang nyaman. Hal ini juga memberikan siswa pemahaman bahwa menjaga kebersihan adalah bagian penting dari budaya sekolah, yang harus mereka jalani setiap hari.', NULL, '2024-08-12 04:02:13', '2024-08-12 04:02:13'),
(2506, 'PNSSKD003', 75, 'Ketika ada masalah terkait mampetnya saluran air di desa tempat tinggal Anda yang\r\nbelumteratasi. Sikap Anda selaku ketua RT adalah ....', NULL, 3, 'Aspek yang dinilai jejaring kerja<br>Dengan memilih opsi C, Anda menunjukkan kepemimpinan yang partisipatif dengan melibatkan warga dalam mencari solusi bersama. Diskusi ini memungkinkan warga untuk memberikan ide dan masukan, sehingga solusi yang diambil adalah hasil kesepakatan bersama. Hal ini juga dapat meningkatkan kesadaran dan komitmen warga untuk menjaga kebersihan saluran air secara berkelanjutan, sehingga masalah mampetnya saluran air dapat dihindari di masa depan.', NULL, '2024-08-12 04:08:20', '2024-08-12 04:08:20'),
(2507, 'PNSSKD003', 76, 'Terdapat laporan bahwa bantuan sosial dari pemerintah daerah yang dikordinir melalui RT\r\nsetempat tidak tepat sasaran. Maka selaku bagian yang bertanggungjawab terkait data\r\ncalon penerima bansos, sikap Anda ....', NULL, 2, 'Aspek yang dinilai jejaring kerja<br>Dengan memilih opsi B, Anda menunjukkan tanggung jawab dan keterbukaan untuk memperbaiki kesalahan yang terjadi. Melibatkan anggota untuk memberikan masukan juga mencerminkan sikap partisipatif dan kolaboratif, sehingga solusi yang diambil lebih akurat dan dapat diterima oleh semua pihak. Langkah ini juga penting untuk memastikan bantuan sosial yang diberikan benar-benar tepat sasaran di masa mendatang, sehingga mereka yang benar-benar membutuhkan dapat menerima bantuan tersebut.', NULL, '2024-08-12 04:16:15', '2024-08-12 04:16:15'),
(2508, 'PNSSKD003', 77, 'Uang saku saya menipis. Kemudian seorang teman dekat mengeluh kehabisan\r\nuang. Saya akan...', NULL, 2, 'Aspek yang dinilai adalah jejaring kerja<br>karena sikap tersebut sudah sangat menunjukan\r\nsikap cara untuk menemukan solusi bersama.', NULL, '2024-08-12 04:25:02', '2024-08-12 04:25:02'),
(2509, 'PNSSKD003', 78, 'Pada penyelenggaraan suatu acara dibentuklah kepanitiaan yang mana saya\r\nditugasi sebagai salah satu panitia, saat itu sedang membicarakan berbagai\r\ntopik kegiatan yang akan mengisi acara. Sebagai salah satu anggota panitia\r\nsaya', NULL, 5, 'Aspek yang dinilai jejaring kerja<br>karena sikap tersebut sudah sangat menunjukan\r\nsikap dalam bersosialisasi.', NULL, '2024-08-12 04:28:50', '2024-08-12 04:28:50'),
(2510, 'PNSSKD003', 79, 'Pada saat gagasan dan ide-ide saya kurang mendapat dukungan bahkan tidak\r\nada dukungan sama sekali dari pihak lain, saya berusaha...', NULL, 3, 'Aspek yang dinilai jejaring kerja<br>karena sikap tersebut sudah sangat menunjukan\r\nsikap saling menghargai.', NULL, '2024-08-12 04:31:03', '2024-08-12 04:31:03'),
(2511, 'PNSSKD003', 80, 'Saat Anda berjalan-jalan ke pusat kota dan sebuah stasiun televisi melakukan\r\nwawancara acak dengan orang-orang tentang topik tertentu, apakah Anda...', NULL, 5, 'Aspek yang dinilai jejaring kerja<br> karena sikap tersebut sudah sangat menunjukan\r\nsikap integritas diri.', NULL, '2024-08-12 04:34:54', '2024-08-12 04:34:54'),
(2512, 'PNSSKD003', 81, 'Anda diminta menggantikan tugas atasan dalammendampingi tamu dari provinsi. Saat\r\nitu, diperlukan keputusan segera. Padahal posisi atasan tidak sedang di kantor. Maka\r\nselaku orang yang bertanggungjawab dalammendampingi tamu, sikap Anda ....', NULL, 2, 'Aspek yang dinilai jejaring kerja<br>Dengan memilih opsi B , Anda menunjukkan inisiatif, tanggung jawab, dan kemampuan untuk mengambil keputusan yang cepat dan tepat dalam situasi yang mendesak. Sikap ini juga menunjukkan bahwa Anda memahami dan mematuhi arahan yang telah diberikan sebelumnya, serta memastikan bahwa keputusan yang diambil sesuai dengan aturan yang ada. Tindakan ini juga dapat menjaga profesionalisme dan kepuasan tamu yang sedang Anda dampingi.', NULL, '2024-08-12 04:39:07', '2024-08-12 04:46:09'),
(2513, 'PNSSKD003', 82, 'Atasan memberikan tugas kepada Anda dan teman Anda untuk membuat laporan akhir\r\ntahun. Namun saat pengerjaan, teman Anda kesulitan sehingga ia tidak bisa menyelesaikan\r\ntugasnya dengan baik. Sikap Anda ....', NULL, 1, 'Aspek yang dinilai jejaring kerja<br>Dengan memilih opsi A, Anda menunjukkan sikap kolaboratif dan tanggung jawab terhadap tugas yang telah diberikan. Menawarkan bantuan kepada rekan yang kesulitan tidak hanya membantu memastikan bahwa laporan akhir tahun selesai dengan baik dan tepat waktu, tetapi juga memperkuat kerjasama tim dan mendukung rekan Anda yang sedang menghadapi kesulitan. Sikap ini mencerminkan komitmen terhadap tugas serta empati terhadap teman kerja.', NULL, '2024-08-12 04:45:42', '2024-08-12 04:45:42'),
(2514, 'PNSSKD003', 83, 'Anda menang dalamperolehan suara pemilihan ketua RW di daerah tempat Anda tinggal.\r\nKebetulan ada beberapa programkerja dari ketua RW lama yang memang sudah\r\nmembudaya, seperti kegiatan pertandingan sepak bola antar kampung dalamrangka\r\nmemeriahkan peringatan kemerdekaan RI, tujuanya sebenarnya untuk mengakrabkan diri\r\nantar warg maka selaku ketua RW baru sikap Anda ....', NULL, 1, 'Aspek yang dinilai sosial budaya<br>Dengan memilih opsi A, Anda menunjukkan sikap menghargai tradisi dan budaya yang sudah ada serta mengakui bahwa program yang sudah berjalan memiliki nilai positif dalam mengakrabkan warga. Melanjutkan program yang sudah menjadi bagian dari budaya komunitas', NULL, '2024-08-12 05:41:30', '2024-08-12 05:41:30'),
(2515, 'PNSSKD003', 84, 'Anda kebetulan sedang mudik di rumah nenek Anda di salah satu daerah di Padang\r\nPanjang yang masih sangat kental dengan tradisi dan budayanya. Menyikapi hal tersebut,\r\nmaka ....', NULL, 3, 'Aspek yang dinilai sosial budaya<br>Dengan memilih opsi C, Anda menunjukkan sikap menghormati dan menghargai budaya lokal, sekaligus terbuka untuk beradaptasi dengan tradisi yang ada. Ini mencerminkan penghargaan terhadap keragaman budaya dan kesediaan untuk belajar serta menyesuaikan diri, yang penting untuk menjaga hubungan baik dengan masyarakat setempat.', NULL, '2024-08-12 05:51:31', '2024-08-12 05:51:31'),
(2516, 'PNSSKD003', 85, 'Ada peraturan baru di kantor, bahwa setiap hari Rabu pegawai diwajibkan mengenakan\r\npakaian adat. Aturan dibuat sebagai upaya melestarikan budaya daerah. Menyikapi aturan\r\ntersebut maka selaku pegawai ....', NULL, 4, 'Aspek yang dinilai sosial budaya<br>Dengan mendukung dan mengikuti aturan memakai pakaian adat, pegawai berperan aktif dalam melestarikan budaya lokal, yang merupakan bagian penting dari identitas suatu daerah.', NULL, '2024-08-12 06:08:00', '2024-08-12 06:08:00'),
(2517, 'PNSSKD003', 86, 'Anda memiliki rekan kerja yang sangat baik pada Anda. Suatu ketika, istri rekan Anda jatuh sakit, \r\nkarena tidak memiliki cukup biaya untuk membayar Rumah Sakit, maka rekan Anda meminjam uang \r\npada Anda. Di sisi lain, kondisi keuangan Anda pas-pasan, hanya cukup untuk memenuhi kebutuhan \r\nhingga akhir bulan. Sikap anda …', NULL, 1, 'Aspek yang dinilai sosial budaya<br>Opsi yang paling baik adalah opsi A karena dalam kehidupan bersosial terkadang kita tidak bisa\r\nmembantu walaupun ingin, sehingga perlu minta maaf terlebih dahulu.', NULL, '2024-08-12 06:11:14', '2024-08-12 19:02:34'),
(2518, 'PNSSKD003', 87, 'Anda ditugaskan ke luar kota. Setibanya di sana, ternyata di daerah tersebut memiliki budaya yang \r\nunik, yaitu diberlakukannya jam malam. Setiap pukul 9 malam, para warga diminta untuk kembali ke \r\nrumah dan tidak diperbolehkan berada di luar rumah setelah pukul 9 malam. Anda terbiasa keluar \r\nmalam untuk melepas penat setelah seharian bekerja. Sikap Anda...', NULL, 1, 'Aspek yang dinilai sosial budaya<br>Tindakan yang paling tepat dalam aspek Sosial Budaya adalah opsi A yaitu menghargai aturan dan \r\nbudaya setempat dan sebisa mungkin menaatinya.', NULL, '2024-08-12 06:13:46', '2024-08-12 06:13:46'),
(2519, 'PNSSKD003', 88, 'Anda bekerja di sebuah perusahaan, selama masa pandemi, kantor anda menerapkan kebijakan \r\nwork from home atau bekerja dari rumah. Apa yang akan anda lakukan agar tidak stress harus selalu \r\nberada di rumah?', NULL, 4, 'Aspek yang dinilai sosial budaya<br>Opsi D memiliki skor paling tinggi karena dengan demikian dapat tetap bekerja maksimal di rumah \r\ndan tetap sehat jiwa raga.', NULL, '2024-08-12 06:15:57', '2024-08-12 06:15:57'),
(2520, 'PNSSKD003', 89, 'Pada peringatan hari raya keagamaan, di keluarga kami ada tradisi berkumpul\r\ndengan anggota keluarga besar kami dalam rangka menjalin silaturahmi, saya..', NULL, 1, 'Aspek yang dinilai sosial budaya<br>karena sikap tersebut sudah sangat menunjukan\r\nsikap yang dapat bersosialisasi.', NULL, '2024-08-12 06:21:42', '2024-08-12 06:21:42'),
(2521, 'PNSSKD003', 90, 'Pada penyelenggaraan suatu acara dibentuklah kepanitiaan yang mana saya\r\nditugasi sebagai salah satu panitia, saat itu sedang membicarakan berbagai\r\ntopik kegiatan yang akan mengisi acara. Sebagai salah satu anggota panitia\r\nsaya', NULL, 5, 'aspek yang dinilai sosial budaya<br>karena sikap tersebut sudah sangat menunjukan\r\nsikap dalam bersosialisasi.', NULL, '2024-08-12 06:23:42', '2024-08-12 06:23:42'),
(2522, 'PNSSKD003', 91, 'Anda dan tim Anda ditugaskan untuk mencari karyawan baru menggantikan beberapa karyawan\r\nyang sebentar lagi akan pensiun. Dimana anda akan memasang pengumuman perekrutan karyawan\r\nbaru?', NULL, 4, 'Aspek yang dinilai Teknologi Informasi dan Komunikasi<br>Tindakan yang paling tepat dalam aspek Teknologi Informasi dan Komunikasi adalah opsi D yaitu di\r\nmedia sosial perusahaan dan platform lowongan kerja digital. Hal ini menunjukkan bahwa Anda\r\nmampu memanfaatkan teknologi dengan baik untuk kemajuan perusahaan.', NULL, '2024-08-12 19:14:59', '2024-08-12 19:14:59'),
(2523, 'PNSSKD003', 92, 'Anda bekerja di sebuah perusahaan tekstil. Seiring berjalannya waktu, perusahaan Anda semakin\r\nberkembang dan pesanan semakin meningkat. Akibatnya, tim produksi kesulitan memenuhi tenggat\r\nwaktu produksi karena semua proses masih dikerjakan secara manual, sehingga membutuhkan\r\nwaktu yang lama untuk menyelesaikan pesanan. Mengenai hal ini, saran apa yang akan Anda\r\nsampaikan pada rapat evaluasi mingguan?', NULL, 2, 'Aspek yang dinilai teknologi informasi dan komunikasi<br>Opsi yang paling banyak poinnya adalah yang B, yaitu melaporkan kendala produksi tersebut di forum rapat dan menyarankan untuk pengadaan mesin yang modern agar waktu produksi menjadi semakin cepat dan efisien. Opsi ini yang paling menunjukkan bahwa Anda mampu untuk berfikir kreatif dan inovatif agar produ.ksi lebih ceat dan efisien.', NULL, '2024-08-12 19:19:00', '2024-08-12 19:19:00'),
(2524, 'PNSSKD003', 93, 'Pengisian rapor hasil belajar siswa diusulkan dengan sistemkomputerisasi sehingga akan\r\nmemudahkan dalaminput data. Namun, beberapa guru yang bertugas sebagai wali kelas\r\nterkendala dengan teknologi. Sikap Anda selaku bagian akademik siswa ....', NULL, 1, 'Aspek yang dinilai teknologi informasi dan komunikasi<br>Opsi A menunjukkan dukungan dan inisiatif dalam membantu guru-guru yang mungkin kurang familiar dengan teknologi, serta memastikan bahwa sistem yang baru dapat diimplementasikan dengan efektif.', NULL, '2024-08-12 20:28:10', '2024-08-12 20:31:45'),
(2525, 'PNSSKD003', 94, 'Ketika beredar beragaminformasi hoax di media sosial terkait virus corona varian baru,\r\nmaka sikap Anda selaku ASN ....', NULL, 3, 'Aspek yang dinilai teknologi informasi dan komunikasi<br> Opsi C menunjukkan komitmen untuk memastikan bahwa informasi yang dikonsumsi dan disebarluaskan adalah akurat, serta membantu memerangi penyebaran hoax dengan cara yang bertanggung jawa', NULL, '2024-08-12 20:32:43', '2024-08-12 20:32:43'),
(2526, 'PNSSKD003', 95, 'Atasan Anda meminta Anda untuk melanjutkan kuliah singkat di luar negeri dengan biaya kantor,\r\ndengan syarat Anda tetap bekerja seperti biasa. Saat ini perkuliahan tersebut direncanakan akan\r\ndilaksanakan secara daring. Sikap Anda …', NULL, 3, 'Aspek yang dinilai teknologi informasi dan komunikasi<br>Aspek yang dinilai adalah mau memanfaatkan teknologi informasi dan komunikasi yang dapat menunjang kinerja secara lebih efektif. Opsi E bernilai tinggi karena mau meningkatkan skill dengan mengikuti kuliah singkat secara daring.', NULL, '2024-08-12 20:35:39', '2024-08-12 20:35:39'),
(2527, 'PNSSKD003', 96, 'Ketika Anda ditugasi menjadi admin yang melayani keluhan pelanggan suatu produk di\r\nperusahaan Anda. Anda hanya diberi waktu 5 menit dalammemberi penjelasan ke\r\npelanggan, sikap Anda ...', NULL, 2, 'Aspek yang dinilai teknologi informasi dan komunikasi<br> Opsi B Ini menunjukkan bahwa Anda memprioritaskan efisiensi dalam menyelesaikan masalah pelanggan, sambil tetap memberikan solusi yang memadai dalam batas waktu yang diberikan.', NULL, '2024-08-12 20:38:56', '2024-08-12 20:38:56'),
(2528, 'PNSSKD003', 97, 'Saya baru saja mengalami pemutusan hubungan kerja (PHK) imbas dari wabah corona yang\r\nmengakibatkan perusahaan tempat saya bekerja menjadi bangkrut. Kabar baiknya, saya\r\nmendapatkan bantuan dari pemerintah berupa kartu pra kerja. Oleh karena itu, seharusnya saya...', NULL, 1, 'Aspek yang dinilai teknologi informasi dan komunikasi<br>Opsi A memiliki skor paling tinggi karena bisa memanfaatkan kartu pra kerja untuk meningkatkan\r\nskill sebagai penunjang pekerjaan atau bekal untuk memulai usaha.', NULL, '2024-08-12 20:40:58', '2024-08-12 20:40:58'),
(2529, 'PNSSKD003', 98, 'Adna merupakan seorang yang berminat di bidang kuliner dan memiliki banyak pengikut di sosial\r\nmedia. Suatu ketika ada sebuah produsen makanan ingin berkolaborasi dengan Anda. Anda diminta\r\nuntuk mengulas produk makanan. Produsen ini meminta Anda untuk memberikan komentar positif\r\ntentang produknya dan bersedia membayar mahal pada Anda. Sedangkan, menurut Anda rasa dari\r\nproduk tersebut biasa saja. Sikap Anda …..', NULL, 3, 'Aspek yang dinilai profesionalisme<br>, Anda perlu bekerja secara jujur dan berprinsip serta tidak mengubah\r\nopini dengan mudah hanya karena dibayar mahal.', NULL, '2024-08-12 20:51:05', '2024-08-12 20:51:05'),
(2530, 'PNSSKD003', 99, 'Anda adalah seorang kartunis yang memiliki banyak penggemar. Hasil karya Anda sangat diminati.\r\nAkhir minggu ini, merupakan tenggat waktu pengiriman episode ke-18 dari serial cerita yang Anda\r\nbuat. Namun, Anda kurang bisa berkonsentrasi untuk menyelesaikan episode ini karena kekasih\r\nAnda sering meminta Anda untuk menemaninya menghabiskan waktu liburnya bersama Anda. Sikap\r\nAnda ….', NULL, 4, 'Aspek yang dinilai profesionalisme<br>yang dinilai adalah sikap Anda dalam menentukan prioritas. Seseorang yang professional tentu akan \r\nmengutamakan pekerjaannya dibandingkan kepentingan pribadinya.', NULL, '2024-08-12 20:55:56', '2024-08-13 05:55:00'),
(2531, 'PNSSKD003', 100, 'Ada aturan bahwa semua laporan harus dikirimvia email dan file harus diubah ke pdf.\r\nSeorang teman kebingungan dalammenkonversi file dari word ke pdf, maka sikap Anda ....', NULL, 4, 'Aspek yang dinilai profesionalisme<br>Ini menunjukkan bahwa Anda tidak hanya membantu secara langsung, tetapi juga memberikan keterampilan yang dapat berguna untuk masa depan teman Anda, meningkatkan kemandirian mereka dalam menangani tugas serupa di kemudian hari.', NULL, '2024-08-12 21:02:32', '2024-08-12 21:02:32'),
(2532, 'PNSSKD003', 101, 'Ketika terjadi masalah di perusahaan tempat bekerja, maka selaku orang yang\r\nbertanggungjawab dalammasalah itu sikap Anda ....', NULL, 1, 'Aspek yang dinilai profesionalisme<br>Dalam kebanyakan situasi, menyelesaikan masalah sesuai prosedur yang berlaku (opsi a) adalah tindakan yang paling optimal, karena ini menunjukkan tanggung jawab dan kepatuhan pada aturan perusahaan.', NULL, '2024-08-13 05:58:44', '2024-08-13 05:58:44'),
(2533, 'PNSSKD003', 102, 'Motor Anda mogok di depan salah satu rumah sakit, padahal perjalanan ke kantor masih\r\ncukup jauh. Anda ada jadwal rapat pagi ini. Sikap Anda ....', NULL, 1, 'Aspek yang dinilai profesionalisme<br>Dalam situasi mendesak seperti ini, menitipkan motor di tempat aman (opsi a) dan melanjutkan perjalanan dengan alat transportasi online adalah pilihan terbaik karena memastikan Anda tetap bisa hadir tepat waktu di rapat tanpa harus khawatir tentang keamanan motor Anda', NULL, '2024-08-13 06:00:27', '2024-08-13 06:05:08'),
(2534, 'PNSSKD003', 103, 'Ketika Anda harus presensi secara online karena cuti, ternyata Anda terkendala sinyal,\r\nMaka sikap Anda ....', NULL, 1, 'Aspek yang dinilai profesionalisme<br>Dalam situasi ini, yang paling disarankan adalah mencari tempat yang memiliki sinyal yang lebih baik untuk tetap melakukan presensi (opsi c), karena ini menunjukkan inisiatif dan tanggung jawab yang tinggi dalam menghadapi kendala teknis.', NULL, '2024-08-13 06:06:01', '2024-08-13 06:15:09'),
(2535, 'PNSSKD003', 104, 'Anda adalah kepala lapas disalah satu lapas di provinsi Banten, suatu hari Anda\r\nmendengar kabar bahwa ada yang menyebarkan paham radikalisme di dalam lapas tempat\r\nAnda memimpin hanya saja nama orang tersebut tidak Anda ketahui. Maka dari itu, tindakan\r\npaling tepat menurut Anda adalah ....', NULL, 3, 'Aspek yang dinilai anti-radikalisme<br>meski memiliki wewenang tersendiri sebagai kepala lapas untuk mengatasi masalah tetapi untuk radikalisme akan lebih tepat jika bekerja sama dengan lembaga terkait dalam hal ini\r\nBNPT', NULL, '2024-08-13 06:11:28', '2024-08-13 06:11:28'),
(2536, 'PNSSKD003', 105, 'Terdengar kabar bahwa sekolah tempat anak belajar mengadakan kajian agama yang\r\nmenghadirkan pembicara dari kelompok yang dianggap radikal. Sebagai orang tua tentunya\r\ntidak ingin anak kita terpapar radikalisme, maka dari itu tindakan Anda adalah...', NULL, 1, 'Aspek yang dinilai anti-radikalisme<br>Berdasarkan soal memang adanya afiliasi sang pembicara dengan kelompok yang dinilai\r\nradikal tetapi sebelum mengambil tindakan perlu ditanyakan terlebih dahulu kepada anak\r\napa yang dia terima dengan tentunya mengingatkan kepada panitia atau sekolah', NULL, '2024-08-13 06:14:20', '2024-08-13 06:14:20'),
(2537, 'PNSSKD003', 106, 'Ketika ada imbauan untuk tidak sembarangan menerima tamu yang ingin menginap di\r\nrumah, dikarenakan sedang maraknya buronan teroris. Maka sikap Anda terhadap aturan\r\nini ....', NULL, 4, 'Aspek yang dinilai anti-radikalisme<br>Opsi d (Memilih untuk menjadikannya waspada dengan tidak sembarang menerima tamu) adalah yang paling tepat, karena ini menunjukkan kewaspadaan yang tinggi dan pemahaman akan pentingnya mematuhi imbauan untuk keselamatan diri sendiri dan orang lain.', NULL, '2024-08-13 06:25:41', '2024-08-13 06:25:41'),
(2538, 'PNSSKD003', 107, 'Segala bentuk iuran yang berkedok sedekah dan ternyata digunakan untuk mendanai\r\nkegiatan terorisme maka selaku orang yang rutin memberikan sedekah via akun online\r\nyang menghimpun sedekah, sikap Anda ....', NULL, 2, 'Aspek yang dinilai anti-radikalisme<br>Opsi b (Mencoba mencari tahu akun terpercaya untuk menyalurkan sedekah yang memang jelas ada pelaporan dimana dana sedekah umat dialokasikan) adalah yang paling tepat, karena Anda secara aktif memastikan bahwa dana yang Anda salurkan digunakan dengan benar dan transparan. Ini adalah langkah yang paling bertanggung jawab dan aman dalam menjaga integritas sedekah Anda.', NULL, '2024-08-13 06:30:59', '2024-08-13 06:30:59'),
(2539, 'PNSSKD003', 108, 'Menyikapi aksi demo buruh yang ternyata ditunggangi ormas yang sifatnya radikal bahkan\r\nsempat memakan korban karena kerusuhan, maka sikap Anda selaku kapolri setempat ....', NULL, 3, 'Aspek yang dinilai anti-radikalisme<br>Opsi c (Berusaha menjaga perdamaian dengan mengawal kasus tanpa memancing kericuhan salah satu pihak yang merasa dirugikan) adalah yang paling tepat, karena sikap ini tidak hanya menegakkan hukum tetapi juga menjaga perdamaian dan mencegah eskalasi konflik, yang sangat penting dalam situasi yang berisiko tinggi.', NULL, '2024-08-13 06:36:53', '2024-08-13 07:09:41'),
(2540, 'PNSSKD003', 109, 'Menyikapi adanya laporan dari guru BK, bahwa ada siswa yang sudah berusaha untuk\r\nbertindak radikal dengan cara membaca buku-buku referensi terkait jaringan terorisme\r\ninternasional, maka sikap Anda selaku kepala sekolah ....', NULL, 5, 'Aspek yang dinilai anti-radikalisme<br>Opsi E (Memanggil siswa mengajak dialog dengan perantara guru BK, guru kelas, dan orangtua siswa agar masalah tidak meluas dan cepat teratasi) adalah yang paling tepat. Dengan melibatkan semua pihak terkait, Anda memastikan penanganan yang menyeluruh dan bijaksana, sehingga masalah ini dapat diselesaikan dengan efektif dan tanpa menimbulkan dampak negatif lebih lanjut.', NULL, '2024-08-13 07:02:14', '2024-08-13 07:02:14'),
(2541, 'PNSSKD003', 110, 'Kepada siswa yang berusaha melakukan aksi radikalisme dengan cara menulis kritikan di\r\ntembok sekolah. Kritikan ditujukan kepada pemerintah. Sikap Anda selaku bagian\r\nkesiswaan sekolah ....', NULL, 2, 'Aspek yang dinilai anti-radikalisme<br>embuka jalur komunikasi dengan siswa dan memberikan bimbingan dari guru BK dapat membantu memahami alasan di balik tindakan siswa dan memberikan panduan yang konstruktif.', NULL, '2024-08-13 07:06:48', '2024-08-13 07:08:49'),
(2545, 'PNSSKD004', 66, 'Anda bertugas sebagai penjemput tamu di acara resepsi pernikahan. Sudah menjadi\r\nkewajiban bahwa selama acara resepsi pernikahan tamu wajib mentaati protokol\r\nkesehatan dengan mencuci tangan sebelum memasuki gedung, dan memakai masker.\r\nSeorang tamu datang tanpa mengenakan masker. Sikap Anda ....', NULL, 3, 'Aspek yang dinilai pelayanan publik<br>Opsi C tidak hanya memastikan bahwa tamu mematuhi protokol kesehatan, tetapi juga menunjukkan kepedulian dan pelayanan yang baik dengan menyediakan masker jika mereka tidak memilikinya. Dengan cara ini, Anda menjaga kesehatan semua orang dan tetap memberi sambutan yang ramah.', NULL, '2024-08-13 23:34:44', '2024-08-13 23:34:44');
INSERT INTO `soals` (`id`, `id_paket`, `nomor_soal`, `isi_soal`, `gambar_soal`, `nomor_jawaban`, `isi_solusi`, `gambar_solusi`, `created_at`, `updated_at`) VALUES
(2546, 'PNSSKD004', 67, 'Anda seorang guru mata pelajaran. Saat masuk ke ruang kelas, ternyata susunan tempat duduk tampak tidak rapi bahkan sampah berceceran di lantai. Maka sikap Anda ....', NULL, 3, 'Aspek yang dinilai pelayanan publik<br>Opsi C menunjukkan pendekatan yang konstruktif dan mendidik. Dengan mengkondisikan siswa dan memberi mereka kesempatan untuk membersihkan kelas sebelum pelajaran dimulai, Anda mengajarkan mereka tanggung jawab dan pentingnya menjaga kebersihan tanpa langsung memberikan tekanan atau hukuman. Ini juga membantu menciptakan lingkungan yang lebih baik untuk proses belajar-mengajar.', NULL, '2024-08-15 16:48:04', '2024-08-15 16:48:04'),
(2547, 'PNSSKD004', 68, 'Anda bertugas sebagai penjemput tamu di acara resepsi pernikahan. Sudah menjadi\r\nkewajiban bahwa selama acara resepsi pernikahan tamu wajib mentaati protokol\r\nkesehatan dengan mencuci tangan sebelum memasuki gedung, dan memakai masker.\r\nSeorang tamu datang tanpa mengenakan masker. Sikap Anda ....', NULL, 3, 'Aspek yang dinilai pelayanan publik<br> Opsi C tidak hanya mengingatkan tamu tentang protokol kesehatan yang berlaku tetapi juga menyediakan solusi praktis jika tamu tersebut tidak membawa masker. Ini menunjukkan kepedulian terhadap kesehatan semua orang di acara tersebut dan memastikan semua orang mematuhi aturan dengan cara yang ramah dan mendukung.', NULL, '2024-08-15 16:51:04', '2024-08-15 16:51:04'),
(2548, 'PNSSKD004', 69, 'Seorang ibu datang ke sekolah, ia ingin mengantar buku anaknya yang tertinggal\r\nnamun ia tidak tahu lokasi kelas si anak. Ia menanyakan kepada Anda selaku security\r\nyang berjaga di depan pintu gerbang sekolah. Sikap Anda ....', NULL, 2, 'Aspek yang dinilai pelayanan publik<br> Opsi B menunjukkan tanggung jawab dan kepedulian untuk memastikan buku sampai ke tangan anak tanpa menambah beban pada ibu yang mungkin tidak familiar dengan lokasi sekolah. Pilihan ini juga menghindari potensi kebingungan atau ketidaknyamanan bagi ibu yang mungkin tidak tahu arah dengan jelas.', NULL, '2024-08-15 17:01:38', '2024-08-15 17:01:38'),
(2549, 'PNSSKD004', 70, 'Anda ditugasi dosen untuk melakukan obsservasi disuatu lokasi. Dilokasi tersebut terdapat air\r\nterjun yang belum termanfaatkan dengan baik. Akses ke tempat tersebut cukup sulit.\r\nPerekonomian masyarakat setempat hanya bergantung pada ladang seadanya. Isi dalam\r\nlaporan observasi tersebut Anda akan mengupayakan...', NULL, 1, 'Aspek yang dinilai pelayanan publik<br> dengan menjadikan lokasi air terjun sebagai tempat wisata, Anda tidak hanya membantu meningkatkan perekonomian lokal dengan menarik wisatawan, tetapi juga membuka peluang bagi masyarakat untuk terlibat dalam berbagai usaha pendukung seperti penginapan, restoran, dan layanan wisata lainnya. Pilihan ini bisa membantu menciptakan lapangan kerja baru dan memberikan dorongan bagi perekonomian setempat.', NULL, '2024-08-15 17:21:40', '2024-08-15 17:23:55'),
(2550, 'PNSSKD004', 71, 'Siang ini anda berkunjung kesebuah tempat wisata, karena hari libur tentu saja pengunjung\r\nsangat ramai. Pada saat pembelian tiket masuk objek wisata antrian sangat panjang,\r\nkemudian anda melihat seorang ibu hamil sedang mengantri selang 10an antrian di belakang\r\nanda. Ibu tersebut kelihatan sangat lelah ditambah lagi cuaca pada saat itu panas, apa yang\r\nanda lakukan ....', NULL, 3, 'Aspek yang dinilai pelayanan publik<br>Dengan bertukar posisi, Anda memastikan ibu hamil dapat lebih cepat mendapatkan tiket dan merasa lebih nyaman. Ini adalah tindakan yang baik dan sopan, memberikan perhatian khusus kepada seseorang yang membutuhkan.', NULL, '2024-08-15 17:31:46', '2024-08-15 17:31:46'),
(2551, 'PNSSKD004', 72, 'Seorang nenek kebingungan saat hendak mengambil bansos berupa beras yang\r\nternyata untuk mengambil beras harus menggunakan kartu yang dimasukan ke dalam\r\nmesin, sehingga beras bisa keluar dari mesin. Anda bertugas berjaga di bagian mesin\r\nberas untuk bansos, sikap Anda ....', NULL, 2, 'Aspek yang dinilai pelayanan publik<br> Opsi B menunjukkan kepedulian dan kemauan untuk membantu secara langsung, sambil memberikan penjelasan yang membuat nenek merasa lebih nyaman dan percaya diri menggunakan mesin tersebut. Ini tidak hanya menyelesaikan masalah saat itu juga, tetapi juga membantu nenek memahami proses tersebut untuk keperluan di masa depan.', NULL, '2024-08-15 17:37:43', '2024-08-15 17:37:43'),
(2552, 'PNSSKD004', 73, 'Suami Anda dipilih menjadi ketua RT di suatu komplek perumahan tempat Anda tinggal.\r\nOtomatis, Anda selaku istri juga dilibatkan dalam kegiatan RT khususnya yang berkaitan\r\ndengan wanita seperti kegiatan PKK dan posyandu. Kebetulan kegiatan posyandu di\r\nlingkungan Anda sudah berjalan baik, diadakan setiap bulan sekali dengan memanggil\r\nbidan yang juga ikut memberi pelayanan. Menyikapi kegiatan posyandu yang sudah\r\nberjalan baik, maka selaku ibu RT yang baru ....', NULL, 3, 'Aspek yang dinilai sosial budaya<br> Opsi C menunjukkan pendekatan yang terbuka dan kolaboratif. Dengan berdiskusi dengan kader posyandu, Anda menghargai pengalaman dan keberhasilan yang sudah ada, sambil mencari cara untuk meningkatkan layanan dengan tambahan yang konstruktif. Ini membantu memastikan bahwa setiap perubahan atau penambahan program dilakukan dengan mempertimbangkan masukan dan kebutuhan yang sudah ada.', NULL, '2024-08-15 18:13:49', '2024-08-15 18:13:49'),
(2553, 'PNSSKD004', 74, 'Ketika Anda mengikuti kegiatan KKN. Ternyata di tempat KKN Anda ada aturan bahwa\r\nkendaraan seperti sepeda motor jika melewati gang masuk dekat perkampungan\r\npenduduk harus mematikan mesinnya meski gang masuk jalannya lapang/luas. Anda\r\ningin melakukan pendampingan kegiatan arisan tani. Kebetulan ada di RT sebelah\r\ntempat posko KKN Anda. Saat hendak masuk gang, ada papan peringatan mesin\r\nkendaraan harap dimatikan. Namun, lokasi tempat arisan jauh dari jalan utama. Lebih\r\nenak jika ditempuh dengan motor bukan malah mematikan mesin motor dan\r\nmenuntun motor. Sikap Anda ....', NULL, 2, 'Aspek yang dinilai sosial budaya<br> Opsi B menunjukkan sikap menghormati dan mematuhi aturan yang ada serta berusaha untuk beradaptasi dengan lingkungan dan kebiasaan setempat. Dengan memilih untuk menitipkan motor dan jalan kaki, Anda juga menunjukkan kepedulian terhadap kenyamanan dan keamanan komunitas lokal, yang penting dalam kegiatan KKN dan interaksi dengan penduduk setempat.', NULL, '2024-08-15 18:17:20', '2024-08-15 18:17:20'),
(2554, 'PNSSKD004', 75, 'Kita hidup di negara yang memiliki ragam kepercayaan, budaya dan adat istiadat yang\r\nberbeda-beda. Di perusahaan anda sendiri terdiri dari orang orang yang berbeda\r\nlatarbelakang, banyak karyawan muslim yang mengeluhkan sulitnya beribadah karena\r\nketersediaan tempat atau pada jam untuk beribadah mereka harus tetap bekerja, sikap\r\nanda...', NULL, 1, 'Aspek yang dinilai sosial budaya<br> Opsi A menunjukkan komitmen untuk menghormati kebutuhan religius karyawan dan menciptakan lingkungan kerja yang inklusif. Dengan menyediakan fasilitas tempat ibadah di lingkungan perusahaan, Anda membantu memastikan bahwa semua karyawan dapat menjalankan ibadah mereka dengan nyaman tanpa harus menghadapi kesulitan tambahan. Ini juga mencerminkan sikap menghargai keberagaman dan mendukung kesejahteraan karyawan.', NULL, '2024-08-15 18:23:22', '2024-08-15 18:23:22'),
(2555, 'PNSSKD004', 76, 'Malam ini anda bersama anggota keluarga berkumpul untuk makan bersama. Salah satu di\r\nantaranya menggunakan gawai untuk menjelajahi teknologi informasi pada gawai nya. Sikap anda terhadap ilustrasi diatas ....', NULL, 1, 'Aspek yang dinilai sosial budaya<br>Dengan menanyakan alasannya, Anda menunjukkan perhatian dan pengertian terhadap situasi yang dihadapi orang tersebut. Setelah mendengarkan alasannya, Anda dapat dengan bijaksana mengingatkannya untuk mematikan gawai selama waktu makan bersama, agar semua anggota keluarga bisa fokus dan menikmati kebersamaan tanpa gangguan. Pendekatan ini bersifat menghormati dan juga mendorong komunikasi yang terbuka.', NULL, '2024-08-15 18:40:54', '2024-08-15 18:40:54'),
(2556, 'PNSSKD004', 77, 'Apabila anda baru saja berpindah rumah ke lingkungan rumah yang masyarakatnya sulit\r\nsekali untuk bersosialisasi sedangkan sebelumnya anda tinggal di lingkungan rumah yang\r\nmasyarakatnya sangat senang untuk bersosialisasi, saat anda ingin mengadakan syukuran\r\nrumah di lingkungan baru tidak ada satupun tetangga anda yang datang karena alasan sibuk,\r\nmaka apa yang akan anda lakukan dalam situasi seperti ini…', NULL, 2, 'Aspek yang dinilai sosial budaya<br>Dengan sikap tersebut menunjukkan sikap yang\r\ndapat berharmonisasi kehidupan dalam masyarakat.', NULL, '2024-08-15 18:46:10', '2024-08-15 18:46:10'),
(2557, 'PNSSKD004', 78, 'Pada penyelenggaraan suatu acara dibentuklah kepanitiaan yang mana saya\r\nditugasi sebagai salah satu panitia, saat itu sedang membicarakan berbagai\r\ntopik kegiatan yang akan mengisi acara. Sebagai salah satu anggota panitia\r\nsaya', NULL, 5, 'Aspek yang dinilai sosial budaya<br>Opsi E, sikap tersebut sudah sangat menunjukan\r\nsikap dalam bersosialisasi.', NULL, '2024-08-15 18:52:42', '2024-08-15 18:52:42'),
(2558, 'PNSSKD004', 79, 'Anda memiliki rekan kerja yang sangat baik pada Anda. Suatu ketika, istri rekan Anda jatuh sakit,\r\nkarena tidak memiliki cukup biaya untuk membayar Rumah Sakit, maka rekan Anda meminjam uang\r\npada Anda. Di sisi lain, kondisi keuangan Anda pas-pasan, hanya cukup untuk memenuhi kebutuhan\r\nhingga akhir bulan. Sikap anda …', NULL, 1, 'Aspek yang dinilai sosial budaya<br>Opsi yang paling baik adalah opsi A karena dalam kehidupan bersosial terkadang kita tidak bisa membantu walaupun ingin, sehingga perlu minta maaf terlebih dahulu.', NULL, '2024-08-15 18:54:34', '2024-08-15 18:54:34'),
