(2566, 'POLPPH101', 1, 'Saya tidak keberatan memberitahukan orang lain mengenai perasaan pribadi saya', NULL, 2, 'Positif', NULL, '2024-09-13 21:15:39', '2024-09-13 21:15:39'),
(2567, 'POLPPH101', 2, 'Saya suka mempengaruhi orang lain untuk berpikir seperti yang saya\r\npikirkan', NULL, 2, 'Negatif', NULL, '2024-09-13 22:30:53', '2024-09-13 22:30:53'),
(2568, 'POLPPH101', 3, 'Saya segera menyelesaikan jika sampai terjadi suatu argumentasi', NULL, 2, 'Pernyataan Positif', NULL, '2024-09-13 22:35:04', '2024-09-13 22:35:04'),
(2569, 'PNSSKD002', 107, 'Perumahan tempat Anda tinggal kedatangan seorang warga baru yang berbeda agama dan ras dari \r\nsemua warga yang sudah menetap. Namun sudah dua hari warga baru tidak pernah menyapa atau \r\nmencoba untuk mengenal tetangga samping rumahnya. Bahkan selama ini pintu rumahnya selalu \r\ntertutup rapat. Anda sebagai ketu RT disana, bagaimana sikap Anda ?', NULL, 5, 'Aspek yang dinilai Antiradikalisme<br> Memberikan kesempatan untuk membaur dan menghargai pendapat serta membuat \r\nkeputusan berdasarkan asas kepentingan bersama tanpa memandang ras, agama dan suku merupakan \r\nbentuk toleransi dalam kehidupan sosial yang dapat menghambat radikalisme tumbuh dalam lingkungan \r\nmasyarakat.', NULL, '2024-09-26 01:40:11', '2024-09-26 01:40:11'),
(2570, 'PNSSKD003', 44, '320% dari 1<sup>2</sup>/<sub>5</sub> adalah ....', NULL, 3, '<sup>320</sup>/<sub>100</sub> x <sup>7</sup>/<sub>5</sub><br>\r\n<sup>19</sup>/<sub>5</sub> x <sup>7</sup>/<sub>5</sub> = <sup>133</sup>/<sub>25</sub><br>\r\n<sup>133</sup>/<sub>25</sub> = 5,32', NULL, '2024-09-26 01:58:56', '2024-09-26 01:58:56');
